INSERT INTO "public"."gaode_residential_region" VALUES ('B023B067QW', '330100', '120.105255,30.284175;120.106957,30.284223;120.107518,30.284233;120.107575,30.284045;120.107908,30.282894;120.106322,30.282894;120.106317,30.282769;120.106296,30.282752;120.105422,30.282757;120.104588,30.282739;120.104363,30.283622;120.10526,30.283956;120.105255,30.284175', '金成花园', '杭州市西湖区竞舟路220号', '杭州市', '', '38328.520561', '120.106153,30.283462', '商务住宅;住宅区;住宅小区', '', 'None', '', '39709', '金成花园是金成集团的早期作品,小区环境不错,都是多层,分98年,99年两期,东面沿河是金成别墅区,小区对面是求是竟舟小学,门口新建有西湖区综合服务中心,配套完善。  金成花园小区内部配套:游泳池,网球场;中小学:学军中学,浙江教育学院;幼儿园;综合商场:超市;邮局;银行:工行,农行;医院:浙江第二中医院;其他:联华超市。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B067TB', '330100', '120.176439,30.277667;120.176504,30.277488;120.176205,30.277469;120.17551,30.277517;120.174826,30.277565;120.174782,30.277332;120.174767,30.277201;120.174473,30.277205;120.174143,30.277206;120.174151,30.277361;120.174127,30.277788;120.174084,30.278192;120.174028,30.278597;120.174731,30.278658;120.175068,30.27863;120.175699,30.278492;120.176446,30.27838;120.176423,30.277787;120.176439,30.277667', '金都华庭', '杭州市下城区朝晖路153号(近建北桥)', '杭州市', '', '24035.540131', '120.175167,30.277989', '商务住宅;住宅区;住宅小区', '0.7', '2.69', '63800平方米', '39449', '金都华庭位于下城区上塘河朝晖路的交叉口,是杭州运河北岸城市景观的焦点所在,具备优厚的发展潜力。它由金都房产精心策划的现代城市生态庭院住宅,是高尚生活品质的标志。  金都华庭,之所以称华庭,就是建筑围庭院而建,庭院赖建筑而存,两者互为依托,这也与中国传统的“外紧内松”的居住哲学一脉相承。金都华庭不是逃避城市的世外桃源,而是立足城市营造城市化绿色生态的积极生活方式,是世内桃源。金都华庭,是一个感性的生活空间,每一个细节,每一个情景都可让人体会,这里的建筑,这里的环艺,不只是景观,而是可交流的对象,处处体现对住户的尊重,其生活品质,其盛世人文不是外在表露的,而是内涵蕴藏的。  金都华庭由曾创物业管理示范小区的浙江金都物业管理有限公司严格执行ISO9002国际标准,实施全程式的物业管理,并聘请知名物业管理公司担任顾问。', '2001-01-01', '2.1元/月/平方米');
