INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06EGC', '330100', '120.154663,30.203949;120.152824,30.203148;120.152571,30.203488;120.152167,30.204003;120.155166,30.205617;120.155523,30.205173;120.155924,30.20448;120.154663,30.203949', '民安苑', '杭州市上城区复兴路460号', '杭州市', '0103000020E61000000100000008000000AEB9A3FFE5095E404A0D6D0036343E40CF8250DEC7095E40703FE08101343E405AD427B9C3095E40E22021CA17343E40F321A81ABD095E403049658A39343E40DFDC5F3DEE095E406B80D250A3343E40A7B1BD16F4095E40AF05BD3786343E40562AA8A8FA095E40A3AF20CD58343E40AEB9A3FFE5095E404A0D6D0036343E40', '37258.506281', '120.154094,30.204353', '商务住宅;住宅区;住宅小区', '', 'None', '', '34322', '民安苑位于复兴路413-421号。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。小区幽静,面河,可见部分江景,华东陶瓷品市场旁,离西湖景区近 小区环境安宁,回迁户很多,老人为主 ,物业公司:华群物业。总建筑面积:8000平方米,总户数:1184户。', '', '0.35-0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06ESD', '330100', '120.14297,30.286007;120.142834,30.285976;120.142726,30.285977;120.142613,30.286001;120.14251,30.286007;120.142271,30.286001;120.142204,30.28602;120.142065,30.286039;120.141918,30.286055;120.141975,30.286445;120.142038,30.286672;120.142084,30.286786;120.142128,30.286853;120.142211,30.286896;120.142388,30.286933;120.14269,30.286945;120.142946,30.286946;120.143092,30.286954;120.143391,30.286981;120.143502,30.286465;120.143564,30.286179;120.143426,30.286147;120.143285,30.286111;120.143183,30.286096;120.143102,30.286058;120.14297,30.286007', '名都苑(文化巷)', '杭州市西湖区莫干山路493号', '杭州市', '', '12171.818575', '120.142736,30.286469', '商务住宅;住宅区;住宅小区', '50％的车位', 'None', '50000平方米', '46478', '兴财•名都苑地处杭州中心文教区,座落于西溪河与古新河交汇处,总建筑面积约50000平方米,由四幢小高层向心围合而成,社区以丰盛的自然资源与区位优势,打造真正的环保型纯住宅社区。为所有业主展现了一幅都市纯熟生活的美丽画卷。br在景观营造上,兴财•名都苑充分利用西溪河与古新河200余米长的双河景观绿化带,通过借景、引景使之与区内多维绿化景观形成一个有机的整体;旱喷戏水园、健康慢跑道、西溪探梅等休闲小品,无不营造着健康、纯粹、和谐、宁静的居家生活空间。br在环境规划及建筑设计上,兴财•名都苑依托西溪河与古新河这两道优化空气的天然滤网,精心造就名副其实的天然空气浴场,并巧妙借鉴传统建筑文化中的“穿堂风”概念,使其每一生活空间均能获得良好的通风环境,同时在楼宇底层设置活性碳杀菌吸尘,在围合中心广场建设旱喷,利用喷水过程中产生的大量水蒸气,吸咐尘唉,这些都将对进入小区的空气进行最后的净化,使漫步其间的住户尽情享受杭州市中心这一块不可多得的生活净地。br在户型设计上,兴财•名都苑遵循“以人为本”的设计原则,设计最佳行走路线与居住空间,以适应现代生活方式,动静互立,公私分离,使人体与居所达成最大化的和谐。客厅全部为落地观景大窗,其余窗户则超宽超低设计,配合四明设计(明厅、明卧、明厨、明卫),保障空间的舒适性和充足的自然采光与良好的通风效果。贴近人性的户型设计,构筑舒适悠然的居住空间。br文一街学区房', '', '1.2元/月/平方米');
