INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06F2W', '330100', '120.105224,30.280252;120.105289,30.279912;120.104523,30.279895;120.104481,30.279933;120.104466,30.28005;120.104454,30.280219;120.104433,30.28022;120.103933,30.280193;120.103952,30.27918;120.10327,30.27917;120.103081,30.279863;120.103034,30.280155;120.101696,30.28014;120.101672,30.281582;120.10482,30.281714;120.105143,30.280652;120.105224,30.280252', '南都德加公寓西区', '杭州市西湖区丰潭文二西路369号', '杭州市', '', '54695.905637', '120.103457,30.280704', '商务住宅;住宅区;住宅小区', '', '1.34', '170000平方米', '33722', '小区位于西湖区文二路与教工路交叉口西南,靠近2号线丰潭路站,另有多条公交通达,交通十分便利。小区建筑面积170000平方米,绿化率48.8%,容积率1.34,毛坯装修。小区内部配套有会所、超市、体育健身场所,周边有学军中学、浙江教育学院、幼儿园、农行杭州城西支行、浙江第二中医院、省自然博物馆,宜于居住。', '', '1.20元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06F2Z', '330100', '120.161837,30.185841;120.161763,30.186057;120.15921,30.185662;120.159105,30.187657;120.161183,30.188051;120.163271,30.188492;120.163626,30.187391;120.163948,30.18641;120.16395,30.186319;120.163908,30.186265;120.16278,30.186018;120.161837,30.185841', '南都·江滨花园', '杭州市滨江区滨盛路4199号', '杭州市', '', '88856.945876', '120.161479,30.186995', '商务住宅;住宅区;住宅小区', '', 'None', '', '33502', '南都·江滨花园位于钱江南岸之江居住区内,钱江一桥与钱江四桥之间,杭州之江度假村附近。西临海纳大道,东沿火炬大道,对望凤凰山,傍依钱江美景。园区占地面积140余亩,总建筑面积10万余平方米,由28幢住宅组成,可容纳住户600余户,泊车率达70%。南都·江滨花园是低层、低密度、低容积率、高绿化率的三低一高式人性住宅,源于德国理性主义的建筑风格简洁明快,住宅两两对称,形成9个组团。所有户型均坐北朝南,采用大开间、短进深的全明设计,户型面积从115-380平方米左右区域中心设置人工溪流,园区绿化率超过45%。南都·江滨花园是研究人的需要,真正“以人为本”的宜人居住区。它是杭州房地产市场发展的新一代住宅产品,代表了崭新的居住方式和生活标准。园区(一期)计划在2001年底竣工,2002年上半年交付。南都·江滨花园是杭州市第一个以准现房形式销售的项目,荣获“全国人居经典楼盘”称号。滨江新城以永久河、长兴路为分界线,南北职能分为:北部为环境优美、公建完善的居住生活。南部是以高新技术产业为主的科技园区和文化教育园区。目前滨江新城有大型的农贸综合市场、中南建材市场等。规划在江晖路和北塘河之间,滨盛路以北地区形成商贸中心,主要布置商贸、金融、文娱、康体等大型市级公建项目,其中滨盛路性质为商业街。目前有新武警医院、杭州浦沿中心卫生院、杭州江南胃胆研究院等。投资一亿多元,按照三级医院标准建造的新武警医院,于2000年9月28日正式启用,目前已成为武警部队第一流的现代化综合医院。另外,在江虹路与北塘河之间的临江地块规划有一所市级医院:在中兴西路以北、火炬大道与信城路之间,滨盛路以南规划有区域性医院。南都·江滨花园建筑现代而简洁,住宅原型取自HPP设计事务所设计的科隆贝多芬住宅区。区域中心设置有贯穿东西的人工河道,四层为主的低层住宅建筑和小高层建筑为内部的居住功能提供了亲切的空间。各幢住宅两两相邻,高低错落,形成活泼的组团围合空间。精心设计的花园为建筑群提供了更多的色彩,使简洁的建筑成为环境的最好背景。层顶的柔和曲线舒缓了小区的视觉压力,住宅顶层为家庭提供了大平台与地面花园形成呼应。屋顶全透明工作室是艺术家或自由职业者的理想选择。音乐发烧友可选择带视听室的底层住宅。环形车道彻底实现了人车分流,各个组团的地下车库使业主停车进出非常便利。在整个小区的环境规划上,力求丰富、自然,并且功能分区明确,使建筑与环境相互交融。在南都·江滨花园里,所有的因素都有机地统一在一起。建筑的高低错落与景致的起伏变化相互辉映,形成人们理想中的美丽家园。', '', '0.4元/月/平方米');
