INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06GR6', '330100', '120.202327,30.237642;120.202756,30.23731;120.202782,30.237271;120.202774,30.237228;120.20242,30.236928;120.20232,30.236866;120.202255,30.236861;120.202192,30.236883;120.201965,30.237058;120.201803,30.237171;120.201284,30.237124;120.201035,30.237115;120.200984,30.237132;120.201492,30.237651;120.201112,30.237895;120.201009,30.237787;120.200805,30.237778;120.200413,30.2378;120.200308,30.237787;120.200112,30.237693;120.200038,30.237636;120.199814,30.237825;120.19979,30.237864;120.199802,30.23792;120.200319,30.238391;120.200675,30.238736;120.200916,30.238948;120.200964,30.238967;120.201029,30.238959;120.201086,30.238917;120.201243,30.238794;120.201315,30.238714;120.20135,30.238635;120.201434,30.238443;120.201481,30.238336;120.20153,30.238245;120.201579,30.238204;120.201741,30.238067;120.202327,30.237642', '钱塘名都(清江路)', '杭州市上城区上城钱江路628-640号', '杭州市', '', '21774.143051', '120.201299,30.237868', '商务住宅;住宅区;住宅小区', '', '2.5', '110000平方米', '38369', '龙生·钱塘名都规划有小高层、高层住宅、写字楼组成,一期将于六月份结顶,二期计划2003年底开工。 钱塘名都项目总建筑面积约11万平方米,由6幢高层建筑构成,是钱江新城区块难得的高档楼盘。开阔的新城景观,得天独厚的自然环境、便捷的交通网络,齐全的配套设施,让钱塘名都凭借钱江时代发展之契机,创造一个足以震憾人心的新城市的生活空间。 钱塘名都利用其独特的地理自然景观优势,将名都生活与新城风光有机结合,借助地块直面新城及钱塘江的有利条件,充分利用自然景观至经典的板式高层建筑中,全新打造别致江景生活空间,未来新城,一览无余。 钱塘名都打开窗户,迎来美好未来。 钱塘名都在建筑造型、环境色彩、空间节奏、以及新城意象、环保科技等方面都进行有益的探索。建筑本身与新城市的天际线有机融合,自成杭州东大门一道亮丽的风景线。 钱塘名都的景观设计充分释放周边环境资源与钱塘江自然景观,不留痕迹地运用现代园林设计手法,来表现园区内精致而贴近生活的水景,自然与钱江时代文化一脉相承,营造出一个高尚的新城市的生活空间。园区整体布局严谨、大方、合理,把城市绿化、园林景观串成一个有机而大气的整体,园区视野开阔、绿意常驻。整个园区充满生命气息,彰显名都生活品质。', '2005-01-16', '1-1.5元/月/平方米');
