INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06MLK', '330100', '120.172221,30.233856;120.171999,30.233894;120.171877,30.233902;120.171815,30.233907;120.171737,30.233804;120.171627,30.233637;120.171662,30.233587;120.171672,30.233542;120.171607,30.233237;120.171566,30.233114;120.171537,30.233059;120.171233,30.233095;120.171284,30.23348;120.171494,30.234492;120.172337,30.23416;120.172352,30.23411;120.172246,30.233854;120.172221,30.233856', '通江桥高层小区', '杭州市上城区中河南路61-62号', '杭州市', '', '6314.976383', '120.171675,30.233853', '商务住宅;住宅区;住宅小区', '', 'None', '', '35347', '通江桥小区位于上城区望江,由杭州宋都房地产集团有限公司开发。优点是:地段比较不错,性价比高,综合配套优质。附近医疗配套完善(三甲医院:杭州上城区红十字会医院;二级医院:杭州市上城区妇幼保健院、杭州市第四人民医院;步行到医院比较方便)。景观优美,环境清静怡人,听不到噪音。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06MZM', '330100', '120.136569,30.179073;120.136665,30.179066;120.136746,30.179018;120.136745,30.178516;120.136708,30.178429;120.136619,30.178408;120.135727,30.178391;120.134834,30.178371;120.134833,30.17905;120.136569,30.179073', '同方超级星期天', '杭州市滨江区东信大道西端新和路', '杭州市', '', '11622.586322', '120.135782,30.178727', '商务住宅;住宅区;住宅小区', '', '2.52', '', '23615', '超级星期天的建筑体型呈梭形,总长145.4米,宽39.8米,高为48.5米,南侧16层,北侧14层。为一类高层建筑,标准层为单身公寓,分为一室一厅,两室两厅,三室两厅等户型,地层功能为会所,顶部两层因立面斜切处理,局部房间作了跃层或阁楼。  超级星期天拥有近2000平方米引以为傲的绿色中庭。形形色色的植物、景观小品,或组团,或统一,在宽敞的中庭争奇斗艳,美不胜收。从顶处洒落的阳光,在建筑与园林交融的空间欢快的跳跃,赋予建筑以灵动的生命。植物的绿意,阳光的七彩,使超级星期天成为色彩的画室,自然的原乡;近2000平米的大型会所,体现了开发商对业主的充分尊重:戏水池、健身房、壁球室、晨跑小径等运动设施,将年轻人的活力推向级致;网络咖啡厅、美容中心、棋牌室、读书走廊等休闲场所,让生活多一份逸趣,多一份底蕴。', '2004-06-08', '1.5元/月/平方米');
