INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06NTC', '330100', '120.241,30.160941;120.241341,30.160637;120.241701,30.160329;120.24188,30.16018;120.242002,30.160076;120.242173,30.159929;120.242268,30.159848;120.242337,30.159788;120.242495,30.159671;120.242582,30.159622;120.242625,30.159592;120.242557,30.159535;120.242421,30.159421;120.24231,30.159329;120.242094,30.159139;120.241923,30.159001;120.241732,30.15884;120.241573,30.158706;120.241392,30.158553;120.24105,30.158284;120.240692,30.157995;120.240059,30.157481;120.239497,30.157029;120.238931,30.156565;120.238527,30.156224;120.238491,30.156204;120.23838,30.156302;120.238008,30.156668;120.237802,30.156887;120.237589,30.157173;120.237126,30.157665;120.236831,30.158101;120.236207,30.160004;120.236205,30.160032;120.236223,30.16006;120.236622,30.160372;120.236899,30.160433;120.237051,30.160476;120.237376,30.160763;120.237744,30.160997;120.238048,30.161079;120.23842,30.161079;120.238622,30.161026;120.23886,30.160954;120.239139,30.160933;120.23932,30.16094;120.239443,30.160957;120.239601,30.161003;120.239781,30.161085;120.240109,30.161293;120.240277,30.161421;120.240336,30.161436;120.240423,30.161429;120.24048,30.161399;120.240615,30.161278;120.241,30.160941', '威尼斯水城(休博路)', '杭州市萧山区风情大道2555号', '杭州市', '', '172177.888203', '120.23914,30.159275', '商务住宅;住宅区;住宅小区', '1180', '1.17', '250000平方米', '20039', '威尼斯水城位于著名的省级湘湖旅游度假区,坐落于杭州市重点建设的绿色生态带上,有着绝佳的自然山水环境,是一个集休闲、旅游、度假、会展、人居以及购物为一体的现代中国休闲景观岛居生活街区。威尼斯水城总占地面积达1100亩,总建筑面积有25万方。公寓以4-5层为主,房屋以平层为主,也有跃层和带阁楼的户型。威尼斯水城引入湘湖天然活水,形成四纵三横主水道和三大湖泊,65%活性水覆盖率,构筑全景式城市岛居生活街区。30多座形态各异、风格独特的桥,围绕威尼斯城市人文景象。8大风景岛区依次展开,岛与岛之间桥桥相接,再现威尼斯纯正岛居风情。5000多米风情水街,家家临水、户户观景、勾画纯水岸生活,限度满足了人和水与生俱来的亲密关系。10多个主题广场,形成开放空间与私密空间自然转换的复合景观形态。 威尼斯水城拥有30座形态各异、风格独特的桥,每个桥都有自己的名字,也都有自己的性格。桥作为链接岛与岛的纽带,成为有韵味的景观和具特色的环境艺术,彰显了威尼斯水城独特的城市人文景象。威尼斯水城在户型设计上充分体现了原汁原味的意大利居住模式,面积范围从80 m2-260 m2等20多种户型,即照顾到各种客户的需求,又不失个性元素。经典户型由大师丹尼尔亲自设计,他力图在同一平面内,户型功能完全做到动静分区,异域的休闲居住本质。一楼的户型即亲水又有的花园,更是让住户有别墅级的享受。2006年杭州世界休闲博览会和2010年规划通车的湘湖地铁站也将为水城带来了高尚的配套和巨大的商机。', '2005-08-31', '1.5元/月/平方米');
