余平米会所、23000平米国际化商业街区。目前,前三期1000余户已交付,众多业主荣耀入住,构筑了成熟的社区氛围。    大华西溪风情悦宫采取组团式开发,已经开发三期,一期水岸茗苑占地230亩,共建有联排排屋364套;二期水榭茗邸占地180亩,共建有联排排屋、叠排排屋共347套;三期水榭香堤占地220亩,共建有双拼排屋、联排排屋和独立别墅312套,后续组团将陆续进行开发。', '2012-09-30', '3元/月/平方米');
