INSERT INTO "public"."gaode_residential_region" VALUES ('B023B06PKK', '330100', '120.171917,30.291029;120.171712,30.291117;120.171112,30.292278;120.170706,30.293026;120.170087,30.293829;120.169552,30.294329;120.169496,30.294463;120.169501,30.294662;120.170589,30.295197;120.170744,30.295079;120.17122,30.294494;120.17231,30.293324;120.173326,30.292205;120.173632,30.291895;120.173932,30.291489;120.173905,30.29137;120.173746,30.29131;120.171917,30.291029', '现代雅苑', '杭州市下城区绍兴路279号', '杭州市', '', '67434.153106', '120.171646,30.292923', '商务住宅;住宅区;住宅小区', '', '1.8', '114000平方米', '37553', '朝晖现代城系由浙江野风房产建设,东起绍兴路,西临上塘河,北靠德胜路,南接打铁关南片住宅区。现代城位于城市的次中心,处于市中心武林门商业圈的辐射范围内,与著名高等学府浙江工业大学和朝晖小区、德胜小区为邻,地段非常成熟。现代城总占地近370亩,总建筑面积50万平方米,全部由小高层、高层建筑组成,建成后可拥有3400余个建筑单位,是目前杭州市中心最大的居住园区之一。朝晖现代城以上塘河支流、潮王路延伸段为分割,自然形成北、中、南三个区域。野风.现代雅苑,65万㎡野风.现代城一期,潮王路以北、绍兴路以西、上塘河以东,与和平国际会展中心毗邻,呈南北向舒展,上塘河自西侧流过。沿河近五百米绿化带和小区南北端两个市级公园,宛如小区和城市之间的绿化屏障,营造出绿意融融的生态景观。野风.现代雅苑共有住户1200多户,项目于2003年9月交付,曾先后获得了“2004年度詹天佑土木工程大奖优秀住宅小区提名奖”、“杭州首届人居奖12强”等荣誉称号。如今,亲临现代雅苑,一个环境幽雅、视野开阔的现代居住社区将会呈现在您的眼前,简洁而充满现代感的建筑立面,飘逸而不失韵律的建筑天际线构成了一道亮丽的城市景观,尤其社区内齐全而布置合理的各项运动休闲设施,沿上塘河数百米长的健康跑道已经成为众多业主最喜爱的小区配套。而优雅的居住环境也使得现代雅苑现今的入住率高达90%以上,更成为崛起中的和平会展板块内乃至市中心主流生活的社区典范。', '', '1.2元/月/平方米');
