INSERT INTO "public"."gaode_residential_region" VALUES ('B023B07Y05', '330100', '120.153528,30.294013;120.15404,30.292858;120.152738,30.292314;120.152179,30.292086;120.151997,30.292232;120.151808,30.292507;120.151662,30.292728;120.151416,30.29307;120.15139,30.293492;120.151438,30.293718;120.151426,30.294119;120.15119,30.294784;120.151498,30.294997;120.151663,30.29515;120.151725,30.295251;120.151763,30.295389;120.151785,30.295637;120.151765,30.295775;120.151789,30.295861;120.151992,30.296046;120.152271,30.296149;120.152511,30.295802;120.153528,30.294013', '清水公寓', '杭州市拱墅区拱墅德胜西路德胜巷13号', '杭州市', '', '59757.128971', '120.152457,30.293903', '商务住宅;住宅区;住宅小区', '共550个', '2.52', '210000平方米', '36189', '清水公寓位于杭州市德胜路北侧,西邻京杭大运河和霞湾公园。依托于运河、沿河绿化带和霞湾公园,为1200余户清水公寓家庭营造了一方悠然、怡然、自然的生活天地。清水公寓占地180余亩,总建筑面积20余万平方米,是杭城大规模的旧城改造项目之一,小区由多层、电梯公寓和排屋组成,配套上强调运动主题,有一座带有室内篮球场、网球场和各种健康休闲娱乐设施的高级业主会所,和一个带有游泳池、篮球场和众多运动设施的大型户外运动广场。同时,清水还非常强调细部设计的“情趣化”,像通透的兼具休闲与娱乐功能的架空层设计,住户自行车可直接停放于自家底层的地上车库,充分利用地块原有高差营造景观的起伏跌落等。(2001年8月开盘至今,前两期全部交付,三期全部售完,四期排屋2004年8月)', '2009-12-14', '1.7元/月/平方米');
