INSERT INTO "public"."gaode_residential_region" VALUES ('B023B088AP', '330100', '120.20336,30.235366;120.203464,30.235099;120.203574,30.234719;120.205331,30.234699;120.205468,30.234694;120.205543,30.234673;120.20564,30.234624;120.205939,30.234362;120.205967,30.234322;120.206001,30.234255;120.20604,30.23415;120.206073,30.234103;120.206298,30.233983;120.206469,30.233904;120.20662,30.233824;120.206808,30.233697;120.207212,30.234122;120.20722,30.234149;120.207209,30.234171;120.205972,30.235045;120.205135,30.235641;120.204897,30.235577;120.204773,30.235532;120.204719,30.235492;120.204649,30.235426;120.20462,30.235371;120.20392,30.235495;120.20336,30.235366', '钱江时代公寓', '杭州市上城区清江路346号', '杭州市', '', '24762.92304', '120.205268,30.23483', '商务住宅;住宅区;住宅小区', '600个', '4.5', '150000平方米', '40045', '钱江时代位于杭州市东南部钱塘江畔,东南临钱塘江滨江大道,东北为钱江三桥,西北以新塘河为界,西南紧邻“天福花园”、“临江风帆”.钱江三桥是杭州市南大门,该地块环境优美,交通便利。目前滨江大道正在铺设,杭州市政府要将其建设成为杭州市的外滩。以新的市政府大楼、大剧院、体育中心以及一批高标准办公、金融、商业、居住建筑为主体的新城已经全面启动。随着这些项目的陆续建成,市中心将向钱塘江畔偏移,一个杭州的“钱塘江时代”即将到来。通策钱江时代5.8米LOFT艺术公寓,占据钱江新城核心区域,钱江三桥一侧,步行生活半径将老城区和CBD完美串联,中美法三国联袂打造的前卫时尚“双层盒子建筑”,让您在“艺术”中创造艺术!通策钱江时代顶层20席penthouse,为高贵的您打造专署高层私人领地,独揽百米江景,傲守空中别墅之典范,300-600m2跃层布局,彰显尊贵,首度珍藏发售。', '', '1.08元/月/平方米');
