INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08CGK', '330100', '120.133328,30.287204;120.132426,30.287108;120.132408,30.287138;120.132329,30.288108;120.13411,30.288186;120.134153,30.287386;120.134088,30.287313;120.133328,30.287204', '中豪晴园', '杭州市西湖区文一路181号', '杭州市', '0103000020E6100000010000000800000008E9297288085E40C7478B3386493E40F7C8E6AA79085E40836BEEE87F493E40A46E675F79085E4058703FE081493E40FED30D1478085E404AB72572C1493E4043041C4295085E40412AC58EC6493E4042EA76F695085E400954FF2092493E404FB2D5E594085E4035B742588D493E4008E9297288085E40C7478B3386493E40', '15156.02068', '120.133229,30.287677', '商务住宅;住宅区;住宅小区', '地下车位205个', '2.53', '55243平方米', '51148', '中豪.晴园坐落于杭州市文一路,西临耀江文翠苑,东近教工路,南接杭十三中操场,周边高校林立,交通便捷,商业、运动、休闲设施成熟完善,是都市中心的珍藏地块。中豪.晴园总建筑面积为55000余平方米,绿地率达30%以上,园区以“市中心大家别院”定位,主张城市现代功能与庭院式居住环境的 机结合,规划建 五幢多层、小高层及高层住宅,户型面积从126-209余平方米,可以充分满足业主对现代市中心大家别院生活的需求。在园区布局上中豪?晴园充分遵循“以人为本”的思想,强调空间与景观的实用性和人性关怀。园区充分营造大家别院生活的家园,糅合现代造园手法,完美重现市中心大家别院“户户 阳光,家家享庭院”的栖居享受。', '2005-03-23', '1.4元/月/平方米');
