INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TBS', '330100', '120.207129,30.232924;120.207877,30.232196;120.207059,30.231552;120.206755,30.231832;120.206641,30.232017;120.206541,30.232298;120.206483,30.232539;120.206494,30.232769;120.206516,30.232986;120.206582,30.233174;120.206647,30.23333;120.206791,30.233561;120.206914,30.233731;120.207014,30.233831;120.207297,30.233599;120.207574,30.233348;120.207129,30.232924', '景江城市花园', '杭州市上城区之江路958号', '杭州市', '', '15836.17767', '120.207054,30.232629', '商务住宅;住宅区;住宅小区', '305个', '4.86', '112670平方米', '24392', '景江城市花园座落于杭州市钱塘江北岸、西兴大桥(钱江三桥)的西南边,占地面积18494平方米(约28亩),总建筑面积约11.3万平方米;绿化率约为30%。由28层的1号楼和33层的2号楼以及裙楼商铺组成;其中建筑物东向为小户型精装修单身公寓,南向为全江景大户型住宅。  景江城市花园尽享一线开阔江景;与钱江新城隔清江路对望,紧临钱江新城,地理上的优势,将使景江城市花园享受钱江新城为生活、休闲、娱乐、文化带来的至上便利。  景江城市花园SOHO尊享钱江新城规划的全新市政配套,未来城市CBD的都市繁华盛景和浓厚的商务氛围,为SOHO的工作带来便利,从而提高办公效率。  在户型方面,景江城市花园根据SOHO的实际需求精心设计,开朗的户型加上紧凑的功能布局,使工作融于生活,生活在一定程度上又独立于工作,程度上对“SOHO”进行完美诠释。  在景江城市花园,工作如鱼得水。俊美的西湖创造了居住杭州的“西湖时代”,而雄浑大气了居住杭的钱塘江引爆州的“钱江时代”。随着钱江新城的规划和建设,钱塘江北岸的土地资源日益稀缺,临江住宅可遇难求。  景江城市花园高层景观房傲立钱塘江北岸,览钱塘江风生水起,让人豪气顿生。迎面而来的更多阳光和更纯净的空气,成就了城市新贵生活的新品质。  景江城市花园大量采用中空隔音降噪玻璃,充分与整个建筑融合,不但使建筑现代大气,而且营造出空间的通透感,强调居住的一种舒适、休闲感觉,有效化解了传统建筑的空间局促性。景江城市花园不但追求整体建筑的气势和人性化,更注重细节的完美,推崇“细节完美才是真正的完美”的精品方针,造就杭城精品SOHO中的经典,并成为钱江新城边上一个建筑亮点。  景江城市花园建筑极具时代感,它通过简洁明快的线条,将本身的定位创新性的演绎居住之美。  超时代感的“直角型创意”,使整个建筑立面形成一种气势,一种精神内涵。那就是永远在发散的朝气,永不枯竭的活力。  俗话说,体贴在细处。景江城市花园除了打造空中花园精品,同时还在中心花园细心规划有林荫小道、花圃小品、纳凉小驿等精致景观,处处尽显尊贵体贴的舒适关怀。  景江城市花园的景观规划以“人与自然相和谐”为宗旨,充分借用现有的江边绿化带、江水等绿色资源,以小区内聚性空间为点,江边共享绿化带为线,江面水系为面,来形成小区、绿色空间与江面水系点、线、面的完美结合,使自然绿色与人居空间相互渗透,充分体现“人与自然、空间与自然”的和谐共存。  SOHO空间规划于景江城市花园两幢高层公寓楼东侧部位,推窗见景,尽揽东向繁华景致。景江城市花园SOHO精心规划了多种户型方案,36-55多平方米的灵巧空间设计,充分具备了居住、工作或度假的功能。主人可根据自己的喜好和舒适要求对开间尺度进行科学而自由的划分。在家居设置上更能充分满足现代人的多元需求。现代感的大面积落地窗设计使室内空间的采光通风和景观性得以加强,营造出一个真正属于自己的幸福小天地。', '', '0.9元/月/平方米');
