INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TKK', '330100', '120.193363,30.288443;120.193403,30.288437;120.193478,30.288445;120.193882,30.288556;120.194,30.288556;120.194035,30.288532;120.194097,30.288436;120.194141,30.288303;120.194158,30.288205;120.194131,30.288147;120.194093,30.28811;120.193886,30.287944;120.193799,30.287836;120.193623,30.287587;120.193526,30.287457;120.193301,30.287206;120.193037,30.286984;120.192402,30.287679;120.192195,30.28791;120.192035,30.288098;120.191979,30.288258;120.191982,30.288291;120.192014,30.288319;120.192334,30.288435;120.192363,30.28846;120.192373,30.288497;120.192384,30.288714;120.192402,30.288747;120.192435,30.288775;120.192481,30.288786;120.192973,30.288827;120.193051,30.288817;120.193118,30.288809;120.193155,30.288793;120.19319,30.288758;120.193219,30.288726;120.193248,30.28865;120.193275,30.288516;120.193303,30.288477;120.193363,30.288443', '沁园雅舍', '杭州市江干区机场路163号(文晖大桥东侧)', '杭州市', '', '20259.605364', '120.193046,30.288034', '商务住宅;住宅区;住宅小区', '', 'None', '', '26365', '本项目为小高层住宅、酒店式公寓(单身公寓)、沿街精品店、会所、中心花园和地下机动车库七大功能块组成。沁园酒店式SOHO“两座原理”,纯为两座设计,纯粹服务自己。三至八层真正纯酒店*自我:只住市中心,距武林广场仅3公里。*淡定:40-70万小总价,享受爱情低负担。*精致:40-50平方米主流面积,近20种个性户型。*个性:设计够酷,家电够全。*自主:全产权准现房,租售随意。*风尚:几米首度介入房地产项目主题创作,杭城首家艺术主题酒店,艺术住区的升华之作。*情趣:豪华酒店大堂,9-15层业主可以尽情享受酒店的贵宾服务。*休闲:城东的成熟商区,提供精致生活配套服务。*地下铁:地铁一号线闸弄口站,相距100余米。*体贴:观景阳台,坐享园区原生态树林和30米宽的景观绿化带。上面只讲述的是沁园雅舍生活馆。钱塘沁园有三个项目,分别为,沁园雅舍生活馆,沁园雅舍商务馆和沁园雅舍(住宅),其中商务馆和生活馆都是50年产权,商务馆是纯写字楼,生活馆是酒店式单身公寓,均可注册公司。在这里我主要是推荐住宅,沁园雅舍为住宅,住宅区为7幢小高层组成,小区楼间距大,其中三幢为点式房,其余四幢为排式房,主力户型为3室2厅,面积为120平米-150平米,中间套的户型,卫生间基本都有窗,这个现代式设计赢得了广泛业主的赞同。本小区无沿马路的房子,并且绿化率非常高,晚上一点都不吵闹,非常适合居住。我也不光说好,小区里缺少的就是菜场和超市,超市要到华润万家,小区附近有三个菜场,距离都差不多,可自由选择。若想入住成熟的地铁房,可在沁园雅舍生活馆楼下的假日房产咨询,小区里的房子百分之九十都是他们成交的。相信你也可以在那里找到满意的房子。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TPW', '330100', '120.184302,30.311832;120.18437,30.311867;120.185421,30.311851;120.185449,30.311792;120.185427,30.310782;120.185456,30.310716;120.185479,30.310684;120.185499,30.310612;120.185484,30.309996;120.185442,30.309957;120.184125,30.309989;120.184142,30.31075;120.183031,30.310763;120.183014,30.311753;120.184277,30.311751;120.184302,30.311832', '沈家南园', '杭州市下城区长浜路280号', '杭州市', '', '32646.02019', '120.184425,30.31101', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '交通便利,配套成熟    交通便利,配套成熟', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TPZ', '330100', '120.222721,30.258207;120.222081,30.257477;120.221426,30.258018;120.220717,30.258633;120.219522,30.259734;120.221206,30.260821;120.221487,30.261045;120.222379,30.260295;120.222608,30.260098;120.223118,30.259637;120.223593,30.259215;120.222721,30.258207', '盛世钱塘', '杭州市江干区富春路899号', '杭州市', '', '65304.008406', '120.221644,30.259329', '商务住宅;住宅区;住宅小区', '1057个', '3', '235000平方米', '62652', '盛世钱塘地处“江河汇流之处,钱来运通之地”,东依古老运河、西临钱江新城、南望钱塘江景、北瞰主城繁华,360°度全景住宅,轻松拥有钱塘江壮美景致,千年古运河的优雅风情,是同时具备钱塘江、运河景观的住宅项目,是真正意义的江河景观CBD公寓,曾荣获国际花园社区(中国赛区)大奖。  盛世钱塘设计吸取了中国传统堪舆学的精髓,由七幢近百米高的板式、板点式高层围合而成,气势宏大,幢距开阔,视野宽广。建筑分别以北斗七星名字命名(玉衡阁、瑶光阁、开阳阁、天枢阁、天权阁、天璇阁、天玑阁)。  盛世钱塘中心花园约有3万平方米,底层采用架空层设计,使得园林景观与建筑物彼此和谐交融。小区内所有的电梯厅设计都是直接采光,另外在板点式建筑中还特别采用了观光电梯设计,让业主踏着美景直到家门。住宅设计南北通风,以明厅、明室、明厨、明卫即“四明”为特征,主力户型以150㎡左右的三室二厅、180㎡左右的四室二厅为主。其中玉衡阁设计的全装修Loft白领公寓户型更是独具匠心,层高4.8米的复式结构,将创造的激情从居住的空间展示着,让生活更加随心所欲。开发商精装修并附送分体式空调、热水器、整体厨柜、洁具、淋浴房。  盛世钱塘建筑是融入城市环境建筑,以高层住宅的形式兴起与城市发展的必然需要,宽敞的楼体间距可以让建筑之外的空间被用作绿化和其它配套,为业主寻求更多生存空间,为生活营造更好的环境。', '2005-07-29', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TQE', '330100', '120.173383,30.26471;120.174368,30.264684;120.17434,30.265063;120.174321,30.265345;120.174277,30.265633;120.174496,30.265657;120.175165,30.26572;120.175311,30.265744;120.175394,30.265773;120.175457,30.265811;120.175626,30.265844;120.175886,30.265902;120.175692,30.267099;120.17563,30.267721;120.173967,30.267531;120.172957,30.267466;120.17308,30.266808;120.173383,30.26471', '十五家园社区', '杭州市下城区健康路163号', '杭州市', '', '54334.876271', '120.174339,30.266406', '商务住宅;住宅区;住宅小区', '', '1.83', '12300平方米', '36324', '十五家园建于1988年左右,南面为凤起路,西靠丝绸城,北靠体育场路,东靠东河和建国路,小区于2007年被市政府庭院整改过。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TR8', '330100', '120.166116,30.317079;120.166624,30.317885;120.166697,30.317961;120.167478,30.317989;120.168128,30.318077;120.16921,30.318186;120.169811,30.318237;120.169829,30.318182;120.16991,30.31804;120.169982,30.317854;120.16995,30.317759;120.16988,30.317683;120.169795,30.317655;120.16967,30.317621;120.169785,30.317544;120.169865,30.317425;120.170129,30.317461;120.170538,30.31748;120.17096,30.317462;120.170952,30.31622;120.169179,30.316171;120.167364,30.316182;120.166681,30.316185;120.166299,30.316237;120.165931,30.316324;120.165734,30.316419;120.166116,30.317079', '水印康庭', '杭州市下城区白石巷384号', '杭州市', '', '76018.189746', '120.168454,30.317057', '商务住宅;住宅区;住宅小区', '0.3', '2.2', '200000平方米', '33193', '水印康庭位于城北香北大型居住区的核心腹地,处于绍兴路和东新路之间,南近规划中700余亩的城北体育休闲公园,区位优越,交通便捷,至武林门仅7公里距离。总建筑面积约20万平米,是城北核心居住区大规模的高尚住宅园区。欧尚、乐购等大型生活超市近在小区附近,东新路沿线也将建成为大型商业中心,众多商业、文化、餐饮等居家生活配套沿路布置,方便生活。利兹.水印康庭总占地175亩,地面建筑面积16.4万方,共有住宅约1800套,户型以80—120平米为主,户型紧凑实用,自然环境优美,东北两面临河,地块中有一条河流通过,西南面临规划占地580亩的城北体育公园,南面有规划近20000平米的城市集中绿化,绿化率超过30%。', '2007-06-25', '2.2元/月/平方米');
