INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08UEY', '330100', '120.171705,30.241452;120.171687,30.241828;120.171271,30.241836;120.171262,30.242351;120.171261,30.242683;120.171273,30.242713;120.171297,30.242724;120.172122,30.242748;120.172151,30.242742;120.172168,30.242731;120.172176,30.242697;120.172186,30.242599;120.172208,30.24146;120.171705,30.241452', '中山苑', '杭州市上城区光复路28号', '杭州市', '', '9359.887776', '120.171771,30.242164', '商务住宅;住宅区;住宅小区', '', 'None', '', '30573', '中山苑位于上城区光复路28号,小区共4幢高层,建于1995年,沿中河高架。地理位置优越、交通便利、环境优美。项目规划创造一个具有公共文化空间、亲和力与和谐人文特色的社区。生活安静,环境优美,生活氛围浓厚等优势为您创造了优良居住环境。周边教育、娱乐等配套设施完善、环境优美。', '', '0.8元/月/平方米');
