INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X6P', '330100', '120.153604,30.303841;120.153289,30.303821;120.152498,30.304269;120.152498,30.305548;120.154321,30.30557;120.154318,30.305065;120.154318,30.304411;120.154335,30.304141;120.153598,30.304193;120.153604,30.303841', '大关西三苑', '杭州市拱墅区上塘路538号附近', '杭州市', '', '24914.056903', '120.153404,30.3048', '商务住宅;住宅区;住宅小区', '', '1.5', '4000平方米', '31265', '小区周边配套齐全。大关西三苑的优点在于:处于闹市地段。综合配套优质。出行比较方便(公交线有26路-大关东五苑、503路-上塘路香积寺路口、843路-百丈井东路、K605路空调-公交三公司等6条;步行到近的公交线仅需1)。。购物配套便利(大型超市:世纪华联等2家;小型超市:喜士多便利连锁店德苑路店、红霞便利超市、可的便利店no.803等12家;步行到近的大型超市较近)。', '', '0.15元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X6X', '330100', '120.155044,30.303365;120.154802,30.303219;120.154635,30.303454;120.154451,30.30384;120.154375,30.304275;120.154367,30.304583;120.15438,30.305219;120.156099,30.305199;120.156121,30.304414;120.156118,30.304156;120.155975,30.304044;120.155494,30.303696;120.155044,30.303365', '大关东五苑', '杭州市拱墅区大关苑路与香积寺路交叉口', '杭州市', '', '24624.712824', '120.155189,30.304406', '商务住宅;住宅区;住宅小区', '', '1.4', '19874平方米', '31102', '大关东五苑位于位于大关苑路,靠钱江市场旁边。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。交通便捷,购物方便,风景优美。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。环境优美,丽水成天的风景给予了回归家庭、回归私域的生活体验。', '', '0.5-0.54元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X7K', '330100', '120.156592,30.30861;120.156594,30.308488;120.156692,30.308222;120.156811,30.308034;120.15697,30.307803;120.156158,30.307771;120.15616,30.308747;120.156147,30.309025;120.155833,30.309449;120.155551,30.309813;120.155405,30.309994;120.156264,30.310567;120.156939,30.309989;120.15686,30.309889;120.156966,30.309672;120.156756,30.309402;120.156673,30.309097;120.156592,30.30861', '大关东九苑', '杭州市拱墅区大关苑路', '杭州市', '', '19206.960648', '120.156315,30.309319', '商务住宅;住宅区;住宅小区', '', 'None', '', '29473', '大关东九苑位于拱墅区大关小区。香积寺路与苑中路交叉口 通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。大关东九苑的优点是:处于商圈地段,综合配套优质,交通便捷,购物便捷,景观好,有河景。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X7L', '330100', '120.157712,30.306963;120.157934,30.306748;120.157905,30.306709;120.157621,30.306678;120.157633,30.306112;120.156867,30.305845;120.156863,30.305577;120.156186,30.305556;120.156159,30.307761;120.156497,30.307769;120.15646,30.307043;120.157061,30.307065;120.157059,30.307283;120.157274,30.30728;120.157453,30.307259;120.157541,30.307146;120.157612,30.307042;120.157712,30.306963', '大关东四苑', '杭州市拱墅区香积寺路', '杭州市', '', '20314.394347', '120.15683,30.30655', '商务住宅;住宅区;住宅小区', '', 'None', '', '31817', '小区共12幢,竣工于1994年,交付于1995年,旁边就是大关游泳馆,大型欧尚超市,生活购物都十分的便利.', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X7M', '330100', '120.156096,30.305242;120.154447,30.305299;120.154434,30.306532;120.155256,30.306505;120.155438,30.306315;120.156095,30.306305;120.156096,30.305242', '大关东六苑', '杭州市拱墅区大关苑路56号', '杭州市', '0103000020E6100000010000000700000055C2137AFD095E409A5DF756244E3E40C87DAB75E2095E4063804413284E3E40FDD8243FE2095E406F2D93E1784E3E407FA0DCB6EF095E407C0F971C774E3E4090A339B2F2095E403546EBA86A4E3E406C04E275FD095E40ED9925016A4E3E4055C2137AFD095E409A5DF756244E3E40', '17367.875595', '120.155237,30.305852', '商务住宅;住宅区;住宅小区', '', '2', '22000平方米', '31754', '大关小区地处拱墅区,东临上塘河,南至石灰坝,西与上塘路接壤,北靠大关路,常住人口在8万人以上,是杭州规模比较大的成熟小区之一。  按照所处位置的不同,大关小区又可分为南苑、东苑和西苑。其中南苑共有南一到南十苑组成,东苑由东一苑至东十苑组成,西苑有西三至西八组成,每个苑大约有十幢左右的房子,总共住宅楼在200多幢。大关小区建设的跨越时间比较长,早建的西苑大多数房子和东苑的一部分组团建筑年代在1994年左右,后的大关东十苑和香吉公寓在2002年才终完工。  经过近十年的发展,大关小区已经从原来的城郊结合部成为城市的一个次中心。现在大关小区周边的配套相当完善,吃穿行都可方便的解决。位于大关东一苑旁边的大关小区公交车站是城北的枢纽站,有K3路、12路、K41路、57路、58路、K78路、K82路、K218路、K316路等十数条在此始发。除了大关小区车站,在大关西八苑的大关苑路上还有大关小区北车站,上塘路上的大关西六苑站。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X7Q', '330100', '120.160062,30.304379;120.159559,30.304119;120.159335,30.304325;120.159108,30.304433;120.158937,30.304467;120.158816,30.304473;120.15873,30.304426;120.158568,30.304347;120.158469,30.304261;120.158429,30.304301;120.158009,30.304695;120.15755,30.305061;120.157363,30.30522;120.158007,30.305692;120.158365,30.305967;120.158472,30.306035;120.15852,30.306024;120.159091,30.305591;120.15954,30.305139;120.160048,30.304639;120.160203,30.304448;120.160062,30.304379', '大关东一苑', '杭州市拱墅区香积寺路222号', '杭州市', '', '24243.642705', '120.158751,30.305023', '商务住宅;住宅区;住宅小区', '', '1.2', '60000平方米', '32327', '大关东一苑在香积寺路和绍兴路西北面,小区配套设施齐全,交通也是非常的方便。大关是一个大型小区,有大型的世纪联华和欧尚超市,中小学有大关一小、德胜小学、行知中学、育才中学。杭十一中和交通技术学校,医院有钢铁医院和市二医院,还有两个大型的农贸市场,大关还是一个公交车中转站。大关东一苑居住环境安静,交通方便快捷,生活配套一应俱全,方便居民的日常生活。生活安静,环境优美,生活氛围浓厚等优势为您创造了优良居住环境。让居家的日子变得方便、轻松、惬意,周边教育、娱乐等配套设施完善,环境优美。', '', '0.25元/月/平方米');
