INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09FQZ', '330100', '120.129772,30.286121;120.129299,30.286109;120.129232,30.287077;120.129175,30.28797;120.129772,30.288002;120.130451,30.288034;120.130413,30.287685;120.130413,30.287632;120.130476,30.286142;120.129772,30.286121', '梧桐公寓', '杭州市西湖区学院路258号', '杭州市', '', '20637.2671', '120.12984,30.287073', '商务住宅;住宅区;住宅小区', '0.7', '2.5', '45600.4平方米', '52040', '梧桐公寓是杭城首座完整体现以优雅、唯美见长的Art Deco社区,矗立于备受杭州市民青睐的文教区,西湖区文一路与学院路的优雅结点处,与翰墨飘香的杭州师范学院、浙江工商大学比邻而居,是由6栋具备时间感的多层、小高层、高层组成的宁静城市公寓。围而不合的建筑布局,充分传递自然于人文和谐共生建筑哲学,以雍容内敛的气质推动时代的变迁,百米生活圈内,荟萃丰富的24商务、饮食、购物、休闲娱乐资源和完善的生活配套设施。  梧桐公寓通过强调Art Deco建筑的华贵坚实,细部装饰的细腻丰富,以及Art Deco主题园区的典雅稳重,并融汇了杭城精致、内敛、闲适的气质,实现了Art Deco建筑艺术与都会生活的完美结合。', '2006-03-31', '2.5元/月/平方米');
