INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09HMT', '330100', '120.150821,30.184131;120.149501,30.181523;120.147238,30.183357;120.14705,30.183771;120.14816,30.185905;120.150821,30.184131', '碧水豪园', '杭州市滨江区浦沿街道西环路30号', '杭州市', '0103000020E6100000010000000600000033A31F0DA7095E40062E8F35232F3E40096EA46C91095E40C878944A782E3E409FAEEE586C095E40207EFE7BF02E3E401D38674469095E4006F4C29D0B2F3E40D3A414747B095E40B3295778972F3E4033A31F0DA7095E40062E8F35232F3E40', '80087.350236', '120.14889,30.183768', '商务住宅;住宅区;住宅小区', '', 'None', '', '29413', '华龙碧水豪园坐落于美丽的钱塘江大桥南岸,它东沿东信大道,北临跨江主干道中兴路以及40余米宽的河绿化带,与之江旅游度假村两两相对。小区总规划用地117亩,总建筑面积11.6万余方,总户数536户,绿地率40%以上。整个园区呈菱形状向北开放,部分楼层可直接眺望钱江美景,并与六和塔等风景名胜隔江相望,具有的视觉景观。华龙碧水豪园建有三至五层的高尚排屋和花园式洋房,辅之以多层高级公寓和高层景观电梯房,为钱塘江南岸一个极富现代气息的高尚临江住宅园区。华龙碧水豪园配套齐全,环境优美,空气清新,智能化程度较高,是“钱塘江时代”的代表作品之一。', '', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09HPB', '330100', '120.155265,30.301418;120.155395,30.301531;120.155579,30.301664;120.155653,30.30172;120.156777,30.300615;120.156425,30.3003;120.156158,30.300563;120.155884,30.300834;120.155265,30.301418', '大关南二苑', '杭州市拱墅区上塘路412号', '杭州市', '', '6902.952275', '120.156026,30.301019', '商务住宅;住宅区;住宅小区', '', '1.3', '15000平方米', '21466', '大关南二苑地处拱北繁华的地段,周围有商场,超市,购物中心,银行,菜场,钱江市场,欧尚超市,大关夜市。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09HRW', '330100', '120.112245,30.291772;120.112271,30.291497;120.112286,30.291232;120.11197,30.291219;120.111503,30.291198;120.110727,30.291125;120.109556,30.291058;120.109095,30.291052;120.107956,30.290972;120.107138,30.290918;120.106951,30.292045;120.107435,30.292002;120.107647,30.291973;120.109135,30.291753;120.10918,30.291764;120.109244,30.291823;120.10959,30.291824;120.112211,30.292086;120.112245,30.291772', '物华小康居住区', '杭州市西湖区丰潭路171号', '杭州市', '', '40319.499423', '120.109543,30.291501', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '物华小区环境很安静,很优雅。虽然是98年的小区,但是现在全部做过了外包新,看起来非常不错。由于靠近余杭塘河、周边还要建银泰等大型购物中心,潜力不错。物华小康居住区占地82亩,总建筑面积8万余平米,是全国较早开发的小康示范小区,已被国家科委和建设部正式定为全国小康型城市住宅示范小区建设,并通过了专家组对物华小区规划设计方案的评审,是杭州市经国家正式批准的小康型城市住宅居住示范小区在建项目。', '', '');
