INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JJN', '330100', '120.277725,30.142779;120.277279,30.14275;120.272888,30.142589;120.2728,30.144723;120.274658,30.144806;120.27715,30.144903;120.277285,30.143658;120.27741,30.143495;120.277612,30.14337;120.277797,30.143198;120.27786,30.142823;120.277725,30.142779', '绿都四季花城', '杭州市萧山区南秀路1176号', '杭州市', '', '89289.178167', '120.275135,30.143719', '商务住宅;住宅区;住宅小区', '', 'None', '', '23829', '充分考虑地块自身条件,南面500米长箩婆桥河岸线,景观资源丰富;楼盘所在为贺知章故乡,文化底蕴深厚,周边学府林立;紧邻10万㎡南江公园等。', '2002-12-25', '1.95元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JJO', '330100', '120.285034,30.192093;120.284992,30.191316;120.283292,30.191387;120.283322,30.192047;120.283395,30.192043;120.283445,30.192053;120.283483,30.192079;120.283515,30.192087;120.283958,30.192067;120.283965,30.192117;120.283987,30.192128;120.284019,30.192129;120.285034,30.192093', '明江苑', '杭州市萧山区萧山萧山区经济技术开发区通惠北路1-5号', '杭州市', '', '11571.642579', '120.284183,30.191724', '商务住宅;住宅区;住宅小区', '', '2.23', '18000平方米', '17531', '明江苑小区位于萧山区通惠北路与建设一路交叉口,是70年产权的纯住宅小区,有学区、可以落户的,小区全部是多层住宅,得房率高,下面有自行车库、地面车位,顶楼送露台的,周边设施、配套完善,交通便捷。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JJP', '330100', '120.257778,30.184317;120.257775,30.183418;120.25686,30.183449;120.256627,30.183439;120.256438,30.183458;120.256026,30.183472;120.25582,30.183484;120.255462,30.183544;120.25489,30.183632;120.254485,30.183661;120.253414,30.18366;120.253298,30.1837;120.253239,30.184205;120.253113,30.185303;120.253166,30.185412;120.253265,30.185464;120.254501,30.185467;120.255604,30.185448;120.257752,30.185415;120.257778,30.184317', '众安·国泰花园', '杭州市萧山区金惠路993号', '杭州市', '', '78929.709987', '120.25554,30.1845', '商务住宅;住宅区;住宅小区', '', 'None', '', '23174', '众安.国泰花园位于萧山新区最为繁华的中心地带,区政府大楼西侧,位于金惠路、金鸡路之间。本项目系建设部2000年度6个国家级康居示范工程之一,杭州地区首个国家康居示范工程。该项目总用的面积86091平方米,总建筑面积18.2万平方米,由多层、高层、联体别墅、单体别墅组成,共有801个居住单位,住宅面积137412平方米,公共建筑面积11599平方米,地下室及车库14467平方米,绿地面积高达40218平方米,绿化率达45.7%。社区配套极尽完善。众安.国泰花园闹中取静,大浦河,工人河从她的周边蜿蜒而过,隔开了城市中心的喧嚣,安然藏于城市中心的深处。社区自然水景与人工水景交融穿插,典雅的别墅、多层、小高层错落其间,井然有序。水、桥、各种庭院景观、水岸公园,使本项目充满优雅、祥和、华贵的居住气氛。众安.国泰花园是21世纪高技术含量的水景花园住宅,系众安房产的品牌经典之作。2001年,众安·国泰花园被国家建设部评为“三优”工程,即规划设计优、建筑设计优、总体水平优;同年,由浙江省消协、杭州房地产协会发起的“住在杭州”大型调查活动中,国家康居示范工程——众安.国泰花园被评为“消费者首选楼盘”;2004年7月,众安.国泰花园荣获建设部第四届中国国际住宅产业展览会“创新楼盘奖”等荣誉。', '', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JJR', '330100', '120.17927,30.283585;120.178219,30.283494;120.178102,30.284533;120.178084,30.285135;120.178068,30.285281;120.178894,30.285363;120.178954,30.285279;120.179074,30.285065;120.179168,30.284863;120.179153,30.284667;120.179194,30.284386;120.179203,30.284144;120.179273,30.28365;120.17927,30.283585', '现代家园(置业街)', '杭州市下城区文晖路', '杭州市', '', '16900.744906', '120.178648,30.284414', '商务住宅;住宅区;住宅小区', '', 'None', '', '38995', '野风.现代家园由7幢小高层、高层公寓组成,总建筑面积约4万㎡,市中心65—145㎡罕有精致空间,演绎“室不在大,在于雅”的新城市居住审美观,令人艳羡的时尚生活版本,全新演绎。野风.现代家园中小户型“高级公寓”运用“序列——离散——有序”的空间设计概念,创造性的将点式建筑和条式建筑布置成相互交错的有序空间格局,使每个角度的可视面大大增加,从而使住宅单元的视野、通风、观景等性能得以极大的提高,让您细细品味空间光影里的四季轮回。以“现代环境艺术”为主题的景观贯穿整个错落有序的建筑空间,布以水、筑以亭、植以竹,营造出现代庭院的独特韵味。提倡“以面积有效为户型设计第一原则”,所设计的户型功能完备、空间流畅、面积舒适,让您轻松享受生活乐趣。', '', '1.3-3.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JK0', '330100', '120.344993,30.304453;120.344961,30.304436;120.344215,30.304401;120.344177,30.304689;120.343564,30.304651;120.343476,30.305605;120.344925,30.305716;120.344975,30.305093;120.34504,30.30458;120.345025,30.30447;120.344993,30.304453', '文汇苑', '杭州市江干区下沙管委会旁3、4号路交汇处', '杭州市', '', '15025.196056', '120.344301,30.305087', '商务住宅;住宅区;住宅小区', '160位', 'None', '60000平方米', '18599', '下沙·文汇苑位于下沙的核心地段,3、4号路交汇处,南临下沙管委会、高新技术开发区,北倚10平方公里大学城,整个社区深深沉浸在浓浓的的文化氛围中。下沙·文汇苑周边多条公交线路直达市中心,育英小学、东方医院、锦鳞公园、松下健身中心、体育馆、超市、银行等配套一应俱全。下沙·文汇苑总建筑面积约70000m2,由5幢高层、小高层围合而成。中心的位置、轩昂的建筑、优秀的品质使下沙·文汇苑成为都市新城里的标志性社区。', '2003-03-18', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JK4', '330100', '120.053971,30.245752;120.053723,30.245759;120.053648,30.245777;120.053589,30.245826;120.053742,30.24638;120.053853,30.246407;120.05514,30.246532;120.0554,30.245309;120.053985,30.245193;120.053971,30.245752', '钱潮花园', '杭州市余杭区天目山路515号西溪湿地斜对面', '杭州市', '', '16381.919629', '120.054537,30.245867', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '小区交通便利 配套完善', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JKC', '330100', '120.161671,30.207507;120.161598,30.207503;120.160871,30.208496;120.160922,30.208689;120.162354,30.209446;120.16313,30.208373;120.161671,30.207507', '海月花园', '杭州市上城区海月路15号', '杭州市', '0103000020E610000001000000070000008B6D52D1580A5E40EAB0C22D1F353E405646239F570A5E4067D2A6EA1E353E40FDF7E0B54B0A5E40C9586DFE5F353E403ECDC98B4C0A5E40F2086EA46C353E40FC170802640A5E402C47C8409E353E40C6BFCFB8700A5E40925ED4EE57353E408B6D52D1580A5E40EAB0C22D1F353E40', '21739.831678', '120.161968,30.208473', '商务住宅;住宅区;住宅小区', '0.3', '4.3', '400000平方米', '35493', '海月花园位于复兴地区中央海月桥,南临钱塘江,北靠凤凰山。由浙江金纬房产开发,占地120余亩,分南北两区,区间为40余亩的中河绿化区,是目前城南沿江地区规模、开发定位的住宅之一。海月花园位于杭州市南部复兴地区中央海月桥,南临钱塘江,北靠凤凰山。●海月花园由浙江金纬房产开发,占地120余亩,分南北两区,区间为40余亩的中河绿化区,是目前城南沿江地区规模、开发定位的住宅之一。●海月花园的开发以新杭州城市发展战略规划为背景,开发选址上具有一年左右的前瞻性,基本做到小区建成之日,即为区块繁荣之时。●海月花园内无拆迁回迁用房,社区品质上乘一致。●海月花园所在复兴地块非农业用地,市政基础设施良好,水、电、排污、道路均已齐备,无须再进行大规模市政基础设施建设,公建配套由市政统一计划实施', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JKD', '330100', '120.166082,30.207099;120.162877,30.205598;120.162,30.206904;120.163778,30.207925;120.164937,30.208687;120.166082,30.207099', '金棕榈花园', '杭州市上城区复兴南街与洋泮路交汇处', '杭州市', '0103000020E61000000100000006000000139D6516A10A5E40C808A87004353E405111A7936C0A5E407D1F0E12A2343E40EE7C3F355E0A5E405E6919A9F7343E407973B8567B0A5E405305A3923A353E409F39EB538E0A5E40B119E0826C353E40139D6516A10A5E40C808A87004353E40', '54771.240489', '120.164037,30.207089', '商务住宅;住宅区;住宅小区', '0.3', 'None', '130000平方米', '39694', '海月金棕榈作为城南的精品楼盘,以其舒适的空间尺度,将在高楼挺立的钱江北岸突显出一片新城的开阔天空。花园南区强调并凸显出后现代主义风格,设计充分考虑了临江的特点,将窗外的景观与小区景观有机的融合为一体,户型全面采用大开间、小进深设计,金棕榈大量运用了低窗台、大阳台、落地窗设计,并根据山景和江景对开窗角度和朝向作适当处理,以最大限度地发挥现代滨海建筑的独有气质。', '2003-08-18', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JKG', '330100', '120.272433,30.178315;120.271689,30.178227;120.271514,30.179561;120.271547,30.179606;120.271971,30.179732;120.272154,30.179784;120.272658,30.179867;120.273109,30.179915;120.273305,30.178463;120.273021,30.178401;120.272433,30.178315', '绿茵园小区', '杭州市萧山区北干街道永久路453号', '杭州市', '', '21809.077854', '120.272411,30.179061', '商务住宅;住宅区;住宅小区', '', '1.05', '65000平方米', '18608', '绿茵园小区建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。大环境、大配套、交通便捷,吸引众多置业人青睐。其地理位置优越、交通便利、环境优雅,是质量较高、配套完善的优秀住宅小区。多角度采光纳景,让的自然阳光漫洒进屋,增添生活乐趣。交通便捷,人文气息浓郁。    绿茵园小区建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。大环境、大配套、交通便捷,吸引众多置业人青睐。其地理位置优越、交通便利、环境优雅,是质量较高、配套完善的优秀住宅小区。多角度采光纳景,让的自然阳光漫洒进屋,增添生活乐趣。交通便捷,人文气息浓郁。', '', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JKK', '330100', '120.290911,30.206527;120.291001,30.206509;120.290826,30.205657;120.29068,30.205627;120.288944,30.205909;120.287636,30.206102;120.287534,30.206171;120.28767,30.20674;120.289081,30.206516;120.289289,30.207428;120.291015,30.207157;120.290911,30.206527', '明辉花园', '杭州市萧山区宁围镇兴园路65号', '杭州市', '', '34215.96574', '120.289611,30.206466', '商务住宅;住宅区;住宅小区', '', 'None', '', '15898', '毗邻钱江二桥、三桥,为沪杭甬、杭金衢高速公路的交汇处,与萧山国际机场近在咫尺,交通便捷', '2002-09-30', '1.3元/月/平方米');
