INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JL0', '330100', '120.180613,30.267459;120.180361,30.26915;120.180259,30.270105;120.182973,30.27024;120.183022,30.26989;120.183057,30.269578;120.183085,30.269189;120.183056,30.268985;120.182897,30.267896;120.182885,30.267629;120.182084,30.267575;120.180613,30.267459', '树园小区', '杭州市下城区建国北路424', '杭州市', '', '61747.889406', '120.181705,30.268904', '商务住宅;住宅区;住宅小区', '', '2.8', '12000平方米', '31644', '树园位于建国北路,靠近市中心,生活便利,小区配套成熟总栋数30栋,1-6幢1988年,7-15幢1988年,16-22幢1989年,22-30幢1990年。  小区建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09JL3', '330100', '120.347428,30.30585;120.347457,30.305005;120.347443,30.304891;120.347111,30.304576;120.346591,30.304948;120.346482,30.30503;120.34633,30.305062;120.345113,30.30499;120.345042,30.305707;120.347428,30.30585', '香榭里花园', '杭州市江干区下沙新城四号路南侧', '杭州市', '', '18390.586596', '120.34638,30.305342', '商务住宅;住宅区;住宅小区', '', 'None', '', '21965', '香榭里花园位于下沙新城中心区域四号路南侧,处于新城居住、休闲、商业发展的核心要地,东临镜屏公园和体育健身中心,环境优美,北与大学城隔街相望,南面为已建北美风格高尚别墅组团,不仅阳光、视野无遮挡,更彰显建筑的挺拔与尊贵。香榭里花园规划建筑面积7万平方米,由七幢8-18层景观电梯房组成,共有440余户尊贵席位全部围绕中庭,户户有庭景,尽享围合式庭院的葱翠绿意。香榭里花园中庭由国内著名的专业园林景观设计单位东方园林规划设计,为体现环境的观赏性、实用性,中庭环艺以水景为主体穿越东西,辅以缓坡、小桥、叠水、亭台等丰富视野,有庭有景的生活才是有品位的人生。香榭里花园沿下沙4号路住宅底层设立200余米休闲商业街,依托优越的物业位置,完美精致的建筑规划及一流水准的物业管理服务,创造了丰富的人居环境,成就了一流的品质保证。香榭里花园之庭院由东方园林设计公司精心设计打造。东方园林系目前这内最大的专业园林景观设计公司,拥有EDSA-ORIENT园林环境景观规划设计院,是国内首家通过英国(NQA)颁发的ISO9002国际质量认证的园林企业。香榭里花园景观庭院由北京东方园林及新加坡PALA公司首席设计师John主持设计,名家手笔,非凡之作。「入口」园区从地块特点、消防安全、物业管理出发,在四号路设置主入口。主路口建筑手法简洁明快,又不乏文化韵味,以入口广场的主题雕塑凸显园区品位,结合园内水景、平台,成就高品质生活意象。「道路」园区路网设计和地形园景相协调,实现人车分流,通而不透,畅而不直。在设主次干道的同时设立健康步道,同时在景点之间设步行游道,营造美妙的风景线,为业主提供了闲庭信步的场所,丰富了园区的景观。「车库」考虑园区规模及业主品位,香榭里花园采用地上车库与地下大型车库相结合的原则,充分满足住户的停车需要。车库自然采光通风,不同于传统车库的阴暗潮湿,结合园林景观设计,将美景一路延伸', '', '0.9元/月/平方米');
