INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09LL4', '330100', '120.161409,30.204923;120.160054,30.204389;120.159339,30.205432;120.160275,30.205914;120.161147,30.206415;120.16191,30.206826;120.162753,30.205532;120.161409,30.204923', '清怡花苑(复兴南街)', '杭州市上城区复兴南街347号', '杭州市', '0103000020E61000000100000008000000ED116A86540A5E40BE326FD575343E4004E621533E0A5E4082A966D652343E408D7E349C320A5E40478D093197343E4073D712F2410A5E40DEC9A7C7B6343E404EB6813B500A5E4062670A9DD7343E404EB9C2BB5C0A5E4066F6798CF2343E40DB148F8B6A0A5E400F48C2BE9D343E40ED116A86540A5E40BE326FD575343E40', '37315.329373', '120.161067,30.205558', '商务住宅;住宅区;住宅小区', '0.97', '2.2', '100000平方米', '34852', '清怡花苑位于江干区之江路200号,面朝钱塘江,北依凤凰山,背山面水,地理位置极佳,景观优美。小区住宅全朝南,建筑群布局合理,绿化率达30%,小区多为1梯2户或1梯1户,保证了住户通风的良好。  清怡花园占地4万余平方米,总建筑面积10万余平方米,由多层、小高层住宅以及多幢别墅组成,群体空间设计南低北高,使的住户能够充分享受美丽的江景。小区利用背山面水的优越环境,借自然之美为己用,中央绿地与江、塔、山、桥一起构筑了钱塘江畔的传世美景。作为住宅建设的创新,清怡花苑是我省首家国家节能住宅示范小区,也是目前我国在冬冷夏暖地区进行建设的国家节能住宅示范小区。    清怡花苑位于江干区之江路200号,面朝钱塘江,北依凤凰山,背山面水,地理位置极佳,景观优美。小区住宅全朝南,建筑群布局合理,绿化率达30%,小区多为1梯2户或1梯1户,保证了住户通风的良好。  清怡花园占地4万余平方米,总建筑面积10万余平方米,由多层、小高层住宅以及多幢别墅组成,群体空间设计南低北高,使的住户能够充分享受美丽的江景。小区利用背山面水的优越环境,借自然之美为己用,中央绿地与江、塔、山、桥一起构筑了钱塘江畔的传世美景。作为住宅建设的创新,清怡花苑是我省首家国家节能住宅示范小区,也是目前我国在冬冷夏暖地区进行建设的国家节能住宅示范小区。', '', '0.8元/月/平方米');
