INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09LSS', '330100', '120.208355,30.201206;120.207157,30.200689;120.205949,30.200159;120.20506,30.202392;120.205058,30.202569;120.205151,30.202674;120.206772,30.203518;120.207215,30.203751;120.20783,30.204091;120.208423,30.20438;120.208661,30.204356;120.208771,30.204299;120.208862,30.20419;120.209139,30.203621;120.20944,30.202947;120.20973,30.201995;120.20972,30.201885;120.20961,30.201814;120.208355,30.201206', '风雅钱塘', '杭州市滨江区江汉路1444号', '杭州市', '', '105393.698989', '120.20749,30.202261', '商务住宅;住宅区;住宅小区', '1;1', 'None', '320000平方米', '39720', '风雅钱塘花园由世界著名的澳大利亚PTW建筑设计公司(PTWArchitects)进行建筑规划设计,浙江大学建筑设计研究院进行施工图设计。本着“以人为本”的设计理念,两大著名的设计单位通力合作,使整个设计创意独特,现代感强烈,使人耳目一新。风雅钱塘的设计是国外先进设计理念与中国传统建筑理念结合而成的完美杰作,是滨江区最有个性、最具人性化的住宅园区。在总体规划中采用了跟一般住宅完全不同的布局形式——开放空间,与整个城市融为一体。风雅钱塘着力重现法国建筑大师LeCorbusier的新都市乌托邦规划理念--高层建筑+大绿地,即建筑向高空发展,最大限度将空间留给绿地公园。风雅钱塘崇尚“新城市主义”的渗透及开放观念—小区绿地公园与市政绿化相互渗透,使业主相信他们不会被看作观察者,而是使用和享受城市空间的主人。整个小区绿化面积达到6万平方米,绿化率超过55%,通过建筑与小区绿化融合,自然形成了面积分别高达25000平方米和15000平方米的二块集中绿化庭院以及相应的休闲活动广场。建筑立面现代、摩登、新颖、时尚,外形简洁明快;室内户型设计中西结合,大厨房、大卫生间,功能分区清晰,方正实用,采光、通风二者兼顾,全部明厨明卫,主卧室均带有卫生间。小区采用人车分流的交通体系,是一个安全、舒适、方便的智能化小区。园林设计讲究人性化,既营造出一个具有怡人芳香氛围和优雅景致的健康自然的居住环境,又保持了空间的开敞和通透,使所有业主共享这森林般的自然景观资源。风雅钱塘是一个充分体现“以人为本”,实现智能化管理和人性化服务的清新、雅致、时尚、现代的高尚住宅园区。风雅钱塘,带你进入东方和西方建筑文化水乳交融的生活境界。', '2007-04-02', '1.68元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09OPP', '330100', '120.260686,30.178126;120.259855,30.178131;120.259829,30.178207;120.258557,30.178221;120.258341,30.178266;120.258316,30.178851;120.257652,30.178854;120.257682,30.18024;120.259603,30.180194;120.260325,30.180037;120.260613,30.179998;120.260686,30.178126', '新白马公寓', '杭州市萧山区工人路899号', '杭州市', '', '49830.853255', '120.259232,30.179228', '商务住宅;住宅区;住宅小区', '1050', '2.8', '223000平方米', '23479', '新白马公寓位于萧山新区的中心位置,工人路与金城路交界处,距离区政府仅800米,近邻规划中的地铁线人民广场站,周边有萧以及成熟的商业业态。新白马公寓占地约6万平方米,建筑面积22.3万平方米,是萧山以及杭州地区具代表性的标志性高层住宅五中、人民广场、萧山歌剧院等公建配套群落之一。', '2006-07-06', '1.8元/月/平方米');
