INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09X7I', '330100', '120.20178,30.291926;120.200635,30.291091;120.200509,30.291254;120.200275,30.291539;120.199947,30.29186;120.200108,30.292033;120.200363,30.292257;120.200802,30.292549;120.201007,30.292672;120.201227,30.292496;120.201567,30.292155;120.20178,30.291926', '绿城·玉兰公寓', '杭州市江干区徐家洋路与范家路交叉口东100米', '杭州市', '', '13515.431927', '120.200847,30.291908', '商务住宅;住宅区;住宅小区', '车位比1：1', '2.8', '38502.4平方米', '38805', '绿城.玉兰公寓是绿城高层公寓2008年礼献城东的经典之作。项目位于城市中心稀缺区位,东邻麦庙港河,西接规划徐家洋路,紧靠机场路、秋涛路、天城路交通枢纽,周边生活配套设施齐全,交通便捷。项目总建筑面积5万余平方米,由四幢18层高层景观公寓围合而成。项目延续了“杭州绿园”和“春江花月”等绿城高层建筑端庄典雅、精致高贵的品质,更执着于细节的精致和完美,追求温馨和谐的人居环境,成就城市公寓永恒经典。', '2008-07-27', '2.8元/月/平方米');
