INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09XD0', '330100', '120.147373,30.300606;120.146237,30.300154;120.146094,30.300301;120.145487,30.300828;120.146265,30.301162;120.146587,30.3013;120.14741,30.301573;120.14756,30.301315;120.147217,30.301082;120.147373,30.300606', '绿城·锦兰公寓(长乐公寓东)', '杭州市拱墅区湖墅街道丽水路18号(长乐公寓东)', '杭州市', '', '13497.438933', '120.146601,30.300844', '商务住宅;住宅区;住宅小区', '252', '2.5', '60000平方米', '48240', '项目位于拱墅区运河边,西临规划丽水路,东依长乐路,紧邻京杭大运河、大兜路历史文化步行街和运河商务综合体,周边配套成熟,交通便利,为城市人文历史、生态环境和生活配套资源聚合之地。 依河而筑的锦兰公寓延续了绿城经典建筑的高贵血统,闹中僻静的自然环境,精致恒久的建筑语言,卓尔不群的人文追求,注定其非凡的际遇和传世形态。 锦兰公寓是杭州城市中心高档精品住宅社区。项目周边配套 十分成熟,这已经奠定了该项目高端定位的标准。对于项目本身品质而言,在以往开发高层公寓基础上进行优化和提升,为项目营造树立新的标准,力求把该项目打造杭城的精品项目。    项目位于拱墅区运河边,西临规划丽水路,东依长乐路,紧邻京杭大运河、大兜路历史文化步行街和运河商务综合体,周边配套成熟,交通便利,为城市人文历史、生态环境和生活配套资源聚合之地。 依河而筑的锦兰公寓延续了绿城经典建筑的高贵血统,闹中僻静的自然环境,精致恒久的建筑语言,卓尔不群的人文追求,注定其非凡的际遇和传世形态。 锦兰公寓是杭州城市中心高档精品住宅社区。项目周边配套 十分成熟,这已经奠定了该项目高端定位的标准。对于项目本身品质而言,在以往开发高层公寓基础上进行优化和提升,为项目营造树立新的标准,力求把该项目打造杭城的精品项目。', '2009-10-19', '3.5元/月/平方米');
