INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09XG9', '330100', '120.219491,30.278326;120.218937,30.277934;120.218338,30.278504;120.217746,30.279067;120.217722,30.279188;120.218125,30.279459;120.218666,30.279814;120.219507,30.280151;120.219747,30.279828;120.220085,30.279503;120.220414,30.279254;120.220491,30.279172;120.220453,30.279083;120.219877,30.278617;120.219491,30.278326', '云河家园', '杭州市江干区彭埠章家坝', '杭州市', '', '29702.773305', '120.219104,30.279084', '商务住宅;住宅区;住宅小区', '', '2.5', '28000平方米', '', '小区位于江干起严家弄路,北至16米规划道路。小区既设有休闲健身场地、老年活动中心,又有图书馆、阅览室、大型超市等,具有浓厚的现代生活气息,能满足农转居居民生产、生活的需要。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09XHF', '330100', '120.132101,30.326172;120.132106,30.327536;120.134016,30.327701;120.133981,30.326123;120.132101,30.326172', '德信·银树湾', '杭州市拱墅区文岚街158号', '杭州市', '0103000020E6100000010000000500000036B1C05774085E40F4DE180280533E40BE66B96C74085E403D433866D9533E400249D8B793085E40D3DD7536E4533E4044520B2593085E40317903CC7C533E4036B1C05774085E40F4DE180280533E40', '25359.335707', '120.133074,30.326885', '商务住宅;住宅区;住宅小区', '486', '3', '10平方米', '37847', '银树湾地处拱墅区桥西区块,东临吉祥寺路,南接文澜街,西靠巨州路,北为花园港街。小区建设用地面积27198平米,总建筑面积101458平米,总户数748户,由2幢24层高层住宅,5幢18层高层住宅,1个地下车库及商业会所组成。小区东南部分布置11—18层住宅,西侧为18层住宅,北侧为24层住宅,共同围合中央公共景观花园。整个规划的结构布局合理,实现户户呈南北朝向,做到窗窗有景的居家品质。  银树湾以艺术情调、亲情户动为规划特色,规划建造高层、小高层,部分底层架空,超大中心庭院设计,小区内点缀多处水景,雕艺小品等,创造了充足的绿色休闲运动空间。户型面积为85-130平方米,“四明”通透,部分带有入户花园设计,是一个艺术情调与典雅韵味并存的精品住宅。', '2007-12-24', '1.1元/月/平方米');
