INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09Y4R', '330100', '120.133554,30.312201;120.133541,30.312171;120.133508,30.312159;120.133363,30.312201;120.132772,30.312409;120.131805,30.312697;120.130954,30.312966;120.13093,30.312986;120.130922,30.313014;120.131114,30.313243;120.131314,30.313608;120.131462,30.313816;120.131574,30.313956;120.131784,30.314212;120.131871,30.314264;120.132034,30.314303;120.132224,30.314314;120.132499,30.314303;120.133321,30.314257;120.133835,30.314206;120.133876,30.314197;120.133899,30.314171;120.1339,30.314029;120.133822,30.313305;120.133646,30.31257;120.133554,30.312201', '嘉泰·馨庭', '杭州市拱墅区登云路291号', '杭州市', '', '39950.834185', '120.132619,30.313358', '商务住宅;住宅区;住宅小区', '770个车位配比为60％', '2.01', '100000平方米', '39987', '嘉泰.馨庭位于杭州城北拱墅区核心居住区块,地处登云路转角处内侧,东临小河路,南接桃园路。占地逾60亩,总建筑面积约10万余平方米,东邻京杭大运河,北望LOFT文化公园,与运河文化广场隔河相望,由9幢板式高层住宅、小高层住宅、LOFT公寓组成。嘉泰.馨庭通过“立体庭院”的建筑架构,让庭院精神在公共空间得以实现;又通过“户内花园”的设计,让私家庭院的享受重新回归人们的生活;她以立体花园式的家园形态,最大程度地整合市中心区的居住资源,打造出令人耳目一新的城市庭院生活。在景观和户型上,馨庭最大的特点就是立体生态的庭院和一户一花园的设计;建筑底部的架空层将南北两大景观绿园的风景横向铺开,形成一层平面的超大公共庭院;2、3号楼采用的下沉式庭院为底层住户筑造了一个私有的“跃层”;阳光地下车库,引入了自然光线和清新鲜氧。', '2007-04-10', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09Y67', '330100', '120.187707,30.278604;120.187269,30.278312;120.187208,30.278366;120.187008,30.278693;120.186762,30.278939;120.186242,30.279466;120.185921,30.279853;120.186853,30.280157;120.186944,30.280182;120.187015,30.280202;120.186809,30.280485;120.186616,30.280883;120.187319,30.281108;120.187522,30.280625;120.18775,30.280239;120.187895,30.280048;120.188114,30.279753;120.188359,30.279427;120.18852,30.279235;120.188525,30.279189;120.188165,30.278926;120.187707,30.278604', '紫薇公寓', '杭州市江干区机场路里街', '杭州市', '', '30790.179902', '120.18729,30.279669', '商务住宅;住宅区;住宅小区', '', 'None', '', '38900', '绿城西子•杭州紫薇公寓项目是绿西集团受杭州市城市建设前期办公室委托,具体由浙江绿城新兴置业有限公司实施建设的拆迁安置房项目。项目位于杭州市江干区京杭运河北岸、机场路西侧,规划用地面积33676平方米,总建筑面积104882平方米,容积率2.51,建筑密度23%,绿化率30%,分一期开发,计划2010年12月交付使用。项目设计有917户住宅单位,均为90平方米以下户型,设计有385个停车泊位,2171个自行车位。本项目同步开发建设的小区周边配套还包括九年一贯制学校一所、幼儿园一所、市政道路二条和城市公共绿地。', '', '1.3元/月/平方米');
