INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09Y9A', '330100', '120.157332,30.29297;120.157568,30.292998;120.157643,30.292837;120.158071,30.29233;120.15817,30.292061;120.158455,30.291508;120.15692,30.290918;120.1564,30.29076;120.156294,30.291044;120.156144,30.291368;120.155712,30.291336;120.15549,30.291312;120.155253,30.291949;120.155467,30.292002;120.155334,30.292394;120.157332,30.29297', '昆仑公馆', '杭州市下城区湖墅街道长板巷99号', '杭州市', '', '40086.99664', '120.156844,30.29191', '商务住宅;住宅区;住宅小区', '1100个左右；配比1：2', '3.2', '200000平方米', '46496', '项目介绍:昆仑公馆,武林广场旁,杭州城市中心超百米标志性高层住宅建筑。由5幢现代、简约、典雅、尊贵的院宅建筑以墙套墙的独有院落组成,所形成的中心大庭院与东面稀缺24000方城市公园相得益彰,为客户提供了极其尊贵的生活空间。  项目采用目前极受国际推崇的新亚洲风格尊贵设计理念,主要以具有浓厚地域特色的传统文化为根基,融入现代西方文化,并将传统亚洲元素植入现代建筑语系,利用世界现代材质和技术手法,演绎传统亚洲建筑文化,形成独有的,市都市中心奢华新亚洲风格院宅,是承载东方人对自然宁静生活的向往,成就世界精神结构中的东方情结,也是未来东方豪宅发展趋势。  在整体规划上,昆仑公馆利用东北面环水优势,以东面约24000方都市中西稀缺城市公园(含沿河绿化)为依托,在南面因地制宜,引入水系,使项目掩映在水系和绿色森林之中,形成现代大都会瑰丽城堡,形成城市核心区域罕有的兼具完善配套与自然景观资源的贵胄之地,独有三面环水的自然生态环境,卓然融合于城市中心,又独立于城市中心,不为外界干扰,却又与周边地块形成良好的过渡。  为客户提供全面尊贵服务的考虑。昆仑公馆首创杭城三大堂尊贵贴身服务,设立地下一、二层礼仪大堂;地上一层服务大堂的三大堂尊贵体验,为社会上流人群提供专业的贴身服务。同时,为来访贵宾设立豪华等候区,尽显昆仑公馆高贵气质。&#160;&#160;地下一层、二层的礼仪大堂与新亚洲风格庭院相连通,下沉庭院挑高超10米,可直接采光,装修豪华并配以精致的艺术缀饰,营造出高贵的艺术氛围,为城市上层人士营建了尊贵且高雅的归家感受,充分体现了业主的尊贵身份。礼仪大堂内更设有助理专属休息区,提供人性化的等候空间。昆仑公馆样板园区现已全面开放,采用预约制参观。  昆仑公馆样板园区面积超过10000平方米,采用东方洄游式庭院造景手法,以曲池为纽带,围绕蜿蜒水系,树木繁盛。设置有枯山水、茶亭、金鼎桥和樱花林等东方皇室庭院特点,种植了胸径均在80公分以上名贵大香樟并引进了日本进口的造型黑松和槭树。具有现代风格全U型玻璃打造的昆仑公馆销售展示中心掩映在园林中心隐蔽处,展示中心内部装修风格以低调奢华的新亚洲风格为基础,整体所营造的新亚洲理念让人耳目一新,对豪宅的理解又有了一个全新的认识', '2010-01-18', '3.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YAC', '330100', '120.152553,30.29585;120.152428,30.296063;120.152359,30.296182;120.153448,30.296607;120.153565,30.296428;120.153684,30.296213;120.152622,30.295763;120.152553,30.29585', '盛德欣苑', '杭州市拱墅区西临德胜巷北濒胜利河', '杭州市', '0103000020E61000000100000008000000077AA86DC3095E4088855AD3BC4B3E40A9BF5E61C1095E403F8EE6C8CA4B3E401590F63FC0095E40F4A96395D24B3E40BE688F17D2095E40C2C3B46FEE4B3E40DB334B02D4095E40629E95B4E24B3E40C87A6AF5D5095E406AA67B9DD44B3E409BA9108FC4095E40EA5DBC1FB74B3E40077AA86DC3095E4088855AD3BC4B3E40', '5018.179398', '120.153021,30.296188', '商务住宅;住宅区;住宅小区', '', '2', '30209平方米', '31603', '项目介绍:什么是稀缺的住宅?就是对有需求的人来说,与期望值完美契合,能充分满足居住需求的住宅。盛德欣苑位于德胜区域中心,紧邻城市CBD,离市中心武林广场仅有2公里,是当之无愧的赤金之地。占据稀缺典藏地段,盛德欣苑一席之地弥足珍贵。周边咫尺即有各项市政配套设施,可全方位深入城市各要塞,全面尊享现代生活。都市的繁华围绕,小区的幽静独享。在成熟之地,创造至美生活。盛德欣苑限量发行,仅有216个机会不容错过,因为稀缺,所以珍贵。园林景观:在成熟小区建造一座大型精品楼盘,为运河之畔增添一道亮丽风景线,是成盛德嘉苑的追求和设计的源泉。盛德喜苑区域环境优良,大型超市、市场、商场、菜场、酒店等生活设施完备,小学、中学、大学近在咫尺,省级医院、邮局、书店等服务机构一应俱全,足以让您放飞浪漫情怀。', '2006-05-22', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YAY', '330100', '120.20433,30.288449;120.20405,30.289321;120.204655,30.289597;120.205344,30.288636;120.205286,30.28858;120.20433,30.288449', '天城路60-8号院', '杭州市江干区天城路60-8号', '杭州市', '0103000020E61000000100000006000000DEE522BE130D5E405C902DCBD7493E40EC2FBB270F0D5E40C80BE9F0104A3E40A0FD4811190D5E400C056C07234A3E40821B295B240D5E40C172840CE4493E40E814E467230D5E409947FE60E0493E40DEE522BE130D5E405C902DCBD7493E40', '7982.058614', '120.204633,30.288964', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YBA', '330100', '120.134734,30.305765;120.134905,30.305737;120.135119,30.305789;120.135787,30.30496;120.135255,30.304602;120.134789,30.304204;120.134565,30.304293;120.13453,30.304239;120.132336,30.305323;120.133222,30.306097;120.134029,30.305914;120.134734,30.305765', '和新南苑', '杭州市拱墅区和睦路与小河支路交叉口西南150米', '杭州市', '', '33159.503087', '120.134145,30.305205', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YBD', '330100', '120.134822,30.309786;120.134795,30.309695;120.134587,30.309382;120.132905,30.310685;120.133117,30.310898;120.133422,30.3116;120.133573,30.311981;120.133637,30.312013;120.134638,30.31167;120.135193,30.311478;120.135266,30.31131;120.135108,30.31062;120.135057,30.310492;120.134946,30.310095;120.134873,30.309849;120.134822,30.309786', '名城燕园', '杭州市拱墅区和盛街25号', '杭州市', '', '32856.903169', '120.134187,30.310806', '商务住宅;住宅区;住宅小区', '226个(1：0.65)', '2', '100000平方米', '41824', '名城.燕园地处城市核心区域,杭州市中心湖墅板块核心地带,东至小河路,南至西塘河,北至桃园路,距离武林广场不到6公里,周边1000米成熟居住配套圈内商业、医疗、教育、交通、休闲各类配套一应俱全,更有规划中的运河商务区强力支持,精彩演绎城市腹地高尚生活指数。  名城.燕园规划高层、小高层、多层三类建筑形态,总建筑面积10万余平方米,两幢16-18层的高层住宅沿北侧桃园路布置,中部为小高层,南面沿河设置一幢多层、三幢排屋,南低北高,充分保持沿河景观的通透性。沿小河路规划商业,形成小河街区的凝聚力。园区尽享小河直街深厚人文底蕴和市中心繁华景致,堪称城市中难得一见的历史水岸公园住区。  “舒适为美”,是名城·燕园建筑空间倡导的居家理念。名城.燕园布局84平方米温馨两房、89平方米精致三房,130平方米舒适三房、160平方米尊贵四房,户型均采用全明设计,并利用大面宽、短进深的设计手法,有效增加房间的采光面以及居住的舒适性;此外,局部设计融入了挑空露台、错层阳台、大飘窗等多种空间元素,为居住者提供了更为丰富的生活内容和更加多彩的居住方式。在园区景观上,为了完美表现出人文公馆的特性,名城房产力邀世界级的澳大利亚PLACE设计集团担纲景观设计,以“水景共享、和谐共生”为设计理念,外以南面小河水系及东、北规划公园为线,构筑临水而居的优美风景轴线;内以规划景观为线,结合现代时尚的元素,以大型中心景观长廊为线,串起五重特色庭院景观;通过布局有动态水景,壁画水墙、休憩凉亭及各色小品的南北双林荫绿色走廊及特设水中吧台、按摩池、跌水小瀑布的500平方米的景观泳池表达时尚、健康、卓越的高品位生活。  京杭大运河、小河、余杭塘河三河的交汇处;两万多平方米的小河滨水景观带、四万多平方米的小河公园、一万一千多平方米的市政配套公园……处于城市中心,又在三河三园怀抱中的名城.燕园,区位及居住环境优势极为明显。加上运河天地、LOFT49、青莎公园、运河文化广场以及规划中占地570亩的运河商务区,处于集商贸、居住、休闲功能为一体的历史文化街区中心地带的名城.燕园无形之中增添了历史情韵和生活意趣', '2009-12-19', '1.4元/月/平方米');
