INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YDT', '330100', '120.143836,30.319233;120.143324,30.319147;120.143253,30.319406;120.143008,30.319388;120.142936,30.319923;120.143229,30.320039;120.143537,30.320204;120.143595,30.320238;120.143617,30.320227;120.143666,30.320175;120.143736,30.320117;120.143845,30.320045;120.143869,30.32003;120.144168,30.319866;120.144284,30.319797;120.144358,30.319734;120.144432,30.319599;120.143777,30.319529;120.143836,30.319233', '正中尚品庭院', '杭州市拱墅区台州路', '杭州市', '', '8101.36572', '120.143567,30.319695', '商务住宅;住宅区;住宅小区', '住宅车位114，商业车位70', 'None', '28454平方米', '24696', '正中尚品庭院总建筑面积49338平方米,住宅部分由三幢形态不一的高层、小高层为何而成,仅设193户尊贵住家,堪称拱墅核心第一院,作为商业配套的正中尚品街区总建筑面积20884平方米,由一幢6层高的建筑呈L型围绕外侧。正中尚品庭院位于拱墅交通枢纽,于南北主干道上塘高架平行,上塘高架近在咫尺。', '2007-12-18', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YGU', '330100', '120.138797,30.302032;120.139046,30.302195;120.139276,30.302328;120.1401,30.302798;120.139946,30.303067;120.140245,30.303257;120.140697,30.302852;120.139045,30.301841;120.138797,30.302032', '明真宫', '杭州市拱墅区和睦路224号大关路和小河路口', '杭州市', '', '6153.435344', '120.139822,30.302543', '商务住宅;住宅区;住宅小区', '', 'None', '', '29827', '明真宫位于和睦路224号 大关路和小河路口。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YJH', '330100', '120.100693,30.306937;120.100607,30.307002;120.100558,30.307152;120.100476,30.307129;120.100333,30.307533;120.101646,30.307871;120.10188,30.307185;120.100693,30.306937', '丽阳苑', '杭州市西湖区西湖西湖区竞舟北路与申花路交叉口', '杭州市', '0103000020E61000000100000008000000EA7B0DC171065E40AFEE586C934E3E40EAAF575870065E407DCEDDAE974E3E407A56D28A6F065E40A7E67283A14E3E401B82E3326E065E4037A79201A04E3E406A6D1ADB6B065E40D670917BBA4E3E403B71395E81065E40066344A2D04E3E407407B13385065E405FD218ADA34E3E40EA7B0DC171065E40AFEE586C934E3E40', '8308.148626', '120.101126,30.307385', '商务住宅;住宅区;住宅小区', '', 'None', '69800平方米', '41095', '丽阳苑位于城西申花路上,处杭州楼市申花板块核心地段,北面业已交付的广宇西城年华,规划中的银泰、沃尔玛超市、富强商业中心、紫金港广场购物中心等高档生活配套举步即至,成熟的生活配套成熟,繁华的商业环境,使该区域被誉为杭州未来的徐家汇。与此同时,申花板块也是整个杭州市中心教育资源为丰富的区域之一,位于申花核心的丽阳苑,更是紧邻浙大紫金港校区,与名校保俶塔实验学校申花路分校一路之隔,深厚的人文氛围,高素质人口集聚的居住环境,从幼儿园到大学的全程教育配套体系,让每位业主得以相伴孩子健康成长之路。', '2008-12-31', '4.2元/月/平方米');
