INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09YN5', '330100', '120.133755,30.312732;120.133852,30.313276;120.133886,30.31352;120.133918,30.313791;120.133984,30.314184;120.134199,30.314161;120.135326,30.314084;120.135728,30.314033;120.135808,30.313966;120.135801,30.313858;120.135538,30.312493;120.133755,30.312732', '凯德视界', '杭州市拱墅区登云路99号', '杭州市', '', '25128.894335', '120.134788,30.313363', '商务住宅;住宅区;住宅小区', '270多个', '2', '54000平方米', '41645', '凯德视界位于杭州市拱墅区,东邻京杭大运河,西面和南面为新规划道路,北接登云路。拥有得天独厚的江南水乡传统人文景观。与规划中的运河CBD隔河相望,距区政府和运河文化广场仅500米,距LOFT49创意园区600米左右。驱车5分钟即可达上塘高架大关匝道口,西南临近城市主干道莫干山路,车行出入极为便利;项目周边公交线路众多,可以很方便到达杭州的各个区域。凯德视界周边社区配套服务非常完善,文澜中学、紫荆公园,大型超市,市级医院环绕项目周边。展望未来,沿小河路向南约700米有规划中的小学、幼儿园和小区公园以及大型绿地小河公园。从本项目出发,信步可达代表传统江南风情的小河直街。凯德视界由亚洲最大的上市开发商嘉德置地旗下的子公司凯德置地投资开发。共分二期。按照“筑就人文空间”企业理念,凯德置地深入地研究客户的需求,为客户提供优质的精装修房。凯德置地也将多年在全球房地产行业积累的开发国际经验带到杭州,贯穿体现在项目在规划、设计、建造、管理过程中,结合杭州城市的特点和客户的需求,努力将本项目打造成为一个亲和性、高品质、充满现代都市气息的中高档居住小区', '2008-01-13', '2.1元/月/平方米');
