INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A3Y0', '330100', '120.095801,30.297536;120.095661,30.297504;120.095678,30.295136;120.093278,30.295138;120.093183,30.297767;120.093192,30.298073;120.093244,30.299955;120.097087,30.299976;120.097042,30.298416;120.097029,30.298338;120.096955,30.298236;120.096899,30.298197;120.096722,30.298099;120.096627,30.298046;120.096537,30.297992;120.096457,30.297923;120.096332,30.297813;120.096158,30.297708;120.095801,30.297536', '耀江文鼎苑', '杭州市西湖区萍水西街193号', '杭州市', '', '134077.556477', '120.094819,30.297825', '商务住宅;住宅区;住宅小区', '', '2.5', '700000平方米', '61654', '耀江文鼎苑雄居于杭州新城西之核心区位——浙大紫金港板块。沃尔玛、浙大国际医疗中心(规划)、地铁二号线(规划)站点、西城广场等一批大型高尚配套环伺左右,内部还有大型公建、健身房、游泳池、社区商业……有现在更有未来,文鼎苑因此将成为全新高尚生活的标杆社区。文化大盘生活的半径,圈定居住的价值。耀江.文鼎苑,以其傲人的先天优势与强力的后天自塑,缔造了主城区稀缺文化空间——直面新浙大紫金港校区,内设学军小学紫金港校区,并配备了一流社区幼儿园。不仅如此,文鼎苑还推出了各类文化活动,文化饕餮席卷杭城。天赐区位,内赋气质,使其成为诸多家长与精英人士优选住地。生态大盘生态景观三重奏,成就了文鼎苑社区生活环境之美:从原生湿地上崛起的新浙大风景如画,约6000亩大型校园成为了在文鼎苑眼前的一座文化公园;余杭塘河、浦家桥港这两条天然水系相依社区,创造现代版“两河流域”;约1500余米鼎级景观水系环绕全区,独特的“双西”景观设计理念,将两种不同的景观文化在社区内自然融合。品质大盘耀江.文鼎苑,一个适合人居的住品,更是值得品味生活的艺术品。建筑上将理性与人文特色完美结合;品质细节上更是精益求精。二期的文鼎苑,中心水系沿线建筑底层架空,通透空间更能分享灵动水景生活;户型继承了一期的经典格局,在合理规划整体的基础上拓展人性化需求,注重实用空间效用,给生活以最大的舒适尺度。二期规划如今的文鼎苑,一期准现房完美呈现,二期的文鼎苑,秉承了一期在规划、建筑、景观等诸方面的精华,继续演绎主城区鼎级大盘的精彩品质:◎区位:更近新浙大,文化氛围更为浓厚,让浙大校园人文之美成为每日风景◎社区规划:延续了一期点、板式小高层、高层的均好性规划与全明户型的设计,通风、采光面面俱到,力求每幢建筑皆能均好享受浙大风景与全区风情◎水景:更为广阔,纵贯全区的1500余米鼎级水系至此豁然开朗。中心水系沿线建筑底层架空,通透空间更能分享灵动水景生活◎社区配套:更为贴近,东有大型社区商业、南有一流幼儿园,北邻学军小学紫金港校区,社区内还设游泳池、健身房等丰富配套,便捷生活唾手可得。', '2005-09-22', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A3YS', '330100', '120.260636,30.166569;120.260558,30.166552;120.260366,30.166554;120.260053,30.166559;120.259981,30.166551;120.259908,30.166517;120.25982,30.166422;120.259781,30.166452;120.259541,30.166639;120.259158,30.166888;120.258462,30.16733;120.258432,30.167363;120.258422,30.167398;120.258433,30.167427;120.258703,30.167812;120.258746,30.167849;120.258788,30.167866;120.259044,30.167875;120.259166,30.167901;120.259211,30.167934;120.259262,30.168006;120.259327,30.168056;120.259743,30.167912;120.26017,30.167672;120.260448,30.16747;120.260938,30.167026;120.260817,30.166872;120.260783,30.166788;120.260753,30.166721;120.260692,30.166624;120.260636,30.166569', '同和公寓', '杭州市萧山区萧西路78-7号', '杭州市', '', '21163.619036', '120.259691,30.16724', '商务住宅;住宅区;住宅小区', '', 'None', '', '20083', '同和公寓由杭州市城建开发集团下属杭州南岸房地产开发有限公司开发,位于萧山区城厢街道老火车站附近,地块东临民居,南面隔官河河道与萧西路相邻,西面临官河河湾,北临铁路萧山西站。项目拟建12幢6层住宅,户型70-150余平米。建筑立面以清新简约的现代风格为主,略带中式江南的韵味,在鲜明的现代气息中带有传统的文脉延续,景观设计以现代中式为风格定位,通过水、阳光草坪、庭院与滨水环境,营造舒适、温馨的老城新生活。', '', '3.5元/月/平方米');
