INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4NC', '330100', '120.235359,30.167028;120.23563,30.167021;120.235916,30.166955;120.235948,30.166909;120.235931,30.16651;120.237721,30.16655;120.238335,30.166595;120.238683,30.166531;120.238799,30.166319;120.238662,30.165332;120.238641,30.164734;120.238503,30.164221;120.238089,30.163519;120.23794,30.163389;120.237619,30.16337;120.23725,30.163421;120.236649,30.163105;120.236771,30.16289;120.237354,30.162865;120.237506,30.162671;120.23795,30.162553;120.23868,30.16252;120.239092,30.162344;120.239363,30.162017;120.239976,30.162102;120.240149,30.161823;120.239823,30.161394;120.239349,30.161238;120.238771,30.161306;120.238389,30.161494;120.237936,30.1618;120.237699,30.161871;120.236655,30.161877;120.236157,30.161926;120.235983,30.16197;120.235945,30.162253;120.235701,30.162587;120.23532,30.162931;120.235263,30.163359;120.235091,30.163692;120.235069,30.164342;120.23501,30.165862;120.234948,30.166031;120.234915,30.166996;120.235055,30.167025;120.235359,30.167028', '奥兰多小镇', '杭州市萧山区萧山风情大道4555号', '杭州市', '', '148273.181798', '120.236984,30.164295', '商务住宅;住宅区;住宅小区', '368', 'None', '160000平方米', '24594', '奥兰多小镇位于山水共生的湘湖旅游度假区内,南濒南都.威尼斯水城,西为风情大道,与宋城.苏黎士小镇为邻,距离杭州主城区13公里,离萧山区2.5公里。小镇总占地面积约460亩,建筑面积约16万平方米,其中平地公寓建筑面积约10万平方米,山地别墅建筑约3万平方米,建筑容积率为0.5,绿化覆盖率超过75%,规划建造68幢87户山地别墅和约670多户公寓。它由文化广场、节日广场、圣诞街、啤酒休闲街区以及景观公寓、山地别墅组成,是2006年杭州世界休闲博览会的核心项目。br相比湘湖绝版地带其他两个楼盘,南都.威尼斯水城注重做“水”文章,宋城·苏黎士小镇注重做“山”文章,奥兰多小镇则充分发挥别墅、公寓二者结合的优势,重在细节部分,全力打造老百姓心中的精品。整个奥兰多小镇以美式小镇居住文化为主线索,引入诸多美国小镇独特元素,在广场、商业部分、建筑外形上,都引入原滋原味的美国小镇风情及其构造脉络,同时不放弃湘湖的深厚底蕴,整体上以有机主义建筑理论为指导,主张建筑与大自然的和谐统一,顺着自然的原则构建社区。br奥兰多小镇整体规划分为公寓区、别墅区、商业区,有取舍地移植了美国奥兰多小镇的规划理念和建筑风貌,打造出具有居住、商业、生活共存的模块,力求在总体空间布局、室内外环境、别墅类型、区域配套上有一定的超前性与创新性。br在奥兰多,最高的建筑绝对不会超过山顶。风格上采用了具有悠久历史文化与居住艺术的北美建筑风格,以,砖、石、木等自然元素为主建筑材料,极具个性,充满无限异域风情。所有建筑均依山地形态蜿蜒而行。在单体布局上赋予建筑退台和坡地地貌的特色,让建筑“附”在山坡上,与山势有机结合,成为具有山地风韵的坡式建筑。在灵活多变的造型基础上,在立面处理上再次把体量化整为零,加入大量的平台、绿化、花圃,使建筑隐于山间绿化中。别墅外观设计上则选用北美乡村别墅造型,斜屋顶和天然石材的外墙材料,弥漫着温馨小镇风情。br以美国丰富的建筑和游乐文化为背景,结合湘湖的自然资源和气候特征,以先进的休闲理念,倡导健康的休闲方式,先做景观,再造房子。在小镇外部,各种美式雕塑、喷泉、广场、啤酒街、圣诞街,洋溢着浓郁的异国风情。奥兰多在景观设计上的要求归结两点就是:“立体式的景观、强调人的参与性”。地下“生态车库”,力求阳光都能照进车库,车库也由满眼的绿色包围着。空中花台和屋顶花园又将奥兰多妆点成一个立体的空中大花园。br奥兰多小镇是由公寓和别墅组合而成的,别墅分为四种类型:掬水别墅、森林别墅、草原别墅、山居别墅,与自然亲密接触,走在其中,让人有种“人在画中游”、人景交融的感觉。一期公寓一般为中档户型,以100-120为主力户型。br在世界休闲博览会、世界休闲风情园内将规划建有五星级大酒店、女人街、艺术街、超市等市政配套,约30万平方米的铜锣湾购物广场也已正式签约休博园。除此之外,各种特色小商铺、个性商店以及小酒吧构成了奥兰多多样、奔放的魅力,徜徉其中,无不感受到一种无所顾忌的异国生活姿态。br从奥兰多小镇到杭州市中心处于半小时生活圈之内。通过钱江一桥、三桥、四桥,将奥兰多与杭州主城区紧密相连。规划中的地铁一号线起(终)点站——湘湖站,也在这里。', '', '1.2元/月/平方米');
