INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4QA', '330100', '120.243873,30.199702;120.244113,30.199716;120.248917,30.199637;120.249064,30.199605;120.249136,30.199462;120.249188,30.194489;120.243716,30.194621;120.243701,30.197637;120.243746,30.199512;120.243873,30.199702', '明怡花苑', '杭州市萧山区建设一路388号', '杭州市', '', '253636.018753', '120.246443,30.197108', '商务住宅;住宅区;住宅小区', '', 'None', '', '23645', '明怡花苑面积达400多亩,可容纳2000多户居民,共花了两年时间建设完成。小区内配套设施齐全,苑内及周边设有中心组团绿地、会议室、农贸市场、地下停车库、幼儿园等。五甲河从小区内穿流而过,犹如一条玉带横卧,为小区增色不少。小区景色优美、绿地覆盖率达35%以上,且极具江南特色。明怡花苑不仅建筑优美,而且价格低廉,每平方米只需640元,是真真正正的惠民工程。看到这里,我们都不禁为之咋舌。这儿布局合理、环境优美,真不愧“示范”二字。政府把居民安置房规划得那么棒,真是实实在在地为百姓服务啊!', '', '0.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4QL', '330100', '120.226178,30.19894;120.226189,30.197765;120.223888,30.197722;120.22369,30.199983;120.226137,30.200081;120.226178,30.19894', '钱塘滨和花园', '杭州市滨江区江汉东路202号(迎春路350号)', '杭州市', '0103000020E61000000100000006000000C8444AB3790E5E40C2DD59BBED323E40C26D6DE1790E5E401F4B1FBAA0323E40E17D552E540E5E4020B3B3E89D323E404E9CDCEF500E5E4087C1FC1532333E4098DA5207790E5E400D8D278238333E40C8444AB3790E5E40C2DD59BBED323E40', '49687.996897', '120.224984,30.1989', '商务住宅;住宅区;住宅小区', '', 'None', '', '35639', '钱塘滨和花园位于江汉路西兴路口,属于商品房,共28个单元,高层、小高层共14幢。', '', '1-1.2元/月/平方米');
