INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4QU', '330100', '120.220878,30.199663;120.220967,30.198098;120.221024,30.197248;120.219881,30.197056;120.219289,30.196967;120.218806,30.196893;120.218494,30.199427;120.218493,30.199506;120.219041,30.199571;120.219233,30.199554;120.219635,30.199608;120.219874,30.199661;120.220871,30.199774;120.220878,30.199663', '迎春北苑', '杭州市滨江区政府南1号线地铁口', '杭州市', '', '54363.845263', '120.219787,30.198363', '商务住宅;住宅区;住宅小区', '', 'None', '', '31235', '小区在滨江区政府南面,交通方便。地理位置优越。到地滨和站就在家门前,小区全多层住宅,性质回迁房!周围配套完善!', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4T9', '330100', '120.217462,30.199657;120.214386,30.199317;120.214134,30.20141;120.217269,30.201649;120.217462,30.199657', '瑞立中央花城', '杭州市滨江区北靠风荷路瑞立中央花城附近', '杭州市', '0103000020E61000000100000005000000DB87BCE5EA0D5E40DF6A9DB81C333E4019AE0E80B80D5E406E895C7006333E408CBD175FB40D5E405D16139B8F333E40D15B3CBCE70D5E406745D4449F333E40DB87BCE5EA0D5E40DF6A9DB81C333E40', '58314.749831', '120.215799,30.20051', '商务住宅;住宅区;住宅小区', '', '2.8', '', '44451', '中央花城东沿江陵路,南临滨和路,北靠风荷路,西临浙江省重点学校杭州江南实险学校,距滨江区政府仅1000米左右,距三桥、四桥约2000米。  中央花城占地面积为5.9万平方米,总建筑面积22万平方米,建筑密度仅为17.6,容积率为2.8,绿化率更是达到了40%以上,由9幢26-32层的高层住宅围合而成,主力户型为130-140平方米,其中中央景观广场面积2万余平方米,这在国内住宅小区甚为少见,会呼吸的地下车库概念。', '2005-04-30', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4V5', '330100', '120.131522,30.316707;120.13149,30.316409;120.130325,30.316473;120.129775,30.316494;120.12973,30.316495;120.128289,30.316572;120.128336,30.317418;120.127639,30.317424;120.12762,30.317539;120.127666,30.317624;120.12777,30.317859;120.127917,30.318521;120.127947,30.318683;120.12801,30.318889;120.128621,30.318947;120.129775,30.319071;120.13069,30.319141;120.13121,30.319163;120.131326,30.319162;120.131441,30.319137;120.13151,30.319064;120.131559,30.318981;120.13156,30.318647;120.131519,30.317446;120.131522,30.316707', '吉如家园', '杭州市拱墅区通益路77号', '杭州市', '', '82078.911573', '120.129813,30.317804', '商务住宅;住宅区;住宅小区', '', '2.5', '243817平方米', '31748', '吉如家园为农转居高层公寓,17幢高层住宅和2幢1-2层配套公建。建筑层数:1期:3幢11层,3幢25层,1幢18层,1幢21层,1幢24层;2期:3幢25层,2幢18层,1幢11层,1幢21层,1幢24层,1幢1层,1幢2层。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4W3', '330100', '120.273185,30.30629;120.272901,30.306174;120.271809,30.305635;120.271268,30.305371;120.271219,30.305324;120.271185,30.30519;120.27115,30.30469;120.271018,30.30397;120.271069,30.303921;120.271174,30.303886;120.271581,30.303812;120.272705,30.303634;120.273794,30.303472;120.274623,30.303354;120.274921,30.30331;120.27502,30.303305;120.275076,30.303326;120.275101,30.303511;120.275307,30.304498;120.275302,30.304662;120.275278,30.304711;120.275186,30.304729;120.274403,30.304877;120.273934,30.304975;120.273738,30.30503;120.273585,30.305097;120.273432,30.305218;120.273314,30.305327;120.273277,30.305424;120.273239,30.305537;120.273228,30.305639;120.273223,30.305848;120.273263,30.306156;120.273185,30.30629', '新江花园', '杭州市江干区九堡镇下沙路', '杭州市', '', '67825.543942', '120.273063,30.304546', '商务住宅;住宅区;住宅小区', '', 'None', '', '24555', '新江花园是九堡第一个经济适用房的建设项目,占地面积约113亩,总建筑面积17余万平方米,由28幢多层、小高层住宅、沿街底层商铺、独立餐饮用房、大型地下停车库组成。  本着以人为本,人与自然和谐的设计与建筑理念,小区建筑新颖,立面大气典雅,区内绿荫环抱,小石成景,宽大的景观绿化长廊是休闲漫步的好去处,割断了城市的喧嚣,留给您的是清新的空气和优雅舒适的环境。  新江花园位于杭城东部九堡区域,东接下沙经济技术开发区,南眺钱塘江,西连入市区主要交通线,北邻九堡规划居住区,距市中心约十公里。杭州市政府已为九堡区域描绘了漂亮的蓝图:城市轻轨,客运中心,城市快速干道,规划建筑面积130万平方米的大型居住区。未来的九堡展现在人们面前的必将是一幅美丽如诗的画卷。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4WA', '330100', '120.260612,30.314388;120.260939,30.31361;120.259684,30.313175;120.259374,30.313975;120.259123,30.314744;120.260321,30.315116;120.260612,30.314388', '华鸿·汇盛德堡', '杭州市江干区九堡镇九州路19号', '杭州市', '0103000020E610000001000000070000007D3CF4DDAD105E403E4162BB7B503E400FD07D39B3105E40D5B2B5BE48503E40D8D2A3A99E105E40C0EC9E3C2C503E40B1DB679599105E40F8C264AA60503E400DA9A27895105E40BB9C121093503E40925D6919A9105E4043723271AB503E407D3CF4DDAD105E403E4162BB7B503E40', '19445.292725', '120.26001,30.314151', '商务住宅;住宅区;住宅小区', '车位比1：0.7', '2.5', '70000平方米', '25077', '华鸿•汇盛德堡,位于德胜快速干道与九盛路交汇处,总用地面积21584平方米,建筑面积近7万平方米,规划为8幢高层和小高层。小区以37%宜人绿化率和20%低建筑密度,精致实用的户型设计,典雅细腻的现代简欧风格,多层次景观园林和水岸环境资源,打造高尚、精致的新财智生活空间。项目占据九堡高成长价值板块,交通便捷,配套丰富,成就真正的城市公馆居住享受。', '2008-05-09', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4WI', '330100', '120.320198,30.294497;120.320319,30.294269;120.320432,30.29404;120.317405,30.292963;120.315123,30.29738;120.318584,30.298762;120.318793,30.298366;120.318784,30.298265;120.318788,30.297506;120.318761,30.297345;120.318761,30.297184;120.318979,30.296733;120.31939,30.29602;120.319653,30.295528;120.319935,30.295008;120.320198,30.294497', '七格小区', '杭州市江干区下沙镇七格村', '杭州市', '', '149904.833212', '120.317788,30.295812', '商务住宅;住宅区;住宅小区', '', '3.5', '140000平方米', '', '', '', '2.80元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4WW', '330100', '120.334445,30.185831;120.334341,30.184847;120.334312,30.1848;120.334235,30.18478;120.332713,30.184981;120.332589,30.185102;120.332547,30.185168;120.332573,30.185985;120.333284,30.185899;120.333489,30.186888;120.333546,30.186965;120.33361,30.186978;120.334487,30.186845;120.334563,30.186802;120.33458,30.186724;120.334445,30.185831', '新和人家', '杭州市萧山区新街镇文轩路', '杭州市', '', '27630.944288', '120.333671,30.185782', '商务住宅;住宅区;住宅小区', '', '1.45', '60000平方米', '17043', '新和人家位于杭州萧山区新街镇,交通便捷,周边配套设施比较完善。新和人家总建筑面积约6万平方米,容积率1.45,绿化率达35%,由十六幢多层花园景观公寓和部分沿街商铺组成。小区在规划设计上强调空间的整体和谐,住宅户型精致实用,85m2~135m2十余款户型令您轻松实现筑家梦想,尽情享受温馨时光。  新和人家为纯多层花园景观社区。小区在外立面的设计现代简约、清新典雅,充分体现建筑的时尚美感,整体色系稳重、和谐,亲切。丰富的多层腰线和屋檐廓线设计,凹凸有致,与周边自然水系、园林景观融为一体,从而显得灵动、活泼、典雅,视觉美感强烈。  相比于高层、小高层等建筑形态,多层公寓建筑密度低,得房率高,强调与景观和谐性,综合性价比更高,居住成本更低,居住舒适性更优越。适宜的建筑尺度,充分体现了人与建筑之间的和谐关系,倡导公共空间的情感交流和亲情沟通,使每一次邻里相遇、每一次日常问候,都变得亲切温暖,居家生活将变得更为轻松愉悦。距离:浙江(中国)花木城:1KM。绕城高速东出口:1.5KM。机场高速:2.5KM。萧山区第三高级中学:4KM。萧山主城区:7KM。萧山国际机场:10KM。钱江六桥:10KM。钱江二桥:14.5KM。钱江三桥:15.5KM。', '2008-06-27', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4Z7', '330100', '120.092728,30.322593;120.092311,30.322489;120.092152,30.322783;120.091339,30.324836;120.09351,30.325552;120.093456,30.324692;120.0937,30.324021;120.094189,30.323206;120.093483,30.32288;120.092728,30.322593', '都市水乡·水秀苑', '杭州市西湖区民意街45号', '杭州市', '', '45863.598454', '120.092744,30.323989', '商务住宅;住宅区;住宅小区', '', 'None', '', '25640', '都市水乡临近三墩镇,位于五里河畔、三墩路北、古墩路东。它东起丰庆路,南起留祥路,西至环镇东路、通济北路,北至余杭勾庄。都市水乡有餐饮、超市、医院、学校、健身娱乐设施、 能够充分满足您一站式购物需求。 小区地段好交通便利,周边配套成熟完善。 小区的配套设施齐备,小区内设有幼儿园、小学、中学,超市就在家门口。', '', '0.5元/月/平方米');
