INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A5CC', '330100', '120.19298,30.106637;120.192941,30.106574;120.192948,30.106504;120.192987,30.106427;120.193059,30.106395;120.193117,30.106385;120.193217,30.10618;120.193642,30.105661;120.193786,30.105566;120.194551,30.105702;120.19495,30.105671;120.195461,30.105656;120.195436,30.10544;120.195064,30.105101;120.194549,30.104847;120.194169,30.104701;120.19403,30.104739;120.193626,30.105187;120.193236,30.105332;120.192969,30.105314;120.192704,30.105247;120.192223,30.105187;120.192084,30.105094;120.192007,30.104966;120.192107,30.104605;120.192597,30.104343;120.193304,30.104043;120.193361,30.104009;120.193466,30.103802;120.193514,30.103601;120.193522,30.103485;120.19334,30.10317;120.193302,30.103141;120.193263,30.103119;120.193117,30.103066;120.192759,30.103078;120.19248,30.103215;120.191948,30.103218;120.191771,30.103127;120.191614,30.102867;120.19161,30.102467;120.191822,30.102371;120.191939,30.102295;120.192006,30.102199;120.192033,30.102036;120.192,30.101865;120.191884,30.101734;120.19175,30.101629;120.190921,30.101454;120.190431,30.10135;120.1895,30.105138;120.19267,30.107009;120.19298,30.106637', '南岸花城', '杭州市萧山区萧山萧山闻堰镇湘湖旅游风景区', '杭州市', '', '127484.221115', '120.191732,30.104326', '商务住宅;住宅区;住宅小区', '', 'None', '340000平方米', '18874', '通和南岸花城位于钱江南岸萧山区闻堰镇三江口,湘湖旅游度假区内,东靠山里人家、南依东方文化园、西临闻戴公路,北依规划中的景观河道。北距闻堰镇近3公里;离钱江一桥约12公里;走规划中的四季大道到建设中的钱江四桥约9公里。南距钱江五桥约1.5公里,绕城公路及义桥入口处约1公里,西离钱塘江仅200余米。 通和南岸花城以自然资源为本,进行依山、沿湖、望江的主题化设计,以地形、地貌、景观干道、水系自然划分多元化组团,规划形成一个建有别墅、排屋、景观公寓和商业风情街有机协调的休闲风情社区,并充分挖掘独特的景观优势,营造建筑与自然山水的和谐交融,从而产生现代人居所具有的地域氛围和休闲风情,是现代人追求的理想休闲人居境界。通和南岸花城户型设计呈现现代开放式空间美学主义,框架式的结构采用透明的玻璃和金属构筑,平面空间布局自由,户户带有大面积的观景露台与最大面积的落地玻璃,保证每个单元都有良好的观景视线,使居住空间、精神世界直接与自然对话,形成现代居住空间的真正开放性。同时在各建筑元素上秉承现代主义简约、通透、明朗、开放的风格,强调门、窗、台阶、栏杆、构架在光与影中相互融合交错的休闲视觉效果。建筑形态:排屋、别墅为主,少量小高层江景公寓户型:排屋180—220平方米;别墅280—400平方米;公寓80—150平方米', '', '1.3-1.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A5EB', '330100', '120.082664,30.333918;120.080808,30.333078;120.079665,30.334695;120.079087,30.33539;120.079502,30.335674;120.080158,30.336051;120.080595,30.336141;120.081131,30.335594;120.082664,30.333918', '白马尊邸', '杭州市西湖区三墩镇金家渡河与厚仁路交叉口', '杭州市', '', '49076.526362', '120.080817,30.334631', '商务住宅;住宅区;住宅小区', '0.68', '1.9', '140000平方米', '35727', '白马尊邸地处西湖区北三墩核心区,北依金家渡河,西临厚仁路商业街,南临颐景园,东部与亲亲家园隔河相望,是大城西极为罕见的集排屋与高层于一身的高尚综合人文社区。  白马尊邸总建筑面积14万㎡,由原创四庭院城市排屋、景观小高层及高层组成。其中排屋主力户型面积约220-260㎡,公寓主力户型以86——130平米二房、三房为主。  白马尊邸北侧与东侧临河,构成独特双水岸人居。建筑采用简约、大气的现代建筑风格,精心规划具有“大面宽、短进深”特点的户型结构,并针对主流消费需求,严格控制户型面积。优美园林景观营造社区幽雅环境,成就高品质人文居所。', '2010-05-30', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A5F4', '330100', '120.288688,30.155973;120.288645,30.156028;120.288602,30.156162;120.28859,30.156309;120.288611,30.15637;120.288614,30.156495;120.28859,30.156675;120.288544,30.156895;120.288535,30.157105;120.288492,30.15738;120.288492,30.157657;120.288492,30.157807;120.288526,30.157947;120.288526,30.15803;120.288547,30.158229;120.288544,30.158414;120.288532,30.1585;120.288496,30.158622;120.28848,30.158768;120.288496,30.158988;120.288502,30.159192;120.288569,30.159323;120.288629,30.15939;120.288735,30.159409;120.289476,30.159405;120.289539,30.159388;120.289576,30.159368;120.28965,30.15934;120.289671,30.15929;120.289686,30.159016;120.289674,30.158764;120.289617,30.15818;120.28954,30.157743;120.289529,30.157476;120.289591,30.156746;120.28961,30.156539;120.289695,30.156403;120.289739,30.156259;120.289744,30.156014;120.289706,30.155968;120.288688,30.155973', '滨水名庭', '杭州市萧山区滨水路51号', '杭州市', '', '33868.565362', '120.289082,30.157715', '商务住宅;住宅区;住宅小区', '', 'None', '100000平方米', '', '滨水名庭,北接老城区商业干道人民路,南邻拱秀路延伸段,西面、北面有王家河塘、董家埭河双水相依,东面通过拱秀支路与人民路相连,地理位置优越,景观资源丰富,为老城区不可复制的地块。   滨水名庭,总用地面积约65亩,总建筑面积约10万平方米,建筑密度仅19%,10幢高层住宅沿450余米天然水系错落散开,为老城区罕有的水景高尚住宅。   毗邻商业干道人民路,坐拥老城繁华无限   滨水名庭的核心区位价值   滨水名庭,北接城市商业干道人民路,地处老城区的绝版地段,贵胄气质浑然天成。依托老城区完善配套,虎山中学、蓝天宾馆、萧山商业城、银行商业网点等配套环绕四周,未来生活成熟便捷。此外,项目临近杭州火车南站(规划中),地铁5号线出口(规划中),汽车东站迁至人民路跨河东向延伸(规划中),便捷的立体交通网络,赋予更多的时代意义和居住价值。   畅想450余米天然水景   “众星连珠”的魅力水景景观轴线   江南风情,独在于水;滨水名庭之景,胜于“450余米天然水景”。滨水名庭将伴水优势充分融入到景观中,纳景于外、造景于内,以朝辉夕霞中心广场为轴心,从北到南依次串联“水柳香堤”、“春兰临水”、“浅草伴水”“碧水曲堤”、“半岛果岭”、“鉴亭听雨”精彩景点,呈现“众星联珠”之态,创造了长约450米的水岸风情。   (由北到南7大景观,在景观总平依次标注)   1、水柳香堤/2、春兰临水/3、浅草伴水   4、碧水曲堤/5、朝辉夕霞/6、半岛果岭/7、鉴亭听雨   朝辉夕霞中心广场   入口景观大道与朝辉夕霞中心广场相衔接,通过抱鼓石、龙柱等具有中国特色的建筑符号来体现深厚沉重的中国古典气息。同时中心广场作为450余米景观轴心,充分运用古典造园手法,布置一组特色石景群,烘托入口景观轴线的传统文化韵味。   鉴亭听雨   伞亭立于碧波之上,与岸线起伏的大面积木质栈道相连,碧绿的荷叶映衬盛放的荷花,一派诗画江南的优美意境。栈道是茶余饭后散步休闲的好去处,伞亭为适宜休闲小憩的观景佳地,放松、宁静的风格配合细致的小尺度设计,极具浓厚的江南气息。   水柳香堤   以观景木质凉亭、下沉广场、滨水栈道打破呆板的河岸线,通过竖向空间的变化,创造出丰富的临水空间,临水布置水草、荷花等水生植物,打造唯美、幽静休憩空间。   碧水曲堤   木石结合的景观长廊立与石质滨水广场内侧,沿河设置临水走廊,大面积木制挑台向河岸延伸,碧水从挑台下流过、浅草在水岸轻摇,夕阳西下,一幅优美的碧水曲堤景象。', '2008-08-18', '1.5元/月/平方米');
