INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A5WF', '330100', '120.098923,30.284185;120.096014,30.284164;120.095948,30.28465;120.095899,30.285117;120.095756,30.286088;120.09572,30.286502;120.096905,30.286451;120.098557,30.286402;120.098629,30.286117;120.098863,30.285035;120.098995,30.284255;120.098923,30.284185', '新金都城市花园', '杭州市西湖区古墩路415号', '杭州市', '', '60563.186859', '120.097319,30.285301', '商务住宅;住宅区;住宅小区', '', '1.94', '130000平方米', '44968', '新金都城市花园位于杭州文华路与古墩路交叉处,小区占地123亩,总建筑面积12.12万平方米,区内分为紫东苑、嘉南苑、西雅苑、北铭苑四个组团,还配设有游泳池、网球场及会馆中心。小区建筑以五六层多层住宅为主,局部点缀九层电梯公寓和二三层公建,整个小区围具有4000平方米的中心组合绿地展开,天际线高低错落,并且建筑立面淡雅轻盈,与杭州山色秀美的城市特征和谐统一。', '1998-05-31', '0.6元/月/平方米');
