INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A6GI', '330100', '120.191584,30.201625;120.189444,30.205192;120.191085,30.205881;120.193185,30.202453;120.191584,30.201625', '同人春江时代小区', '杭州市滨江区长河路与滨盛路交叉口', '杭州市', '0103000020E61000000100000005000000F69B89E9420C5E40560E2DB29D333E40191BBAD91F0C5E409D66817687343E40657094BC3A0C5E4027DE019EB4343E40FA449E245D0C5E4022FAB5F5D3333E40F69B89E9420C5E40560E2DB29D333E40', '66233.396112', '120.191324,30.203779', '商务住宅;住宅区;住宅小区', '配置率约1:2，出售价格 14-16万', '2.31', '230000平方米', '', '同人·春江时代充分考虑了现代人居的舒适性与审美需求,把人、建筑、环境三者和谐融合,把江景、山景、园景完美结合,成就了一处自然景观与人文建筑有机组合的高尚江景住宅;根据小区景观总体布局需要,分为15个区域。分别为南商业街;南入口小广场;南入口喷水池广场;日本枯山水屋顶休闲花园;雕塑花园(一)小区中心花园;雕塑花园(二);小丘花园(一);小丘花园(二)健身康乐乐园;西商业街;西主入口景区;瀑布景观区、法国花园;中国传统花园;游泳池区;北商业区步行街以及架空层内庭景观。', '2007-05-17', '1.5元/月/平方米');
