INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7DV', '330100', '120.354087,30.302121;120.353469,30.30206;120.353419,30.302708;120.354699,30.302795;120.354727,30.302275;120.354632,30.302181;120.354087,30.302121', '四季名门城市公寓', '杭州市江干区9号大街以西', '杭州市', '0103000020E61000000100000007000000153C855CA9165E40506F46CD574D3E4097C9703C9F165E40056EDDCD534D3E403EB2B96A9E165E40D13C80457E4D3E40213B6F63B3165E406F641EF9834D3E408600E0D8B3165E40FE65F7E4614D3E405D876A4AB2165E40FB78E8BB5B4D3E40153C855CA9165E40506F46CD574D3E40', '7261.051067', '120.354069,30.302439', '商务住宅;住宅区;住宅小区', '80个', '4.3', '29097.2平方米', '15607', '大北四季名门位于杭州下沙经济技术开发区六号北、九号路西的地块内,临近下沙大学城。项目所在的下沙区块,交通条件日益便利,多条交通大道与周边地区相连,地铁、公交等大众运输体系完备;项目周边配套齐全,物美超市、开发区邮局、杭州东方医院、文海小学、杭四中、外国语学院等生活配套一应俱全,基本能够满足生活需要。', '2007-06-18', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7DW', '330100', '120.345751,30.302518;120.346183,30.302562;120.346425,30.302581;120.347122,30.303226;120.347214,30.303326;120.347242,30.303458;120.347276,30.303741;120.348671,30.30385;120.34877,30.303833;120.348803,30.30334;120.348921,30.301853;120.34886,30.301754;120.348777,30.301611;120.348529,30.301516;120.347158,30.301409;120.345886,30.301309;120.345751,30.302518', '四季风景苑', '杭州市江干区5号大街西侧', '杭州市', '', '52171.29846', '120.347527,30.302443', '商务住宅;住宅区;住宅小区', '500位', '2.5', '138000平方米', '24132', '新鹏四季风景位于杭州经济技术开发区5号路与6号路交叉口,北临怡乐园、西临瓯江大酒店该项目共为5幢高层;新鹏四季风景总占地面积23717平方米,总建筑面积98633平方米,其中地上建筑面积78266平方米,包括住宅70617平方米,商业用房6512平方米,配套辅助用房1137平方米,地下室18108平方米,半地下室2259平方米。四季风景苑分为一期、二期工程。一期工程由杭州大北房地产开发有限公司开发,约4万平方米,已经投入使用。四季风景苑二期工程位于杭州经济技术开发区的中心地带,5号路、6号路交叉口,由杭州新鹏房地产开发有限公司开发,建筑面积约98577平方米,该工程由5幢高层组成,与一期住宅相连,住宅环绕在1万方的小区中心花园四周,小区北面是下沙约2万多平方米的城市公园—怡乐园。二期住宅楼以现代化建筑风格为主,体现了简洁时尚的特征。四季风景苑1号楼总层数为21+1层,整幢为小户型,每套面积约89平方米左右;顶层为越层,面积约233平方米左右;2号楼总层数为21+1层,整幢为中、小户型。其中:西边套为中户型,面积约124平方米左右;其余三套为小户型,面积约89平方米左右;顶层为越层面积,约197平方米、144平方米、172平方米、124平方米等;3号、4号楼三梯五户,总层数为29+1层,整幢为大、中、小户型。面积有139平方米、87平方米、128平方米;顶层为越层;5号楼为板式,分为二单元。面积有137平方米、120平方米、85平方米、顶层为越层。', '2008-12-13', '1.1元/月/平方米');
