INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7E2', '330100', '120.350825,30.307363;120.350733,30.308512;120.351414,30.30855;120.352115,30.308281;120.352225,30.307087;120.350828,30.307039;120.350825,30.307363', '格林园', '杭州市江干区4号大街', '杭州市', '0103000020E61000000100000007000000A167B3EA73165E401D007157AF4E3E403128D36872165E406E6C76A4FA4E3E40D25625917D165E40492EFF21FD4E3E40965B5A0D89165E406AFAEC80EB4E3E405AF5B9DA8A165E40D906EE409D4E3E405AA148F773165E40B7989F1B9A4E3E40A167B3EA73165E401D007157AF4E3E40', '17613.042643', '120.351454,30.307768', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7E5', '330100', '120.322056,30.294898;120.322063,30.294696;120.321602,30.294924;120.321343,30.295074;120.320974,30.295353;120.320595,30.295757;120.320136,30.29649;120.319875,30.297055;120.319686,30.297768;120.319651,30.298307;120.31961,30.299033;120.320151,30.299162;120.321899,30.299299;120.322056,30.294898', '东海·柠檬郡', '杭州市江干区下沙幸福南路252号', '杭州市', '', '73242.153923', '120.320985,30.297345', '商务住宅;住宅区;住宅小区', '1400个(1：0.55)', '2.6', '280000平方米', '24611', '东海柠檬郡,位于杭州大城东金沙湖板块的下沙路与幸福南路交汇处,是杭城首个东南亚风情园林社区,占地约130亩,建筑面积28万方,园区分位三大区块,中间是超50000㎡的中心花园,北面是高层景观住宅,南面是小户型高层公寓,社区整体以大围合式布局理念设计而成,户型设计上户户赠送入户花园、89方实现舒适四房。无论是实景呈现的东南亚风情园林,还是日益完善的风情商街,无不是品质、艺术的完美演绎。50000㎡大围合式景观园林,使建筑在丰富的园林之中融为一体,婉如画中佳境。如今,柠檬郡一、二期已完美交付的1000余户业主,一同见证了柠檬郡品质地产的最好佐证。并且,极高的入住率为柠檬郡带来了浓厚的生活气息。', '2013-04-16', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7E6', '330100', '120.331124,30.317019;120.328322,30.31699;120.328268,30.318152;120.329767,30.318473;120.330401,30.31856;120.331142,30.318615;120.331124,30.317019', '铭和苑桂雨坊', '杭州市江干区下沙街道学源街1337号', '杭州市', '0103000020E61000000100000007000000EDBAB72231155E40EB353D2828513E40AB23473A03155E40B728B34126513E40B114C95702155E403128D36872513E4034130CE71A155E40B5A84F7287513E4034643C4A25155E4053D0ED258D513E404015376E31155E40DA03ADC090513E40EDBAB72231155E40EB353D2828513E40', '36833.186321', '120.329788,30.317727', '商务住宅;住宅区;住宅小区', '', 'None', '', '20736', '铭和苑是杭州铭雅铭和苑房地产开发有限公司严格按照市政府要求和合同建设的经济适用房项目,位于杭州市下沙新城中心区内。铭和苑总占地面积200余亩,总建设面积近40万平方米,一期柳翠坊、桂雨坊已竣工交付,1600余户已入住新居;二期新荷坊、探梅坊是由18栋高层、小高层住宅组成,其主力户型为70至90平方米,共有1610套住宅,将于2009年底前交付。  铭和苑周边拥有大面积城市绿化景观带,仿佛再现了一个坐落在家门口的公园,园区景观布局均匀,通过平台、草坡、中心花园形成多种视觉角度的美丽景致。周边绿树成荫,与四季不断的花卉相辉映,营造清新怡人的家园风格。规划中2010年将建成的地铁1号线起于下沙副城,其中下沙中心站紧邻铭和苑小区,为业主出行带来了极大的方便。  铭和苑还倡导和美优雅的生活,营造自然、人文、和谐的生活模式,让业主能追求身心的健康、生活的舒适。园区东边是繁荣的高沙商业街、时尚购物中心,集酒店、娱乐、休闲等多元化业态,已形成了浓郁的商贸氛围。园区周边自幼儿园到大学,教育设施完善,师资力量雄厚,满足各个阶段的教育需要。成熟的浙江省东方医院(省中医院下沙院区)和规划在建的三甲下沙医院完全可满足下沙市民的健康医疗需求。', '', '0.68元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7M4', '330100', '120.292083,30.347703;120.291635,30.347703;120.29149,30.347687;120.290597,30.3476;120.290507,30.347835;120.290242,30.347809;120.290234,30.347954;120.292119,30.348314;120.292228,30.347813;120.292228,30.34766;120.292083,30.347703', '紫晶时代', '杭州市余杭区乔司南街96号', '杭州市', '', '7962.354602', '120.291363,30.347919', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '紫晶时代位于余杭区南街96号。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。    紫晶时代位于余杭区南街96号。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.6元/月/平方米');
