INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7NA', '330100', '120.279822,30.304209;120.279756,30.304331;120.279974,30.305908;120.28007,30.305996;120.28216,30.30579;120.282184,30.305702;120.281942,30.304035;120.281883,30.304003;120.279822,30.304209', '左邻右舍', '杭州市江干区金堡街86号', '杭州市', '', '36242.029574', '120.280967,30.305002', '商务住宅;住宅区;住宅小区', '', '2.5', '', '27860', '名城左邻右舍占地38705平方米,总建筑面积120000平方米,整个小区由6幢11层小高层住宅和2幢18层住宅1幢16层住宅组成,名城左邻右舍由杭州名城房地产集团有限公司开发,2008年开盘,2009年下半年入住。  名城左邻右舍离地铁1号线九堡东站点约500米,交通条件优越,目前有快速B1、848、K401、K566、K223、K210、K525、K320等多路公交车直达市区。艮山东路、德胜快速路、杭海路、下沙路等快速路 。    名城左邻右舍占地38705平方米,总建筑面积120000平方米,整个小区由6幢11层小高层住宅和2幢18层住宅1幢16层住宅组成,名城左邻右舍由杭州名城房地产集团有限公司开发,2008年开盘,2009年下半年入住。  名城左邻右舍离地铁1号线九堡东站点约500米,交通条件优越,目前有快速B1、848、K401、K566、K223、K210、K525、K320等多路公交车直达市区。艮山东路、德胜快速路、杭海路、下沙路等快速路 。', '2008-03-08', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7NB', '330100', '120.284055,30.304506;120.283526,30.304573;120.283429,30.303818;120.281984,30.303972;120.282105,30.304868;120.282237,30.305762;120.284184,30.30556;120.284055,30.304506', '九洲芳园', '杭州市江干区金堡街18号', '杭州市', '0103000020E61000000100000008000000FAD005F52D125E408F6FEF1AF44D3E4034643C4A25125E409F3E027FF84D3E403B6F63B323125E40A6EF3504C74D3E40B27F9E060C125E4054E6E61BD14D3E40704221020E125E40D09849D40B4E3E40272EC72B10125E400C5C1E6B464E3E40F982161230125E403CF71E2E394E3E40FAD005F52D125E408F6FEF1AF44D3E40', '28873.211672', '120.283008,30.304837', '商务住宅;住宅区;住宅小区', '', '2.5', '108099平方米', '25340', '九洲芳园是中兴房产在九堡的一个新的力作,总占地面积33961平方米,总建筑面积10万余平方米,由五幢板式高层组成。  九洲芳园座落于九乔路南侧,东倚兴安路,紧邻地铁一号线,享有得天独厚的区位景观优势,属九堡中央核心区块,是未来杭州东北部都市居住中心。  九洲芳园小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。    九洲芳园是中兴房产在九堡的一个新的力作,总占地面积33961平方米,总建筑面积10万余平方米,由五幢板式高层组成。  九洲芳园座落于九乔路南侧,东倚兴安路,紧邻地铁一号线,享有得天独厚的区位景观优势,属九堡中央核心区块,是未来杭州东北部都市居住中心。  九洲芳园小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。    本段合作编辑者: 徐川', '2008-12-27', '1.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7NF', '330100', '120.25814,30.322277;120.256254,30.320978;120.254768,30.319785;120.255376,30.319214;120.25596,30.318688;120.256565,30.318315;120.259497,30.320656;120.25814,30.322277', '万科魅力之城(九环路)', '杭州市江干区九堡镇九环路41-4号', '杭州市', '0103000020E610000001000000080000008672A25D85105E40C440D7BE80523E40075E2D7766105E4049BC3C9D2B523E404F04711E4E105E4059C0046EDD513E40BB0B941458105E40E36C3A02B8513E4063450DA661105E40AEA0698995513E4016139B8F6B105E4084D382177D513E403F1A4E999B105E402444F98216523E408672A25D85105E40C440D7BE80523E40', '81532.204891', '120.257177,30.320255', '商务住宅;住宅区;住宅小区', '540个', '2.3', '99442平方米', '24918', '万科·魅力之城座落于九堡艮山东路、德胜路北侧杭海路以西九环路与九盛路交汇处总建筑面积约19万平方米分两期开发以小高层与高层为主主力户型为90平方米左右两室两厅、130平方米左右三室两厅  小区交通便捷畅通快速公交、近10条公交线路、德胜快速路及未来的地铁九堡站、即将投入运营的长途客运中心等生活一应俱全九堡幼儿园、九堡中心小学、九堡医院、联华超市、九堡农贸市场等社区内配套拥有商业走廊、阳光泳池、时尚会所等延伸生活空间  万科物业在市场上拥有管家”的美誉在魅力之城万科物业设置了酒店式的专职管家深化服务细节充分体现服务品质  万科·魅力之城秉承万科企业23年来对细节的完美苛求从地块选择到住区规划从建筑设计到景观围合从有限的室内空间到无限的服务精神将对产品细节的完美追求进行到底  高层、小高层之间的自然围合形成四大组团控制居住密度增强居住空间的领域感保障业主私密性首创以林溪.浮岛”为主题自然景观的设计方针步行园路牵引组团浮岛与明快的建筑立面融为一体自然融合与过渡  户型设计拒绝空间浪费讲究舒适性强调在相同面积内拥有更大的面宽、更多的实用空间复合式厨房等创意空间的设计增添舒适与生活情趣以89平米经典两房为代表的集约户型将成为都市菁英的理想居住空间园林景观:小区景观首创以林溪.浮岛”为主题自然景观的设计方针步行园路牵引组团浮岛与明快的建筑立面融为一体自然融合与过渡', '2007-04-22', '1.7元/月/平方米');
