INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7NJ', '330100', '120.295777,30.259258;120.295997,30.256896;120.291977,30.257007;120.291762,30.26094;120.292944,30.261029;120.292978,30.260336;120.292994,30.260212;120.293064,30.260124;120.293174,30.26008;120.293295,30.260051;120.293414,30.259122;120.295777,30.259258', '瑞博·林之语', '杭州市萧山区钱宁线与奔竞大道交叉口', '杭州市', '', '102948.176341', '120.293622,30.258488', '商务住宅;住宅区;住宅小区', '配比70％左右', '1.64', '220000平方米', '18365', '瑞博.林之语项目占地近200亩,由小高层、高层电梯公寓和Townhouse(排屋)两大区共五个组团组成,总建筑面积约25万平方米。  瑞博.林之语位于钱江二桥以东、钱塘江南岸的滨江地带,离杭州中心城区约10余公里路程。', '2011-09-30', '1元/月/平方米');
