INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7P7', '330100', '120.350303,30.308619;120.349292,30.308568;120.349202,30.309894;120.351066,30.310003;120.351122,30.31;120.351172,30.309985;120.351205,30.309961;120.351231,30.309928;120.351319,30.308679;120.350303,30.308619', '月雅苑', '杭州市江干区下沙开发区2号大街877号', '杭州市', '', '24608.485456', '120.350259,30.309286', '商务住宅;住宅区;住宅小区', '124个', 'None', '47189平方米', '19710', '月雅苑由16装建筑组成,其中两幢为小高层,十四幢为多层。小区内有会所,有桌球馆;网球场;美容中心;餐厅。', '2000-11-30', '0.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A7P8', '330100', '120.350707,30.307348;120.35083,30.306237;120.349524,30.306181;120.349496,30.306489;120.349379,30.307859;120.349361,30.308488;120.350603,30.308516;120.350707,30.307348', '东海·未名园', '杭州市江干区百合路34号', '杭州市', '0103000020E610000001000000080000009CDEC5FB71165E40B37DC85BAE4E3E402A1DACFF73165E403DD34B8C654E3E40B24AE9995E165E4015A8C5E0614E3E404D8578245E165E4070952710764E3E4030BABC395C165E407EC7F0D8CF4E3E40DD5F3DEE5B165E405D35CF11F94E3E404AB8904770165E40F14A92E7FA4E3E409CDEC5FB71165E40B37DC85BAE4E3E40', '26821.796556', '120.350069,30.307347', '商务住宅;住宅区;住宅小区', '', 'None', '70000平方米', '22225', '正北方是占地10平方公里的下沙大学城,步行5分钟即可散步进入开放的校园。大学城首批1.8万名新生业已入校,东区建设亦正日新月异,并且随着“市东扩、跨江发展”大势的确定,新城内更有越来越多新兴开发的楼盘即将面世。作为三大副城之一的“下沙城”,规划人口近50万,旺盛的人气,令地段升值潜力直逼城西。清新的自然及人文环境,令这里的空气处处飘散出迷人的气息。周边更有齐全的现代健身、交通、医疗配套。成熟而适宜的人文生活氛围,注定了“东海.未名园”的书香门第。下沙大学城的科技、人文、环境,本身就具备了居住、就业与投资的多方优势。东海.未名园总建筑面积约七万平方米,整个社区呈规模的长方形,由多层和高层建筑相结合,形成了一组丰富、律动的城市天际线。其中规划有联排式公寓、点式公寓,及电梯公寓,建筑整体排列错落有序,充分照顾到了每一户业主对2万多平方米"锦鳞公园"及社区内景观组团的观景视野。真正实现了"均好性住宅"概念。社区内还采用了人车分流的科学规划,并结合地下停车位的分布,布置了动线最短的人行、车行交通线,保证了社区内居民的通行方便与安全。户型设计几个特色:多重空间:空间布局紧凑,功能分区到位,适合安排朋友小聚,私密生活、休闲放松的多重空间。自然采光:客厅、卧室大开间的自然采光、阳光明媚、通风顺畅。景观阳台:南北双向的景观阳台,延伸空间面积,布置上几把休闲椅,风景尽收眼底。厨艺时光:开放式的厨房餐厅,阳台相连的设计。开阔的就餐空间提供了家人共同参与的欢乐厨艺时光。时尚生活:主卧与主卫,进入式衣橱相连的时尚设计。符合家居潮流。缤纷飘窗:飘窗的设计为您增添了更多空间的同时,引进居室更多的缤纷景致。', '2002-06-01', '0.91元/月/平方米');
