INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A8QP', '330100', '120.090355,30.33109;120.090166,30.33099;120.089432,30.330502;120.089294,30.330743;120.089107,30.33088;120.088886,30.330915;120.08871,30.330896;120.088392,30.33079;120.0879,30.331856;120.09041,30.332772;120.090511,30.332607;120.090567,30.33248;120.090704,30.332069;120.090715,30.331932;120.090803,30.331841;120.090906,30.331739;120.091165,30.331443;120.090922,30.331344;120.090491,30.331166;120.090355,30.33109', '都市水乡水曲苑', '杭州市拱墅区环镇东路与长青路交叉口西北150米', '杭州市', '', '36649.097158', '120.089531,30.331636', '商务住宅;住宅区;住宅小区', '', '2.1', '260000平方米', '24822', '都市水乡临近三墩镇,位于五里河畔、三墩路北、古墩路东。它东起丰庆路,南起留祥路,西至环镇东路、通济北路,北至余杭勾庄。都市水乡有餐饮、超市、医院、学校、健身娱乐设施、 能够充分满足您一站式购物需求。 小区地段好交通便利,周边配套成熟完善。 小区的配套设施齐备,小区内设有幼儿园、小学、中学,超市就在家门口。', '', '0.5-2.5元/月/平方米');
