INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A8QV', '330100', '120.085361,30.336099;120.08589,30.334977;120.086718,30.333234;120.086891,30.332834;120.086525,30.332548;120.086166,30.332259;120.086508,30.331557;120.085876,30.331283;120.085354,30.331606;120.085211,30.331707;120.08498,30.331937;120.084828,30.332104;120.084626,30.332343;120.084385,30.332587;120.083798,30.333292;120.083409,30.33377;120.083008,30.334251;120.081805,30.335684;120.081746,30.335784;120.081739,30.335838;120.081748,30.335911;120.081829,30.335987;120.084852,30.337149;120.085361,30.336099', '亲亲家园3期', '杭州市余杭区三墩镇北边(古墩路延伸段)', '杭州市', '', '133771.862164', '120.084575,30.334415', '商务住宅;住宅区;住宅小区', '', 'None', '', '25944', '亲亲家园位于三墩镇北古墩路延伸段,距市中心约11公里,紧邻浙大紫金港校区及建设中的三墩新城,到三墩镇距离约700米。小区东临三墩新建农居点项目及新开河,南临三墩的经济适用房项目都市水乡,西临五洞星桥港,北临王家兜港。  小区以“现代邻里、都市街坊”为核心理念,以BLOCK为形式形成内紧外松,蕴含“公共空间--半公共空间--半私密空间--私密空间”的多层次生活空间,让城市生活的本原在这里得到回归;园艺设计由全球著名的泛亚易道担纲,融合江南风情与现代国际化住区的精神;户型设计引入欧洲航天工业“精密设计”理念,强调户型的合理和舒适,一期主力户型为110-130平方米。亲亲家园拥有以社区商业文化中心,休闲步行街,城市商业街,会馆等构成完善的商业文化设施;以及有幼儿园,9年一贯制学校构成的教育体系和丰富的体育及娱乐设施形成完善的城市生活功能。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A8QW', '330100', '120.080287,30.336944;120.081335,30.337796;120.081896,30.338154;120.082102,30.338247;120.082532,30.338448;120.082725,30.33852;120.082883,30.338326;120.082921,30.337902;120.082676,30.337793;120.082931,30.336765;120.082953,30.336694;120.082608,30.336572;120.082564,30.336561;120.082511,30.336528;120.082461,30.336491;120.082408,30.336453;120.082343,30.336432;120.082258,30.336413;120.082181,30.336397;120.082131,30.336375;120.082076,30.336342;120.082026,30.336301;120.081959,30.336259;120.081901,30.336228;120.081882,30.336215;120.081824,30.336179;120.081785,30.336164;120.081739,30.336145;120.081664,30.336109;120.081573,30.3361;120.081504,30.336108;120.081421,30.33618;120.081365,30.336238;120.081284,30.33627;120.08122,30.336305;120.081161,30.336367;120.081134,30.336404;120.081073,30.336441;120.080965,30.336458;120.080766,30.336459;120.080636,30.33645;120.080498,30.336433;120.08022,30.336763;120.080287,30.336944', '中海金溪园', '杭州市余杭区池华街', '杭州市', '', '34483.994902', '120.08179,30.33719', '商务住宅;住宅区;住宅小区', '', 'None', '6平方米', '37954', '中海金溪园位于三墩成熟板块,北依金渡北路,东靠铭雅苑,南侧与亲亲家园隔河相望。承袭中海一贯的精品品质,中海金溪园与同一区域的中海紫藤苑将共同构筑“中海城西品质生活领地”。中海金溪园小区布局北高南低,北侧高层一字排开,享有超百米开阔的楼间距,充分感受到阳光、绿化、河景的三重体验。南侧排屋散布于郁郁葱葱的园景中,独享恬静适意亲水生活。中海金溪园项目采用新古典主义现代建筑风格,精心规划具有“超大面宽、超短进深”特点的户型结构。90平米客厅、双卧均朝南,功能空间隔而不断,观赏空间相互渗透,带给小户型全新的舒适生活体验。中海金溪园西侧与南侧临河,构成独特“双水岸”生态人居,小区内景观构筑时尚、雅致景观,演绎浪漫主义情怀,展现新古典主义魅力。建筑与景观风格统一,符合现代人的主流审美观。功能空间隔而不断,观赏空间相互渗透,以“八方来仪、掌控全局”的气韵对应住户高尚的人生境界。', '2009-04-28', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A8QX', '330100', '120.083637,30.332508;120.081664,30.331754;120.080852,30.332974;120.082751,30.333847;120.083242,30.333289;120.08348,30.332902;120.083637,30.332508', '三墩颐景园曲水苑', '杭州市西湖区三墩大禹路', '杭州市', '0103000020E6100000010000000700000013EF004F5A055E408BA8893E1F553E40AD50A4FB39055E40335184D4ED543E403CF4DDAD2C055E40166BB8C83D553E4086ADD9CA4B055E4022DE3AFF76553E40D5E940D653055E40D61D8B6D52553E40AF777FBC57055E40E3C5C21039553E4013EF004F5A055E408BA8893E1F553E40', '29722.66389', '120.082271,30.332789', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '三墩颐景园坐落于水乡古镇三墩镇,东至通济路,南靠董家路,古至厚仁路,地处以浙江大学紫金港校区为中心的大学城板块,近邻西溪风景旅游园区。总占地面积102亩、容积率1.8,主要由小高层公寓、排屋组成。园区以颇现代的、轻巧自如的、色彩明快的欧式建筑风格为总体风格,将精致的民族建筑小品融入古典园林环境中。社区得山水之清秀,拥配套之便利,集产业人气,凝文化之魅力,生活条件得天独厚,远景展望曼妙可人。  三墩颐景园由三个地块组成。整个地块的建筑群体形成南低北高的走势。总体设计上使得每一地块相对独立又有机的结合成一个整体。每个地块内的道路水系,建筑形成独立的小园区,而整体上由小区出入口和水系将其结合为一个整体。其中E30地块西北角底层为商业网点,上面是单身公寓。地块东、南为叠排和联排别墅。在地块西、北设立两出入口。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A8R5', '330100', '120.046233,30.36773;120.046206,30.36878;120.046327,30.368887;120.047952,30.368915;120.048014,30.368868;120.048067,30.368787;120.048164,30.367563;120.048153,30.366626;120.048102,30.36583;120.04788,30.365515;120.04766,30.365309;120.047593,30.365293;120.047523,30.3653;120.046887,30.36707;120.046764,30.367489;120.046619,30.367558;120.046549,30.367725;120.046233,30.36773', '北秀蓝湾', '杭州市余杭区良渚北秀蓝湾小区1-1-4号', '杭州市', '', '42356.193413', '120.047373,30.36749', '商务住宅;住宅区;住宅小区', '车位比1:0.7', '1.81', '85000平方米', '15504', '绿建北秀蓝湾配套完善,交通便利。', '2007-05-01', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A8R9', '330100', '120.117776,30.378957;120.117576,30.378784;120.11502,30.378671;120.114737,30.378822;120.1146,30.379586;120.114167,30.382609;120.116837,30.383344;120.117603,30.383469;120.117776,30.378957', '逸居城', '杭州市余杭区农副产品物流园区内逸盛路183号', '杭州市', '', '129541.069623', '120.11611,30.380963', '商务住宅;住宅区;住宅小区', '418个', '1.95', '19001.19平方米', '17753', '逸居城是杭州新城北33万方大规模亲水庭院品质住区,由多层、小高层、高层等多种业态组合而成。项目分三期开发,享受杭州农副产品物流中心的配套,总体布局上以“一轴三心”为建筑章法,围合大小庭院,恰到好处的人车分流,创造人、建筑与环境的和谐统一。逸居城北临绕城公路,南依上塘高架。小区周边交通便捷,目前有杭州公交线路191、192、97路,临平北站至物流中心直达车等。
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A8RA', '330100', '120.122764,30.346768;120.120208,30.346714;120.120106,30.346769;120.119538,30.348778;120.119601,30.34888;120.122006,30.348968;120.122263,30.348903;120.122943,30.346841;120.122764,30.346768', '风雅乐府', '杭州市余杭区冯家浜路附近', '杭州市', '', '55670.412344', '120.121214,30.347827', '商务住宅;住宅区;住宅小区', '约1：1左右', '2.2', '124000平方米', '29573', '风雅乐府位于城北高架勾运路出口西侧约200米,运河支流自然地将风雅乐府分为南北两个岛,占地约56000平米。  风雅乐府参照苏州留园为蓝本,提出了“水上水、园中园、院上院、楼中楼”等四大居住理念,倡导中国人传统的游园、植院、亲水和复式居住的生活理念,次在一个楼盘里以户为单位面同时融入多种居住理想的尝试。  风雅乐府由“空中排屋”与城市联排组成。风雅乐府的“空中排屋”户户两层,设置有中空客厅、相对独立的私家电梯厅和空中的私人院子及多个露台;户型设计引入创新的挑空设计,装修方案变化丰富。城市联排沿200米烟雨水巷布局,户户采用下沉式花园、天井和入户后院等三院墅设计,户型全明,三主卧设计带采光地下洗衣房、地下储藏室和视听室。', '2009-04-30', '2元/月/平方米');
