INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A92B', '330100', '120.234632,30.345306;120.2335,30.347714;120.233384,30.347987;120.235669,30.349014;120.237708,30.346732;120.234632,30.345306', '丁桥兰苑', '杭州市江干区环丁路', '杭州市', '0103000020E6100000010000000600000016A6EF35040F5E40D21C59F965583E406DE7FBA9F10E5E40815CE2C803593E4038DA71C3EF0E5E40E36E10AD15593E4096EB6D33150F5E409DD843FB58593E40D87F9D9B360F5E40077AA86DC3583E4016A6EF35040F5E40D21C59F965583E40', '79018.70568', '120.235384,30.347196', '商务住宅;住宅区;住宅小区', '', 'None', '', '20946', '丁桥兰苑建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.5元/月/平方米');
