INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A9YX', '330100', '120.085199,30.328807;120.084667,30.328663;120.084348,30.330023;120.08453,30.330059;120.084589,30.330093;120.084634,30.330139;120.084664,30.330198;120.084699,30.330335;120.084777,30.330504;120.086103,30.331075;120.087227,30.331526;120.087659,30.330684;120.087932,30.329997;120.087334,30.329852;120.086465,30.329456;120.085199,30.328807', '兰韵天城', '杭州市西湖区三墩镇古墩路与董家路交汇处', '杭州市', '', '49793.647713', '120.086053,30.330113', '商务住宅;住宅区;住宅小区', '', '2.03', '', '25192', '南北.兰韵天城坐落于西湖区三墩镇,毗邻浙大紫金港校区,具体位置位于古墩路与董家路交界处,由浙江新南北投资置业集团有限公司开发建设。整个项目由16幢错落有致的高层、小高层组成,规划大气通透,设计隽永写意,集兰韵君子、慧资天城于一身。小区物业配套齐全,人文气息浓郁,在规划建设中运用大量新材料、新技术,真正实现人与环境的和谐统一。 兰韵天城的生态景观别具诗画意境。小区南侧依托70米宽的绿化带,形成一个天然大氧吧,时刻感受清新和惬意;小区内部营造“北山、南水、树庭院”的山水景观格局,遍植兰系植物,让您真正感受诗意的居住意境和高雅的人文情怀。 此次开盘的三期依然秉承“健康居住、舒适户型”的理念,10、11号楼设置的观光电梯正对小区中心花园美景;入户花园设计独具匠心,不仅可用作分割空间,还为室内增添了一抹温馨绿意,营造出强烈的心里归属感;卫生间、厨房均为全明设计;卧室的飘窗设计扩大了空间利用率;南向超大休闲景观阳台面积15平方米,宽敞舒适,可以尽情俯瞰70米城市绿化带美景,尽享生活闲趣。', '2005-07-31', '1.6元/月/平方米');
