30.184455;120.249719,30.185224;120.249719,30.185278;120.249727,30.185306;120.249742,30.185337;120.249772,30.185366;120.249797,30.18538;120.249826,30.185387;120.249846,30.185392;120.249858,30.185404;120.249873,30.185432;120.249909,30.185586;120.251608,30.185543;120.251641,30.185407;120.251674,30.185328;120.251708,30.185216;120.251741,30.185104;120.251764,30.185011;120.25178,30.184941;120.251851,30.184667;120.251892,30.184467;120.251937,30.184299;120.252056,30.183905;120.252074,30.183853;120.252074,30.183819', '开元加州阳光小区', '杭州市萧山区金城路333号', '杭州市', '', '40769.592741', '120.250773,30.184452', '商务住宅;住宅区;住宅小区', '', '2.6', '300000平方米', '14144', '开元加州阳光位于杭州市萧山新城区金城路与金鸡路交界处,与区政府近在咫尺,南临金城路、北靠金惠路,西面紧邻城市天然河道济民河,大浦河从地块中间穿过,将地块分为南北两区,整个项目总建筑面积约30万方,绿化率达到40%。其中北区由16幢高层组成,户型以三房和四房为主。南区由建筑面积约6万平方的ShoppingMall和两栋高层精装修小户型组成。整个项目于2002年12月开工,住宅2003年5月17日正式开盘。开元·加州阳光创造了一种商圈文明浸染下的全新生活方式,其以休闲为主格调,将南加州风情全线空运至杭州,杭城首家引进全新国际商业概念,营建起大规模复合型SHOPPINGMALL主题购物公园,一站式消费、24HOURS时尚动感生活尽纳其中。开元加州阳光位于杭州市萧山新城区金城路与金鸡路交界处,与区政府近在咫尺,南临金城路、北靠金惠路,西面紧邻城市天然河道济民河,大浦河从地块中间穿过,将地块分为南北两区,整个项目总建筑面积约30万方,绿化率达到40%。其中北区由16幢高层组成,户型以三房和四房为主。南区由建筑面积约6万平方的ShoppingMall和两栋高层精装修小户型组成。整个项目于2002年12月开工,住宅2003年5月17日正式开盘。开元·加州阳光创造了一种商圈文明浸染下的全新生活方式,其以休闲为主格调,将南加州风情全线空运至杭州,杭城首家引进全新国际商业概念,营建起大规模复合型SHOPPINGMALL主题购物公园,一站式消费、24HOURS时尚动感生活尽纳其中。', '2003-04-30', '1.8元/月/平方米');
