INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ABSB', '330100', '120.256531,30.181678;120.256445,30.181689;120.256216,30.181736;120.255882,30.181755;120.255076,30.181827;120.254445,30.181871;120.253759,30.181906;120.253511,30.181941;120.253483,30.181963;120.253352,30.183264;120.253403,30.183298;120.253762,30.183316;120.254469,30.183301;120.256159,30.183168;120.25621,30.183117;120.256281,30.182841;120.256366,30.182588;120.256384,30.182517;120.256524,30.181965;120.256558,30.181702;120.256531,30.181678', '天汇园', '杭州市萧山区金城路411号', '杭州市', '', '38580.659097', '120.254917,30.182531', '商务住宅;住宅区;住宅小区', '', '3.5', '46767平方米', '12703', '天汇园位于萧山新区CBD核心地段,南临金城路,西至金鸡路,东北沿大浦河、工人河,与萧山区政府毗邻,周边金融、商业、文化、交通等设施无限丰足。园区总建筑面积约108000平方米,是集现代办公、商贸一体的高层商业办公楼,底层裙房拥有近14000平方米四层沿街开放式商场,滨河区块布置三组小高层SOHO单元,园区中心设有豪华叠加式SOHO组团。天汇园导入“宽SOHO”概念,整合CBD区有效资源,打造尊荣园区品质,建成后将成为萧山新区一大核心发展动力。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ABVD', '330100', '120.274634,30.162066;120.274592,30.162097;120.274617,30.162378;120.27491,30.162382;120.275057,30.162509;120.275297,30.162513;120.275298,30.162456;120.275575,30.162459;120.275567,30.161781;120.274911,30.1618;120.274901,30.162055;120.274634,30.162066', '东城名苑', '杭州市萧山区萧然东路138号', '杭州市', '', '5007.808627', '120.275156,30.162149', '商务住宅;住宅区;住宅小区', '', 'None', '', '21853', '东城名苑位于萧山老城区市中心萧然东路,萧山商业氛围和生活气息为浓厚的市中心。市心广场商圈,萧山目前商业氛围为成熟的商业中心之一,周边有机关幼儿园、江寺小学、劲松小学、回澜初中。主力户型在153m2-261m2,户型方正,阳光通透。253m2,226m2的跃层除了设有双超大露台,主卧还设有观景凸窗,客厅5.6米挑高,在繁华中享大户生活。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ABX4', '330100', '120.144548,30.169549;120.143703,30.169248;120.142252,30.16874;120.141862,30.169647;120.14189,30.169832;120.141998,30.169994;120.142163,30.170056;120.142376,30.170154;120.143635,30.170628;120.144327,30.170875;120.145152,30.171131;120.145676,30.169988;120.144548,30.169549', '江南文苑', '杭州市滨江区滨文路639号', '杭州市', '', '42651.680775', '120.143719,30.169947', '商务住宅;住宅区;住宅小区', '780个(1：0.6)', '2.28', '170000平方米', '33683', '江南文苑以11层一梯两户及18层一梯三户的板式住宅为主,整个小区共有15幢楼。在90平方米以下户型设计中,较好地兼顾了户型的经济性和居住的舒适性,90平方米户型中一半以上做到了3房2厅一厨一卫,在开间尺度上,客厅做到了在3.9米以上(局部户型3.8米),餐厅2.7-3.0米,主卧3.6米,并保证每户两个开间朝南,做到了在不牺牲住宅基本舒适的前提下,面积不大功能全的良好效果,局部应用了飘窗、错层式阳台,以增加住宅的增值空间。在户型的设计创新中,局部采用了餐厨合一,餐厨空间互为过渡利用的紧凑型设计方案。在建筑外立面的设计上,重点考虑了室外空调机的合理布置与外立面效果的有机结合。每个单元大堂的空间尺度舒适方正,同时中间排住宅采用架空设计,提高了整个环境的通透性。  江南文苑通过钱江一桥、复兴大桥(钱江四桥)与主城相连,小区到主城湖滨平时开车约20分钟可到达,与主城区关系密切。  江南文苑北侧规划有45班初中,南侧规划有48班小学    江南文苑以11层一梯两户及18层一梯三户的板式住宅为主,整个小区共有15幢楼。在90平方米以下户型设计中,较好地兼顾了户型的经济性和居住的舒适性,90平方米户型中一半以上做到了3房2厅一厨一卫,在开间尺度上,客厅做到了在3.9米以上(局部户型3.8米),餐厅2.7-3.0米,主卧3.6米,并保证每户两个开间朝南,做到了在不牺牲住宅基本舒适的前提下,面积不大功能全的良好效果,局部应用了飘窗、错层式阳台,以增加住宅的增值空间。在户型的设计创新中,局部采用了餐厨合一,餐厨空间互为过渡利用的紧凑型设计方案。在建筑外立面的设计上,重点考虑了室外空调机的合理布置与外立面效果的有机结合。每个单元大堂的空间尺度舒适方正,同时中间排住宅采用架空设计,提高了整个环境的通透性。  江南文苑通过钱江一桥、复兴大桥(钱江四桥)与主城相连,小区到主城湖滨平时开车约20分钟可到达,与主城区关系密切。  江南文苑北侧规划有45班初中,南侧规划有48班小学,教育设施的超前规划消除了入住者子女入学的后顾之忧。', '2010-01-09', '1.2元/月/平方米');
