INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ABY0', '330100', '120.267781,30.193981;120.267735,30.193638;120.267665,30.193051;120.267623,30.192972;120.267333,30.192984;120.266941,30.193019;120.266834,30.19307;120.266634,30.193084;120.266408,30.191934;120.268231,30.191867;120.268312,30.192474;120.268548,30.193527;120.268653,30.193598;120.268682,30.193951;120.267781,30.193981', '东方一品', '杭州市萧山区紧邻萧山主干道市心北路东侧南段,北靠建设一路,南面是北塘路', '杭州市', '', '25715.705278', '120.267627,30.192757', '商务住宅;住宅区;住宅小区', '配比1.1.2（只售不租）', '3.7', '110260平方米', '24845', '东方一品,位于萧山经济技术开发区,连接钱江新城萧山城市中心区域。项目占地4万平米,建筑面积11万平米,由7幢32层高层公寓组成。西靠市心北路,是贯穿萧山的黄金城道,也是连通杭州和萧山的主轴线。未来几年即将开通的过江隧道和地铁2号线的建成通车。', '2009-12-13', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC23', '330100', '120.240969,30.173425;120.240932,30.17324;120.240694,30.172324;120.239753,30.172351;120.238949,30.172361;120.23905,30.172071;120.239024,30.172026;120.238194,30.171825;120.237363,30.17161;120.237049,30.171404;120.236346,30.171208;120.235571,30.171048;120.235187,30.171185;120.234715,30.171501;120.234424,30.1719;120.234164,30.172335;120.233945,30.173881;120.234038,30.174034;120.234419,30.174235;120.234703,30.174267;120.241119,30.17408;120.241095,30.173829;120.241036,30.173608;120.240969,30.173425', '湘湖家园', '杭州市萧山区萧西路843号', '杭州市', '', '150984.3218', '120.237179,30.172936', '商务住宅;住宅区;住宅小区', '', 'None', '', '21015', '湘湖家园一、二期工程,规划有一个供居民休闲、聚会、交流的活动中心,绿化带超过3万平方米,小区植被以湘湖原生植物为主,四季有花、四季有景;沥青大道平整宽畅,还有200个左右的生态停车位;供居民散步休闲的建筑小品、长廊,为小区增添了人文气息。5000平方米的生态式树林,成为整个湘湖家园的绿肺。', '', '1.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC24', '330100', '120.24097,30.183128;120.241013,30.182824;120.240688,30.182813;120.240118,30.182848;120.239831,30.183126;120.239676,30.183306;120.239358,30.183592;120.239052,30.183893;120.240842,30.18389;120.24097,30.183128', '君悦丽景', '杭州市萧山区金城路51号', '杭州市', '', '12885.162945', '120.24023,30.18342', '商务住宅;住宅区;住宅小区', '车位配比100%', '2.75', '70000平方米', '25518', '君悦丽景采用智能化综合布线,各种信息网络应有尽有.车位配比100%,符合精英家园所需.聘请知名物管企业担纲物业管理服务,提供专业化、人性化的物业管理服务。君悦丽景的主力户型面积为100-150平方米,是为白领量身定做的纯粹家园,精英与精英为邻。户型设计新型、实用、科学,部分户型采用跃层设计。另有精装修小户型公寓,户型面积40-60平方米,功能配置完整,且独具70年产权。', '2007-06-30', '1.1元/月/平方米');
