INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC2H', '330100', '120.185395,30.200608;120.185357,30.201082;120.185172,30.201861;120.184901,30.202306;120.184573,30.202801;120.186141,30.203575;120.186314,30.203305;120.186882,30.202395;120.186972,30.202196;120.187155,30.200954;120.187095,30.200932;120.187034,30.200886;120.186975,30.200808;120.186912,30.200705;120.185395,30.200608', '锦绣江南', '杭州市滨江区咏渡巷59号', '杭州市', '', '43644.048508', '120.185992,30.201988', '商务住宅;住宅区;住宅小区', '', 'None', '', '32531', '锦绣江南落座于钱塘江畔,毗邻钱江四桥,作为直面一线钱江的楼盘,占尽地利之优,7栋高层建筑合理排布,让更多的户型可以尽情盛揽一线江景。在户型设计上,通透开敞的空间拥有270度景观视觉。  锦绣江南,在建筑设计上以人为本,匠心独运,整体风格统一和谐、大气优雅,把钱塘江的恢弘致远融入极富张力与想象力的现代建筑格局中,树立起城市崭新的地标性建筑群。  锦绣江南以人的居住感受为根本的出发点,营造出大栋距建筑格局,建筑排布点式和板式相结合,更大程度地采光纳风。小区的入口道路采用人车分流的设计,车位配比超过1:1。每栋建筑底部设置架空敞廊,为业主的沟通和交流提供自然休闲的空间,即使是在雨季,也可以在此避雨、赏景、谈笑。  锦绣江南每栋楼房的入口大堂整体和谐统一,局部细致入微,点睛家的优雅尊贵。大幅落地玻璃窗的采用,让视野游历在广阔之外。', '', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC2J', '330100', '120.224848,30.186447;120.224567,30.185995;120.222019,30.186446;120.222154,30.186976;120.222338,30.187575;120.223146,30.187386;120.223201,30.187594;120.223501,30.187499;120.223737,30.18739;120.224006,30.187283;120.224192,30.187194;120.224427,30.187073;120.224602,30.186944;120.22474,30.18685;120.224797,30.186774;120.224867,30.186732;120.224783,30.186538;120.224848,30.186447', '同方燕语林森小区', '杭州市滨江区滨安路150-178号', '杭州市', '', '27521.725817', '120.223431,30.186779', '商务住宅;住宅区;住宅小区', '', '1.62', '55000平方米', '28324', '燕语林森以“追求楼盘本身的高品质”为首要开发纲领,并将其渗透延伸到楼盘的规划、景观、建筑、地段这三个重要环节上。全区由7幢多层建筑,6幢小高层住宅及部分沿街商铺优化组合而成,建筑密度25.16%,绿化率39.81%,户型以130平米左右的三房二厅为主。', '2006-02-28', '0.8元/月/平方米');
