INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC2Y', '330100', '120.25367,30.180445;120.253622,30.181521;120.256553,30.181345;120.256513,30.180103;120.25653,30.179376;120.25649,30.179322;120.256338,30.179171;120.256095,30.179017;120.25585,30.178861;120.25576,30.178826;120.255098,30.17884;120.255069,30.178853;120.255051,30.178902;120.255039,30.178952;120.25501,30.178962;120.254455,30.178956;120.253787,30.178967;120.253767,30.178988;120.253745,30.179562;120.25367,30.180445', '知稼苑', '杭州市萧山区金城路9号', '杭州市', '', '63901.560605', '120.255084,30.180205', '商务住宅;住宅区;住宅小区', '', 'None', '', '20064', '知稼苑位于萧山区金城路408号,项目总建筑面积13万平方米,由2幢高层住宅和1幢写字楼组成。知稼苑于2007年4月开盘,整个项目2008年交付。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱。', '', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC40', '330100', '120.284234,30.197952;120.284085,30.196187;120.28394,30.196185;120.283923,30.195684;120.283023,30.195775;120.283072,30.196085;120.283261,30.19704;120.283434,30.198065;120.283811,30.19804;120.284236,30.197999;120.284234,30.197952', '嘉利公寓', '杭州市萧山区萧山经济技术开发区建设二路25号', '杭州市', '', '18728.658285', '120.283669,30.19686', '商务住宅;住宅区;住宅小区', '', 'None', '', '24647', '嘉利公寓位于萧山开发区主要交通要道处,周边银行、农贸市场、超市、医院、公交线路、学校配套齐全,小区由多幢多层及一幢单身公寓组成,单身公寓配备两台电梯,两个消防楼梯,大堂装修气派。多层设立架空层(自行车库)、电子对讲门铃及相关的监控系统;入住率达到80%以上,配有三级资质的物业管理单位。小区环境良好,为了取得良好的观景效果,户型单体设计在客厅、主卧等部位采用了阳台或飘窗。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6K', '330100', '120.161052,30.190008;120.160981,30.189955;120.158948,30.189522;120.158744,30.192148;120.15888,30.192252;120.160835,30.192435;120.160877,30.192406;120.161098,30.190076;120.161052,30.190008', '太阳国际公寓', '杭州市滨江区伟业路730号', '杭州市', '', '51124.269159', '120.159899,30.191038', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6M', '330100', '120.156051,30.185914;120.15583,30.185898;120.155857,30.186256;120.155975,30.187176;120.15704,30.187306;120.158713,30.187623;120.158862,30.187639;120.158921,30.18689;120.15894,30.186513;120.158961,30.186371;120.158722,30.186339;120.156998,30.186042;120.156051,30.185914', '银色港湾公寓', '杭州市滨江区伟业路481号', '杭州市', '', '34829.379373', '120.157406,30.186746', '商务住宅;住宅区;住宅小区', '1:0.5', '3', '120000平方米', '34639', '银色港湾地处钱江之滨,总占地面积60亩,总建筑面积约10万平方米。建有包括7幢高层、小高层、5幢多层及1幢单身公寓在内的13幢楼宇,近800套房源。距离钱江约500米,空气清新,环境优美,视野开阔,漫游江畔,远可眺六和景区和葱翠玉皇山麓,近可触钱江生生气息,为生活增添无限的遐想。它由生态公园、儿童乐园、温馨庭院和露天广场组成的景观庭院,结合建筑多变的形态,主次分明,动静有别,银色港湾创造适于居民休憩、交流、散步的社区内部环境,有机的融入亲水平台、水体喷泉、园林小品、艺术雕塑、木桥、石板路径等内容丰富、生态均衡的环境构成。', '2004-07-01', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6Q', '330100', '120.131506,30.173952;120.131433,30.175971;120.133921,30.176011;120.133952,30.17518;120.133995,30.17486;120.134071,30.17469;120.134131,30.174673;120.134236,30.174038;120.133752,30.174007;120.133385,30.173984;120.132773,30.173979;120.131506,30.173952', '钱塘山水', '杭州市滨江区钱江一桥西南侧东信大道92号', '杭州市', '', '46958.813846', '120.132751,30.174968', '商务住宅;住宅区;住宅小区', '1:0.8', '2.5', '14.6平方米', '40624', '中海.钱塘山水位于滨江区,东临高新技术产业开发区,聚集了UT斯达康、东方通信、摩托罗拉等国内外知名企业,东南面是滨江高教园区,现浙江中医学院、中国美术学院、杭二中等九所学校已经入驻,西接闻涛路,规划有50米宽的绿化带。总建筑面积约15万平方米,环抱式开放布局,容积率2.5,建筑密度19.8%。中海.钱塘山水建筑由5幢高层、1幢两层楼单身公寓和8幢联排组成。', '2008-09-23', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6R', '330100', '120.14194,30.175934;120.141943,30.175721;120.141933,30.175325;120.141914,30.174551;120.141719,30.174487;120.141372,30.1744;120.141177,30.174367;120.141112,30.174381;120.139604,30.174022;120.139606,30.176099;120.141931,30.176098;120.14194,30.175934', '天鸿君邑小区', '杭州市滨江区东信大道与六和路交叉口西南150米', '杭州市', '', '38349.139238', '120.140714,30.175188', '商务住宅;住宅区;住宅小区', '892个', '2.5', '12平方米', '27593', '天鸿君邑居于东信大道旁,踞滨江居住核心,揽钱塘江景,望六和古风,是一方繁华中更享静谧的人间美境,也是杭州滨江区罕有的精装公寓住品。园区总建筑面积近16万平米,由精装修高层公寓,精装修服务式商务楼和休闲商业街恢弘筑就。  天鸿君邑由钱塘江大桥、复兴大桥快速对接大杭州繁华腹地,杭州高新公建中心、高教园区等大型商务配套环伺周围。天鸿君邑约15000平米的大型中央广场式花园,社区独配的休闲商业街,而入户花园作为天鸿.君邑户型特色之一,创造了公寓中的别墅级豪华配置。', '2008-09-20', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6U', '330100', '120.196043,30.206896;120.196329,30.207015;120.196537,30.206736;120.196706,30.206381;120.196076,30.206061;120.194959,30.205514;120.194886,30.20558;120.194082,30.206919;120.193996,30.207078;120.195471,30.20784;120.196043,30.206896', '银泰·海威国际', '杭州市滨江区科技馆街1600号', '杭州市', '', '30297.91636', '120.195296,30.206663', '商务住宅;住宅区;住宅小区', '926(1:1.25)', '4.2', '23平方米', '29422', '银泰·海威国际建筑设计充分利用地块西南总平朝向,住宅呈现大角度曲线平面,在三个方面产生了效果:一、户户面江,视野无遮挡;二、减少了相同建筑长度下的日照遮挡;三、使四幢高层呈半开放布置,围合出面向钱江的中心花园。  银泰·海威国际在建筑上不乏精彩的细节,比如户型设计上,力图放宽室内的面江视野,客厅落地窗、观景阳台等设计,将江景引入室内;其次,住宅做到了两梯两户,充分尊重居家的私有性,可谓奢华之笔;为了使景观能够渗透到社区各个角落,底层采用了5.1米架空层;同时在建筑造型上,采用比较简洁、现代的风格,恢宏简洁的立面线条,与磅礴大气的钱塘江相辉映,雕刻出钱江时代特有的国际气质。', '2007-12-27', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6W', '330100', '120.225945,30.197564;120.225964,30.19511;120.224031,30.195077;120.223968,30.195111;120.223924,30.195168;120.223882,30.195232;120.223882,30.197386;120.223922,30.197457;120.223994,30.197515;120.224056,30.197547;120.224164,30.197564;120.225945,30.197564', '滨江人才公寓', '杭州市滨江区江汉东路与阡陌路交叉口东南150米', '杭州市', '', '46410.996823', '120.22492,30.196325', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6X', '330100', '120.216044,30.198787;120.21612,30.198305;120.216848,30.198357;120.217513,30.19841;120.21755,30.198379;120.217701,30.197021;120.217726,30.196734;120.214759,30.196634;120.214485,30.198666;120.214449,30.199069;120.215965,30.199226;120.216044,30.198787', '欣盛·东方郡东区', '杭州市滨江区春晓路', '杭州市', '', '57037.797926', '120.215964,30.197765', '商务住宅;住宅区;住宅小区', '', 'None', '', '47376', '', '', '1.99元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6Y', '330100', '120.168656,30.190724;120.165858,30.189592;120.165728,30.189599;120.165664,30.189689;120.165364,30.190661;120.164928,30.19221;120.1646,30.19341;120.16694,30.194172;120.167362,30.19336;120.168656,30.190724', '钱江水晶城', '杭州市滨江区滨盛路4402号', '杭州市', '', '101348.397189', '120.166493,30.191879', '商务住宅;住宅区;住宅小区', '1700', '2.5', '', '58068', '钱江水晶城是继钱江彩虹城后钱江南岸又一座大规模的一线江景高尚住宅园区;钱江水晶城由9幢高层住宅、沿江一线2幢超高层楼王级住宅,以及一条长达270米的商业街区组成,建筑容积率2.5,建筑密度不到18%。    景观设计围绕园区内南北两大景观内庭,以森林、河流、城堡、庄园和广场等自然人文意象,结合经典传承的新欧洲艺术,营造欧洲盛行的新奢华主义特色园林,并在园区内的各个围合空间,结合建筑的公共部位,通过造坡、树阵、水系、园雕和铺装的组合与艺术创意,形成各个组团的主题景观。    尽享滨江区完备教育、商业配套、高新区公建中心、高教园区等大型生活组团簇拥左右,更紧邻滨江区最为成熟的滨盛路生活圈。社区内精心设有尊贵VIP俱乐部、游泳池、欧式风情商业街等丰富多彩的生活配套,奢华品位浑然天成', '2012-08-31', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6Z', '330100', '120.147542,30.171207;120.148153,30.169334;120.148178,30.169195;120.14818,30.169081;120.14815,30.168967;120.146946,30.168605;120.145873,30.170746;120.147542,30.171207', '银爵世纪公寓', '杭州市滨江区浦沿街道715号', '杭州市', '0103000020E610000001000000080000005532005471095E40A5D8D138D42B3E407973B8567B095E40D2191879592B3E4026FF93BF7B095E408FA50F5D502B3E40F67AF7C77B095E40FE5F75E4482B3E40C139234A7B095E406D1ADB6B412B3E40CB11329067095E402CF180B2292B3E40A417B5FB55095E403EEC8502B62B3E405532005471095E40A5D8D138D42B3E40', '32892.202018', '120.147133,30.169934', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC70', '330100', '120.14871,30.167595;120.149002,30.167062;120.149133,30.166892;120.149532,30.166204;120.148373,30.165723;120.14758,30.167207;120.148059,30.167373;120.148488,30.167515;120.14871,30.167595', '星汇荣邸', '杭州市滨江区浦沿街道浦沿路369号(坚塔路和浦沿路交叉口附近)荣邸小区浦沿路与坚塔交叉口', '杭州市', '', '18117.82028', '120.148548,30.166671', '商务住宅;住宅区;住宅小区', '282位', '2.2', '54675平方米', '34234', '已经交房,目前总价再130到150万之间还剩一些89方朝南的尾房,20楼以上,5楼一下,交通:杨家墩站:K706、222(夜间线)、K566。k322、K822、k522、k113(原K402)。', '2010-11-23', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC82', '330100', '120.070257,30.162447;120.070094,30.162284;120.067968,30.161695;120.0677,30.161802;120.065547,30.164117;120.067096,30.165042;120.068694,30.165968;120.069391,30.164364;120.070257,30.162447', '朗郡庭园', '杭州市西湖区斗门路与象山路交汇处', '杭州市', '', '99974.836471', '120.068075,30.163649', '商务住宅;住宅区;住宅小区', '', 'None', '', '27587', '新帝朗郡总建筑面积28万方,其中地上建筑面积20万方,地下8万方,共由9幢高层景观公寓和82套电梯排屋组成。新帝朗郡地处环境优美,自然景观优越的之江国家旅游区中心地带,南临中国美院象山校区约百米,北接西湖国际高尔夫球场仅百余米。    每一套高层户型都根据它周围的景观资源度身定制,绝大多数的住宅拥有不同层次和方向的景观。使住户或饱览高尔夫球场,或远眺望江山、象山山景,让景观充分地渗透至朗郡内部。高层景观公寓的大部分户型均设计有舒适的U型大阳台,最宽开间可达4.8米,最长进深可达6米,提供超越想像的情景式生活。居住者坐卧其中,眼前的风景青绿广袤,更因三面全通透落地玻璃围护的安全感而备感惬意。    对于朗郡的业主来说,入住之后GLOF和艺术在这里完全可以左拥右揽。', '', '1.38-2.7元/月/平方米');
