INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ACLD', '330100', '120.024141,30.232637;120.024051,30.232637;120.023983,30.232668;120.023951,30.23274;120.023699,30.233495;120.023505,30.234395;120.023451,30.234678;120.023266,30.235042;120.023216,30.235218;120.023243,30.235393;120.023288,30.235965;120.023302,30.236528;120.023266,30.236824;120.023212,30.237103;120.023216,30.237212;120.023537,30.23725;120.023869,30.237324;120.024136,30.237577;120.025191,30.237757;120.027182,30.238047;120.027244,30.237637;120.02738,30.236971;120.028056,30.234124;120.028056,30.233989;120.028006,30.23389;120.027921,30.233827;120.024141,30.232637', '盛世嘉园', '杭州市余杭区天目山路延伸段102省道南侧(留下镇西)', '杭州市', '', '177307.129057', '120.025513,30.235417', '商务住宅;住宅区;住宅小区', '1750', '1.42', '290000平方米', '19928', '盛世嘉园位于西湖风景区西扩延伸段,距离西湖仅8公里,而距离杭州武林广场仅12公里。在日益喧闹的都市中打拼的人们,内心深处更加渴望那安宁与纯净的田园风光,期待着接近仿佛渐离我们的绿色自然!目前已经交付的是一期盛华苑,二期盛大苑和三期盛利苑花园洋房三个组团,以及50套典藏排屋和四期盛景苑的小高层公寓,高层单身公寓,即将眩目登场,详情请至电87175188,89080099.盛世嘉园位于天目山路延伸段02省道南侧,距离武林广场仅13公里。小区总占地面积300多亩,建筑面积约29万平方米,绿化率高达35.5%以上。整个楼盘分为六个组团,建有多层、花园洋房、排屋、小高层、小户型公寓。户型丰富多彩,环境优美雅致。盛世嘉园配套建有小区幼儿园、景观戏水池、网球场、综合型会所等配套设施,智能化系统超前设置,在享受自然的同时更能享受到现代化生活的便捷和舒适。由中国美术学院风景建筑设计院进行楼盘环境整体设计。', '2008-12-09', '1.58元/月/平方米');
