INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ACLQ', '330100', '120.007868,30.239165;120.007814,30.239353;120.007776,30.240089;120.007834,30.240538;120.008678,30.240564;120.008747,30.240378;120.008941,30.239488;120.00897,30.239278;120.007868,30.239165', '金都·梧桐苑', '杭州市余杭区闲林镇良睦路', '杭州市', '', '12681.174095', '120.008322,30.239856', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '暂无介绍金都·梧桐苑小区地处闲林,临近西溪风景区。闲林旧称闲林埠,取“闲处林下”之义,相传晋隋年间为风景胜地,宋时置酒库,明清为市集,有着悠久的历史文化和人文积淀。虽经千年变迁,其自然淳朴、青山秀水的田园风光依旧不改。青山碧水、茂林修竹、花香鸟语。鱼儿游跃,宛如世外桃源;柿子树、竹林、芦苇荡,连绵的小池塘与小溪、小河相间,野趣十足,实为不可多得的理想居住之地。  闲林,把城市的喧嚣压抑统统甩在身后,但城市的便捷舒适却不曾离开身边。  随着天目山路延伸段的建设和02省道的拓宽,从市中心到闲林镇一马平川,交通十分便利,随着闲林板块的规模开发,城市配套也逐步完善。学校、医院、银行、超市、文化广场、体育馆等所有生活必需的配套都将拥有,闲林正日益成为成熟的休闲生活社区。  金都·梧桐苑离尘而不离城,座拥山水,只把生活带回家。闲林东处,青山碧水,芦苇蒹葭,更有纵横的溪、河,茂密的竹林、柿树,实为人之向往的桃花源。', '2005-12-18', '1.1元/月/平方米');
