INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ACT2', '330100', '120.156635,30.137744;120.157931,30.1386;120.158628,30.138981;120.159229,30.13834;120.159495,30.138016;120.159905,30.137626;120.160474,30.137185;120.161203,30.136601;120.161407,30.136429;120.161592,30.136292;120.161691,30.136206;120.162072,30.135793;120.16241,30.135204;120.162609,30.134893;120.162973,30.134211;120.163252,30.133538;120.161541,30.13326;120.160897,30.133659;120.159599,30.134791;120.158671,30.13552;120.158205,30.135984;120.156515,30.137645;120.156635,30.137744', '郁金香岸', '杭州市萧山区闻堰镇万达路770号', '杭州市', '', '145338.685678', '120.159964,30.136025', '商务住宅;住宅区;住宅小区', '0.65', '1.52', '300000平方米', '27604', '绿城西子郁金香岸位于闻堰板块沿江6.5公里居住区内,东临万达路,西滨钱塘江,南接已建成的三江花园,北依通和.戈雅公寓,自然环境优美、交通、通讯便捷。  绿城西子郁金香岸建筑造型为新古典主义风格,在规划设计上充分利用了钱塘江的景观资源,通过地下开挖将基地抬高,排屋临江布置,高层沿路排列,整个小区的布局精巧、错落有致、远观简洁、现代,近看精神、典雅,城市天际线丰富、生动,小区住户70%的可以享受到一线江景;单体设计重视户型设计、景观资源的利用,旨在营造出一个满足未来生活需求、充满高尚气质与优雅个性、与钱塘江共生呼吸的现代都市住宅。', '2008-08-31', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ACT3', '330100', '120.172084,30.1276;120.171073,30.127545;120.170069,30.127504;120.169898,30.128775;120.169934,30.129618;120.170013,30.130461;120.171957,30.130408;120.172084,30.1276', '江南摩卡小区', '杭州市萧山区水田畈路89-1号', '杭州市', '0103000020E610000001000000080000008D0A9C6C030B5E4038F8C264AA203E40A20E2BDCF20A5E40B1C403CAA6203E400F441669E20A5E40F31B261AA4203E40F969DC9BDF0A5E40DB8AFD65F7203E409F1EDB32E00A5E4012F92EA52E213E4045B9347EE10A5E40496760E465213E405FD4EE57010B5E4003232F6B62213E408D0A9C6C030B5E4038F8C264AA203E40', '54152.99869', '120.170982,30.128982', '商务住宅;住宅区;住宅小区', '', '2.3', '150000平方米', '25109', '江南摩卡位于萧山闻堰板块中心,距钱塘江仅百步之遥,总建筑面积约15万平方米,规划由多层洋房、小高层、高层组成。优先享用中心成熟商业配套,周边有超市、银行、邮局、中心小学、中民初中、农贸市场、江鲜一条街、大型医院、市民广场、文体娱乐中心等,全面满足衣食住行;紧邻20余亩沿江廊桥公园和滨江公园,美景朝夕相伴,新兴的30000平米商业街区,集购物、餐饮、休闲、娱乐等于一体,城市生活。内配套有杭州蒙特梭利式幼儿园----新天地三江幼儿园,以及摩卡主题会所、社区户外游泳池。', '', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ACT5', '330100', '120.175883,30.127226;120.175838,30.127735;120.179105,30.128094;120.179469,30.124747;120.175559,30.124812;120.17567,30.125416;120.175795,30.126023;120.175915,30.126716;120.175883,30.127226', '三江新村', '杭州市萧山区闻堰镇闻兴路一号', '杭州市', '', '100050.194076', '120.177579,30.126299', '商务住宅;住宅区;住宅小区', '', 'None', '', '20415', '三江新村位于闻堰镇,其地理位置优越、交通便利、环境优雅,是质量较高、配套完善的住宅小区。生活安静,环境优美,生活氛围浓厚等优势为您创造了优良居住环境。社区在规划方面匠心独运,以运动健康为主题,时尚生活为纽带。打造现代都市社区。', '', '');
