INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AD9K', '330100', '120.281284,30.116442;120.280962,30.113055;120.279017,30.113123;120.277291,30.113201;120.276557,30.113312;120.276453,30.113541;120.279753,30.116557;120.281284,30.116442', '华成·天地墅园', '杭州市萧山区通惠北路168号1幢5楼', '杭州市', '0103000020E61000000100000008000000D6389B8E00125E407EE19524CF1D3E40CD5A0A48FB115E4037A6272CF11C3E40CB811E6ADB115E40E86C01A1F51C3E40691EC022BF115E40DFDFA0BDFA1C3E40B69E211CB3115E408E3EE603021D3E406478EC67B1115E4051C1E105111D3E404E7D2079E7115E40B01EF7ADD61D3E40D6389B8E00125E407EE19524CF1D3E40', '98939.379295', '120.279384,30.114549', '商务住宅;住宅区;别墅', '', '1.17', '', '15883', '华成&#8226;天地墅园是由浙江华成置业发展有限公司(中国民营企业500强华成控股集团旗下子公司)开发的住宅项目,紧邻地铁2号线朝阳村站。萧山稀缺纯粹城市排屋区,规划用地约171.1亩。14万方中央纯墅区,其中商业面积近3万方,择址萧山主城与南部卧城生态居住区交汇处,由育才路畅连城市中心,毗邻开元广场等大型城市配套。近享所前镇完善生活配套,以及里士湖的城市稀缺资源。超市、银行、医院、学校近在咫尺,金融、医疗、教育、购物、休闲、娱乐等配套应有尽有,更坐拥南部卧城乃至萧山规模最大、配套最全的全新城市综合体之一开元广场。对有着“小湘湖”之称里士湖的近距离私享,更是天地墅园对城市稀缺资源的绝对占有。190-400方的精心空间规划,汲取美式建筑之精髓,尺度大气,舒适宜居,优雅的私家庭院,大气开阖的室内空间,给予生活无限可能。', '2016年10月', '3元/月/平方米');
