INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ADSO', '330100', '120.190221,30.240425;120.190181,30.240401;120.189834,30.240184;120.189463,30.240168;120.189383,30.240205;120.188835,30.239391;120.188111,30.239792;120.187642,30.240247;120.187892,30.240554;120.188212,30.240878;120.188452,30.241358;120.188739,30.242077;120.189208,30.241868;120.18952,30.241703;120.18988,30.241416;120.189962,30.241241;120.190221,30.240425', '兴隆社区', '杭州市上城区兴隆路', '杭州市', '', '33290.596195', '120.188969,30.240706', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFQY', '330100', '120.229123,30.352005;120.227594,30.35146;120.227113,30.352552;120.229086,30.353209;120.229967,30.353548;120.230591,30.352525;120.229123,30.352005', '丁桥颐景园', '杭州市江干区蕙兰雅路519号', '杭州市', '0103000020E61000000100000007000000BBF083F3A90E5E404A07EBFF1C5A3E4003B16CE6900E5E4027DA5548F9593E40C6DFF604890E5E40AF230ED9405A3E402C7E5358A90E5E4022A7AFE76B5A3E40310A82C7B70E5E40F390291F825A3E4020F0C000C20E5E40BC0512143F5A3E40BBF083F3A90E5E404A07EBFF1C5A3E40', '32905.812803', '120.228816,30.352508', '商务住宅;住宅区;住宅小区', '534个', '2.2', '104294平方米', '26565', '丁桥颐景园项目东至蕙兰雅路、南至明珠路商业街、西至丁桥东路、北至大农港河,处于大型居住区绝佳的地理位置。该项目占地面积37575平方米,容积率≤2.2,建筑密度≤28%,绿化率≥30%,已经方案设计审查的小区开发总建筑面积为104294.19平方米(含地下18680.65平方米),其中建筑面积90平方米以下的套型面积占总住房建筑面积的70%(90平方米以下710套、90平方米以上132套)。整个小区商、住配套齐全。丁桥颐景园项目开发整体立足高起点,充分满足小区整体及住宅单体日照、采光和通风等要求,借鉴颐景园系列产品的成功经验,通过对整体绿化、水面、中央公共活动场地等环境的塑造来调节区域微气候,使居民最大程度的接近自然,感受自然。小区设计遵循“以人为本”的原则,系统性考虑居住行为与住宅环境的关系,重视社区交流空间的营造,提倡新都市时代的社区文化和人文关怀。重视社会效益、环境效益与经济效益三者的有机统一,确保了规划实施的可操作性。为此,小区共计开发12-16层小高层10幢,2层沿街商业2幢,住宅可售面积达76422.12平方米,商业可售面积达5060.82平方米,地下设置汽车停车位355个,其余自行车位、公建配套等指标均到达了杭州市建委审批要求。', '2010-10-26', '1.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFRR', '330100', '120.098752,30.290393;120.098062,30.290392;120.098085,30.290823;120.098592,30.290837;120.098696,30.290822;120.09876,30.290742;120.098752,30.290393', '钱塘·和润园', '杭州市西湖区文幼巷4号', '杭州市', '0103000020E61000000100000007000000899AE8F351065E40C2FC1532574A3E40BEBED6A546065E4021054F21574A3E409ACE4E0647065E40B3EC4960734A3E406CE9D1544F065E407D772B4B744A3E40BF0F070951065E4012F5824F734A3E40CA89761552065E40DA9255116E4A3E40899AE8F351065E40C2FC1532574A3E40', '2691.517901', '120.098413,30.290608', '商务住宅;住宅区;住宅小区', '39个', '2.91', '6388平方米', '37749', '和润园,位于杭州市西湖区古墩路与星艺路交汇处,择邻余杭塘河,南依文新公园,得天独厚的地理优势将西溪湿地与西城广场商圈、印象城沃尔玛、浙大紫金港、城西银泰中心,商业娱乐配套齐全、生活居住环境成熟,而举城繁华皆得,可谓是城西中心最后一块宅地。  和润园,项目占地面积2193平方米,总建筑面积6388平方米,由1幢两个单元13层小高层建筑,主力户型125-138平方米,仅40席。户型层高3米,南北通透、阳光明媚、绿色视野尽入眼帘,约130平米的舒适公馆,满足小太阳家庭及改善型家庭所需。  和润园全外墙干挂石材,以硬朗的线条,考究的线条线脚及经典稳重的色调,形成装饰典雅的新古典主义风格。精细的工艺与考究的材质,形成品质感极强的建筑。精装修酒店式大堂,尊享世家礼仪。挑高近10米酒店式精装大堂及精装电梯前室等公共部位,彰显建筑的典雅、细致及住宅的居住品质,其必将成为城西中心的一座藏品。  和润园拥享成熟的生活区,周边浙大紫金港校区、求是星洲小学、学军小学紫金港校区、翠苑中学文华校区、文新幼儿园等名校云集;西城广场、印象城沃尔玛、城西银泰、多条商业街和绿城医院、浙大医疗中心等举步之遥;交通便捷,多条公交线路及B2快速公交、地铁2号线站点;紧邻政新花园和余杭塘河,幽雅的生活环境,营造城西精品雅致公馆。', '2011-05-06', '3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFSB', '330100', '120.116893,30.289144;120.116948,30.289137;120.117716,30.289191;120.117905,30.289207;120.11794,30.289241;120.117965,30.289277;120.118192,30.289318;120.118213,30.289117;120.118234,30.288752;120.118293,30.288338;120.118315,30.288063;120.118346,30.287689;120.116526,30.28758;120.115672,30.28753;120.115557,30.288446;120.115538,30.288783;120.116113,30.288819;120.116065,30.289406;120.116315,30.289421;120.116778,30.289451;120.116812,30.289446;120.116827,30.289418;120.116848,30.289258;120.116866,30.289163;120.116893,30.289144', '滨江·金色蓝庭', '杭州市西湖区文一西路18号', '杭州市', '', '38608.713423', '120.11695,30.288408', '商务住宅;住宅区;住宅小区', '1000', '2.8', '120000平方米', '47037', '金色蓝庭以板式建筑的开阔布局营造低密度、宽尺度的强烈空间感,大气而时尚。为了充沛的日照,为了更宽的视野,金色蓝庭演绎通透的围合,于是便有了楼间距超过100米的开阔与气魄。在出众的外立面下,蕴藏的是构筑理性建筑品质的细节,处处体现着滨江集团一贯坚守高贵、典雅、内敛的百年经典品质。金色蓝庭内实现人车分流,打造安全恬静的社区空间;超宽地下停车场、地下室与底层双大堂设置更营造舒适居住感受;金色蓝庭的挑高架空层,令建筑与环境完美结合,并增加底层住宅私密性及减少干扰。', '2008-11-06', '2.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFSV', '330100', '120.202919,30.171499;120.200922,30.171495;120.200988,30.173122;120.202909,30.172944;120.202919,30.171499', '江南铭庭', '杭州市滨江区滨文路(滨文路与江虹路交界)', '杭州市', '0103000020E610000001000000050000002B2FF99FFC0C5E40F54BC45BE72B3E4001C3F2E7DB0C5E40726DA818E72B3E40DCB8C5FCDC0C5E40D63730B9512C3E401AC40776FC0C5E40180AD80E462C3E402B2FF99FFC0C5E40F54BC45BE72B3E40', '27407.779294', '120.201915,30.172261', '商务住宅;住宅区;住宅小区', '419个', '2.2', '87300平方米', '30341', '江南铭庭,位于滨江腹地长河街道中心城区东侧,交通便捷,生活配套设施完善成熟。江南铭庭约500米生活半径内超市菜场医院学校银行俱全;同时“北滨江”纯熟生活配套:“星光大道”、华润万家、规划中的物美超市等商业配套。钱江三桥、四桥、一桥以及中河高架联接杭州主城区。江南铭庭,立面造型以简洁,围合式布局,户户开窗见景。此外,江南铭庭还可以享受五重景观,一重景观:江南铭庭依托白马湖旅游度假区,以白马湖为核心的湖景,以冠山为核心的山景,为江南铭庭缔造了天然生态资源;二重景观:西侧紧依万方规划市政公园;三重景观:项目南北两侧沿滨文路与天官路,双向的小区外围绿化带;四重景观:社区内部围合式景观布局,中心绿化及戏水池配套,方便邻里沟通;五重景观:楼幢底层的架空层将景观引入室内空间,配合房间内双层挑高空中花园配置,处处有景。', '2012-06-13', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFSY', '330100', '120.147144,30.189984;120.146989,30.190277;120.148207,30.190675;120.14949,30.191085;120.149431,30.190472;120.149463,30.189138;120.14947,30.188818;120.149311,30.188419;120.1491,30.188155;120.148995,30.188116;120.148826,30.188181;120.148271,30.188486;120.147144,30.189984', '德圣银杏汇', '杭州市滨江区闻涛路与东信大道交叉口向西600米', '杭州市', '', '41010.69157', '120.148536,30.189666', '商务住宅;住宅区;住宅小区', '车位比1:3', '3.16', '190000平方米', '', '中国银杏汇,原乡意大利当代学院派建筑艺术大师邦德亚历维多作品。项目一直致力于营造人文、艺术的品质和品味。项目身处钱塘湾艺术馆的银杏汇,对望西湖世界文化遗产,收藏杭州之江湾,“山、水、塔、桥、城”——杭州精华的自然资源和人文资源,收藏在列。
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFT4', '330100', '120.032969,30.251523;120.032205,30.254638;120.032166,30.254794;120.032084,30.255234;120.033425,30.255513;120.033496,30.254884;120.033595,30.254409;120.033646,30.254121;120.033673,30.253731;120.033737,30.253445;120.03384,30.253179;120.033848,30.253011;120.033911,30.252719;120.033937,30.252432;120.03406,30.25206;120.034146,30.251751;120.032969,30.251523', '华元爱丁郡', '杭州市余杭区宋家湾路北侧', '杭州市', '', '43378.599525', '120.033117,30.253549', '商务住宅;住宅区;住宅小区', '821个车位', '1.8', '136747平方米', '25711', '华元爱丁郡位于余杭区五常街道政府边,紧邻西溪湿地。华元爱丁郡总占地面积为52226.7平方米,总建筑面积近14万平方米,由24幢英伦建筑风格多层住宅组成。  华元爱丁郡区域位置较优越,天目山路延伸段、西溪路、文一西路、五常大道、高教路等通达的交通网络,距黄龙商务区仅约10公里,周边的各项城市配套资源丰富,西溪天堂、省委党校、规划杭师大、小和山高教园区、杭州第十医院、宏丰家居城等城市资源日渐完善,西溪沃尔玛、淘宝城等重量级商业配套也已由规划进入实质性方案阶段,成熟生活配套指日可待。', '2012-08-05', '1.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFT6', '330100', '120.042801,30.280816;120.042759,30.280748;120.042777,30.280014;120.042812,30.279322;120.042844,30.279298;120.043666,30.279392;120.043945,30.279429;120.044193,30.279463;120.044289,30.279472;120.044378,30.279426;120.044472,30.279419;120.045416,30.27953;120.045631,30.279572;120.045614,30.280102;120.045614,30.280373;120.045665,30.280457;120.04574,30.280589;120.045757,30.280677;120.045762,30.280753;120.045757,30.280846;120.045673,30.280987;120.045606,30.281049;120.045502,30.281063;120.042801,30.280816', '华元美林公馆', '杭州市余杭区文二西路和荆长路交汇处', '杭州市', '', '39736.715744', '120.044225,30.280195', '商务住宅;住宅区;住宅小区', '413个', '1.5', '113570平方米', '26521', '华元美林公馆位于杭州市城西,西溪国家湿地公园西北面,文二西路以北,是杭州西溪国际湿地公园旁的生态养生高端人文居住楼盘。西临荆长路,南面为规划支路,东面及北面均为河道。地块有良好的湿地景观资源,同时地块临近大学城,远离城市喧嚣,有着极为稀缺的人文学府资源,同时户户设高端智能安防、户内进口电梯、环保型地源热泵、恒温泳池等的排屋及精装小高层。总用地面积48693平方米,容积率1.6,建筑密度不大于30%。规划拟建地上总建筑面积约77908平方米,地下建筑面积约40000平方米。', '2013-09-28', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFT7', '330100', '120.011131,30.240796;120.011448,30.239471;120.009323,30.239155;120.008876,30.240553;120.008591,30.241557;120.008536,30.241855;120.010841,30.242108;120.011131,30.240796', '蒙卡岸', '杭州市余杭区和睦路', '杭州市', '0103000020E61000000100000008000000323ECC5EB6005E40F30181CEA43D3E40B2666490BB005E402657B1F84D3D3E4070067FBF98005E40C5AC1743393D3E40096EA46C91005E4066F4A3E1943D3E408E0244C18C005E40B01EF7ADD63D3E40AD3594DA8B005E40C45F9335EA3D3E402E1D739EB1005E40981936CAFA3D3E40323ECC5EB6005E40F30181CEA43D3E40', '56075.787111', '120.010011,30.240662', '商务住宅;住宅区;住宅小区', '停车位1074个，设地面停车位67个，地下1007个，车辆配比1：1.01。自行车停车数2488辆。', '2.2', '127000平方米', '24984', '华元蒙卡岸与西溪国家湿地公园仅两街之隔,位于西溪湿地西面约1公里处。项目东侧及南侧为规划道路,西邻沿山河,北靠五常大道。项目东面按规划为城市绿地公园和类似西城广场的商业中心,再往东约600米便是绿城开发的翡翠城大型城市社区,南面和西面分别是金都雅苑、金都梧桐苑社区,北面有五常商业街和闲林商业副中心。  华元蒙卡岸采取南北向排列、周边式布局的方式,从而形成小区中心大面积的绿地景观。人行主入口位于东侧规划道路上。透过公建配套两层高的公共门厅,才是小区的中心景观带。在入口空间处理上,设置了下沉庭院、商业等设施,其中还有回廊、景观桥等元素。同时,通过对中心景观带的精细化设计,使之成为本小区的视觉中心。围绕此中心进行住宅建筑设计,使最大量的住宅能享受到中心绿地景观。    华元蒙卡岸与西溪国家湿地公园仅两街之隔,位于西溪湿地西面约1公里处。项目东侧及南侧为规划道路,西邻沿山河,北靠五常大道。项目东面按规划为城市绿地公园和类似西城广场的商业中心,再往东约600米便是绿城开发的翡翠城大型城市社区,南面和西面分别是金都雅苑、金都梧桐苑社区,北面有五常商业街和闲林商业副中心。  华元蒙卡岸采取南北向排列、周边式布局的方式,从而形成小区中心大面积的绿地景观。人行主入口位于东侧规划道路上。透过公建配套两层高的公共门厅,才是小区的中心景观带。在入口空间处理上,设置了下沉庭院、商业等设施,其中还有回廊、景观桥等元素。同时,通过对中心景观带的精细化设计,使之成为本小区的视觉中心。围绕此中心进行住宅建筑设计,使最大量的住宅能享受到中心绿地景观。', '2012-03-19', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFU6', '330100', '120.126869,30.340386;120.128033,30.34127;120.128982,30.341404;120.129846,30.339298;120.127174,30.339205;120.127062,30.339275;120.126869,30.340386', '天鸿香榭里', '杭州市拱墅区祥园路与通益路交汇处西北', '杭州市', '0103000020E610000001000000070000001478279F1E085E402904728923573E40C3F352B131085E401E1B81785D573E4073F1B73D41085E403DB9A64066573E400DE198654F085E402499D53BDC563E40B2B96A9E23085E40C2A38D23D6563E401EA4A7C821085E40B459F5B9DA563E401478279F1E085E402904728923573E40', '42354.018235', '120.128297,30.340151', '商务住宅;住宅区;住宅小区', '855个', '2.6', '134700平方米', '31586', '天鸿香榭里总占地面积约56亩,位于新城北区域,毗邻京杭大运河,位居运河新城西南侧,通益路与祥运路交叉口。距武林广场仅约6公里,项目建设建筑面积约13.6万方。园区共11栋建筑,采用围合式布局。 
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFUE', '330100', '120.250988,30.19058;120.252136,30.190571;120.253163,30.190575;120.253125,30.190357;120.252924,30.189339;120.252826,30.188875;120.252729,30.188745;120.252586,30.188678;120.252428,30.188646;120.250935,30.188665;120.250944,30.189957;120.250947,30.190117;120.250953,30.19058;120.250988,30.19058', '顺发堤香名苑', '杭州市萧山区金鸡路与博学路的交叉口', '杭州市', '', '35351.016909', '120.251959,30.189648', '商务住宅;住宅区;住宅小区', '', '2.5', '135000平方米', '31848', '顺发堤香位于萧山板块、金城路以北,北临北塘河,东至金鸡路,西至城北中心小学,为萧山新区地段。顺发堤香,占地60余亩,总建筑面积约13.5万平方米,由4幢时尚高层与54席城市法式宅屋共同组成。', '2011年07月', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFUF', '330100', '120.131531,30.314312;120.130245,30.312807;120.130145,30.312704;120.129635,30.312997;120.129097,30.313284;120.128366,30.313732;120.128022,30.31394;120.127777,30.314085;120.127567,30.314213;120.12759,30.314381;120.127801,30.314725;120.127892,30.314867;120.127939,30.315032;120.129152,30.314974;120.129484,30.314889;120.129772,30.314804;120.130801,30.314735;120.131696,30.31467;120.131691,30.314496;120.131531,30.314312', '顺发·吉祥半岛', '杭州市拱墅区登云路118号', '杭州市', '', '49915.930899', '120.129599,30.314089', '商务住宅;住宅区;住宅小区', '1133个,配比1:1', '2.5', '175370平方米', '43938', '顺发吉祥半岛位于拱墅区登云路与通益路交叉口,处拱墅区桥西板块,京杭大运河西侧,享运河商务区、区政府运河文化广场等醇熟配套。项目占地近83亩,总建筑面积约17万方,其中地上建筑面积约为13.8万方。整个小区由9幢高层、9栋沿河排屋、部份商业用房联袂组成。承延古老运河千年情愫,南北更拥小河直街、桥西两大历史文化街区以及五大博物馆,人文气息浓厚。INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFVD', '330100', '120.356288,30.292129;120.357908,30.292107;120.35771,30.291399;120.355877,30.29144;120.35584,30.291533;120.356288,30.292129', '和达自由港', '杭州市江干区下沙12号大街与11号大街交叉口', '杭州市', '0103000020E6100000010000000600000044FD2E6CCD165E40933655F7C84A3E4083BEF4F6E7165E40C4EE3B86C74A3E40F0DC7BB8E4165E404C16F71F994A3E40831953B0C6165E400ABFD4CF9B4A3E40F4A62215C6165E406CB41CE8A14A3E4044FD2E6CCD165E40933655F7C84A3E40', '11352.877996', '120.356922,30.29176', '商务住宅;住宅区;住宅小区', '208个（地下171个，地上37个）', '3.5', '42000平方米', '16163', '项目占地面积9527㎡,建筑面积:约4.2万㎡,位于杭州经济技术开发区制造产业的核心区域,北临十二号路,西倚十一号路,南靠邻里社区,东接绕城高速的高架路,周边由绿化带及水系所环绕。项目包括杭州物流信息交易中心、极具创新意识的LOFT户型及单身公馆。其中,杭州物流信息交易中心将汇聚省内数百家企业,容纳多元化信息于一体,繁荣氛围触手可及。', '2010-09-12', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFVQ', '330100', '120.290719,30.213673;120.290529,30.2126;120.289052,30.212834;120.289314,30.213942;120.290719,30.213673', '凯丽晶座', '杭州市萧山区萧山萧山区通惠北路718号(通惠北路、振宁路路口)', '杭州市', '0103000020E61000000100000005000000DA54DD239B125E40C8091346B3363E408962F20698125E402D211FF46C363E40FAB5F5D37F125E40147AFD497C363E409911DE1E84125E40A73D25E7C4363E40DA54DD239B125E40C8091346B3363E40', '14818.959219', '120.289898,30.213259', '商务住宅;住宅区;住宅小区', '500余个', '3.5', '87000平方米', '18672', '红景凯丽晶座位于萧山区南北主通道-通惠北路、振宁路路口,西接钱江世纪城,与万向集团、传化股份相邻,宁围镇商业街区近在咫尺,距建设中的地铁2号线振宁路站(市心北路、振宁路路口)约1800米,将于2010年年底通车的庆春路隧道,以及将于2012年通车的九堡大桥,瞬间贯通杭州主城与本项目,交通十分便捷。公交K720、K708支线、K316等线路经过本项目并在附近设站。    项目占地13575平方米,总建筑面积约7.8万平方米(其中地下室1.95万平方),为商业和住宅综合体,主要由1#、2#、3#和4#楼组成:    1#、2#楼为70年产权住宅,1#楼总高18+1(跃)层,高度约57米,1层、2层为商业,3层以上为住宅,分2个单元,每个单元1梯3户,户型为A户型86㎡三房、B户型82㎡两房和C户型87㎡三房,共96户;2#楼总高28层,高度约84米,1层架空,层高4.2米,为室内景观休闲空间,2层以上为住宅,一层4户,户型为E户型90㎡两房和D户型132㎡三房,共108户。住宅层高2.9米,均为毛坯交房,共计204户。    3#、4#楼为40年产权、商业性质,高度均约99米,1-4层为商业裙房,5层为屋顶花园和物业管理等配套用房,6-8层为层高3米的单身公寓,户型面积为52-76㎡,一层12户,共72套;9-22层为层高4.79米的居家型LOFT户型,户型面积为52-76㎡,可内部隔成2层,使用空间成倍增加,经局部挑空或挑高后,空间高敞,可演变为两房两厅两卫或三房两厅两卫户型,共计336套。单身公寓和LOFT户型共计408套,均为精装修交房,拎包入住。    4幢建筑联合组成一个地下2层的地下室,建筑面积约1.95万平方米,地下一层设置3个非机动车停车区(分别在1#、2#、4#楼下)、配电房、弱电机房、立体式机动车停车区等,地下二层设置消防水泵房、生活水泵房、人防工程、立体式机动车停车区等,地下车位总计约500个。    整体建筑为框剪结构。外立面采用现代Artdeco(新古典主义)艺术手法,呈现浓厚的简欧风格,裙房外立面以花岗岩干挂、主楼立面以暖色的面砖饰面,温馨自然,浑然一体,充满质感,稳重大气。楼内采用富士达(日本品牌、中国生产)电梯,1#、2#楼住宅电梯速度1.75米/秒,3#、4#楼电梯速度为2米/秒。    小区中央景观区、屋顶花园、空中庭院构成清新自然的多层次立体绿化,优雅生活由此展现。    凯丽晶座于2010年3月1日正式开工,11月到达±0.00层,12月8日1#楼住宅开盘预售,当天售馨。目前正在进行建筑上部结构施工,计划于2011年8月主体结构封顶,2012年3月竣工验收。该项目计划于2011年6月份开盘预售4#楼精装LOFT公寓和单身公寓,共计204套。此次推出的LOFT公寓,为萧山所罕见,通过隔层和精装修,使用面积拓展80%~120%,采用局部挑高或挑空的手法,将空间的层次感和高昌感发挥到了极致。装修采用现代简约风格,小资情调,深受年轻一族喜爱。    项目计划于2012年整体竣工交房。', '2016-06-30', '1.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFVT', '330100', '120.131678,30.315736;120.13168,30.314774;120.130698,30.314781;120.130171,30.314809;120.129801,30.314832;120.129775,30.314839;120.129569,30.314896;120.12937,30.314967;120.129129,30.315024;120.128863,30.31504;120.127936,30.315085;120.127942,30.315162;120.127982,30.31539;120.127988,30.315792;120.127958,30.316025;120.127931,30.316152;120.127879,30.316294;120.127827,30.316456;120.127827,30.31649;120.127875,30.31651;120.129775,30.316426;120.131376,30.316309;120.131634,30.316177;120.131678,30.315736', '嘉凯城·名城公馆', '杭州市拱墅区登云路与通益路交叉口', '杭州市', '', '51059.578114', '120.129839,30.315652', '商务住宅;住宅区;住宅小区', '913个', '2.5', '150000平方米', '46982', '名城公馆地处拱墅区桥西板块,距京杭大运河仅500米,该板块云集了众多历史博物馆,周边生活配套完善,文化氛围浓郁,且随着众多成熟大型居住区逐渐落成,居住氛围将更加浓厚。     名城公馆在规划设计上,充分利用地段南面和西面的自然河道和东侧的20米宽的公共绿化带的景观打造一个舒适宜人的滨水生活社区。在空间布局上,总体思路采用南低北高的建筑形态,并充分利用南面优越的景观资源,在河道交汇处布置个低层住宅组团,小区总体具备较好的景观和朝向。小区在规划上,尽可能大的创造了内部的大庭院,中心景观区17000平方米,同时社区中间东西向的中央和各层的底层架空相结合,使庭院景观和河道水景互相交融,住户能在首层享受到更大的庭院绿化,同时结合具体的功能划分了若干活动区,为老人健身、小孩玩耍、中青年人休闲创造出不同的生活情境。小区建筑风格典雅大气,追求ART DECO的设计风格, 外墙材料基本为干挂米黄色花岗岩,力求通过打造精致的细部,创造清新和谐的社区形象,将着力打造成为城市中的藏品。     本项目预计2011年上半年开盘,80—250平方米多元户型配置,主力户型为80~140平方米,预计将在2013年交付使用。', '2013-04-11', '2.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AFVU', '330100', '120.111704,30.304296;120.111326,30.304113;120.109103,30.30663;120.110239,30.307452;120.11146,30.30846;120.111556,30.308506;120.111647,30.308532;120.111727,30.30854;120.111812,30.308528;120.111892,30.308506;120.111978,30.308447;120.112292,30.308205;120.112838,30.307855;120.114195,30.30686;120.112719,30.305;120.112315,30.304645;120.111763,30.304324;120.111704,30.304296', '欣盛·东方福邸', '杭州市拱墅区益乐路萍水街交汇处往北100米', '杭州市', '', '110516.113973', '120.111668,30.30642', '商务住宅;住宅区;住宅小区', '配比1:0.7', '2.6', '295817平方米', '41082', '欣盛东方福邸项目位于申花板块核心,地处益乐路与水月街交叉口,总建筑面积约38万方,与银泰城(在建)、沃尔玛(开业)、印象城(开业)咫尺之遥,承接浙大紫金港校区的书香厚泽,比邻西溪湿地的氤氲诗意。定位为二次改善型高端公寓,并承袭东方润园的品质特征,汇集其原班设计团队香港刘伍建筑师事务所、香港PAL室内设计公司(梁景华),并联袂加拿大奥雅景观规划设计事务所,在保留与传承东方润园设计精髓上,结合东方福邸自身地块特色,将15、16号两个地块统一进行规划、设计,实现建筑、景观、户型等同步设计,以期在城西创造出一个完美符合人居需求的产品。', '2013-01-19', '3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BCZU', '330100', '120.180649,30.293489;120.180579,30.292899;120.17942,30.292936;120.179384,30.292956;120.179365,30.293007;120.179538,30.2936;120.180649,30.293489', '浙报集团创业人才公寓', '杭州市下城区文晖街道东新街道江南巷5号浙报集团', '杭州市', '0103000020E6100000010000000700000087C3D2C08F0B5E405ABC5818224B3E400AD6389B8E0B5E40F607CA6DFB4A3E40E40F069E7B0B5E4031D28BDAFD4A3E403E5B07077B0B5E40BF2A172AFF4A3E40034356B77A0B5E40C37FBA81024B3E40E998F38C7D0B5E40091B9E5E294B3E4087C3D2C08F0B5E405ABC5818224B3E40', '6751.040263', '120.180016,30.293228', '商务住宅;住宅区;宿舍', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BD1H', '330100', '120.169307,30.279877;120.167191,30.279319;120.167221,30.279194;120.167298,30.278752;120.167304,30.278698;120.16728,30.278629;120.167272,30.278601;120.167615,30.278513;120.16765,30.278497;120.167666,30.278363;120.168591,30.278571;120.168792,30.278601;120.169551,30.278724;120.169307,30.279877', '武林府', '杭州市下城区中山北路600弄80号', '杭州市', '', '21245.415712', '120.168403,30.279084', '商务住宅;住宅区;住宅小区', '1:1.2', '3', '140000平方米', '50929', '', '2012-09-30', '7.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BD1N', '330100', '120.18308,30.272392;120.182792,30.272316;120.18275,30.272396;120.182701,30.272518;120.183021,30.272645;120.182873,30.272926;120.18283,30.273192;120.183743,30.273268;120.183716,30.273526;120.184971,30.273606;120.185043,30.27295;120.18467,30.272915;120.184519,30.272899;120.184348,30.272841;120.183949,30.272718;120.183502,30.272552;120.18308,30.272392', '永康苑', '杭州市下城区潮鸣街道体育场路38号', '杭州市', '', '15115.146725', '120.183896,30.273046', '商务住宅;住宅区;住宅小区', '0.5', 'None', '50000平方米', '32386', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BD1X', '330100', '120.193639,30.223998;120.193761,30.223967;120.195127,30.222667;120.195144,30.222562;120.195098,30.222467;120.192875,30.221316;120.19277,30.221312;120.192671,30.221364;120.191673,30.222335;120.191642,30.22241;120.191664,30.222484;120.193534,30.223973;120.193639,30.223998', '滨江·阳光海岸', '杭州市上城区之江路与甬江路交叉口', '杭州市', '', '46058.131198', '120.193368,30.222608', '商务住宅;住宅区;住宅小区', '配比1：2', 'None', '120000平方米', '72884', '滨江.阳光海岸位于钱江新城区域,之江路与甬江路交界地段。在这块杭城富潜力和璀璨未来的领地,它正对秀丽亦壮观的钱塘江,背靠凤凰山,承接江的浩瀚、山的秀美以及城市的繁华。滨江.阳光海岸,以她涵而不露的低调奢华,于50亩一线临江土地上规划2幢半月型建筑,所有198席空间户户直面浩瀚钱塘江,抒写浙江全江景奢华豪宅传奇。', '2009-04-06', '6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BD2R', '330100', '120.183101,30.272359;120.183454,30.272475;120.183815,30.272617;120.183875,30.272619;120.183908,30.272598;120.183923,30.272547;120.183981,30.271864;120.183979,30.271822;120.183947,30.271785;120.183765,30.271664;120.183787,30.271505;120.183143,30.271476;120.183135,30.271488;120.183113,30.271916;120.183089,30.272333;120.183101,30.272359', '天赐苑', '杭州市下城区体育场路38号', '杭州市', '', '7367.916887', '120.183533,30.27202', '商务住宅;住宅区;住宅小区', '', 'None', '', '34244', '天赐苑位于体育场路与环城东路。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BDCF', '330100', '120.179087,30.270815;120.179039,30.271234;120.178914,30.27159;120.179106,30.271633;120.179756,30.271775;120.179915,30.270918;120.179129,30.270821;120.179087,30.270815', '东河春晓公寓', '杭州市下城区建国北路557-579号(东至建国北路,南至宝善宾馆)', '杭州市', '0103000020E61000000100000008000000E1085229760B5E402844C02154453E40596DFE5F750B5E40329067976F453E40FBB2B453730B5E40AFEB17EC86453E401D210379760B5E40AE8383BD89453E40A0504F1F810B5E40D3DEE00B93453E40D44334BA830B5E40D2E5CDE15A453E40F9307BD9760B5E40ED116A8654453E40E1085229760B5E402844C02154453E40', '6258.344415', '120.179435,30.27128', '商务住宅;住宅区;住宅小区', '地上120个，地下150个', '4', '23120平方米', '', '东河春晓位于宝善宾馆北侧,东靠建国路,西临东河,北面为东河绿化地块。顺应地形、地貌,塑造了优美宜人的绿色景观,环 境的均好性营造了家园感和归属感,并充分利用了地块内及周边丰富的自然景观、空间等,多方面提高环境质量,重视街景及区域内部的空间形态,创造了一个高技术,高水平,高情感的新世纪高尚园区,塑造了新世纪的城市容貌,体现现代风貌以及地方韵味,在设计和建筑中体现出以人为本的人文思想和精神理念。', '2004-05-24', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BDNY', '330100', '120.161272,30.268228;120.160982,30.268207;120.160964,30.268271;120.160947,30.26832;120.160891,30.268372;120.160864,30.268396;120.160853,30.268427;120.160856,30.26855;120.160855,30.268603;120.160863,30.268654;120.160916,30.268683;120.161006,30.268695;120.161235,30.268708;120.161272,30.268228', '延龄苑', '杭州市下城区直戒坛寺巷内(武林路158号码)', '杭州市', '', '1589.481189', '120.16107,30.268466', '商务住宅;住宅区;住宅小区', '', '1.8', '', '57087', '学区房,市中心成熟社区,配套设施全', '', '0.80元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BDUR', '330100', '120.118551,30.296965;120.118444,30.296958;120.118376,30.29792;120.118841,30.297936;120.118839,30.298221;120.119858,30.298205;120.119936,30.29817;120.119903,30.298016;120.119761,30.297831;120.119412,30.297618;120.119049,30.297366;120.118671,30.297027;120.118551,30.296965', '庆云居', '杭州市拱墅区登云路615号附近', '杭州市', '', '9645.891729', '120.119028,30.297724', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BDVA', '330100', '120.134381,30.321673;120.134329,30.321589;120.134215,30.321533;120.132108,30.321639;120.132047,30.32167;120.132004,30.321733;120.132017,30.323135;120.132082,30.323245;120.132214,30.323319;120.133886,30.323457;120.133997,30.323429;120.13406,30.323381;120.134381,30.321673', '风景大院', '杭州市拱墅区风景街358号', '杭州市', '', '36097.47585', '120.13315,30.322461', '商务住宅;住宅区;住宅小区', '地上39个,地下400个', '2.7', '10平方米', '42536', '金瑞城市风景位于杭州拱墅区拱宸桥西,通益路与风景街交界处,总建筑面积约7.6万平方米,由3幢现代风格的板式高层住宅、多主题立体景观庭院及商业街构成。金瑞城市风景坐享优势品牌教育圈,与卖鱼桥小学及大关中学为邻,孩子迈出小区,家对面就是学校。卖鱼桥小学教育集团文澜校区是目前杭州市教育规模最大,设施、设备最完善的国际化一流名校之一,是杭州市教育局、拱墅区政府重点打造的百年名校。不仅如此,与项目隔街对望的文澜中学,还有杭州求事高级中学、源清中学、红缨幼儿园等众多教育质量居全市前列的名校都在家门口,孩子成长无忧,家长更放心。金瑞城市风景周边交通便利,城市公交、城市主干道、运河巴士共同构筑立体交通体系,上塘高架、登云路、莫干山景观大道等城市大动脉顺畅地联动了项目和周边区域,人们可随心所欲地驾车穿梭于运河文化广场、武林广场、黄龙体育中心、西湖大道等地。金瑞城市风景周边环绕着缤纷如云的配套设施,各大银行、邮政中心、医院、商务大楼、世纪联华、农贸市场等生活风景,loft文化公园、运河天地公园、运河八景等自然风景,运河博物馆、3个国字号博物馆、运河图书馆等人文风景,项目便处于所有资源环绕的中心,尽享桥西核心生活区带来的无限便利和惬意。金瑞城市风景主力户型面积为86-200平方米,包括平层、创意跃层等多类别户型,拥有超值可延展空间,让购房者能以更少付出收获更多价值。', '2009-10-02', '1.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BDXJ', '330100', '120.15842,30.265057;120.158103,30.264929;120.158028,30.264994;120.157899,30.265115;120.157582,30.265378;120.157537,30.265567;120.15787,30.265644;120.158339,30.265413;120.15842,30.265057', '耀华湖滨阁', '杭州市下城区湖滨街道孝丰路19号', '杭州市', '', '3342.000559', '120.158005,30.265311', '商务住宅;住宅区;住宅小区', '', 'None', '20227平方米', '57825', '耀华.湖滨阁,位于西湖景区东北侧,近西湖圣塘景区,14层高度,于众多近湖建筑中脱颖而出,拥揽西湖,达观全景。真正观湖豪宅,稀世珍藏,尊崇无比。主力户型115—125平方米。', '2008-06-20', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BDY7', '330100', '120.194754,30.296226;120.194128,30.296179;120.194071,30.296179;120.194036,30.296439;120.194363,30.296455;120.194697,30.296473;120.194754,30.296226', '百合公寓(池塘庙路)', '杭州市江干区石桥路与池塘庙路交叉口', '杭州市', '0103000020E61000000100000007000000F9307BD9760C5E4093399677D54B3E403ACFD8976C0C5E4011C30E63D24B3E408786C5A86B0C5E4011C30E63D24B3E40C98FF8156B0C5E404A42226DE34B3E405B238271700C5E4056BC9179E44B3E4047E867EA750C5E40A2258FA7E54B3E40F9307BD9760C5E4093399677D54B3E40', '1577.080859', '120.194387,30.296327', '商务住宅;住宅区;住宅小区', '配比1:1', '2.2', '15510平方米', '31822', '小区配套成熟、交通便利', '2005-09-11', '1.20元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BDZN', '330100', '120.21564,30.273488;120.214883,30.273131;120.213947,30.274847;120.21399,30.274915;120.215126,30.275414;120.215258,30.275398;120.215395,30.27529;120.215836,30.274717;120.216457,30.273948;120.216389,30.273829;120.21564,30.273488', '水湘人家东苑', '杭州市江干区兴水弄与水湘路交叉口东北100米', '杭州市', '', '28904.11011', '120.215155,30.27431', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '小区位于江干区新塘路与景芳路交叉口,公交有B支1路、K64路、K196路、305/K305路通达,靠近地铁火车东站站(4号线、1号线),交通十分便利。小区建成于2000年,共12栋,1344户,绿化率10%。附近有三新幼儿园、新州大地幼儿园、景芳中学、景华小学、光明小学、浙江大学管理学院、太平洋电器商场、江干区人民医院景湖社区卫生服务站、中国银行新塘支行、建设银行景苑分理处、世纪之星假日酒店等设施,生活便利。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BE0L', '330100', '120.170127,30.264523;120.170155,30.263556;120.169064,30.263555;120.169038,30.264533;120.170127,30.264523', '清远里', '杭州市下城区中山北路256号', '杭州市', '0103000020E61000000100000005000000A94A5B5CE30A5E40310A82C7B7433E400E10CCD1E30A5E4022AAF06778433E4095BBCFF1D10A5E4081B2295778433E400072C284D10A5E4078B6476FB8433E40A94A5B5CE30A5E40310A82C7B7433E40', '9646.351338', '120.169595,30.264042', '商务住宅;住宅区;住宅小区', '', 'None', '', '40462', '具有价格优势,周边配套齐全总栋数6 多层栋数6总户数447 多层户数447,6幢。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BE2S', '330100', '120.111746,30.298512;120.111722,30.296945;120.111722,30.296822;120.11173,30.296741;120.112764,30.296758;120.113086,30.296765;120.113164,30.296802;120.113174,30.296839;120.113182,30.297408;120.113199,30.298747;120.112692,30.298714;120.112139,30.29862;120.111746,30.298512', '西铭苑', '杭州市拱墅区益乐路附近', '杭州市', '', '25201.794627', '120.112472,30.297709', '商务住宅;住宅区;住宅小区', '', 'None', '', '33798', '“西铭苑”为高层住宅项目,由浙江省监狱管理局开发,座落于杭州市拱墅区祥符镇阮家桥。本项目总占地面积28394平方米,总建筑面积105487.8平方米,包括地上面积85038.3平方米、地下面积20449.5平方米。项目主体为7幢高层住宅。项目总户数为671户。项目预交付时间为2009年9月30日。', '', '1.58-1.85元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BE4U', '330100', '120.105987,30.297495;120.106299,30.295522;120.106379,30.295011;120.106404,30.294849;120.106902,30.29497;120.107532,30.295138;120.107568,30.295283;120.107375,30.295974;120.107112,30.296698;120.10692,30.29741;120.106875,30.29757;120.105987,30.297495', '芳满庭', '杭州市拱墅区丰潭路366之1-3', '杭州市', '', '24948.058837', '120.106727,30.296191', '商务住宅;住宅区;住宅小区', '385', '3', '71000平方米', '40747', '华元芳满庭只有顶楼房源了,130-250㎡的顶楼平层、跃层,1822层高层顶楼,起价16800元/㎡,还有12-13套房源。预计将在2009年底交付。  芳满庭是杭州华元房地产集团有限公司在杭城市中心的开山巨作,也是城西独具一格的公馆气质楼盘。芳满庭占地23000余m2,地上总建筑约71000余m2,东南两面临河,北面是规划中的银泰百货和欧尚超市,西面是省府机关公务员社区——政苑小区。地理环境优越,坐享城西中心的无限繁华,生活配套十分齐全。建筑富有创新,大庭院小公馆设计,户型中带有精美空中庭院和入户花园,城市罕有', '2007-11-05', '1.45元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BE56', '330100', '120.105384,30.30269;120.105405,30.30199;120.105419,30.30048;120.105369,30.300445;120.102302,30.300403;120.102313,30.300815;120.102317,30.301007;120.102253,30.301719;120.102304,30.302186;120.102383,30.30248;120.102803,30.302438;120.102833,30.302591;120.102923,30.302656;120.102997,30.302667;120.103822,30.302709;120.10538,30.302766;120.105384,30.30269', '和苑', '杭州市拱墅区祥符街道萍水西路528号', '杭州市', '', '63568.967814', '120.103881,30.301548', '商务住宅;住宅区;住宅小区', '', '1.76', '44000平方米', '39032', '与政苑小区同样是省直政府人员经济适用房,完善的周边配套,尽职负责的物业管理,以及与之围绕并将不断完善的交通,使得和苑小区注定与众不同。', '', '0.8-1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BE58', '330100', '120.100785,30.306562;120.100996,30.306614;120.101241,30.306657;120.101515,30.306703;120.101753,30.306768;120.101998,30.306799;120.102154,30.306789;120.102248,30.306756;120.102294,30.306673;120.102329,30.306494;120.102448,30.305991;120.102644,30.305181;120.102569,30.30503;120.101339,30.304857;120.10116,30.304949;120.100625,30.306529;120.100785,30.306562', '上郡', '杭州市西湖区申花路以南丰潭路以西浙大紫金港校区以东800米', '杭州市', '', '25669.225654', '120.101683,30.305835', '商务住宅;住宅区;住宅小区', '0.8', '2.5', '100000平方米', '43727', '协安上郡位于城西申花路板块,浙大紫金港校区以东约800米。小区东至东环河,南至方家北路,西至姜家门路,北至虾龙圩河,与城市主干道——申花路、丰潭路、古墩路、萍水路(规划)相近,是杭州市区稀缺的双水岸学院气质精致社区。协安上郡总建筑面积约10万平方米,由10栋16-17层高层建筑组成,小区内具有浓郁学院气息的林荫道,与下沉式庭院、组团花园、景观架空层等景观元素有机结合,自然和谐。', '2009-10-19', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BE68', '330100', '120.107657,30.300597;120.107144,30.300458;120.106721,30.300439;120.106704,30.302259;120.107115,30.302273;120.107376,30.302295;120.107637,30.30234;120.108041,30.302454;120.108404,30.302614;120.109247,30.301257;120.108229,30.300796;120.107657,30.300597', '昆仑橡树园', '杭州市拱墅区萍水街450号', '杭州市', '', '33906.76293', '120.107773,30.3015', '商务住宅;住宅区;住宅小区', '地上车位:37个/地下车位:400个', 'None', '100000平方米', '43206', '昆仑橡树园是昆仑置业继绿洲之馨、银座大厦、水印城、红苹果之后在杭州开发的又一力作。昆仑橡树园座落在城西新贵之地丰潭路区块的核心地段,萍水路与丰潭路交叉口,总建筑面积约10万平方米。小区南拥规划中的银泰百货、富强商业广场和沃尔玛,西接政苑小区,浙大紫金港校区、祥符中心小学以及诸多规划中中小学校环伺四周,文化氛围浓郁。园区由10幢小高层、高层建筑围合组成,绿化率达30%,60-130㎡的经典空间。', '2008-02-02', '1.4元/月/平方米');
