INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BET2', '330100', '120.16848,30.310717;120.167804,30.310709;120.167788,30.31143;120.168483,30.311449;120.16848,30.310717', '裕丰青鸟香石公寓', '杭州市下城区颜三路190号', '杭州市', '0103000020E61000000100000005000000ED815660C80A5E40AD4F39268B4F3E40D508FD4CBD0A5E40A79201A08A4F3E40522AE109BD0A5E4048FE60E0B94F3E40A5BBEB6CC80A5E40355F251FBB4F3E40ED815660C80A5E40AD4F39268B4F3E40', '4533.31965', '120.16814,30.311078', '商务住宅;住宅区;住宅小区', '443个', '2.2', '77000平方米', '49014', '裕丰青鸟香石公寓位于杭州下城区香积寺路与白石路交汇处。南临颜三路,西临红西河,北至杜家桥河、新西路,东至再行路,与城北体育公园仅260米左右,紧邻创新创业新天地核心区,近临上塘路、德胜快速路等城市主干道,交通便捷。裕丰青鸟香石公馆总建筑面积77000余方,一期容积率2.2,二期容积率3.2,规划5幢精致典雅的新古典主义高层建筑。裕丰青鸟香石公寓具有以下几个特点:1.它是香积寺路上的首座公园洋房;2.地处老城区便利繁华的生活圈;3.建筑风格为新古典主义建筑风格;4.拥有4.45m层高的休闲连廊;5.注重门的设计;6.设有双大堂;7.营造法式庭院;8.由国家一级资质的浙江南都物业管理有限公司担纲物业管家;9.拥有高速电梯、可视对讲系统、地下停车管理系统、光纤入户、背景音乐、周界报警系统等智能化配套;10.户型设计方正实用,南北通透,多为可生长设计。', '2012-09-08', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BETH', '330100', '120.18611,30.234971;120.185689,30.234579;120.184641,30.2352;120.184598,30.235272;120.184635,30.235349;120.186155,30.237209;120.18623,30.237328;120.187243,30.23678;120.187914,30.236368;120.187114,30.235775;120.18611,30.234971', '望江新园二园', '杭州市上城区上城秋涛路汽车南站旁边', '杭州市', '', '38509.292351', '120.186158,30.235954', '商务住宅;住宅区;住宅小区', '', '2', '140000平方米', '25019', '2009年交付新小区, 靠近汽车南站。全部为高层楼房 大型住宅区 离钱江新城很近 距地铁口只有100米 ,小区很大 三期的还在造,旁边还有个华山美容医院,交通极为便利。周边配套齐全。', '', '0.75元/月/平方米');
