INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BFFY', '330100', '120.175501,30.23294;120.175417,30.232966;120.175011,30.233133;120.174919,30.233191;120.175331,30.233832;120.175771,30.234514;120.176454,30.234147;120.176413,30.234063;120.17586,30.233439;120.175579,30.233112;120.175501,30.23294', '响水坝', '杭州市上城区上城江城路470-492号', '杭州市', '', '9688.048303', '120.175673,30.233729', '商务住宅;住宅区;住宅小区', '', '1.4', '', '34994', '老小区,交通便利,户型好,结构正气周边环境:太庙公园,世纪联华超市,金衩袋巷菜场,紫阳幼儿园,抚宁巷小学,建兰中学。离城站火车站3站', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BFNG', '330100', '120.200241,30.292268;120.199854,30.291911;120.199781,30.291997;120.199679,30.292078;120.199152,30.292428;120.198803,30.292676;120.198888,30.292838;120.199429,30.293673;120.199561,30.293826;120.199684,30.293741;120.200164,30.293335;120.200351,30.29316;120.200585,30.292955;120.200908,30.292715;120.200517,30.292452;120.200241,30.292268', '东方丽都', '杭州市江干区范家路附近', '杭州市', '', '18147.408151', '120.199779,30.292834', '商务住宅;住宅区;住宅小区', '', '2.6', '48000平方米', '34802', '东方丽都花苑位于江干区,东南西面比邻范家村,北靠机场路,是杭州现代化城市新中心——新火车东站区块的核心,也是政府1500亿“决战东部”规划区块的核心。东方丽都花苑拟建成5幢现代高品质的高层住宅,以围合式布局的模式,赋予居者优质生活感受。', '', '1.75元/月/平方米');
