INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BG7J', '330100', '120.193524,30.224123;120.191544,30.222526;120.190481,30.223441;120.19047,30.223482;120.190504,30.223487;120.190608,30.223506;120.19075,30.223607;120.191153,30.223982;120.191519,30.224328;120.191682,30.224472;120.191832,30.224606;120.192271,30.225004;120.192294,30.225025;120.192339,30.225066;120.192441,30.22497;120.193524,30.224123', '新绿园', '杭州市上城区鲲鹏路97号', '杭州市', '', '32131.827403', '120.191996,30.223791', '商务住宅;住宅区;住宅小区', '', 'None', '118000平方米', '65728', '新绿园是钱塘江北岸高尚住宅区的典藏之作,也是绿城在杭州开发的纯住宅精装修项目。新绿园规划布局采用围合建筑形式,形成安定、和谐、完整的内院式住宅组群,赋予业主更多的领域感和归属感。园区内设高档会馆及景观泳池,集高起点的生活、休闲、娱乐于一体,使得整个社区具有了更强的精神归属感。新绿园传承绿城城市公寓营造经验,恰当表达新古典主义建筑风格精髓,建筑整体隽秀挺拔,端庄典雅。外立面全部采用干挂花岗岩石材铺砌,色彩丰润、凝炼,具大家之气,凸显尊贵感,历久而弥新。', '2008-08-21', '3.5元/月/平方米');
