INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BI55', '330100', '120.229186,30.191563;120.229191,30.19186;120.230897,30.191798;120.23257,30.19175;120.232579,30.191106;120.232581,30.19104;120.232632,30.190997;120.233717,30.190777;120.233731,30.190765;120.23374,30.190745;120.233738,30.190703;120.233701,30.190454;120.233682,30.190442;120.233657,30.190434;120.230926,30.190435;120.230856,30.190419;120.2308,30.190375;120.230761,30.190314;120.230738,30.190254;120.230683,30.189725;120.230606,30.189502;120.230579,30.189435;120.230446,30.188895;120.230427,30.188854;120.230364,30.188848;120.229095,30.189381;120.228998,30.189453;120.228935,30.189567;120.22892,30.189682;120.229046,30.190191;120.229104,30.190583;120.22914,30.190951;120.229186,30.191563', '温兴风情苑', '杭州市滨江区西兴路750号-1', '杭州市', '', '67428.514938', '120.230715,30.190687', '商务住宅;住宅区;住宅小区', '1:0.55', '2', '160000平方米', '27238', '温兴风情苑地处滨江区西兴街道占地面积66000余平方米总建筑面积16万余平米由8栋高层和18幢多层的现代建筑组成现代造型、简洁立面空间人性规划生态布局缔造集现代、尊贵、舒适、健康于一体的纯水岸绿色住宅  温兴风情苑坐踞西兴街道核心东临西陵路、南接古塘路、西邻西兴路北依北塘河紧邻风情大道直通三桥西风古镇风情为小区古朴的文化奠定了厚实的积淀老式的剃头铺、木凳、茶馆仿佛还能听到当年的声声吆喝残存的牌坊、街亭、河埠头仿佛还能想象当年的衣裙纷飞云鬓簇簇  铁骑规划中的地铁一号线将停靠西兴古镇当地铁邂逅古镇当下班回家成为信步风情当繁华”的气息依然浓烈我们有理由相信莘庄”的奇迹会再次上演错过了莘庄”难道您还要错过西兴”吗  西兴北区块与小区隔河相望的西兴北区块(住宅及配套公建)将西兴与滨江新城有机的联系在一起既享有老街固有的繁华又兼享新城的风姿具有不言而喻的地理优势  小区饱览密林掩映碧波荡漾的300米长北塘河天然水岸30米宽的沿河景观带(市政规划)信步见水景闭坐闻水声通过沿河高层底部近5米的架空使之与小区内20000多平米的艺术园林相映成趣园林流水树丛竹林嫩草野花足以让您融入自然感悟人生', '2006-01-31', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BI5G', '330100', '120.195647,30.09833;120.196446,30.097479;120.196488,30.097156;120.195456,30.09687;120.195062,30.096925;120.193965,30.096628;120.193586,30.097797;120.191591,30.097339;120.191271,30.097566;120.191127,30.097826;120.191175,30.099374;120.191494,30.099482;120.192577,30.09941;120.194216,30.099258;120.194415,30.099239;120.196025,30.09908;120.196064,30.098897;120.195647,30.09833', '三水一生', '杭州市萧山区萧山萧山义桥镇南岸花城南面、东方文化公园旁', '杭州市', '', '92870.075074', '120.193717,30.098213', '商务住宅;住宅区;住宅小区', '车位配比1：0.7', '1.17', '152200平方米', '14666', '三水一生由建筑立面丰富的多层退台式花园洋房及联排别墅组成,总户数达1050户,形成一个山水共享的成熟的生活社区。三水一生主楼有地下一层,地上六层,建筑格局新颖别致,通体灰白色配以木质雕饰营造了非凡的现代品味。主体结构采用全现浇钢筋砼异形框架结构,灵动性极佳,大大提高房间的使用率,并可自由分割室内空间,从而达到真正的私人化、个性化、艺术化空间。三水一生采用杭州独一无二的多层退台式花园洋房设计,此种设计风格使每户均有朝南露台,栋栋空中别墅,家家花园洋房。此种设计风格使人居空间充分与自然接触,晚风朝霞信步走入生活,每日尽享阳光生活乐趣。更适合家人与朋友间的休闲、健身、家庭PAPTY等情趣生活。br山水之间的花园洋房br在杨岐山和三水交汇之间,沉淀着山水一生与生俱来的灵气,加之东方文化园诗情画意的熏陶,尤使三水一生倾洒儒雅的气息。三水一生社区景观与周围自然环境相互融合,内外相应,充分挖掘周边景观资源,将景观融入周围一片山水之中。br三水一生社区内景观设计以山水为主题,充分运用中国传统私家造园手法,通过理水、筑石、堆山植栽等手法,将主题景点宅间绿地、道路景观、组团中心绿地有机结合,追求“临山而居,近水而栖”的理想人居环境。在充分保证景观均好性、可亲近性、功能性的同时,使整个园区景观与人之间充满灵动,最大程度做到诗意空间的共享,以营造一个自然、健康。可持续发展的人文社区景观。br三水一生不仅全面满足生活所需,并且以提高生活质量为宗旨,在社区内设有完善的配套设施。小区内设置休闲会所、室外游泳池、幼儿园、健身场、儿童游乐场、24小时便利店、美食作坊、医疗站等配套设施,使业主足不出户,便可坐享三水一生。另外,社区内规划地下汽车位和地上车位,共有700多个,其中地上车位300个、地下车位360个、和少量私家车库,使业主不必为车位烦恼、朋友来访泊车无后顾之忧。br可视对讲系统:小区采用可视对讲系统,可实现客户与楼道门的联系。br电子巡更系统:在社区各交叉、入口点,设置24小时监视巡更系统,针对突发情况和实时记录。br闭路电视监控系统:在地下车库及车道、主要出入口、楼梯间、自行车库、周界设置闭路监视器,由保安控制室进行24小时监视。br小区周界防盗报警系统:小区周界采用红外线越境报警器,社区内24小时安全监控。br保安巡更管理系统:在小区各区域内及重要部位制定保安人员巡更路线,并安装巡更站点。', '2009-07-25', '0.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BI81', '330100', '120.127567,30.279243;120.126849,30.279237;120.126828,30.280693;120.126822,30.281338;120.126826,30.282469;120.128454,30.282553;120.129059,30.282583;120.12923,30.28258;120.129324,30.282561;120.129402,30.282505;120.129497,30.281009;120.129519,30.280216;120.129516,30.279779;120.12945,30.279725;120.129354,30.279698;120.128894,30.279643;120.128617,30.279573;120.128342,30.279475;120.127721,30.279267;120.127657,30.279249;120.127567,30.279243', '枫华府第', '杭州市西湖区学院路129号华星路6号', '杭州市', '', '74553.007649', '120.128119,30.280972', '商务住宅;住宅区;住宅小区', '0.75', '2.5', '255000平方米', '43860', '项目介绍:2003年7月枫华府第即文二路原中国计量学院整体出让地块以10.55亿元的总价被国都房产集团摘得成为浙江省土地招标拍卖制度以来块超过10亿元成交价的地块标王”的身份使其一出世就戴上荣耀的光环气质华贵2004年6月枫华府第的规划一出台即惊艳四方中国国际花园社区”和 创新风暴.中国经典示范住宅”二项荣誉接踵而来为其加冕2005年又荣获浙江省十大城市人居经典”是值得期待的住宅开发项目枫华府第位于杭州市区的学院区和高新区内北临文二路东靠学院路总用地面积约9.4万平方米总建筑面积约25.5万平方米枫华府第由6幢12层小高层和9幢25层高层住宅构筑建筑景观群落采用点式住宅处于一侧板式住宅分布于周边”布局形成超大的景观群落并以纯自然的手法设计景观成为屹立在市区立体花园枫华府第采用新古典主义建筑风格建筑圆润而畅和极富张力并通过上下阳台的错落创造出超大面积的景观空间以更多的阳光更广阔的视野空间收获自然的居住享乐智能化系统按建设部星级标准设计智能化水平可保持长时间领先临水而筑下沉式会所设有多种休闲场馆2004年11月枫华府第动工景观:枫华府第采用新古典主义建筑风格建筑圆润而畅和极富张力并通过上下阳台的错落创造出超大面积的景观空间以更多的阳光更广阔的视野空间收获自然的居住享乐智能化系统按建设部星级标准设计智能化水平可保持长时间领先临水而筑下沉式会所设有多种休闲场馆园林景观:枫华府第采用新古典主义建筑风格建筑圆润而畅和极富张力并通过上下阳台的错落创造出超大面积的景观空间以更多的阳光更广阔的视野空间收获自然的居住享乐智能化系统按建设部星级标准设计智能化水平可保持长时间领先临水而筑下沉式会所设有多种休闲场馆', '2005-09-30', '1.85元/月/平方米');
