INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BMJB', '330100', '120.253307,30.168222;120.253491,30.168086;120.253794,30.167824;120.254288,30.168235;120.254459,30.168033;120.254658,30.167819;120.254685,30.167757;120.25468,30.167702;120.254616,30.167664;120.254551,30.167578;120.254568,30.167048;120.254557,30.166675;120.254508,30.166581;120.254363,30.166465;120.254084,30.166338;120.25351,30.166572;120.253309,30.166402;120.253097,30.166421;120.252641,30.166718;120.252206,30.167039;120.252107,30.167126;120.252122,30.167173;120.25278,30.16777;120.252953,30.167915;120.253307,30.168222', '华瑞·湘湖林语', '杭州市萧山区城厢街道下湘湖路8号', '杭州市', '', '29136.649299', '120.25355,30.167244', '商务住宅;住宅区;住宅小区', '205', '1.8', '', '18425', '华瑞.湘湖林语位于休博园湖畔区东北侧,紧邻下湘湖河,社区东南方可近观西山,西南向可远眺湘湖,鸟瞰休博园,即能享受湘湖美景,又可体会休博园的浪漫与休闲,是一个理想的栖居场所!湘湖林语社区占地约2万平方米,总建筑面积达5万平方米,共由5幢11-18层小高层建筑组成,共有住宅近300户,户型面积从70-150㎡不等。  华瑞.湘湖林语公寓所处区位,极具发展潜力,目前社区东侧的金鸡路延伸段、南面的彩虹大道均已列入市政规划,待两条城市主干道开通后,湘湖林语约2000米范围内,向东可抵达市心广场、萧绍路商业区,往北可直达金城路、人民广场,向西经彩虹大道可至风情大道,游湘湖、通杭州均十分便捷。  城市与自然的共享地段,繁荣与休闲的和谐交融,使湘湖林语既可以享受现代城市的丰腴物质,又能亲享自然,感受生活真谛。   湘湖林语社区拥有如下配置:   ◎节能保温配置:外墙内保温系统、双层中空玻璃、顶层隔热层;   ◎电梯配置:高档东芝品牌电梯,运载速度可达1.75米/S,可直达地下车库;   ◎智能化配置:周界防越报警系统、闭路电视监控系统、可视对讲系统、电子巡更系统、门禁管理系统、公共广播系统、家庭综合智能箱系统等; ◎健身会所设置:湘湖林语从日后业主健康生活考虑,集中设置健身会所,为业主提供一个健身休闲、邻里交流的平台。', '2007-06-02', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BMNO', '330100', '120.242391,30.350048;120.241183,30.348765;120.240732,30.349109;120.240412,30.348891;120.239482,30.350774;120.240965,30.351784;120.241261,30.35206;120.241508,30.352387;120.241612,30.352325;120.241696,30.352207;120.242187,30.351365;120.242571,30.350453;120.242495,30.350264;120.242391,30.350048', '美邻嘉苑', '杭州市江干区勤丰路12号', '杭州市', '', '57381.808122', '120.24111,30.350482', '商务住宅;住宅区;住宅小区', '', 'None', '123979平方米', '17867', '美邻嘉苑,位于杭州丁桥大型居住区东南侧,东临绿化带及东风港河,南至华丰路,西至勤丰路,北至一号路,占地面积84余亩,总建筑面积近150000m2,由8幢小高层和13幢高层住宅组成,园区规划尺度亲和,庭院景观层次分明,建筑群落布局明快,户型空间精巧实用。有近7000方的沿街商业配套及社区服务中心。  美邻嘉苑以尺度合宜的规划,有序的行道脉络,匠心的景观营造,宜人的建筑布局,使家园呈现自然韵味和亲和之感。  美邻嘉苑,恬美家园三大品质:  亲和规划  住宅围绕中心绿地布置,设置环道为主干道。宅间道路与环形干道相接,布局简洁明快。错落有序,保证了良好的通风效果和每一住户最大限度地享有中心景观,营造家园归属感。  自然庭院  大面积中心绿地景观,情景交融,宅间绿地与中心庭院相辅形成自由式和几何式的行道脉络,创造多层次绿地系统,景观视野和可活动空间更加开阔,弱化楼体对空间的阻断,为邻里创造富有庭院感的交往空间。    美邻嘉苑,位于杭州丁桥大型居住区东南侧,东临绿化带及东风港河,南至华丰路,西至勤丰路,北至一号路,占地面积84余亩,总建筑面积近150000m2,由8幢小高层和13幢高层住宅组成,园区规划尺度亲和,庭院景观层次分明,建筑群落布局明快,户型空间精巧实用。有近7000方的沿街商业配套及社区服务中心。  美邻嘉苑以尺度合宜的规划,有序的行道脉络,匠心的景观营造,宜人的建筑布局,使家园呈现自然韵味和亲和之感。  美邻嘉苑,恬美家园三大品质:  亲和规划  住宅围绕中心绿地布置,设置环道为主干道。宅间道路与环形干道相接,布局简洁明快。错落有序,保证了良好的通风效果和每一住户最大限度地享有中心景观,营造家园归属感。  自然庭院  大面积中心绿地景观,情景交融,宅间绿地与中心庭院相辅形成自由式和几何式的行道脉络,创造多层次绿地系统,景观视野和可活动空间更加开阔,弱化楼体对空间的阻断,为邻里创造富有庭院感的交往空间。  宜人建筑  社区由8幢小高层与13幢高层住宅组成,立面设计采用简明风格,融时代感和亲和性于一体,建筑单体采用暖色组合,营造温馨气息。  精巧户型,适意居住  户型面积70-90m2,设计精巧,有效发挥小户型特色,在有限的户型面积内设计出更为齐全的功能,全部做到明厨明卫设计。  户型平面动静分离,居寝分离,洁污分区。板式住宅户型以一梯两户为主,辅以部分一梯三户及一梯四户的点式住宅,保证每户争取到更大面积的南向朝向。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BNID', '330100', '120.254468,30.178911;120.254476,30.178911;120.254999,30.178914;120.255038,30.178611;120.255071,30.178288;120.255139,30.177653;120.254468,30.177652;120.253729,30.177648;120.25377,30.178911;120.254468,30.178911', '高运锦园', '杭州市萧山区金鸡路318号附近', '杭州市', '', '15164.812401', '120.254411,30.178267', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '高运•锦园位于萧山新区黄金地段,东邻市心路,南连山阴路,西接金鸡路,北依金城路,紧邻地铁滨康站和规划中的人民广场站,交通条件十分优越。项目总占地面积约14600平方米,建筑面积为26730平方米,绿化率为31•2%左右。项目由9幢多层和一层沿街商铺组成,并建有地下停车库,主力户型在120平方米左右,户型结构以三室两厅为主,并建有极少量复式跃层房型。项目周边配套成熟,北干幼儿园(即将使用)、金山初中、北干初中、萧山第五中学等为子女提供高质量就学环境;时代超市、时代酒店、五星级等购物、餐饮、休闲配套一应俱全。高运•锦园是目前萧山城区在建楼盘中仅有的多层项目,其市场稀缺性目前非常突出,已引起了市场的高度关注。', '', '3.6元/月/平方米');
