INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BPTV', '330100', '120.252224,30.185511;120.252601,30.185502;120.252723,30.185429;120.252795,30.18538;120.252854,30.185306;120.252958,30.184573;120.253032,30.183834;120.252988,30.183768;120.252928,30.183727;120.252816,30.183716;120.252332,30.183734;120.252286,30.183759;120.25217,30.183943;120.252073,30.184262;120.251897,30.184893;120.251792,30.185304;120.251755,30.185513;120.251815,30.185529;120.252224,30.185511', '城品华庭', '杭州市萧山区金鸡路和金惠路交界处', '杭州市', '', '15389.269759', '120.252447,30.184659', '商务住宅;住宅区;住宅小区', '', '3.68', '22140平方米', '26118', '德圣·城品华庭总建筑面积5万平方米,主体为3幢现代简约风格的高层建筑,地块依水而生,自然清新水景,推窗可见,沿河边的畔河绿化带,绿柳拂风,触手可及。 城品华庭毗邻加州阳光,离天汇园100米、距离恒隆广场、衣之家、Holiday Inn、杭州萧山国际商务中心,农业银行约500米,距人民广场、世贸广场、杭州开元名都大酒店、蓝山咖啡约1000米……此外,距离地铁1号线滨康路站、2号线(规划中)人民广场站不过数百米……城品华庭扼守萧山新区核心区的繁华地带,享受以米为单位的生活特权。 德圣·城品华庭临金鸡路规划了沿街三层商铺,临金鸡路、沿金惠路分别规划了四层临街商铺及商场,其中层规划为面积近3000平方米的按五星级标准设置的菜市场,二、三层规划为大型超市,四层为主题休闲。为了形成一个相对静谧的生活空间,德圣·城品华庭巧妙利用三号楼对人流的引导与阻挡作用,与沿街三层商铺一起,共同围合成一个相对封闭的庭院,并通过双层中空玻璃的设置,将飞扬的尘土、喧哗隔绝在外,留下一方清心宁静的空间。 德圣·城品华庭在户型设计上考虑到不同经济水平、不同生活要求和不同家庭结构的需求,设计了舒适多样的户型结构,以80-150平米为主打产品,更是设计出“两代居”这样可分可合的灵活设计。室内空间功能明确,布局合理,独立餐厅并设生活阳台,室内流线清晰,动静分离,并可进行空间灵活划分。顶层更是设计了带大型花园的豪华全景“空中别墅”,宽绰尺度,成就经典尚品生活。', '2008-09-20', '1.8元/月/平方米');
