INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQ45', '330100', '120.286629,30.165688;120.286476,30.164925;120.285774,30.165036;120.286006,30.166097;120.286025,30.166139;120.286176,30.16615;120.286631,30.166099;120.286629,30.165688', '柠檬公寓(通惠中路)', '杭州市萧山区通惠中路58号', '杭州市', '0103000020E610000001000000080000007445292158125E40F3565D876A2A3E40B0C56E9F55125E40F54A5986382A3E400403081F4A125E40A4A99ECC3F2A3E406D1D1CEC4D125E40B6F63E55852A3E40A835CD3B4E125E401497E315882A3E409B3924B550125E40FB3A70CE882A3E4044C18C2958125E40F7E5CC76852A3E407445292158125E40F3565D876A2A3E40', '7300.445438', '120.286239,30.165542', '商务住宅;住宅区;住宅小区', '1.3', '4.5', '35000平方米', '14751', '柠檬公寓是由浙江金帝集团投资(浙江金帝集团在萧山开发的项目有金色钱塘、高新科技广场、文源广场等),由杭州金泰房地产开发有限公司开发的高层单体公寓项目,地处通惠路与萧绍路交汇处,西面有乐购超市,北面靠商检局,东面有成熟居住社区,萧山大型商业城就在项目附近,生活非常之便利。 整个项目总建筑面积约4万方,由单体公寓和商场组成。柠檬公寓建筑是由两梯六户组合而成,户户均南北朝向,围合屋顶中心绿化广场是项目一大亮点,实现生态小区概念。', '2008-02-29', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQ5U', '330100', '120.263408,30.302778;120.264032,30.302118;120.264501,30.301632;120.264084,30.3009;120.264017,30.300865;120.263811,30.300499;120.263523,30.30062;120.262717,30.301311;120.263161,30.301632;120.26309,30.301694;120.26299,30.301675;120.262903,30.301664;120.262632,30.301526;120.262558,30.301509;120.262485,30.301537;120.262234,30.301735;120.262052,30.301914;120.261957,30.30207;120.261911,30.302191;120.261865,30.302275;120.261922,30.30233;120.262529,30.302623;120.262438,30.30277;120.262725,30.302926;120.262868,30.30297;120.262991,30.30299;120.263154,30.30303;120.263249,30.302992;120.263332,30.302882;120.263408,30.302778', '汇隆风林公寓', '杭州市江干区杭海路1109号', '杭州市', '', '30974.528448', '120.263253,30.30184', '商务住宅;住宅区;住宅小区', '', 'None', '', '23387', '风林公寓占地面积27739㎡,建筑面积55500㎡。由一幢6层多层和三幢16层高层组成,共有21种户型,466套住房。主力户型由137㎡、90㎡和60㎡,能满足不同年龄层的需要。', '2008-07-13', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQ6I', '330100', '120.169738,30.214758;120.170262,30.215389;120.171038,30.216274;120.171112,30.216336;120.171236,30.216291;120.171543,30.216634;120.172167,30.216213;120.17089,30.214841;120.170372,30.214352;120.169738,30.214758', '复兴东苑', '杭州市上城区复兴路北口', '杭州市', '', '19099.853646', '120.170938,30.2155', '商务住宅;住宅区;住宅小区', '', 'None', '', '36365', '小区环境佳,是居住的最佳选择择。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQAM', '330100', '120.202392,30.333236;120.201607,30.33318;120.201526,30.334046;120.201571,30.334645;120.202419,30.334654;120.202392,30.333236', '海辰·水岸晶座', '杭州市下城区康宁街136号', '杭州市', '0103000020E61000000100000006000000363E93FDF30C5E4090D959F44E553E4042E90B21E70C5E4068AED3484B553E40CCD24ECDE50C5E40105CE50984553E409C340D8AE60C5E4019C5724BAB553E40B345D26EF40C5E40C07971E2AB553E40363E93FDF30C5E4090D959F44E553E40', '11111.383266', '120.20198,30.333939', '商务住宅;住宅区;住宅小区', '地上13个，地下110个', '2', '23896平方米', '16928', '海辰·水岸晶座位于下城区华丰板块,华丰板块早在上个世纪中后期就开始启动城市化进程,是“杭州老的新区”;在极富计划性和前瞻性的规划下,未来配套日臻完善,成为“杭州成熟的新区”指日可待。华丰板块是杭州城东北板块中接轨杭州主城为紧密的区块,有机衔接运河板块与丁桥板块,这些新兴居住区与华丰板块呈现出联动发展态势。海辰·水岸晶座总建筑面积为23896平方米,其中商务公馆面积15400平方米,商铺面积3000平方米, 由三幢九层的商业办公楼和商业裙房组成。其中主楼三至九层为精装商务公馆,一至二层及裙房为商业用房,局部架空。单身商务公馆总户数261户;一楼商铺16间;二楼为大开间。其中一层层高为4.95m,二层层高为4.95m,标准层层高为4.79m,主力户型为50多㎡和70多㎡户型。注重神形兼备,将人性特征与美学感受融入建筑空间海辰·水岸晶座对建筑外立面进行了精心设计,使得建筑有较强的韵律感。且在建筑横向上设置了丰富的线脚角,这样有效改变了建筑立面的单调无趣,克服了给人视觉带来的不舒适感。通过在建筑山墙面设计构架和在建筑屋顶设计格栅活泼建筑的性格,使建筑具有很强的个性和可识别性。虚实对比、变化中求统一。采用现代设计手法处理诸多细节问题,如每层梁位置颜色处理,玻璃窗上的分隔,里面材质的分隔线条。通过这些表达了大楼典雅、宁静、现代的特殊气质。别人从入手,我们从生活感受着力住宅的本质,不是追求表面,而应是对主人生活的真心关照。好的设计,一定不会忽略居住者的内在感受。海辰·水岸晶座的室内设计上,想要营造的,不是大量国际的简单堆砌,而是更注重整体的视觉感受和居住品质,体现居住者的生活价值:楼层的科学高度,户型设计等细节的关怀,让房子尽可能地符合人们的生活习惯和行为方式,从而更好地提供一种称心的生活方式。海辰·水岸晶座,却从建筑、户型到精装修,产品全程打造,力争在建筑、户型、配套等方面都达到超越其地段价值的程度。', '2010-05-01', '3.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQHF', '330100', '120.335694,30.302119;120.333984,30.301477;120.333506,30.301844;120.333534,30.30267;120.333534,30.30285;120.335601,30.302898;120.335655,30.302632;120.335725,30.302431;120.335752,30.30223;120.335694,30.302119', '德嘉·金沙阳光', '杭州市江干区海通街99号', '杭州市', '', '21831.612326', '120.334528,30.302302', '商务住宅;住宅区;住宅小区', '800个(1：1.26)', '3.44', '68208.6平方米', '21530', '德嘉金沙阳光是未来杭州城东CBD中心区金沙湖板块的首个住宅项目,临近地铁1号线,汇聚政府办公、文化娱乐、居住休闲、商务金融、生态景观等城市核心资源,区域前景一片光明。金沙阳光围合庭院贯穿水系景观,实现高层建筑良好的通风采光效果;80-90平米主力户型紧凑实用、科学合理、明亮通透,打造新一代阳光舒适型住宅。', '2009-12-22', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQPZ', '330100', '120.021463,30.253154;120.021457,30.253268;120.022318,30.25323;120.023055,30.253398;120.023635,30.25346;120.023636,30.252212;120.023432,30.251845;120.023208,30.251629;120.023445,30.248472;120.022769,30.248501;120.021801,30.24858;120.021061,30.248592;120.020423,30.248576;120.019588,30.248604;120.018896,30.248711;120.019003,30.250572;120.019336,30.250593;120.01961,30.250598;120.020172,30.250598;120.02045,30.250567;120.020491,30.250573;120.020512,30.250629;120.020511,30.251391;120.020399,30.251463;120.020236,30.251455;120.019442,30.251495;120.019316,30.251519;120.019181,30.251523;120.019623,30.253164;120.021463,30.253154', '溪上玫瑰园', '杭州市余杭区高教路东侧(五常大道高教路口公交站附近)', '杭州市', '', '169731.760328', '120.021413,30.250856', '商务住宅;住宅区;别墅', '配置地下车库，每户可停2-3辆车', 'None', '210000平方米', '34580', '溪上玫瑰园总体占地面积约314亩,总建筑面积约13万方,总套数323套,一期排屋地上面积约360-430㎡,地下建筑面积约130-160㎡,庭院面积约80-300㎡。别墅:地上建筑面积约380-480㎡,地下建筑面积约200-300㎡,庭院面积约600-900㎡,并配备游泳池、SPA、BBQ、壁炉。', '2016-11-26', '4.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQTT', '330100', '120.119007,30.366983;120.119228,30.366953;120.119511,30.366876;120.120601,30.366752;120.120632,30.365995;120.12071,30.365536;120.120913,30.364669;120.120907,30.364398;120.118759,30.364395;120.118582,30.364451;120.118441,30.364599;120.118429,30.366912;120.118758,30.366976;120.119007,30.366983', '赞成美树', '杭州市余杭区良渚镇运河村金恒路174号', '杭州市', '', '51591.864007', '120.119571,30.365612', '商务住宅;住宅区;住宅小区', '约800个', '2.4', '128835平方米', '20857', '赞成美树位于杭州城北上塘路高架巨州路下桥口西侧,尽享桥西配套、运河繁华。美树花园交通极为便捷,经上塘高架,5分钟就可达大关欧尚超市,15分钟即可到武林广场。项目东临巨州路,南达拱墅区桥西生活圈,规划中的北城广场商贸综合体提供了生活配套。北达杭州市农副产品物流中心,家居生活近在咫尺。项目西侧规划有金恒德幼儿园,南面有文澜中学、卖鱼桥小学分校和杭州市第二人民医院等教育医疗设施。赞成美树总用地面积5万多平方米,容积率2.4,总建筑面积约13万平方米,总居住户数近1200户。项目规划为7幢12到16层的景观小高层、3幢31到32层的舒适高层公寓。赞成美树力求户型设计新典范,在90方、120方、130方等多种选择的同时,也创造性地为购房者设计了超值而舒适的家园。1号楼、2号楼的90方三房两厅一厨一卫小户性,三房全部朝南,且最大面宽近9米,充分保证了阳光的充足。4号楼130方五房两厅一厨三卫超值公寓空中“别墅”,每户设计了上下两层,且两层总层高达到5米多,客厅层高为4米。在美树户型设计中,每个户型都有不计入建筑面积的露台或飘窗赠送,提高了住宅的使用率。', '2010-09-30', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQW5', '330100', '120.28184,30.30389;120.281833,30.303772;120.281578,30.302167;120.279513,30.302526;120.279708,30.304099;120.28184,30.30389', '圣奥领寓', '杭州市江干区金堡街83号', '杭州市', '0103000020E6100000010000000600000019ADA3AA09125E40D9942BBCCB4D3E40C07B478D09125E40C5707500C44D3E407A51BB5F05125E4031EE06D15A4D3E40A3737E8AE3115E4090300C58724D3E407E1B62BCE6115E400EBF9B6ED94D3E4019ADA3AA09125E40D9942BBCCB4D3E40', '32151.208324', '120.28068,30.303172', '商务住宅;住宅区;住宅小区', '1：0.8', '2.5', '110000平方米', '28676', '圣奥领寓项目占地面积约3.4万㎡,总建筑面积逾11万㎡,规划由6幢高层住宅和底层商业组成,规划有约12000㎡集中式中央景观庭院。地处杭州东部中心居住区九堡核心地段,距离杭州中央商务区钱江新城仅约2公里周围交通便捷、 配套齐全,宜居指数非常高。圣奥领寓 位于九堡核心领域下沙大道与胜稼路交汇处,紧邻艮山东路、德胜快速路等城市主干道;距离建设中的地铁九堡东站和长途客运中心分别约500米 800米;距离杭州中央商务区钱江新城仅约2公里左右路程。通过已开通的德胜快速路快速公交B1线,可迅速直达主城区;预计2011年投入使用的地铁1号线,将令出行更为方便;多达10余条的公交线路,可直达武林广场、汽车东站等、火车城站等地。项目南侧的沿江大道,集观光、休闲、游览、通行等功能于一体,能大大缩短前往钱江新城的时间更平添无限出行乐趣。经下沙大道可直达下沙中心。圣奥领寓的建筑以新古典主义的清新、简洁、明快为主,注重体快、色彩等要素的处理,通过尺度、造型、外墙建筑材料和色彩等方面的努力,创造出有识别性、统一性的丰富立面,整体造型感强,视觉美观度高。', '2010-04-19', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQXN', '330100', '120.19489,30.203384;120.194559,30.20321;120.193241,30.202523;120.191257,30.205789;120.191188,30.205961;120.193111,30.206736;120.19428,30.204642;120.194389,30.204326;120.19489,30.203384', '水印城', '杭州市滨江区滨盛路2242号', '杭州市', '', '70611.208792', '120.193083,30.204681', '商务住宅;住宅区;住宅小区', '1604个', '3.5', '', '36611', '水印城由十栋现代高层住宅组成,其中6栋板式,4栋点式,最低的为24层,最高的为34层。建筑立面以浅色面砖墙体、部分高档进口石材和黑色铝合金相互搭配,构成大气、极具现代风格的视觉效果。整体建筑造型追求现代、时尚、大气,打造滨江区高档楼盘的住宅形象水印城位于滨江行政商业中心西侧,在钱江四桥南岸以东,紧靠钱塘江,是滨江CBD的核心区块。水印城总建筑面积近30万㎡,绿化率约40.5%,建筑密度不到15%,水印城园区内人车绝对分流,在整体园区平面下设置了二层地下停车库,车位配比率达到了1:1以上。日本原田华景观设计机构担纲景观设计,提出了“绿立方”设计思路:它以现代感的几何图形为主要轮廓,景观中心以人行主动线和自然水景为轴线;在社区北部设计了“江景12舫”空中景观电梯,使江景变成真正意义上的流动景观;水印城的下沉式广场设计了南岸首家瀑布景观,业主可在广场上部的原木天桥和下部的水晶台阶上欣赏水景;在社区地下车库的设计中,设计师提出“金色车库”理念,车库的室外采光系统由采光井、采光水系带、下沉式采光广场组成,这是水印城关注细节设计方面的突出体现;作为对高层建筑生态化生活的突破,水印城设计了真正意义上的空中花园,通过对通风、光照、空间利用、环艺维护等各个方面的考量,提出了为个性化家庭设计的私人空中花园,在业主进入客厅之前将首先穿越绿意盎然的私家花园。在运动主题的规划中,水印城首推滨江阳光室内运动馆,挑高6M的透明天顶,国际化标准场地配置,为生活增添健康运动的气息;水印城设置了景观橙色跑道,跑道两侧种植了高大的阔叶植物,为运动提供充沛鲜氧;水印城的泳池设计采用了健康式半开放方案,在保证了泳馆空气流通的良好性的同时兼顾了业主对于光照的双重选择;水印城的网球场采用国际化网球场标准,在网球场的观看平台的设计中引用了坡地围合的概念,观众席不再是冰冷的座椅取而代之的是可坐卧的草皮坡地。水印城在室内空间设计中加大了创新的力度,室内空间上倡导一种“新室内主义”,户型面积40M2~300M2不等,通过江景、LOFT、SUN等要素,设计出“时间景观”户型,景观随着时间的变化而改变,并在杭州推出“首席江景沐浴空间”和“景观魔幻厨房”,摒弃了传统空间布局规程,把空间的乐趣作为生活的主题,开创了南岸空间乐趣为主的先河。同时水印城荣获2004年度“全国人居经典综合大奖”,并以此献给一直支持水印城的广大客户。', '2004-11-30', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQYE', '330100', '120.161037,30.234809;120.160957,30.234811;120.160863,30.234823;120.160726,30.234859;120.160626,30.234906;120.160544,30.234965;120.160481,30.235023;120.160445,30.235089;120.16044,30.235133;120.160467,30.235169;120.160524,30.235175;120.160569,30.2352;120.16072,30.235386;120.160889,30.235573;120.161006,30.235722;120.161135,30.235899;120.16116,30.235923;120.161773,30.235654;120.161037,30.234809', '广宇·吴山鸣翠苑', '杭州市上城区四宜路3号,蔡官巷转角西南侧', '杭州市', '', '6668.25156', '120.161088,30.235342', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '吴山鸣翠苑在中大吴庄的南面面幢数8幢高档的住宅小区', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQZC', '330100', '120.2445,30.174012;120.244353,30.173636;120.244278,30.173605;120.244154,30.173581;120.244087,30.173565;120.244063,30.173523;120.243787,30.172962;120.243589,30.172533;120.243503,30.172375;120.243446,30.172259;120.243366,30.172229;120.243111,30.172185;120.242993,30.172162;120.242907,30.172101;120.242824,30.171842;120.242781,30.171696;120.2425,30.171042;120.242398,30.170675;120.241419,30.170879;120.241343,30.171974;120.241483,30.172567;120.241681,30.173173;120.242033,30.173817;120.242258,30.174049;120.2445,30.174012', '华瑞湘湖美地', '杭州市萧山区萧山风情大道东,毗邻美之园与湘湖家园', '杭州市', '', '53595.293257', '120.242581,30.172635', '商务住宅;住宅区;住宅小区', '60-70个，售价12万/个，车库15万/个', '2', '150000平方米', '25874', '华瑞湘湖美地,项目位于湘湖旅游度假区北侧,紧邻萧山城区,项目距离湘湖约2公里,靠近地铁1号线湘湖站。INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BR6J', '330100', '120.282906,30.297645;120.282662,30.297606;120.28017,30.2979;120.280145,30.298049;120.28047,30.29984;120.280541,30.299933;120.280834,30.299899;120.282137,30.299753;120.283215,30.299514;120.283223,30.299358;120.282906,30.297645', '绿城丽江公寓', '杭州市江干区仁爱路73号', '杭州市', '', '51899.683441', '120.28168,30.298753', '商务住宅;住宅区;住宅小区', '1280个（1：0.9）', '2.5', '250000平方米', '32038', '绿城丽江公寓位于杭州市钱江新城东,南临钱塘江和沿江大道,北依下沙路,距离钱江新城核心区仅约9公里,通过即将开通的沿江大道,仅需约10分钟车程。    绿城丽江公寓为全精装修项目,总占地约10万平方米,地上总建筑面积约25万平方米,项目分为南北两个区块。北区块自2008年3月开始销售,迄今房源全部售罄并已于2009年底全面交付,其销售情况及价格走向一度成为九堡区域的风向标。    绿城丽江公寓南区由8幢20-23层高层组成。目前在售为一线江景大宅,主力户型面积约为200-300平方米。其中300平方米的平层官邸为绿城在杭州首个在高层公寓中引入十字圆厅的户型,仅78席,五室三厅四卫的设计,270度观江视野,五室均可观江景。300平方米的平层官邸约6.05米的架空层层高、约3.3米的标准层层高、约1.4米的双开进户门、约13.2米的沿江面宽、约9.6米南向阳台面宽,同时配备户式中央空调、新风系统、地热系统,德国唯宝、德国汉斯格雅洁具品牌,德国西门子厨房电器,德国柏丽橱柜等国际知名品牌,全面打造高贵生活。', '2010-04-29', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BR6L', '330100', '120.287356,30.302784;120.287147,30.302764;120.286649,30.303207;120.286126,30.303686;120.285799,30.304001;120.285652,30.304121;120.285696,30.304833;120.285749,30.305431;120.286732,30.30533;120.288163,30.305167;120.288072,30.304411;120.288013,30.304021;120.287814,30.303397;120.287575,30.303036;120.287356,30.302784', '九月庭院', '杭州市江干区九乔路', '杭州市', '', '42931.040881', '120.286924,30.304283', '商务住宅;住宅区;住宅小区', '地上：74个 地下：381 个', '2.7', '150000平方米', '25526', '项目介绍:<DIV class=DivTxt>万均九月庭院南临艮山东路绿化带,北至规划中的九乔路,总建筑面积近15万平方米,建筑密度仅为15.6%,10幢高层围合多主题景观庭院,园区中心设计 20000余平米中央大绿洲,内植多种乔木、灌木,点式建筑底层5.1米架空, 主力户型98~130平方米……九月庭院地理位置得天独厚,外部环境繁华优越,内部规划森情绿意,繁华于外自然于内,为您营造舒适浓郁的庭院生活。</DIV><DIV class=DivTxt>&#160;</DIV><DIV class=DivTxt>200米楼间距,15.6%建筑密度,53.6%绿地率:万均九月庭院规划打开大合,空间通透,最宽楼间距达200米,绿化率高达15.6%,将建筑密度降到最低,使项目中心留出20000平方米的中心庭院,10幢建筑围绕中心庭院有序排列,让95%以上的家庭都可以在自己家中看到中心大庭院,从而实现人、建筑、景观的和谐相处。为了降低建筑能耗,规划及建筑设计合理利用朝向,室外气候及地形条件,合理设计。九月庭院的朝向为南偏西6.56度,满足江南住宅最佳的朝向。建筑内部及其户型设计组织良好的自然通风。通过围护结构的热工设计,在满足保温隔热要求的基础上,同时尽量满足建筑立面的美观要求和人们的舒适性要求,达到建筑设计和热工设计合理平衡。</DIV><DIV class=DivTxt>&#160;</DIV><DIV class=DivTxt>20000余平米中央大绿洲:万均九月庭院最大的特色式庭院设计,中心庭院占地达20000余平方米,内植多种落叶、长绿灌木、乔木园区氛围森情绿意。</DIV><DIV class=DivTxt>&#160;</DIV><DIV class=DivTxt>体验型景观节点:九月庭院内部设置时光柱、测量尺、水滴石穿、小太阳、风景画框等众多体验型景观节点,让您充分体验时间、季节、岁月的变化。</DIV><DIV class=DivTxt>&#160;</DIV><DIV class=DivTxt>5.1米底层架空:万均九月庭院点式建筑底层设计5.1米架空,结合架空层设计老年活动区、儿童活动区、青少年活动中心、坡地景观等众多活动区域让人们在这里休闲娱乐、放松心灵。杭售许字(2008)第0043号</DIV><br />景观:20000余平米中央大绿洲:万均九月庭院最大的特色式庭院设计,中心庭院占地达20000余平方米,内植多种落叶、长绿灌木、乔木园区氛围森情绿意。<br />园林景观:美达.九月庭院位于九堡中心区,东至50米多宽的城市绿化带,成为小区建筑布局设计的重要因素,通过与小区内部中心绿地的视觉连通,形成了空间开阔的绿地景观。建筑是硬朗的,景观是柔性的,建筑与景观构成大虚大实的关系。美达.九月庭院最大的特色就是庭院设计,中心庭院占地约2万平方米,给居者以开阔而优美的视野,同时也满足居者在庭院中运动、休闲、娱乐以及邻里间沟通的需求。园区内部设有社区内罕见的2000平方米中心大花园,将邀请高水准景观设计公司进行专业设计,在内部设置休闲区、运动区、儿童游戏区、坡地景观区等等。<br />', '2009-10-25', '1.3元/月/平方米');
