INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSGL', '330100', '120.134188,30.328743;120.136846,30.328945;120.136736,30.329222;120.136656,30.329493;120.136557,30.32985;120.136436,30.330091;120.136359,30.330314;120.136303,30.330454;120.13627,30.330602;120.136256,30.330616;120.136223,30.33062;120.134145,30.330327;120.134188,30.328743', '西岸花园', '杭州市拱墅区昼锦街12号', '杭州市', '', '36147.172734', '120.135383,30.329632', '商务住宅;住宅区;住宅小区', '640个(1：0.7)', '2.3', '130000平方米', '40375', '南北.西岸比邻拱宸桥,连接市中心的交通非常便捷,是老城区桥西板块中具有一线运河河景的高档楼盘,拥有运河、红旗河双水岸,运河公园、石祥公园双公园等优美的景观资源。项目总总建筑面积逾13万平方米,物业类型有排屋、小高层、高层,总户数998户。项目呈半岛状,两河从东北两方向尊贵拱护。充分体现运河文化,利用地面河道景观,融运河人文环境与自然生态于一体。两幢18层的单元式高层住宅沿北侧布置,中心区域为四幢点式高层,沿运河为排屋和小高层。南低北高,东低西高,点板结合;使小区成为一个疏密相间的住宅小区。东面京杭大运河及北面红旗河与建筑之间的开阔河流景观带,构筑了南北.西岸独有的黄金双水岸线。270度沿河视野为.西岸增添了一个不凡的亮点。南北.西岸南临公交中心站(规划中)、农贸市场(规划中),出行、生活极为方便。周边还有LOFT公园、北星公园、运河博物馆、运河文化广场、世纪联华超市、72班航母型九年制学校、文澜中学、市二医院和运河码头公园(规划中)等成熟配套,入则宁静、出则繁华。南北.西岸的高层、小高层公寓以80-90平方米的“小三房”为主力户型,精致紧凑,适合三口之家;城市排屋紧邻运河公园和京杭大运河,基于运河的深厚历史文化底蕴和人文景观,是老城区极为罕见珍惜的高档物业。在建筑上,西岸追求传统与现代风格相结合,充分体现运河文化,小区的建筑成为运河景观的有机部分。建筑立面追求光影效果,有机分段处理,整体形象简洁而又不失细部。中国式简洁的白墙、青砖和涂料-----简练到极致的建筑元素,将浪漫情怀、人居理想通通融入西岸的空间模式之中。以一种超越居住、生活自身的审美意趣,创造一个身与心均闲适悠然的所在。在内部空间上,西岸户型空间层次错落,将“生态、健康、舒适”等现代观念融入社区的建设之中,每一处户型皆体验了通透舒畅的设计理念。整体气质现代、简洁。布局设计精巧,内部空间灵活,赋予变化,可使人有迤俪不尽之感,景外有景,壶中田地自是变宽了。设计大师倾情打造79-140平米感性空间,大开间、小进深的标准的设计,空间方正实用,布局合理,通风对流。“四明”空间设计,采光充裕、户户有景,并强调内部空间设计的参与性,您可根据需要灵活分隔空间。与运河相伴,与公园为邻。南北-西岸整体规划秉承千年运河文脉,现代人居风格融合运河风景,致力打造运河边珍藏版人文社区。', '2010-05-09', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSL4', '330100', '120.159332,30.209207;120.15891,30.208885;120.158704,30.208788;120.158482,30.20873;120.157781,30.208703;120.156756,30.208515;120.156221,30.208354;120.155825,30.208367;120.154886,30.208339;120.154722,30.208245;120.155752,30.206835;120.160266,30.209214;120.159857,30.20966;120.159332,30.209207', '复兴城市家园', '杭州市上城区上城凤凰山路36号', '杭州市', '', '39743.113859', '120.157061,30.208136', '商务住宅;住宅区;住宅小区', '', '1', '800平方米', '', '1.复兴区块一个高档小区,在凤凰山路36号,是05年建成的,面积大概都是190-240左右大面积。2.位置离陶瓷品市场非常近,是个闹中取静的高档小区。楼盘地处陶瓷品市场旁,背靠凤凰山,傍依八卦田,过玉皇山隧道距西湖景区百米之遥,实属办公居住的之选。3.小区环境非常好,楼层一般4-5楼就是顶楼了,相当于叠排!4.面积都是比较大的,类似于排屋,都是非常高档的。5.周边配套齐全 小区环境好  出行便利 装修干净清爽.6.地理位置非常好  钱塘江畔 凤凰山脚下  前见江景 后见山 真是依山傍水的', '', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSO7', '330100', '120.205121,30.337668;120.205128,30.337028;120.202863,30.337056;120.202864,30.337671;120.205121,30.337668', '华润·翠庭', '杭州市下城区太公街112号', '杭州市', '0103000020E6100000010000000500000043AED4B3200D5E40DEE7F86871563E409CDF30D1200D5E4017D68D7747563E4061A417B5FB0C5E40ABEB504D49563E404A6249B9FB0C5E40C0CE4D9B71563E4043AED4B3200D5E40DEE7F86871563E40', '12912.097828', '120.204001,30.337356', '商务住宅;住宅区;住宅小区', '一层8万元/位，二层12万元/位。只售不租。', '2', '50000平方米', '29012', '华润翠庭地处杭州下城区华丰板块,总建筑面积约5万㎡,由7幢小高层组成,最高为9层。华润翠庭依靠贯穿南北的上塘中河高架、秋石高架快速路、留石高架快速路、石大快速路构建起井字交通线,同时以规划中的地铁三号线和即将通车的快速公交B3线深入繁华腹地,无缝对接城市生活,另有多路公交车均可快速融入城市中心。高架快速路、地铁、10余条公交线路、快速公交B3线等共同围合成华润翠庭的立体交通网,20分钟即可直达武林广场。在户型设计上,华润翠庭有89-130㎡的不同户型,充分保证各层次的多样性选择。', '2010-06-05', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSO9', '330100', '120.202885,30.334876;120.202816,30.334949;120.20279,30.335063;120.202807,30.336672;120.202824,30.336777;120.202864,30.336845;120.202925,30.336894;120.203022,30.3369;120.204559,30.336892;120.204508,30.334969;120.202982,30.334873;120.202885,30.334876', '万泰·风华新语', '杭州市下城区华中路79号', '杭州市', '', '31124.674835', '120.203661,30.335908', '商务住宅;住宅区;住宅小区', '609个地下，其中：地下559 地面50', '2', '97258.85平方米', '28728', '万泰·新语位于杭州传统主城区东北部的华丰板块,距武林广场约10公里,项目以回归学院情怀为整体营造思想,总建筑面积约10万㎡,共10幢围合式高层公寓,同时拥有10000㎡学院派中庭景观,15个主题情境园林,超大规模的景观群落重现心灵放飞的年代,整体风格清新而古典。    万泰·新语周边拥有学校、医院、公交总站、规划中的大型超市、现代娱乐基地等众多公建设施,规划地铁3号线近在咫尺,1500米范围内拥有多个城市综合体,生活的舒适性和成熟度早已构筑,十五分钟国际化的精雅生活配套,重塑学院醇熟理性生活理想。    增长板块——凝聚城市光辉,华丰板块潜力无限    华丰,下城区唯一的权重板块,早在上个世纪中后期就启动了工业化、城市化进程,新型居住区和现代金融、商业正逐步取代工业,生态居住、绿色消费已成为现实,华丰板块正在迅速地融入“一核三圈三带四街区六组团”的政府规划。区域交通便利、配套成熟、生活氛围浓厚。德胜、秋石、留石、中河、上塘四条快速路构成井字路网。地铁、快速公交,多维立体交通快速融入市中心。届时,从万泰·新语到武林广场仅需20分钟。    成熟配套——15分钟国际配套圈,毫无缺撼的完美    万泰·新语周边生活、娱乐休闲配套十分丰富,600米范围内,农贸市场、超市、公交首末站、银行、酒店、医院一应俱全。1500米范围内,还有即将开业的大润发超市、21万方华丰城市综合体、现代文娱基地,及规划建设中百万方都市综合体——杭州创新创业新天地。再加上城北体育公园、城北森林公园,居住的舒适度与成熟度已然构筑。    项目周边教育配套完善,下城北区域内初步建设的,包括知名的安吉路幼儿园桦枫居分园、青蓝小学青华校区、风帆中学华丰校区等优质教育资源在内的,2所幼儿园、2所小学和1所中学,已陆续建成,其中风帆中学华丰校区即在项目隔壁。    完美建筑——新学院意向建筑,交融理智与情感    万泰·新语小区采用新学院派建筑特色,以简洁直线条勾勒出极富艺术特质的建筑立面。10幢高层建筑围合万余方中庭花园,形成开放邻里尺度,共享社区空间。建筑单体充分吸收学院建筑精髓,通过面砖色彩的自然搭配和露台、飘窗所形成的立面变化,使得建筑外观更加层次分明,丰富多彩,具有温和的建筑特性和浓重的文化气息。    小区整体采用围合式布局方式,商业街的开放要求和小区内部的私密性均得到满足,严格把握“城市-建筑-生活”之间的合理尺度。围合形成的超大中庭花园,也将中国传统建筑的院落文化得以实现,体现高档社区的私密感和空间感,同时实现了高层建筑间的最大化视线。小区南北最大楼间距达到了160米,实现社区内部充足的光照面,打造惬意的阳光社区空间。    精致园林——10000㎡学院情境园林,多色彩交融雪月风花    万泰·新语,传承艺术庭院设计精髓,万余平方米中庭景观以文化典故为创作源头,通过动、静双方面需求进行功能布局,打造多层次立体景观,使之成为一个充满艺术感、自然感、健康感的现代园区,“人-景观-建筑-城市”完美交融。社区内多景点的主题文化广场烘托出浓郁的文化氛围和艺术气息,学院气质在眼底晕染。    树木掩映中的林荫大道、树影斑驳中的幽雅小径、各式经典雕塑……校园里曾经随处可见的经典元素都将在万泰&#8226;新语中呈现。小区沿景观带建筑均采用局部架空处理,以文化典故作为创思源泉,以雕塑、文化墙、景观小品的表现,并通过木栈道、文化石、沙池、廊架等,精心营造兼具文化和休闲功能的公共邻里空间。在园林布局中,通过下沉式庭院等多层次空间的塑造,引入音乐书吧、健身、运动、保健、教育等功能区间,以及阅读角、音乐隅、篮球场、漫步跑道等校园生活特色的生活场景,精心构筑健康、文化、亲子三主题休闲天地,让您走出私人居所,依然享受生活的乐趣。    信步在树林的小径,在架空层或下沉式庭院中悠闲地品味着自制的咖啡,享受着阳光下的那一份惬意、舒坦,属于万泰&#8226;新语建筑的智慧,创造着让你意想不到的惊喜。', '2013-08-31', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSRV', '330100', '120.283822,30.179736;120.282625,30.17973;120.282637,30.180449;120.283938,30.180423;120.283939,30.179938;120.283897,30.179735;120.283822,30.179736', '嘉瑞华庭', '杭州市萧山区金城路与通惠路交叉口', '杭州市', '0103000020E61000000100000007000000A9F8BF232A125E40F2E9B12D032E3E400C022B8716125E402E1C08C9022E3E40EEE87FB916125E408D98D9E7312E3E40DE054A0A2C125E403B72A433302E3E40C6C37B0E2C125E40C24EB16A102E3E40AE9B525E2B125E4052F2EA1C032E3E40A9F8BF232A125E40F2E9B12D032E3E40', '8325.686561', '120.283277,30.180085', '商务住宅;住宅区;住宅小区', '', 'None', '100000平方米', '', '绿都嘉瑞华庭,地处金城路东侧,是金城路沿线为数不多的70年住区。总建筑面积10万余平方米,内含酒店式公寓及高层公园住宅,是新区核心地标性城市综合体。项目紧临繁华CBD,及大型市政公园边,全方位包容城市核心生活资源,成就新区完美生活圈。项目为85—150㎡的中小面积,弥补了萧山新区缺少小面积住宅的空白,将成为09年, 刚性需求关注的焦点。看点一:地段:萧山新区核心成熟配套  地铁5号线规划站点绿都嘉瑞广场所处的区域,是萧山的城市核心,举步间,享受完善成熟的鼎级配套,学校、医疗、交通、购物一应俱全。在新区土地资源日益稀缺,城市核心不断外扩的今天,如此的地段已弥足珍贵。此外,从余杭贯穿杭州主城区市中心到萧山火车站的地铁5号线,在项目附近规划站点,建成后,将与杭州主城区及余杭实现无缝对接。看点二:景观:90000㎡城市中央水景公园  稀缺市政配套据悉,绿都嘉瑞华庭项目北面的大浦河将于年内进行河道整治,治理后,将在嘉瑞华庭正对面新建一个90000㎡的原生态水景公园,其规模相当于1.5个人民广场或是1个南江公园,这样的面积在萧山新区这种寸土寸金的核心地段内,可谓是的。而嘉瑞华庭无疑是这一利好的受益者,不仅95%以上的业主可以享受到一线景观资源,还可以随时随地与公园进行亲密接触。看点三:户型:首创第四代魔方户型  超乎想象的实际使用率绿都嘉瑞华庭的户型面积处于80—120㎡之间,据绿都房产销售部经理介绍,该项目户型具有超强的实用性性与可拓展性,是绿都研发团队在对国内上百个楼盘进行考察学习后,自主研发而成的第四代魔方户型,具有一定的性。此次推出的魔方户型不仅具备了高赠送、高附加值的特点,同时,注重户型的实用性与舒适度,在可利用面积增加的同时,让舒适度呈几何倍增长,100㎡的发挥出140㎡甚至更大面积所具备的使用功能与居住舒适感。绿都嘉瑞华庭秉承绿都房产一贯以来做精品的品牌思路,相信定将成为萧山新区核心的又一地标力作。', '2009-04-30', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSS0', '330100', '120.253915,30.14761;120.253928,30.145866;120.252576,30.145807;120.252018,30.145794;120.252068,30.146004;120.25202,30.146103;120.252209,30.146875;120.252269,30.14723;120.252266,30.147278;120.252287,30.147328;120.252404,30.147951;120.252449,30.149202;120.252568,30.149374;120.253608,30.149378;120.253568,30.148716;120.253892,30.148713;120.253915,30.14761', '众安山水苑东区', '杭州市萧山区潘水路', '杭州市', '', '50337.874328', '120.253069,30.147446', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSUS', '330100', '120.258767,30.170345;120.258507,30.17052;120.258267,30.170686;120.258069,30.170824;120.257677,30.171109;120.257484,30.17125;120.257468,30.171388;120.257901,30.171406;120.258181,30.17166;120.258162,30.171816;120.25847,30.171825;120.259121,30.171893;120.259252,30.171463;120.259087,30.171412;120.259181,30.171088;120.259349,30.171116;120.259526,30.170541;120.258767,30.170345', '萧然人家', '杭州市萧山区萧棉路378号', '杭州市', '', '16686.435341', '120.258621,30.171134', '商务住宅;住宅区;住宅小区', '', '2.5', '', '20937', '萧然人家位于杭棉路,毗临萧杭路,西山脚下, 位于毗邻湘湖休闲旅游度假区,风景好。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSUZ', '330100', '120.266976,30.169528;120.267023,30.169303;120.267032,30.168767;120.267065,30.16708;120.265657,30.167086;120.264396,30.167119;120.264359,30.167198;120.264176,30.167786;120.263818,30.167722;120.263712,30.167962;120.263647,30.168107;120.263494,30.168397;120.263098,30.169261;120.263207,30.169348;120.264913,30.169519;120.265323,30.169522;120.266976,30.169528', '顺发·旺角城南区', '杭州市萧山区市心中路123号', '杭州市', '', '73610.245788', '120.265349,30.16837', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BT6Q', '330100', '120.274849,30.214791;120.27429,30.211817;120.272364,30.21216;120.272847,30.215122;120.274849,30.214791', '御庭园', '杭州市萧山区宁围镇文明路288号', '杭州市', '0103000020E61000000100000005000000A795422097115E40A379008BFC363E40ABE7A4F78D115E40A1BC8FA339363E40E5266A696E115E40F584251E50363E40F373435376115E406EA6423C12373E40A795422097115E40A379008BFC363E40', '54649.999386', '120.27359,30.213481', '商务住宅;住宅区;住宅小区', '1.1', 'None', '253256平方米', '21564', '御庭园位于萧山区市中心北路东侧与文明路交汇处,距萧山区政府三千米,上机场高速到钱江三钱三千米,至规划建设中的钱江隧道三千米,道路通畅,是未来杭州大都市的中心。小区占地100余亩,总建筑面积11万平方米,地块东、南两面临河,独具江南风水灵性,园区按组团风为初阳苑、中庭苑、静怡苑、环境优雅别致、还专设小区幼儿园、会所等教育、休闲设施、生活便利、舒适尊贵。小区设计有115平方米至190平方米多种户型供选择。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BTJ3', '330100', '120.089884,30.280948;120.089613,30.281716;120.089475,30.282103;120.089321,30.282492;120.089173,30.282745;120.08897,30.283134;120.088782,30.28363;120.088565,30.284204;120.088421,30.284664;120.088375,30.284821;120.088391,30.285646;120.088405,30.285997;120.088386,30.286237;120.090657,30.286228;120.09076,30.284852;120.09088,30.283509;120.090973,30.282269;120.091089,30.281022;120.089884,30.280948', '林语别墅', '杭州市西湖区文新街道文二西路688号', '杭州市', '', '93222.462888', '120.089829,30.283891', '商务住宅;住宅区;别墅', '1', 'None', '40000平方米', '86547', '1 林语别墅有占地15亩的绿色长廊与40余亩的西溪河水。  2 林语别墅有占地21亩的社区绿色植物公园。  3 林语别墅有南北长达600米占地近40亩的林荫大道。  4 林语别墅整体环境占地近160亩,综合绿化面积达110余亩,绿化率达70%。  5 林语别墅组团景观与私家院落小景观相结合,创造充分的社交空间 其建筑风格结合了当代欧美“低层独立花园别墅”园区建设模式,是杭州城区内最具规模的高尚别墅群。 林语别墅获全国人居经典楼盘“最佳规划环境奖”荣誉称号、所在社区曾获得“杭州市绿色社区”荣誉,是杭州市物业管理优秀住宅小区。根据别墅区的特点,林语别墅客户服务中心为业主提供贵宾专项服务,开展“情满林语”系列活动,受到业主的欢迎。', '1999-04-30', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BTN7', '330100', '120.10582,30.262878;120.105348,30.262627;120.104424,30.263304;120.105385,30.264429;120.106486,30.263505;120.106582,30.263267;120.106307,30.263231;120.10582,30.262878', '华元·天鹅堡', '杭州市西湖区西溪路539号', '杭州市', '0103000020E61000000100000008000000D0D03FC1C5065E4080D6FCF84B433E40BDAC8905BE065E40ED0BE8853B433E40B83A00E2AE065E40EFE714E467433E404B1FBAA0BE065E402E1D739EB1433E40D7DEA7AAD0065E401D554D1075433E40E8154F3DD2065E40B41D537765433E407F15E0BBCD065E401B4B581B63433E40D0D03FC1C5065E4080D6FCF84B433E40', '18094.116309', '120.105473,30.263466', '商务住宅;住宅区;住宅小区', '批准车位总数量300个、其中地下车位273个、', '1.7', '53362平方米', '24564', '项目介绍:华元天鹅堡位于人文景关优越的西湖区,南侧隔老和山与西湖为邻,北至西溪路,西侧是拥有中国湿地第一园美誉的西溪湿地景区,周边市政配套设施成熟完善,华元天鹅堡以新加坡raffles hotel为蓝图,占地面积18485平方米,总建筑面积约为31000平方米,以法式兼职和法式皇家景观园林为特色的精装修法派SOHO。<br />', '2010-07-24', '7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BTVD', '330100', '120.157495,30.184951;120.156733,30.184834;120.156536,30.184806;120.155968,30.184683;120.155889,30.184925;120.155677,30.185723;120.156158,30.185811;120.157038,30.185946;120.158135,30.186132;120.158916,30.186305;120.159005,30.18519;120.157495,30.184951', '钱塘景苑', '杭州市滨江区伟业路399号', '杭州市', '', '30969.481855', '120.157396,30.18548', '商务住宅;住宅区;住宅小区', '', 'None', '', '28431', '钱塘景苑位于滨江区滨盛路与伟业路交叉路口,小区对面是彩虹城,前面是联庄,周边有动漫之都、元天科技、信雅达、创新大厦、龙禧、华荣、诺基亚、西门子、恒生、三维通信等等众多软件和电子通信单位。居住环境安静,交通方便快捷,生活配套一应俱全,方便居民的日常生活。创造具有城市文化和精神自由的、开放的、生态的、恬静的生活空间。体现“自然、和谐、舒适”的主题。', '', '1.2元/月/平方米');
