INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BU2Y', '330100', '120.080673,30.309861;120.080936,30.308499;120.081322,30.308536;120.08143,30.308471;120.081746,30.30836;120.082446,30.30845;120.082637,30.308522;120.08276,30.308684;120.082776,30.308749;120.083098,30.308809;120.083136,30.309022;120.08291,30.310138;120.082529,30.310129;120.082395,30.310226;120.082197,30.310287;120.081365,30.310217;120.081242,30.310078;120.081167,30.310046;120.081086,30.309925;120.080673,30.309861', '蓝田', '杭州市西湖区泰和路与迪臣路交叉口西南150米', '杭州市', '', '33676.562739', '120.081921,30.309329', '商务住宅;住宅区;宿舍', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BU7R', '330100', '120.067948,30.254549;120.068275,30.253991;120.067593,30.2537;120.067179,30.254188;120.066417,30.253835;120.06603,30.254533;120.066414,30.254709;120.066122,30.255331;120.068364,30.256434;120.069171,30.255191;120.067948,30.254549', '留庄', '杭州市西湖区天目山路389号', '杭州市', '', '42745.768567', '120.067543,30.255039', '商务住宅;住宅区;住宅小区', '', '1.17', '78000平方米', '24780', '留庄作为高级公寓的建筑类型开发,以丰富的建筑形态和空间形态、极具差异性的户型设计、完备的功能空间来营造官邸式的家居生活。生活与大自然紧密结合,完全融入到这西溪湿地公园的生态环境当中。建筑单体:与自然美景相得益彰的沉稳华美留庄的建筑单体造型沉稳华美,浅米色石材外墙、坡屋顶构造、正南正北的朝向、廊与柱的结合、私家花园的设计、高级VIP式会所的设置将留庄以官邸为蓝本的设计意图表现。每个户型,无论候客厅、起居室、餐厅、书房还是走廊都宽敞气派而又相对私密,满足主人生活、社交需要的同时,恰如其分地表达出主人的身份尊宠感。室内设计:深具古典美的新帕拉蒂奥风格为更好地吻合目标客户的审美取向,留庄在引入市场上罕见的帕拉蒂奥风格的同时,又融入东方元素的设计与现代工艺,力求使之呈现出中西合璧、优雅瑰丽的设计效果。', '2007-09-30', '8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BUD2', '330100', '120.071915,30.254899;120.071816,30.255313;120.071737,30.255708;120.071663,30.256098;120.071546,30.256558;120.071377,30.256933;120.071377,30.256971;120.071403,30.256992;120.071923,30.257239;120.072063,30.257009;120.072474,30.257217;120.073187,30.256168;120.073461,30.255768;120.073777,30.25536;120.073797,30.255215;120.073391,30.254999;120.07298,30.254796;120.07214,30.254392;120.072027,30.254548;120.071915,30.254899', '和庄(天目山路)', '杭州市西湖区留下街道天目山路383号', '杭州市', '', '34911.257959', '120.072479,30.255829', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '华元和庄位于国家唯一城市湿地西溪湿地之畔,周边配套繁华,属泛黄龙商圈,为城市中高档排屋项目。园区占地42131平,共100余幢纯中式排屋,户型面积约为320-530平方米,有天有地有庭有院。华元和庄主力370平方,面积跨度340-530平方。全部设有一层地下室和地上三层建筑,并赠送前庭、后院、中天井。华元和庄位于西溪湿地之畔,周边配套繁华,为高档排屋。园区依山傍水,环境优美,西湖、老和山俱在左右,西溪湿地举步即至。华元和庄位于国家唯一的城市湿地西溪湿地之畔,周边配套繁华,属泛黄龙商圈,为城市中罕见的第一居所高档排屋。园区依山傍水,环境优美,空气清新,西湖、老和山俱在左右,西溪湿地举步即至。园区占地面积42131平方米,地上住宅面积约为41500余平方,共100余幢纯中式排屋,户型面积约为340-530平方米,有天有地有庭有院。华元和庄的总平规划布局,讲究中轴对称,从院门、前庭、天井、正房到后花园,水景迂回、亭台水廊,如棋盘布局,层层递进。每个排屋组团犹如村落,各个组团之间由一些幽静街巷和花园庭院灵活进行分割组合,院落之间由绿篱、石材、墙体的组合围挡区分(具体的组合方式及高度由开发商确定并以实际交付为准)。华元和庄所处天目山路:天目山路是杭州主城区贯穿东西的主干道,与天目山路垂直交接的紫荆花路和紫金港路是西溪湿地的配套公路,其中紫荆花路连接灵溪隧道和天目山路,一肩挑起西湖和西溪,现车辆从西溪到西湖,可选择天目山路——紫荆花路——灵溪隧道——灵隐路一线,非常便利。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BUE4', '330100', '120.249123,30.310256;120.248408,30.309625;120.247405,30.310488;120.248095,30.311099;120.249123,30.310256', '普福公寓', '杭州市江干区普福社区德胜东路与红普路交叉口西北350米', '杭州市', '0103000020E610000001000000050000009C6B98A1F10F5E404563EDEF6C4F3E402504ABEAE50F5E4025068195434F3E407BF7C77BD50F5E40EACC3D247C4F3E4046D3D9C9E00F5E407CD11E2FA44F3E409C6B98A1F10F5E404563EDEF6C4F3E40', '11193.134435', '120.248261,30.310365', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BUER', '330100', '120.21837,30.312877;120.21843,30.313036;120.218526,30.313092;120.220389,30.313119;120.221492,30.313103;120.221517,30.31306;120.221572,30.312456;120.221397,30.312318;120.220694,30.312233;120.220026,30.312161;120.2191,30.312172;120.218402,30.312151;120.218254,30.312312;120.218275,30.312781;120.21837,30.312877', '美达·浅草名苑', '杭州市江干区机场路226号', '杭州市', '', '26478.068496', '120.219882,30.312649', '商务住宅;住宅区;住宅小区', '274个', '2.6', '100000平方米', '22211', '美达浅草名苑规划设计以公建、小高层及河流形成具有围合式的院落空间。住宅朝向均以正南北向布置,与城市轴网一致,增强了小区建筑群的整体秩序感,南北相错的建筑布局改善了边端套户型的对视干扰,开阔了景观视野。在建筑立面讲究现代简洁,采用挑阳台、落地凸窗、金属百页、玻璃栏板为造型元素形成独特的均质化的立韵律和节奏,有意识的改变了通常的以户为单位的立面节奏,代之以开间为单位的立面节奏。同时巧妙的隐藏了立面上开间大小的差异,使之呈现出一种均质化的富有表面肌理感的立面特征。采用经典的现代主义设计风格,简洁、干净、理性。美达.浅草名苑的内外环境都十分优美。  美达浅草名苑以与周围环境想融合为指导思想,认真处理好建筑与周边住宅、学校、河道、绿带及城市道路的关系。小区绿化景观与机场路对面的规划中的森林公园遥相呼应,充分发挥建筑与自然环境的亲和力,居住人群和周围环境、小区环境和城市环境融洽而统一。南面和西面均为河岸绿化带,沿河的高层公寓有着良好的视野。内部则做好庭院的营造,景观环境也采用了比较现代前卫的做法,景观边界大胆使用了直线和斜线,与建筑的造型融为一体。内部大庭院又巧妙的布置了社区中心、游泳池等生活配套,以满足现代人生活需求。', '2007-11-24', '0.9元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BUJJ', '330100', '120.196415,30.180999;120.196555,30.178363;120.193443,30.178507;120.193378,30.181295;120.196383,30.181366;120.196415,30.180999', '南岸晶都花园', '杭州市滨江区平安路72号', '杭州市', '0103000020E61000000100000006000000685C3810920C5E40D49B51F3552E3E4061376C5B940C5E4003D19332A92D3E40F8A8BF5E610C5E40691B7FA2B22D3E4004711E4E600C5E40A6ED5F59692E3E40629F008A910C5E40399B8E006E2E3E40685C3810920C5E40D49B51F3552E3E40', '80709.519185', '120.194962,30.179875', '商务住宅;住宅区;住宅小区', '1000', '2.4', '27平方米', '29005', '华业南岸晶都座落于杭州市滨江区滨康路和长河路交叉口,总建筑面积约27万方,由20幢高层和小高层、沿街商铺等组成。项目位居滨江区中心区位,东西滨江区行政中心和高新区公建中心的高尚规划配套均在其服务半径内,南面紧邻滨江区长河街道的成熟配套疔就近享受银行、邮局、农贸市场、医院等众多生活配套,尤其是省重点中学——杭州长河高级中学、杭州长河中学、长河中心小学、博文小学、长河街道幼儿园,等众多教育配套簇拥环伺,让孩子赢在起跑线上。  华业南岸晶都社区以“亲睦人文社区”为主题,拥有三大亲睦景观,多个温情庭院,多项亲子设施,曲曲蜿蜒的景观水系、30米宽城市公共景观绿化带,还有社区服务型商街,以适用但不失舒适的尺度全力为您和您的家人打造一片欢快、健康、舒适的居住新天地。  华业南岸晶都特聘浙江绿城物业管理有限公司担任项目的物业管理,为业主营造五星级品质现代社区。    华业南岸晶都座落于杭州市滨江区滨康路和长河路交叉口,总建筑面积约27万方,由20幢高层和小高层、沿街商铺等组成。项目位居滨江区中心区位,东西滨江区行政中心和高新区公建中心的高尚规划配套均在其服务半径内,南面紧邻滨江区长河街道的成熟配套疔就近享受银行、邮局、农贸市场、医院等众多生活配套,尤其是省重点中学——杭州长河高级中学、杭州长河中学、长河中心小学、博文小学、长河街道幼儿园,等众多教育配套簇拥环伺,让孩子赢在起跑线上。  华业南岸晶都社区以“亲睦人文社区”为主题,拥有三大亲睦景观,多个温情庭院,多项亲子设施,曲曲蜿蜒的景观水系、30米宽城市公共景观绿化带,还有社区服务型商街,以适用但不失舒适的尺度全力为您和您的家人打造一片欢快、健康、舒适的居住新天地。  华业南岸晶都特聘浙江绿城物业管理有限公司担任项目的物业管理,为业主营造五星级品质现代社区。', '2005-06-07', '1.58元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BUUS', '330100', '120.283586,30.143665;120.283458,30.144184;120.283406,30.144361;120.28338,30.144541;120.283354,30.145075;120.283366,30.145162;120.283448,30.145198;120.284395,30.145233;120.284465,30.145205;120.284471,30.145132;120.284474,30.144845;120.284475,30.144607;120.284476,30.143826;120.283586,30.143665', '晶典公寓', '杭州市萧山区南秀路1528号', '杭州市', '', '14077.442208', '120.283941,30.144502', '商务住宅;住宅区;住宅小区', '1：1', '3.5', '100000平方米', '20484', '万都·晶典公寓地处通惠南路与南环路交界处,位置上风上水,是萧山城南的崛起钜作,依托成熟的区域市场及非凡的影响力,全力打造的城南区域鼎级风范地标。  万都·晶典公寓总建筑面积约10余万平米,同时规划一条时尚商业街,以及一座星级酒店,营建高品位全功能社区生活环境。  雅筑城市生活的空间  万都·晶典公寓社区周边已形成成熟生活网络,银行、医院、餐饮、娱乐设施林立,与萧山电大隔河相望,四季花城幼儿园、汇宇小学、高桥小学、高桥初中、萧山中学、萧山十二中等各所名校近在咫尺。依托便利的交通网络,更可快速抵达城市各个角落。  图叙心灵的美学  万都·晶典公寓依西直江60米宽天然河道,坐拥罕有的超宽水岸景观,户户面江,纵览水岸美景。立体化的景观规划,葱翠的树木、碧绿的草丝、饶有情趣的景观小品、岸边的花团锦簇,在繁华市中心独具清新气质。沿河景观与水岸环境相辅相成,置身高处,可纵览水天一色的绚丽风姿,并尽情收纳如画风景。  雕琢城市品位的巨擘  恢弘力作、开创居住经典,27层生态智能建筑,以经典的现代极简主义风格,构筑城市天际线,智能化系统完美融入科技及生态内涵。知名品牌电梯的优良性能和双路供电,确保整个小区的高效能正常运作,1:1车库配比,拥有1000多平米的空中花园,无一不彰显高档品质的气概。  品鉴城市晶典生活  追求至高品质的生活,对每个户型设计的精雕细啄,精品全明设计,完全人性化,舒适的房型尺度、流畅的空间格局,布局紧凑且不失大气,分设生活阳台与景观阳台,户户水景。更有底层花园洋房和纵揽萧山全景的空中别墅,气派与尊贵尽显。  尊享城市感性的关怀  项目物业管理由浙江万都物业管理有限公司担任,并由国际知名物业公司担当顾问,引进国外先进管理方式和理念,通过亲情服务、规范服务、真正做到“100%业主第一”,成为业主的“好保姆、好管家、好朋友”。景观:坐拥罕有60米超宽水岸景观,空中花园立体化的景观规划,在繁华市中心独具清新气质', '2010-01-31', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BV1T', '330100', '120.188805,30.34342;120.188796,30.341351;120.18862,30.34136;120.186226,30.34136;120.186235,30.34168;120.186235,30.342721;120.186257,30.343403;120.188805,30.34342', '北景园月桂苑', '杭州市下城区回龙路312号', '杭州市', '0103000020E6100000010000000800000090149161150C5E40D5CA845FEA573E406667D13B150C5E40F77475C762573E40C7D79E59120C5E409E29745E63573E408EEA7420EB0B5E409E29745E63573E40B7973446EB0B5E4081B2295778573E40B7973446EB0B5E4005A73E90BC573E40ABE97AA2EB0B5E4029594E42E9573E4090149161150C5E40D5CA845FEA573E40', '47850.882245', '120.187521,30.342385', '商务住宅;住宅区;住宅小区', '', 'None', '', '25307', '北景园是目前规模经济适用房项目,位于下城区石桥镇,东起石桥路,西至上塘河,石祥路、宣杭铁路以北,规划杭玻路以南。用地面积45500平方米,规划总建筑面积10余万平方米,容积率2.3,绿化率32%,由13幢11层板式小高层组成。社区依托北景园项目,交通便捷、配套齐全,户型经济实用,是安居之。', '', '0.45元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BV8G', '330100', '120.059082,30.175135;120.05919,30.176062;120.059345,30.176188;120.059973,30.176197;120.060493,30.176086;120.06081,30.175942;120.06111,30.17552;120.061352,30.175297;120.061547,30.175144;120.061808,30.175075;120.062422,30.175003;120.062655,30.174917;120.062856,30.174796;120.062897,30.174701;120.062945,30.174546;120.062966,30.174159;120.062969,30.173598;120.063068,30.17341;120.063433,30.1727;120.06346,30.172415;120.063017,30.172111;120.06219,30.171674;120.061362,30.171237;120.06104,30.171775;120.060992,30.172712;120.061008,30.173087;120.061148,30.173598;120.061228,30.17401;120.061175,30.174238;120.060799,30.17433;120.060563,30.174289;120.060284,30.173964;120.06,30.173871;120.059624,30.173788;120.059158,30.173621;120.058884,30.173662;120.058999,30.173867;120.059318,30.174122;120.059733,30.174503;120.060209,30.17484;120.060407,30.175114;120.060407,30.175325;120.060145,30.175471;120.05975,30.175348;120.059082,30.175135', '西湖高尔夫别墅', '杭州市西湖区之江路200号', '杭州市', '', '91300.611887', '120.061439,30.173834', '商务住宅;住宅区;别墅', '', 'None', '', '49178', '南都西湖高尔夫别墅地处杭城西南风景区——“之江国家旅游度假区”内,坐拥西湖国际高尔夫乡村俱乐部4000亩的灵山秀水,堪称绿海中的翡翠。首期别墅占地170亩,共建有78幢独立别墅。它位于西湖高尔夫球场中的钻石地块,并被6个球道所环绕,如此精品、世界罕见。南都西湖高尔夫别墅平面形状成三角形,三边均面临高尔夫球场,10个别墅组团沿边依次布置。社区不仅绿地开阔、地势平缓、并充分将西湖高尔夫球场上的草坡、水体、果岭等环境景观全部融入社区生活中,尽现尊贵生活品位。南都西湖高尔夫别墅的建筑造型设计,综合了近年来国际高尔夫球场内外别墅设计的精华。倾斜平缓的瓦屋顶、厚重的毛石基座、高耸的砖砌烟囱、以及室内的壁炉、大面积的落地玻璃窗、一层半通高的客厅等,使建筑具有十分鲜明的个性。整个立面设计从材质到用色都充分考虑了别墅这一关键,同时景观沿小区主干道及组团间遍植茂密的树木,从而使整个别墅区隐藏在一片茂密的森林中。住宅与环境绿化紧密结合,使之仿如从地下"生长"出来的一样,建筑由此被赋予了生命。  别墅区内的景观沿小区主干道及组团间遍植茂密的树木,从而形成宽20-30M不等的蜿蜓曲折的森林带,联系各个组团并与周边的高尔夫球场贯通,连成整体,从而使整个别墅区隐藏在一片茂密的森林中。组团间宽窄不等的森林带,使沿边布置的别墅呈现“别墅--森林带--小组团--森林带--大组团--森林带--小组团--别墅”的有节奏的空间关系,从面彻底打破了景观的均质化,使整个别墅区自然地溶于高尔夫球场中。杭州西湖高尔夫球场是浙江省惟一国务院批准建设的拥有两个标准18洞国际锦标级的高尔夫球场。杭州西湖高尔夫俱乐部是浙江省惟一的国内高尔夫俱乐部联盟创始会员,具有不可替代性南都西湖高尔夫别墅致力营造出“高尚、运动、健康”的别墅社区氛围,成为新世纪初杭州个面向全国和海外销售的国际化楼盘。它是浙江乃至华东地区综合品质的别墅群。荣获“全国人居经典楼盘”称号。', '2004-03-01', '3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BV8T', '330100', '120.042389,30.274242;120.040333,30.274044;120.040233,30.274057;120.040161,30.274114;120.040136,30.274355;120.040151,30.274416;120.040185,30.27448;120.040575,30.275091;120.040917,30.275545;120.041206,30.275929;120.041264,30.275981;120.041351,30.276025;120.04188,30.276221;120.042291,30.276368;120.042749,30.276508;120.042859,30.276536;120.042943,30.276493;120.04302,30.275837;120.04304,30.275248;120.042916,30.274648;120.042874,30.274521;120.04268,30.274385;120.042461,30.274263;120.042389,30.274242', '西溪望庄', '杭州市余杭区建设中的荆常大道(文二西路与建设中的荆常大道交界处)', '杭州市', '', '43744.429752', '120.041787,30.275142', '商务住宅;住宅区;住宅小区', '368个', '1', '70000平方米', '22415', '西溪望庄,西溪核心紧临文二西路和荆常大道,距离西城广场5公里左右。7万余平方米的社区,11幢古典主义建筑,层数一律控制在4层,每个单元都设置知名品牌的无机房电梯,保证居住的舒适度和纯粹性。中轴对称的造型,三段式的分割及立面的进与退、凹与凸、虚与实,在整体的和谐之外建立了秩序的美感,改变普通低层公寓建筑立面单调与重复的视觉印象。以中央景观轴为界进行组团划分,构筑两个宁静、私密的围合式蝶翅形花园空间。18000平方米左右的英式大花园运用了大面积的坡地绿化、简洁的立体景观层次和大量水景。低矮的房子和开阔的花园形成宜人的空间关系,逾100米的楼间距营造了尺度的奢华感。以“大”为美的设计准则,主力户型面积控制在180—300方左右,力图将别墅的功能空间在平层中予以体现。引入帕拉迪奥十字户型的交通组织流线,以圆厅和十字内廊为骨架,形成功能分区鲜明、轴线清晰的空间。在呈现纯粹、对称的古典主义设计美感的同时,采用全框架建筑结构又为室内空间的灵动多变提供可能。3.15米的室内层高相比于普通住宅,则增加了更多的空间利用率和居住的舒适感。', '2009-05-31', '2.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BVA0', '330100', '120.331176,30.315585;120.328749,30.315471;120.328543,30.315469;120.328392,30.315569;120.328365,30.316851;120.331154,30.316879;120.331176,30.315585', '铭和苑新荷坊', '杭州市江干区学林街1344号', '杭州市', '0103000020E61000000100000007000000164ED2FC31155E40B01BB62DCA503E40EFE53E390A155E401FD61BB5C2503E401A1538D906155E40DEE68D93C2503E402711E15F04155E40A5A14621C9503E40AB09A2EE03155E4074B4AA251D513E4022FC8BA031155E4008CA6DFB1E513E40164ED2FC31155E40B01BB62DCA503E40', '34031.730958', '120.329758,30.316194', '商务住宅;住宅区;住宅小区', '', 'None', '', '21589', '铭和苑是杭州铭雅铭和苑房地产开发有限公司建设的经济适用房项目,位于杭州市下沙新城中心区内。铭和苑总占地面积200余亩,总建设面积近40万平方米,二期新荷坊、探梅坊是由18栋高层、小高层住宅组成,其主力户型为70至90平方米,共有1610套住宅。', '', '0.68-0.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BVAP', '330100', '120.289044,30.169808;120.288628,30.169516;120.288365,30.169614;120.288191,30.169676;120.287862,30.169708;120.287955,30.170291;120.288365,30.1709;120.288249,30.171178;120.288299,30.171204;120.288242,30.171375;120.28965,30.171556;120.289683,30.171349;120.289678,30.171225;120.289669,30.171092;120.289702,30.170863;120.289786,30.170325;120.289626,30.170223;120.28945,30.170106;120.289044,30.169808', '金马·名仕园', '杭州市萧山区商城西路', '杭州市', '', '24109.541663', '120.288857,30.170562', '商务住宅;住宅区;住宅小区', '514个,15万元/位', '3.2', '85000平方米', '', '独有150米沿河喷泉水岸,生机盎然,是适合全家人散步、亲子、亲近自然的纯氧平台。小区南侧住宅通过局部底层架空4米,与城市景观河流相互渗透,打开南面景观河流的视角,形成通透立体的景观绿化,内外景观和谐统一', '2006-06-28', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BVDQ', '330100', '120.243877,30.18757;120.243853,30.187599;120.24384,30.188111;120.243868,30.191359;120.245676,30.191266;120.245993,30.191238;120.246138,30.191169;120.246315,30.191132;120.246481,30.191118;120.247972,30.191187;120.248712,30.19121;120.248991,30.19122;120.249118,30.191232;120.24915,30.190532;120.249231,30.189123;120.249236,30.18871;120.24923,30.188684;120.248866,30.188471;120.248691,30.188327;120.248501,30.188144;120.248399,30.187995;120.248343,30.187815;120.248273,30.187622;120.248222,30.187411;120.248195,30.187381;120.248104,30.187369;120.247454,30.187307;120.247082,30.1873;120.246483,30.187331;120.246155,30.187339;120.245878,30.187363;120.245646,30.187409;120.2454,30.187475;120.245229,30.187515;120.244999,30.187548;120.244778,30.187596;120.244675,30.187603;120.244286,30.187585;120.244069,30.187574;120.243928,30.187571;120.243877,30.18757', '绿都湖滨花园', '杭州市萧山区金山路', '杭州市', '', '177155.512832', '120.24643,30.189377', '商务住宅;住宅区;住宅小区', '接近1：1', '约1.70', '300000平方米', '31044', '绿都.湖滨花园位于萧山新区的核心地带,是未来萧山的中心。北面,过江即是未来大杭州市中心——钱江新城;南面,临近风景秀丽的湘湖风景区及正在建设中的世界休闲博览园。项目总占地面积约260亩,总建筑面积30多万平方米,是江南城罕见的大盘之一。总户数约2000多户,绿化率超40%,是钱塘江两岸低容积率,低密度,高绿化率的高档水景楼盘。 地块三面环水,北塘河、济民河、北大浦河三条自然河流交叉纵横。小区北面与北塘河间将拥有60米宽的市政绿化带,东面临济民河规划有10米绿化带,各色花卉和植被,四季景致怡人。小区内外景观环境融为一体,或迈步其中呼吸着清新纯净的空气,或徜徉于静谧的河堤翠柳下,尽情享受自然最美的景色。临水而居是多少成功人士梦寐以求的生活梦想。 项目临近萧山新区金城路、市心中路,这是目前萧山城区的主要行政、商务文化娱乐中心。众多市政机构如区政府、电信中心、区办事中心等沿金城路分布,一些文化、商业、服务等机构云集周围,商场、超市、餐饮及娱乐设施星罗棋布,生活配套相当完善。青年路也已规划中,建成后连接机场路,直通三桥,K515、K581公交路线都经过小区...', '2011-10-08', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BVGZ', '330100', '120.160723,30.239533;120.160042,30.239523;120.15935,30.239406;120.159342,30.238915;120.160004,30.238901;120.160339,30.238871;120.160336,30.238625;120.160249,30.23862;120.160256,30.238399;120.160323,30.2384;120.160312,30.238176;120.1607,30.238202;120.160712,30.238876;120.160723,30.239533', '柳浪新苑', '杭州市上城区河坊街512号', '杭州市', '', '10025.537518', '120.160175,30.239029', '商务住宅;住宅区;住宅小区', '', 'None', '', '48553', '柳浪新苑位于杭州市上城区河坊街463号附近。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。交通便捷,购物方便,风景优美。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。环境优美,丽水成天的风景给予了回归家庭、回归私域的生活体验。', '', '0.5元/月/平方米');
