INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXRB', '330100', '120.188374,30.244454;120.188352,30.244449;120.188328,30.244453;120.187965,30.244634;120.187837,30.244649;120.187787,30.244651;120.187709,30.244635;120.187289,30.244409;120.186932,30.244554;120.185721,30.244959;120.185822,30.24514;120.186317,30.24613;120.186356,30.246138;120.187162,30.24587;120.187744,30.245723;120.188237,30.245639;120.188557,30.245625;120.188629,30.245623;120.188847,30.245618;120.188885,30.245609;120.188892,30.245601;120.188893,30.245584;120.188798,30.245286;120.188567,30.24474;120.188374,30.244454', '清泰南苑', '杭州市上城区清江路4号', '杭州市', '', '30753.079023', '120.187285,30.245222', '商务住宅;住宅区;住宅小区', '', 'None', '', '35577', '清泰南苑二期总建筑面积逾5.5万平方米,其中地上面积近4.5万平方米,地下面积1万平方米。清泰南苑二期,风格俭约,挺拔高雅,极富现代气息、建筑区域配套设施齐全、满足现代都市生活需要,是理想的中心城市人性化社区。', '', '0.2-1.28元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXRP', '330100', '120.277314,30.177845;120.275667,30.177769;120.275632,30.178267;120.277283,30.178341;120.277299,30.178098;120.277314,30.177845', '新安寓住宅小区', '杭州市萧山区山阴路与育才北路交叉口西150米', '杭州市', '0103000020E61000000100000006000000452E3883BF115E40D3C1FA3F872D3E4088653387A4115E401D3EE944822D3E40CA6E66F4A3115E40BFF4F6E7A22D3E40272F3201BF115E4033897AC1A72D3E40AA0D4E44BF115E40A67B9DD4972D3E40452E3883BF115E40D3C1FA3F872D3E40', '7483.242236', '120.276474,30.178056', '商务住宅;住宅区;住宅小区', '', 'None', '', '23201', '', '', '4.17元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXT3', '330100', '120.144728,30.183955;120.144562,30.183906;120.144184,30.184594;120.14364,30.185576;120.143448,30.185509;120.142768,30.186821;120.143726,30.187195;120.144231,30.187263;120.144629,30.187302;120.145522,30.187271;120.14627,30.187052;120.146477,30.186951;120.147166,30.186564;120.148031,30.186014;120.147844,30.185675;120.147567,30.185148;120.147285,30.18464;120.146789,30.184496;120.146248,30.184351;120.145276,30.184101;120.144728,30.183955', '临江花园', '杭州市滨江区西环路33号', '杭州市', '', '104155.204035', '120.145393,30.185783', '商务住宅;住宅区;住宅小区', '1:0.7', 'None', '300000平方米', '27714', '临江花园位于滨江中兴路西环路。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。  临江花园第三期项目占地36686平方米,总建筑面积150787平方米,项目拟分两个组团开发,建筑密度17.8%。项目楼栋设计为由三栋点式楼和三栋三联排楼组成。共可提供房源1356套。  项目的主要目标是在江水汇合处建成一坐地标建筑、建造一个生态环境幽雅的典型住宅小区。户型多为南北朝向、大开间式居家房。项目伴江边公园而立,更多一份秀丽风景。该区域其未来潜力与发展前景令人期待。  项目定位为服务于工业园区职工住房。但是又不处于园区之中且远离的距离又比较适中,既可以使职工下班之后能快速回家,又能避开工业园区的各种污染。  项目所在地处于工业园区东南面,在夏季的东南季风影响下空气不会从工业区吹过来,冬季的北风则经过太子湖,已经不具有影响性。', '2003-05-30', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXWN', '330100', '120.201007,30.342199;120.201007,30.340852;120.200272,30.34081;120.200268,30.34018;120.197601,30.340213;120.19757,30.341428;120.196803,30.341448;120.196844,30.342257;120.197001,30.342307;120.198257,30.342294;120.198898,30.342282;120.19919,30.342277;120.200175,30.342277;120.200825,30.342286;120.200916,30.34227;120.201007,30.342199', '华丰北苑', '杭州市下城区华丰路与华西路交叉口华丰村社区', '杭州市', '', '66685.309661', '120.199022,30.341343', '商务住宅;住宅区;住宅小区', '', '1.7', '320平方米', '', '华丰南苑位于下城区石桥街道,紧邻杭州装饰城和省五金市场。附近有天堂工业园区,省肿瘤医院,杭钢股份集团等知名企业。交通便利。', '', '');
