INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXX0', '330100', '120.096273,30.269824;120.096146,30.2699;120.096107,30.270073;120.095993,30.271173;120.096228,30.271204;120.096591,30.271287;120.098652,30.272246;120.10003,30.272874;120.100062,30.272882;120.100094,30.272878;120.100122,30.272876;120.10015,30.272863;120.100303,30.270629;120.096273,30.269824', '嘉绿景苑东西苑', '杭州市西湖区文新莲花街264号', '杭州市', '', '68680.830003', '120.098346,30.271166', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '嘉绿景苑是城西新的一个居住社区,总户数达到7000多户,分为东园、西园、南园三个区块,全部是从龙井、杨公堤等景区拆迁回迁的安置房,周边配套齐便。项目位于西湖区古墩路与莲花街交叉口,63路、179路、290路、310路、900路公交可达,交通便利。小区建成于2007年,建筑面积380000平方米,占地面积10000平方米,总户数7800户,绿化率30%,容积率3.20。', '', '');
