INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXXZ', '330100', '120.166,30.210267;120.164681,30.209316;120.163935,30.210342;120.167039,30.212011;120.167073,30.211937;120.167227,30.211637;120.167346,30.211474;120.167202,30.211329;120.166,30.210267', '复兴北苑', '杭州市上城区复兴路159号', '杭州市', '', '31133.612174', '120.165603,30.210661', '商务住宅;住宅区;住宅小区', '', 'None', '', '31945', '复兴北苑位于复兴路163号南星街道以西。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。复兴北苑规模大、环境好、管理好,周边配套齐全,交通方便,1幢、2幢、5幢、6幢、10幢沿河,景观较好,属于一线江景房。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXYF', '330100', '120.17547,30.217003;120.175765,30.216546;120.177152,30.217269;120.176806,30.217693;120.17547,30.217003', '凤凰城', '杭州市上城区钱江路39号', '杭州市', '0103000020E6100000010000000500000077DB85E63A0B5E40462234828D373E4003B2D7BB3F0B5E406214048F6F373E40F29A5775560B5E40446FF1F09E373E4024EF1CCA500B5E4071917BBABA373E4077DB85E63A0B5E40462234828D373E40', '7519.141762', '120.176298,30.217126', '商务住宅;住宅区;住宅小区', '', '6.5', '', '', '', '2007-02-15', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXYX', '330100', '120.046107,30.37012;120.047982,30.370187;120.048011,30.369201;120.046177,30.369095;120.046107,30.37012', '良渚十六街区', '杭州市余杭区良渚,东临东西大道(新104国道)紧邻二号干道', '杭州市', '0103000020E610000001000000050000007847C66AF3025E4074982F2FC05E3E40FD32182312035E4084674293C45E3E404AB6BA9C12035E4087A6ECF4835E3E40F4346090F4025E40FC1D8A027D5E3E407847C66AF3025E4074982F2FC05E3E40', '17009.899669', '120.047063,30.369652', '商务住宅;住宅区;住宅小区', '地上停车位76个、地下停车位64个', '2', '240000平方米', '', '良渚.十六街区位于“良渚文化”发祥地——良渚的商贸区中心地段。东临东西大道(新104国道),紧邻二号干道,北依独具休闲特色的良渚中心文化广场,西向即为规划中的综合医院。良渚·十六街区由12幢富具文化内涵的小高层、多层组成,总建筑面积约48000平方米。底层及商铺地下室空间将引进休闲娱乐设施和各类品牌店,全力打造良渚的商业中心;40年产权商品房为积极创造生活的人们倾心构建纯生活自主新地。良渚.十六街区融合商业服务与生活休闲于一体,配套齐全,满足各类人群的生活需求,全方位打造新良渚休闲生活街区。商业区为沿街空间,良渚.十六街区延续良渚文化广场中心轴线,通过连接中心广场的下沉广场将人流自然的引入半地下室的大型超市及品牌店,而地面通过各种不同的台阶、踏步、坡道引导人流。不同空间的围合将商业与居住空间巧妙分离,让商业空间热闹欢庆,一片繁荣景象。而居住空间则幽静休闲,更添古典情致。', '2006-07-02', '2.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXZG', '330100', '120.197572,30.173357;120.19849,30.173311;120.198581,30.17321;120.19859,30.172236;120.198251,30.172188;120.198063,30.172315;120.197681,30.172734;120.197613,30.172975;120.197523,30.173112;120.197489,30.173298;120.197572,30.173357', '朗庭', '杭州市滨江区滨文路115号', '杭州市', '', '8587.008168', '120.19813,30.172845', '商务住宅;住宅区;住宅小区', '', 'None', '', '11024', '朗庭位于联盟西路与友谊大街交叉口西行(水上公园西北角),阳光板式高层、咖啡色时尚立面、现代简约流线设计、易商易住SOHO空间、畅想40万平米水上公园、质感景观户型。', '', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXZM', '330100', '120.112546,30.337993;120.112543,30.338092;120.112592,30.338175;120.112667,30.338229;120.112879,30.338279;120.113888,30.338349;120.113947,30.337755;120.112623,30.337679;120.112546,30.337993', '香槟之约', '杭州市拱墅区祥运路8号', '杭州市', '', '7122.804446', '120.113256,30.338006', '商务住宅;住宅区;住宅小区', '0.5', '2.5', '45000平方米', '12649', '景园香槟之约位于拱墅区祥符镇祥园路,毗邻杭州汽车城,位于欧尚、欧倍德、建设中的南北商务港物流金三角辐射区,依托一园三点(祥符园区、康桥园区和上塘园区)的拱墅科技经济园区,集合“汽车拱墅、物流拱墅、居住拱墅、文化拱墅”的品牌亮点,属杭城城市总体规划中“北秀”之核心区块,交通便利,汽车北站近在咫尺。景园香槟之约总建筑面积约43000余平方米,以“居住+商务”的综合设计,容纳“财富街区”与“MINI空间”两种物业形态。财富街区由两座5层楼宇组成,一二层为大开间商铺,三四五层为综合办公楼,主要针对拱墅科技经济园区一些对办公有特殊需求的企业。MINI空间由两幢11层点式、一幢13层板式公寓组合而成,户型面积从30多平方米到200多平方米不等,能满足不同层面购房者的需求。', '2006-01-03', '0.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXZO', '330100', '120.28836,30.143175;120.288443,30.142287;120.288435,30.141817;120.287282,30.14178;120.287244,30.14208;120.28713,30.142076;120.287051,30.142074;120.286905,30.142151;120.286767,30.142225;120.286639,30.142246;120.286197,30.142222;120.285933,30.142237;120.285864,30.142817;120.285859,30.143039;120.285958,30.143096;120.286139,30.143132;120.28821,30.143253;120.288306,30.143242;120.28836,30.143175', '新惠名苑', '杭州市萧山区新螺路20号', '杭州市', '', '26984.033835', '120.28729,30.14258', '商务住宅;住宅区;住宅小区', '', 'None', '80000平方米', '22914', '高运·新惠名苑坐落于萧山区通惠南路与新螺路东南角,地理位置优越,有K7、K308、K311等多路公交车可直达,交通十分便利。项目总建筑面积约25000㎡,绿地率30.6%,由A、B两幢分别为12层和18层的小高层、高层住宅及裙房商铺组成,户型面积:40~140㎡,结构合理,三阳台的设计是本楼盘的一大特色,在设计上以舒适、合理为规划导向,北高南低,错落有致,围合式的建筑规划格局使业主们更能感受到居家的生活气氛和安全感,户户朝南,人车分离,均可最大限度地享受公共景观资源。  高运·新惠名苑贴心为您设置品牌“日立”电梯,方便快捷,同时为您提供完备的安防智能化系统及消防智能化系统。每家每户全面到入宽带网络设施,使能掌握世界脉动不落人后。管道煤气的接入,让您省心省力,访客可视对讲系统,闭路电视监控系统,将生活与高科技全面结合,让苑内居民尽享现代科技带来的安心舒适。  社区实行信息智能化管理,保持社区内部生活的安静舒适,充分彰显高尚居住品位。同时提供绿化养护、保洁清理、设施维护等日常维护。人性化、专业化的物业管理让您从容写意、笑对人生。  高运房产曾在2005年开发了新惠名苑一期,当时仅两天就售完156套房源。时隔4年,坐落于萧山区通惠南路和新螺路交叉口的东南角新惠名苑二期也将重磅登场,总建筑面积约10万平方米,为8幢11-18层的板式、点式小高层、高层,为70年产权的纯住宅,沿街有1—2层独立商铺,整个楼盘楼栋分布为南低北高,错落有致。其中,3号楼与6号楼之间至宽处间距约为63米,中心景观广场面积约8000平方米,前后通透开阔,实现了大间距、大景观、大视野,在城南板块楼盘中非常罕见。户型面积从81、88、90、116、125、136、137、138平方米不等,共计17款经典户型。其中,主力户型为90平方米三房二厅(被专家评为金牌户型)。  高运·新惠名苑二期项目采用知名品牌电梯,电梯使用宽绰,业主上下十分便捷,为确保宁静的居家生活,小区实施人车分流。同时,项目红外线周界报警系统、可视对讲系统等一应俱全,安全程度高。小区实施24小时全程物业服务,将为明天生活在这里的每一位业主提供体贴、周到的服务。  新惠名苑周边的交通十分便捷,距离通惠路公交站约一站路,距离地铁2号线朝阳站约1000多米。如果从新惠名苑开车出发,走通惠路——新街——到下沙大学城大约30多分钟,如果走四桥去杭州20多分钟。根据规划,未来的通惠路将成为市政道路,大货车将限行,这对改善通惠路的交通环境十分有利。  新惠名苑除了可以享受老城区成熟商业配套外,还享有丰富的学区资源,周边有萧山中学、十一中、高桥初中、高桥小学、汇宇小学(建设中)、浙江电大萧山分校、四季花城幼儿园……几乎涵盖了幼儿园到成人大学的整套教育体系,应该说是萧山完善成熟的教育配套板块之一。', '2009-03-28', '1.5元/月/平方米');
