INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY26', '330100', '120.200611,30.234115;120.200588,30.234041;120.200403,30.234045;120.200313,30.233964;120.19891,30.235258;120.1996,30.235833;120.200909,30.234707;120.20093,30.234524;120.201022,30.23422;120.201068,30.234097;120.200611,30.234115', '耀江福村', '杭州市上城区衢江路与富春路交叉口钱丰酒店后面', '杭州市', '', '16995.838376', '120.200023,30.234861', '商务住宅;住宅区;住宅小区', '', 'None', '112000平方米', '37993', '耀江福村由杭州城建开发有限公司 开发,2000年竣工,耀江福村物业类型是多层住宅,小区开盘时间在1998年, 就在钱塘江边上,属于钱江新城的房子 耀江福村位于富春路与衢江路交叉口。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY2P', '330100', '120.136341,30.326083;120.136242,30.32608;120.135541,30.326076;120.135384,30.326763;120.135334,30.326919;120.135263,30.326998;120.135132,30.327064;120.134132,30.327043;120.134149,30.327797;120.13595,30.327904;120.136103,30.32727;120.136226,30.326656;120.136368,30.326099;120.136341,30.326083', '信步闲庭', '杭州市拱墅区小河路697号', '杭州市', '', '21315.15335', '120.135367,30.327142', '商务住宅;住宅区;住宅小区', '0.8', '2.7', '54447平方米', '39569', '信步闲庭,城北桥西首发楼盘,她既拥有老城的古朴又具有新城的妩媚,她秉承城北的历史文明,又蓄势待发开创桥西的美好未来。信步闲庭位于拱墅区拱宸桥和京杭大运河西畔,东临小河路和规划中运河客运码头,周边环境优美,交通便利。信步闲庭由1幢小高层、6幢高层和部分商业配套围合而成,建筑和绿化园林相呼应,形成人景互动、情味交融的社区环境,筑就了精致、闲适、悠然的双景观休闲社区。信步闲庭在户型设计上遵循人性化设计理念,合理使用空间结构,创造出精致多样的各种户型,并根据每幢楼的不同特点,对不同户型进行特定的取景设计,使每户均有良好的采光通风和景观视野。其主力户型在90——130方之间,户型经济舒适,适合市场的需求。把居室、餐厅、厨房的功能发挥到极致,追求在有限的空间里创造完美的居住空间。让每一个空间都散发着家的芳香,让您感受到的是深入骨髓的幸福。', '2006-12-31', '1.5元/月/平方米');
