INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY5I', '330100', '120.206714,30.233577;120.206681,30.233521;120.206562,30.233325;120.205996,30.233324;120.206002,30.233481;120.20513,30.233489;120.204505,30.233499;120.204044,30.233506;120.203996,30.233554;120.203656,30.233817;120.203356,30.234058;120.203358,30.234103;120.203485,30.234312;120.203616,30.234656;120.204499,30.234634;120.20537,30.23462;120.20548,30.234612;120.205563,30.234579;120.205561,30.234358;120.205889,30.234325;120.205884,30.234197;120.205928,30.234101;120.206021,30.234035;120.206127,30.23397;120.206308,30.233892;120.206483,30.23384;120.206703,30.233711;120.206754,30.233641;120.206714,30.233577', '天福花园', '杭州市上城区近江东路34号', '杭州市', '', '26981.931467', '120.204929,30.234003', '商务住宅;住宅区;住宅小区', '', 'None', '', '40930', '天福花园位于市政府新址附近,紧靠丹阳师范,公交车站在公司门前。一期工程开发的55000平方米,天福花园二期工程已开工建设。天福花园位于近江东路34。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.35元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY5J', '330100', '120.150996,30.191423;120.15203,30.191516;120.152106,30.191513;120.152182,30.191483;120.152231,30.191442;120.152264,30.191381;120.152373,30.190461;120.152437,30.188344;120.152416,30.188206;120.152315,30.188137;120.149655,30.188862;120.149561,30.191142;120.149972,30.191275;120.150996,30.191423', '之江花园', '杭州市滨江区滨盛路', '杭州市', '', '72981.464846', '120.151078,30.189926', '商务住宅;住宅区;住宅小区', '1:1', 'None', '36285平方米', '32071', '靠近闻涛路、一线江景别墅。', '1998-08-01', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0I00Q', '330100', '120.155667,30.185771;120.155579,30.185785;120.154802,30.185931;120.154017,30.186046;120.152931,30.186124;120.152033,30.186179;120.152193,30.186544;120.152291,30.186624;120.152789,30.187906;120.155216,30.187272;120.155962,30.187183;120.155882,30.186643;120.15583,30.186102;120.155716,30.185795;120.155667,30.185771', '六合天寓', '杭州市滨江区浦沿镇东信大道1222号', '杭州市', '', '48708.448148', '120.154064,30.186759', '商务住宅;住宅区;住宅小区', '1:1.25', '3.5', '240000平方米', '35192', '六合天寓位于东信大道。六合天寓通过大型乔木、阶梯、树岛、水体、局部特质围墙将内外空间以自然的形态隔断,使小区的绿化景观、居住环境在融入到周边大环境之中又保有自我的独立性,达到了“你中有我,我中有你”的共享境界,营造出一种开放、自然、优雅、充满生机的居住新空间。  六合天寓在环境细节上的处理也相当别致,水景中将植有形态优雅的水生植物,如睡莲,带动水线的空间错落。椭圆形的树岛、方形的树井和极具设计感的小公建在绿化了环境的同时也使建筑空间显得活泼与生动,通过树木缝隙的摆动营造视觉的动感空间,使景观终融入建筑与城市中。', '2007-09-20', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0I07F', '330100', '120.237162,30.357989;120.237083,30.357924;120.236704,30.358016;120.236514,30.358038;120.234986,30.358624;120.235492,30.359865;120.235716,30.359997;120.237301,30.359503;120.237628,30.359375;120.237939,30.359226;120.238146,30.359064;120.237839,30.358673;120.237162,30.357989', '天阳·观筑', '杭州市江干区丁桥勤丰路(勤丰路与环丁支路交汇处)', '杭州市', '', '36051.756173', '120.236487,30.358946', '商务住宅;住宅区;住宅小区', '512个，配比1：0.55', '2.2', '120000平方米', '25957', '丁桥将建设2所中学、4所小学、7所幼儿园、和1所市级医院,规划建设净菜超市三座,垃圾中转站,公交首末站、公交中心各一座,文化、商场、公园等基础设施也将同步建设,水、电、污水、燃气、通信等市政管线配套设施,以及居住配套中心部分都将建成并投入运营。', '2010-05-03', '1.2元/月/平方米');
