INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13GJH', '330100', '120.098576,30.277365;120.097655,30.277302;120.097546,30.277648;120.097238,30.278657;120.098562,30.278825;120.099355,30.278875;120.100122,30.278923;120.100384,30.277445;120.100091,30.277419;120.098576,30.277365', '金田花园', '杭州市西湖区古墩路369号', '杭州市', '', '37355.897794', '120.098864,30.278104', '商务住宅;住宅区;住宅小区', '', 'None', '', '32403', '金田花园分3期开发,期为96年,为1至7幢,以2房一厅,65平米左右为主打,大都是2房朝南,户型比较正气,得房率比较高,第二期为98年,第三期即新一期99年底,主要是与颐景园相连。生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.44-0.6元/月/平方米');
