INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13I7W', '330100', '120.153843,30.308012;120.152557,30.308009;120.15253,30.309723;120.153182,30.3101;120.153576,30.309595;120.153982,30.309065;120.15428,30.308609;120.15432,30.308454;120.154327,30.308014;120.153843,30.308012', '大关西五苑(大苑路)', '杭州市拱墅区大关路254-264号', '杭州市', '', '24967.576274', '120.153301,30.308851', '商务住宅;住宅区;住宅小区', '', '2.5', '22000平方米', '32266', '大关西五苑的优点在于:处于闹市地段。综合配套优质。出行比较方便(公交线有26路-大关东五苑、503路-上塘路香积寺路口、843路-百丈井东路、K605路空调-公交三公司等6条;步行到近的公交线仅需1)。购物配套便利(大型超市:世纪华联等2家;小型超市:喜士多便利连锁店德苑路店、红霞便利超市、可的便利店no.803等12家;步行到近的大型超市较近)。美中不足的是:有一定噪声。', '', '0.54元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13I9Y', '330100', '120.138984,30.173908;120.138778,30.17387;120.138552,30.173842;120.137915,30.173853;120.137223,30.173932;120.136698,30.173984;120.13612,30.174086;120.135733,30.174141;120.135532,30.174171;120.13527,30.174226;120.135015,30.175346;120.13489,30.17603;120.139497,30.176057;120.139466,30.173995;120.138984,30.173908', '逸天广场', '杭州市滨江区东信大道270号', '杭州市', '', '82784.337934', '120.137341,30.175022', '商务住宅;住宅区;住宅小区', '车位比1:1', '1.73', '17平方米', '29798', '逸天广场位于钱塘江南岸,东信大道与振浦路的交叉口东南面,北与杭二中隔路相对,与六和塔隔江相望,社区总占地面积约147亩,总建筑面积约17万平方米,是一个由全装190㎡-220㎡大户型、全装40㎡—90㎡精致小户型、写字楼三种物业类型构成的功能复合型现代社区。  在钱江南岸,逸天广场是少有的低容积率高层社区。与周边的其他高层住宅相比,万科.逸天广场在1.73的低容积率指标内,建设了一个纯高层的社区,建筑密度控制在13.82左右,留出86%的空间作为环境设计的基本平台。随着区域内建筑高层、高容积率的发展趋势,2.0以下容积率住宅区将日显稀缺。  逸天广场的社区会所地上建筑面积约2544平方米,总建筑面积约4000平方米,地上三层,地下两层。除了专业的健身设施与场地外,会所可以设置羽毛球室、壁球室、乒乓球室与室内游泳池,结合户外场所中的网球场、半场篮球场、嬉水池等,逸天广场运动设施在同等规模的社区中。', '2006-12-23', '1.8元/月/平方米');
