INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13J5D', '330100', '120.163074,30.242628;120.163042,30.24142;120.162639,30.241439;120.162567,30.24147;120.162524,30.241527;120.162654,30.242564;120.162631,30.24274;120.163085,30.242716;120.163074,30.242628', '吴山名苑(劳动路)', '杭州市上城区清波街道劳动路28号', '杭州市', '', '5497.309967', '120.162825,30.242058', '商务住宅;住宅区;住宅小区', '', 'None', '16000平方米', '86997', '西湖边顶级豪宅,距西湖步行两分钟,到吴山广场河坊街步行5分钟吴山名苑共72套高尚住宅为涉外高档电梯多层公寓,位于吴山广场以北,西邻劳动路,东临杭四中。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13JEF', '330100', '120.17028,30.209255;120.166241,30.207196;120.165782,30.207804;120.16509,30.208726;120.166395,30.209739;120.166938,30.208924;120.167918,30.209403;120.168031,30.209598;120.168061,30.210058;120.166802,30.21006;120.166849,30.210163;120.168522,30.211682;120.17028,30.209255', '复兴南苑', '杭州市上城区美政路4号', '杭州市', '', '87073.473461', '120.167746,30.209254', '商务住宅;住宅区;住宅小区', '', 'None', '', '35667', '复兴南苑位于之江路525号,美政路和洋泮路中间。复兴南苑共有3批年代的房子分别室1998年、2000年和2005年。2005年的房子属于一线江景房。复兴南苑以科学、人性化的规划设计打造出惬意的居住文化。生活安静,环境优美,生活氛围浓厚等优势为您创造了优良居住环境。  小区的配套设施齐备,小区内设有幼儿园、小学、中学,超市就在家门口。复兴南苑位于通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.35-1.2元/月/平方米');
