INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13L8D', '330100', '120.217322,30.27236;120.216846,30.272129;120.215969,30.271685;120.215881,30.271656;120.215805,30.271657;120.21574,30.271699;120.215573,30.271952;120.215038,30.272935;120.21502,30.273017;120.215035,30.273066;120.215087,30.27311;120.216491,30.273748;120.21722,30.272792;120.217398,30.272657;120.217532,30.272466;120.217322,30.27236', '东润枫华(昙花庵路)', '杭州市江干区昙花庵路水湘路', '杭州市', '', '26733.096651', '120.216196,30.272694', '商务住宅;住宅区;住宅小区', '370个（1：0.7）', '2.2', '85000平方米', '43453', '东润枫华项目,位于杭城东部,钱江新城北部,大运河西岸。东临运河、南临昙花庵路、西依水湘路、北靠新河路,属于钱江新城“一心两社区”中的运河社区;距钱江新城核心区(万象城、市民中心)约2千余米,距武林广场约6千米;通过昙花庵路、新塘路,直抵钱江新城核心区和武林广场。东润枫华属杭州城市成熟区域,坐享钱江新城核心的国际化尊贵配套和采荷、景芳的成熟配套,市场稀缺性强、投资安全度高,区域发展潜力很大,是杭州城区的人居,为众多业内人士看好。规划:围合式布局,人车分流,低建筑密度、高绿地率,纯住宅园区。建筑:采用新古典主义风格,历久弥新,彰显尊贵。景观:东枕千年运河,西依6000方市政公园,内享近万方景观庭院。户型:具有高享受度、高品质感、高可塑性,户型面积在88-186㎡。智能配置:光纤入户。', '2011-09-17', '2.5元/月/平方米');
