INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13M9K', '330100', '120.276767,30.182724;120.276721,30.182588;120.27669,30.182363;120.276657,30.182246;120.27663,30.182199;120.276586,30.182138;120.276535,30.182117;120.275593,30.182219;120.274428,30.182344;120.274294,30.182385;120.274259,30.182451;120.274248,30.182609;120.274249,30.182694;120.274283,30.182695;120.274324,30.182698;120.275395,30.182638;120.275408,30.183528;120.276895,30.183515;120.276906,30.183444;120.276872,30.183355;120.276835,30.183257;120.276767,30.182724', '雍景湾', '杭州市萧山区育才北路685号', '杭州市', '', '20636.138555', '120.275866,30.182798', '商务住宅;住宅区;住宅小区', '', 'None', '', '25668', '中新·雍景湾花园总规划用地面积23109平方米,总建筑面积近4万平方米,规划总住户220户,是一个由排屋、小高层和高层组成的中高档住宅小区。整个小区依傍大浦河而建,是萧山三面临水的亲水住宅区。现代建筑设计手法巧妙搭配现代园林设计将打造成领秀萧山新区的水岸浓荫豪宅。 雍景湾融合现代建筑艺术的思想内涵,以睿智的简洁之美,以锐意进取的直线精神,成为建筑风景中的经典制作.关注建筑的每个一微小细节,以精心的雕琢,追求的唯美,虽另类不群却不失卓然之感;建筑外围鲜明而幽雅、夺目却温文,处处传递着舒适,明快的新都市主义视觉观感;建筑顶部的直线方形装饰体,宛如舒展的羽翼,奔放的自由精神在空间中流泻……', '', '');
