INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13MFD', '330100', '120.244183,30.153979;120.244498,30.153436;120.24457,30.153301;120.244659,30.153083;120.244653,30.15297;120.244543,30.152753;120.244396,30.152662;120.244278,30.152647;120.244179,30.152644;120.244009,30.152707;120.2437,30.152949;120.243264,30.153301;120.243087,30.153417;120.242848,30.153505;120.242615,30.15355;120.242173,30.15356;120.241663,30.153558;120.241497,30.153568;120.241354,30.153586;120.241109,30.153675;120.240866,30.153813;120.240746,30.153904;120.239917,30.154734;120.238938,30.155772;120.238819,30.15593;120.24114,30.157833;120.241863,30.158422;120.242961,30.159282;120.243068,30.159375;120.243676,30.159897;120.244469,30.159117;120.244537,30.159008;120.244662,30.15849;120.244586,30.158095;120.24452,30.158018;120.243766,30.157682;120.243676,30.157568;120.243675,30.157223;120.243425,30.156667;120.243058,30.156274;120.24305,30.156131;120.243089,30.156009;120.243166,30.155854;120.24321,30.155711;120.24342,30.155457;120.243567,30.155347;120.243998,30.155106;120.244058,30.155015;120.244092,30.154807;120.244143,30.154104;120.244183,30.153979', '宋城·地中海别墅', '杭州市萧山区杭州乐园城乡休博园五区', '杭州市', '', '191557.889206', '120.24218,30.156084', '商务住宅;住宅区;别墅', '', 'None', '', '', '别墅与山相望,与水相亲。位于钱江南岸湘湖旅游度假区,西临湘湖,北依湘河,内抱秀湖,是罕有的纯水岸别墅尊贵社区,属于世界休闲博览园人居样板展示项目。宋城地中海别墅与山相望,与水相亲。位于钱江南岸湘湖旅游度假区,西临湘湖,北依湘河,内抱秀湖,是罕有的纯水岸别墅尊贵社区,属于世界休闲博览园人居样板展示项目。宋城地中海别墅总占地面积约350亩,其中水域面积约95亩,总建筑面积约33000平方米,区域内仅有56幢亲水豪宅,别墅设有游泳池和私人游艇码头,环绕社区的自然水系水域面积广阔。地中海别墅以自然错落环形布局,湖面上镶嵌着太阳岛、月亮岛、湖心岛、蓬莱岛四颗璀璨明珠,聚散有致,与纵横贯穿整个项目的60000平方米的湖光潋影、园林胜景相映成辉,真正做到了豪宅私密、个性、稀缺、生态的独特空间序列,把地中海别墅营造成稀世鼎级的亲水豪宅社区。容积率0.145;绿化率50%左右;交房时间2009年2月左右物业公司:上海高力国际物业管理有限公司中小学:城西小学,城西中学,萧山十中,朝晖初中,远东外国语学校幼儿园:有综合商场:时代超市,华润超市,解百萧山商厦银行:有其他:第一世界大酒店、杭州乐园', '', '4.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13MGI', '330100', '120.157033,30.190667;120.156629,30.190662;120.156284,30.190697;120.15562,30.190766;120.155543,30.191225;120.155494,30.19203;120.157001,30.192111;120.158331,30.192165;120.158472,30.192057;120.158605,30.190833;120.158421,30.190791;120.157725,30.190734;120.157341,30.190696;120.157033,30.190667', '彩虹豪庭', '杭州市滨江区伟业路与文涛路交叉路口', '杭州市', '', '37715.634795', '120.15705,30.191411', '商务住宅;住宅区;住宅小区', '600', '2', '100000平方米', '51843', '项目介绍:钱江彩虹豪庭座落于杭州钱塘江南岸,位于钱江·彩虹城东北侧,总建筑面积约10万平方米,由6幢高层住宅组成,主力户型约260平方米,为钱江南岸一线江景精装修豪宅住区。    钱江彩虹豪庭直面壮阔的钱塘江,左看凤凰山、六和塔和钱塘江一桥,右望杭州城市景观,历史与城市合抱,风景与生活独揽,拥有“半边山半边城”无可替代的江景视野。    钱江彩虹豪庭6幢高层建筑结合钱塘江的流向,有序排布,大气磅礴,形成户户迎江的全江景格局,开阖有序的空间和半围合的规划,实现园区外有浩瀚大江,内有风情雅园的空间格调。    钱江·彩虹豪庭传承典雅主义风格,提取西方建筑语汇和典型元素,融合现代建筑的构筑手法,将尊容华贵与典雅大方的设计意象周全展现,竖向线条的强调,柱饰细部的韵律,墙面石材的运用,渗透了典雅主义风格独有的细节感动。    钱江彩虹豪庭主入口大堂、住宅建筑入户大堂、各单元楼层电梯厅全面实施精装修,用材、部品和设备精挑细选,星级酒店装修标准的艺术和优雅,营造出回家的荣耀和归属。    钱江彩虹豪庭住宅室内实行精装修,各厅室硬装到位,厨卫全装到位,窗系铝合金、厨房装配、卫浴设备全部选用欧系高档品牌,彰显欧洲工业设计的精神和工艺制作的品质,引领欧美生活时尚的理性主义。    钱江彩虹豪庭独创VIP财经人文俱乐部,专设室内恒温游泳池,加盟杭州高端商业金融商圈团体和论坛,在休闲养生之时轻松实现志同道合的精神对话。    钱江房产与浙江国大雷迪森酒店管理有限公司精诚合作,引进五星级酒店管理标准,造就钱江·彩虹豪庭专业、周到的品质服务。    1、门窗:意大利阿鲁克断桥隔热系统门窗、皮尔金顿Low-e中空玻璃2、厨房电器:德国西门子厨房电器(冰箱、微波炉、消毒碗柜、抽油烟机、煤气灶)(或同档次其他品牌) 美国爱适易垃圾处理器    3、厨房橱柜:德国艾诺(或同档次其他品牌)    4、室内石材:金世纪米黄、凡尔赛金、爵士白、帝王金、伯朗米黄、古典米黄、黑金花等多种高档大理石。    5、室内地板:高档实木复合地板    6、洁具:德国杜拉维特、乐伊(或同档次其它品牌)    7、龙头及淋浴花洒:德国汉斯格雅(或同档次其它品牌)    8、自然新风系统:德国丝吉利娅(或同档次其它品牌)    9、开关插座:德国吉徕(或同档次其它品牌)    10、可视对讲:韩国三星(7寸彩屏)    11、空调:日本大金变频中央空调    12、电梯:原装进口日本三菱电梯    13、配电箱:德国穆勒', '2009-06-20', '4.8元/月/平方米');
