INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13MGY', '330100', '120.229304,30.188209;120.228874,30.188398;120.229072,30.188779;120.229053,30.188934;120.228896,30.189083;120.22905,30.189245;120.229514,30.189064;120.230471,30.188644;120.23044,30.188425;120.230155,30.187859;120.229304,30.188209', '官河公寓', '杭州市滨江区西陵路126号附近', '杭州市', '', '11446.151234', '120.229664,30.188543', '商务住宅;住宅区;住宅小区', '', 'None', '', '24377', '地理交通:西兴实验小学旁,温兴风情苑前面。骑电动车至3、至4桥10分钟桥15分钟、至1桥20分钟。经西兴过四桥开往解百、官巷口,行程约40分钟,杭萧间便捷巴士过三桥10多分钟便到总管塘。315过一桥,经西兴,路线是延安路--萧山,没坐过不知道多少时间。骑电动车也可,只是三桥、四桥上下桥要推行。', '', '');
