INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13NCT', '330100', '120.267056,30.212784;120.266388,30.212787;120.266391,30.213218;120.267736,30.213194;120.269097,30.213125;120.269012,30.21257;120.267056,30.212784', '幸福时代', '杭州市萧山区文明路499号附近', '杭州市', '0103000020E61000000100000007000000D68C0C7217115E40B01C210379363E40000341800C115E409203763579363E40B83CD68C0C115E4025EB707495363E408FFD2C9622115E4014B4C9E193363E40E99C9FE238115E40C3F5285C8F363E40D28E1B7E37115E40581CCEFC6A363E40D68C0C7217115E40B01C210379363E40', '11669.448195', '120.267795,30.21294', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '幸福时代公寓位于钱江新城对岸,机场高速路以南,市心北路以西,毗邻萧山经济开发区,区位优越,交通便捷,占据未来杭州城市中心——钱江世纪城核心地理优势,具备无限发展潜能。  项目占地255亩,总建筑面积约39万方,由风格简洁、气质的高层、小高层组成,绿地率40.2%,容积率仅1.8,真正高绿化,低密度的高品质健康住宅。小区配备三大功能会所,运动馆、幼儿园、特色商业街等社区内部配套一应俱全。', '', '1.3元/月/平方米');
