INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13NLD', '330100', '120.201371,30.239433;120.202948,30.241041;120.204316,30.242436;120.20555,30.241551;120.20467,30.240439;120.203775,30.239521;120.202723,30.238469;120.201371,30.239433', '滨江·城市之星', '杭州市江干区市民街167号', '杭州市', '0103000020E6100000010000000800000038D73043E30C5E404A95287B4B3D3E4079B29B19FD0C5E40C1FEEBDCB43D3E402C836A83130D5E40815F2349103E3E4057EC2FBB270D5E40EC504D49D63D3E403A1E3350190D5E40D5AE09698D3D3E40832F4CA60A0D5E4089B48D3F513D3E4069C9E369F90C5E401D1CEC4D0C3D3E4038D73043E30C5E404A95287B4B3D3E40', '62159.138973', '120.203496,30.240439', '商务住宅;住宅区;住宅小区', '1:2', '4.6', '225000平方米', '53940', '滨江·城市之星概况滨江集团高端精装力作,CBD精装城市公馆  滨江·城市之星CBD5号,作为滨江集团精装大宅典范,承袭金色海岸、阳光海岸一贯秉持的精装工艺,以人性化的设计将艺术与空间极至奢华完美结合,将专属豪宅的高贵血脉镌刻于此。并可享受新政下自由购房及贷款政策,多套购买均可享受按揭贷款政策。  尊踞钱江新城核心区,尊享CBD最后稀缺席位  滨江·城市之星CBD5号,尊踞钱江新城CBD中央,以地标性的璀璨荣耀与国际化的城市功能,尽现CBD精装人居的华贵,随着钱江新城住宅用地的稀缺,城市之星的精装城市公馆已成为入主钱江新城、尊享繁华城市配套的最后机遇。  高远世界,非凡私享,可遇不可再(项目规划)  30万m2半围合式社区150米“天空之城”  滨江·城市之星的30万方整体社区,由6幢擎天建筑半围合式而成。经典“U”型布局,既让整个社区相融于周边环境,又保持相对独立,小区风景以及城市璀璨尽收眼底;  150米的傲视高度,使滨江·城市之星成为杭州目前最高的住宅之一,匹配着尊贵住户的开阔视野与胸襟,人生高阔,尽在掌握。  20万方石材立面赋予建筑华贵典雅气质  滨江·城市之星的主要建筑立面采用石材干挂,铺设面积达到了20万平方米。隽永的石材与通透的玻璃和谐相融,古典韵律与现代时尚交相辉映,营造出整个社区典雅华贵的气质。  臻享3.6万m2中央园林杭城最大规模的公园住区  滨江·城市之星采用独具艺术气息与自由感的西班牙风格,营造杭州最大的3.6万m2中央园林。宽度近100米的摩尔风格泳池,融合周边环境、地形地势,勾画每一域风格各异的风景。  近享高尚会所专属名流殿堂  CBD5号是距离园区豪华会所最近的建筑,这里的会所为业主们提供了一个体面、尊贵的绝佳社交场所。  在这里,不仅有丰富的功能配套,还有优雅的服务,让气质相近的名士们流连于此。每一次愉悦的踏足,都将他们各自迥异的魅力风采,尽情地优雅展现。365天的恒温泳池、高级健身会、中西高档餐厅、商务会议中心和棋牌娱乐室……会所里的丰富设施,让工作与生活张驰有度,达到完美平衡。', '2013-04-26', '4.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13NLS', '330100', '120.171372,30.209858;120.171097,30.210311;120.172207,30.210857;120.172487,30.210413;120.171372,30.209858', '蓝江公寓', '杭州市上城区南星桥之江路552号', '杭州市', '0103000020E61000000100000005000000CFDC43C2F70A5E40D1CDFE40B9353E4066DCD440F30A5E4033FD12F1D6353E401B498270050B5E40F7216FB9FA353E400DFFE9060A0B5E403BA759A0DD353E40CFDC43C2F70A5E40D1CDFE40B9353E40', '5931.407995', '120.17179,30.210359', '商务住宅;住宅区;住宅小区', '', '2.4', '50000平方米', '32781', '一线江景房,边套,背山面水,视野开阔,景观优美,小区总共有三幢房子,分别为高层,多层,小高层组成。每幢2个单元,每单元一梯二户,1幢为总楼层19楼。跃层。 2幢6楼。 3幢12楼。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13NLV', '330100', '120.173436,30.214383;120.172655,30.214013;120.17244,30.214364;120.172365,30.214678;120.172144,30.214973;120.172667,30.215538;120.172784,30.215437;120.17303,30.215022;120.173436,30.214383', '钱塘雅苑', '杭州市上城区上城紫花支路28号', '杭州市', '', '9116.267925', '120.172757,30.214731', '商务住宅;住宅区;住宅小区', '1', '3', '38000平方米', '30076', '钱塘雅苑位于钱塘江北岸,北临复兴街,南接南星水厂,东靠政法大楼,西临紫花苑小区。周边医院、超市、学校、体育场馆等配套设施齐全。总建筑面积3.8万平方米,为高层精品住宅小区。 依慕钱塘古风 钱塘雅苑为三栋不同建筑形态的点式与板式高层住宅,以小见大,以形造势,形成东南开发、西北围合的庭院空间布局。既秉承和发扬了中国传统的四合院和城市广场空间特点,又有利于通风、日照以及领略钱塘胜景。 再现繁华春晓 为融绿化于环境,寓生活与绿色中,钱塘春晓精心选用莳令花木,采用自然式的培植方式,使树成丛,花成片,草成坪。阳春三月,绿柳倒垂,玉兰婷立,杜鹃争艳;每逢七、八月份,桂花香气阵阵袭来,月光在姹紫嫣红的木槿花、石榴花映衬下显得格外明亮,“醉里偶摇桂树,人间唤做凉风”,是暑夜纳凉的好地方;秋高气爽,鸡爪槭、七叶树、银杏林始展亮立秋色,“停车坐爱枫林晚,霜叶红于二月花”的意境尽在眼前;隆冬将至,梅林初雪,梅吐蕊,松傲立,即使在寒冷冬天也能闻到幽幽清香。使您无论在家里、院里、春天、冬天,都能切身享受的绿化。 体现个性追求 钱塘雅苑按照多元化标准进行设计,具有足够的可变性。住户可以根据生活方式和个人喜好的不同,对内部空间进行灵活分割,从而直接参与到户型的设计和室内装修中,创造您“个性的家”。', '2005-10-29', '1.05元/月/平方米');
