INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13NZ3', '330100', '120.253574,30.179218;120.253563,30.178505;120.252651,30.178513;120.251988,30.178542;120.251869,30.179522;120.251783,30.180502;120.252719,30.180601;120.253243,30.180586;120.253391,30.180603;120.253521,30.179964;120.253574,30.179218', '盛元·蓝爵国际', '杭州市萧山区金城路333号开元百货对面', '杭州市', '', '30881.191502', '120.25271,30.179549', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '盛元蓝爵国际位于萧山新区金城路与金鸡路交叉口,隶属新区CBD核心。市政府、人民广场、开元加州MALL、萧山国际中心、太古广场等大型市政商业中心近在咫尺,尊踞萧山繁华核心,执掌城市最鼎级资源。蓝爵国际总占地面积约4.5万方,由四幢精品公寓和一幢超高层写字楼组成。住宅项目追求一种尊贵的低调品格,大间距宽视野、广场式主入口、典雅的新古典主义建筑、公园式园区景观、精装修入户大堂、奢华的空间尺度……演绎萧山最高生活理想。蓝爵国际主力户型约150-230㎡,采用奢华双厅(会客厅家庭厅)、豪华全套房、空中庭院、入户花园、独立单元门厅等设计理念,极大地保证了生活的私密、舒适、情趣与尊崇,引领萧山奢适生活新潮流!', '2009-11-30', '3.8元/月/平方米');
