INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13OFP', '330100', '120.262685,30.316106;120.262454,30.316082;120.262313,30.316019;120.262203,30.315902;120.262091,30.315637;120.260964,30.315511;120.260598,30.316632;120.259795,30.317577;120.261385,30.318631;120.261949,30.317918;120.262486,30.317095;120.262584,30.316765;120.262685,30.316106', '海棠公寓', '杭州市江干区九昌路与九华路交叉口', '杭州市', '', '46785.787142', '120.261365,30.316991', '商务住宅;住宅区;住宅小区', '', 'None', '', '29976', '绿城西子海棠公寓定位为建设经济型的住宅小区,共设10栋建筑。建筑风格参考了德清西子百合公寓的造型和立面效果,外立面风格采用温和的现代风格,建筑立面简洁、现代,线条细腻优雅、灵巧,整体色调浅暧为主,立面采用大面积落地窗,通透大气、细巧的建筑风格。', '2009-12-05', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13OTW', '330100', '120.181837,30.25914;120.180904,30.259114;120.180891,30.26008;120.181837,30.260042;120.181837,30.25914', '云龙·十一景', '杭州市下城区建国北路80号', '杭州市', '0103000020E61000000100000005000000FA0CA837A30B5E40DF15C1FF56423E40CCED5EEE930B5E408DEF8B4B55423E400249D8B7930B5E40FB57569A94423E40FA0CA837A30B5E402096CD1C92423E40FA0CA837A30B5E40DF15C1FF56423E40', '7985.849247', '120.181362,30.259595', '商务住宅;住宅区;住宅小区', '', '3.59', '47000平方米', '24078', '云龙十一景座落市中心,位于城市主干道庆春路和“金融街”建国北路的交叉口,在地理位置上具有先天的优越性。云龙十一景总建筑面积达47862平方米,由二幢高层建筑,一幢高级酒店式公寓组成。三幢楼宇均采用精装修设计,力求为业主打造高档精致的住宅名品。云龙十一景周边各类生活配套设施齐全:教育、医疗、金融、商业、餐饮、休闲活动一一涵盖。入住即可享受繁华、便利的都市中心生活。小区内部华丽会所,享受家门口的从容生活。外立面和小区内部景观设计采用经典复古的ART DECO风格:雅致凉亭水景,凯旋大门,空中花园,镂空围墙。并以西湖十景为文化基石,同时导入独特的光主题、挺拔高贵的Art Deco建筑风格、与建筑主题建筑风格契合的景观设计。', '2008-07-26', '2.6元/月/平方米');
