INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13PXT', '330100', '120.103713,30.183403;120.103681,30.182879;120.103726,30.182606;120.103952,30.182051;120.104121,30.181822;120.104199,30.181581;120.104266,30.181291;120.104268,30.181022;120.104241,30.180704;120.104225,30.180442;120.104258,30.180336;120.10437,30.180016;120.104413,30.180004;120.104461,30.180011;120.104545,30.180067;120.104931,30.180468;120.105043,30.180565;120.10529,30.18069;120.105545,30.180762;120.106175,30.180885;120.106685,30.181024;120.107066,30.181075;120.107229,30.181068;120.107439,30.180996;120.10753,30.181013;120.107621,30.181082;120.107739,30.181265;120.107809,30.181316;120.107897,30.18134;120.107989,30.181335;120.108026,30.181314;120.108115,30.181129;120.108235,30.180964;120.108399,30.180853;120.108664,30.180739;120.108799,30.18073;120.108882,30.180762;120.108909,30.180825;120.108903,30.180925;120.108815,30.181136;120.108276,30.181859;120.107778,30.182783;120.107699,30.182821;120.107264,30.182842;120.106448,30.182916;120.10639,30.182902;120.106352,30.18287;120.10624,30.182661;120.106084,30.182575;120.105872,30.182534;120.105502,30.182524;120.105186,30.182564;120.105051,30.182647;120.104829,30.182946;120.104727,30.183023;120.104609,30.183067;120.104512,30.183111;120.104408,30.183181;120.104314,30.183322;120.104252,30.183452;120.104158,30.183558;120.104059,30.183612;120.10396,30.183621;120.103866,30.183596;120.103785,30.183528;120.103713,30.183403', '西湖花园(五云中路)', '杭州市西湖区之江度假区五云西路1号', '杭州市', '', '81422.140013', '120.10593,30.181832', '商务住宅;住宅区;住宅小区', '0.4', 'None', '173365平方米', '32666', '坐落于杭州之江国家旅游度假区内,距市中心仅8公里,面眺钱江,背枕五云,左傍九溪烟树,右伴云栖竹径,自然环境得天独厚。道路与路边景观互相衬托,用道路的材质变化丰富园区景观,通过对道路局部线条的调整,增强景观序列的趣味。  园区道路整体结构通畅、合理。玫瑰园西区的度假村设单独的出入口一处,住宅区设两个日常入口,五云西路南北二端设应急出入口;在车道交通基础上,利用冲沟,设完整的步行道路。', '', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13Y9I', '330100', '120.196357,30.200004;120.195597,30.200228;120.192645,30.200129;120.19191,30.201375;120.191964,30.201527;120.192858,30.201993;120.193442,30.202279;120.195059,30.202997;120.196587,30.20005;120.196357,30.200004', '半岛国际', '杭州市滨江区滨盛路2271号', '杭州市', '', '75710.27475', '120.194229,30.201257', '商务住宅;住宅区;住宅小区', '1:1（1500个）', '2.64', '240000平方米', '45404', '半岛国际,是发力滨江重点打造的高端住宅项目,项目位于滨江核心区,距钱塘江边仅400米,滨盛路以南,长河路以东,滨江四桥与三桥之间,是滨江近年来重点发展的区块之一,尽享滨江核心区多重优质生活配套;紧邻两条天然河道与绿化带,隐贵稀缺双水岸景观价值。项目总建筑面积约24万平方米,由一栋超高层住宅、七栋高层住宅、五栋一层的商业配套及一层地下车库组成,滨江的项目主力户型为80-160平方米。', '2013-05-11', '3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13Y9O', '330100', '120.102124,30.311212;120.100775,30.310686;120.099773,30.310326;120.099658,30.310321;120.099548,30.310353;120.099476,30.310429;120.099424,30.310519;120.099167,30.311574;120.101563,30.312432;120.102183,30.311344;120.102124,30.311212', '广宇·西城美墅', '杭州市西湖区申花路386号', '杭州市', '', '33775.405888', '120.10062,30.311357', '商务住宅;住宅区;住宅小区', '0.66', 'None', '96000平方米', '45969', '西城美墅是广宇集团继西城年华后在申花板块上筑造的又一个城市公寓精品,它传承了西城年华现代、优雅的建筑特色,精益求精,使在产品品质、景观营造、户型空间上寻求新的突破和提高,为业主营造更舒适的家园、更高的礼遇。景观:广宇西城美墅,浑然天成的灵气之地,拥览无限风光,是杭城为数不多的公园名校社区。为使小区景观与周边自然景观相融合,设计时以“自然、阳光、绿树、碧水”为主题,汲取中国园林造园手法,造就风生水起的水天意境;为确保每一空间都有开阔的景观视野,建筑为景观让路;为确保小区安静,设置人车分流;为进一步升级景观,添设多个景观入口、立体水景、亲水广场等功能区,使功能景观化;建筑前后间距宽阔,首层架空,视野极为开阔,生态环境尽收眼底。户型:广宇西城美墅,传承西城年华特色,延续且升级品质经典。其主力户型90-140㎡,依据“不同景观方向设计不同客厅朝向”的原则,结合凸窗、转角窗、隔层阳台等多种形式,将空气、阳光及景观延伸与室内,创造的自然对流通风和采光环境,为生活而添彩。', '2008-11-15', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13Y9Y', '330100', '120.103202,30.278517;120.102676,30.278467;120.102624,30.278552;120.102298,30.280055;120.102326,30.280111;120.103014,30.280129;120.103082,30.279764;120.103164,30.279412;120.103245,30.279187;120.103343,30.278677;120.10336,30.278533;120.103202,30.278517', '美都新村', '杭州市西湖区古墩路242号', '杭州市', '', '10859.190122', '120.102829,30.279303', '商务住宅;住宅区;住宅小区', '', 'None', '', '30459', '小区环境舒适,闹中取静,绿化率高,生活配套成熟,餐饮、超市、银行、学校、医院、公交站点近在咫尺,生活非常方便,多条主干道相拥环抱,出行便利,非常宜居。  小区建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区内居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.5元/月/平方米');
