INSERT INTO "public"."gaode_residential_region" VALUES ('B023B141DJ', '330100', '120.037018,30.26962;120.037183,30.269617;120.038441,30.269606;120.038551,30.269476;120.038296,30.268752;120.038133,30.267985;120.037931,30.267974;120.037625,30.267974;120.037235,30.267948;120.036519,30.267916;120.036277,30.267894;120.036285,30.267222;120.036275,30.266627;120.036101,30.26673;120.035421,30.267041;120.034586,30.267466;120.034078,30.26763;120.033914,30.267781;120.033866,30.267926;120.033833,30.268089;120.033863,30.268256;120.034326,30.268755;120.034515,30.268804;120.034737,30.269;120.035064,30.269261;120.035201,30.269605;120.035255,30.269769;120.035384,30.269887;120.035494,30.270048;120.035631,30.270253;120.035809,30.270276;120.035905,30.270266;120.036005,30.270234;120.036094,30.270179;120.036781,30.269755;120.03692,30.269652;120.037018,30.26962', '西园', '杭州市余杭区五常街道荆长大道377号', '杭州市', '', '81031.113224', '120.036137,30.268578', '商务住宅;住宅区;住宅小区', '地下停车库,排屋每户有1-2个车位', '1.1', '100000平方米', '32467', '项目介绍:  <STRONG>-西湖以西,西溪之胜(区位)</STRONG>  位于杭州“城市绿肺”西溪湿地核心区域,西邻天竺港,南邻常兴路,东侧为荆常大道,依水而宅,尊享10.08平方公里西溪国家湿地公园胜景。  <STRONG>-收藏山水,涵养天地(环境)</STRONG>  10万余平方米低层、低密度高贵园区。园区三面环绕自然水系,与周边盛境和谐铺排,形成独特半岛式布局,延续了历代西溪名宅所秉持的“自在与优雅”。  <STRONG>-诗意栖居,指点繁华(交通)</STRONG>  距西城广场仅5公里,经文一西路、文二西路、天目山路等重要城市主干道,直达武林商圈,真正做到了自由切换城市繁华与生活宁静。  <STRONG>-凝练隽永,传世府邸(建筑)</STRONG>  延承百年欧洲经典名宅,名流气质邂逅西溪山水,现代风格结合古典格调,讲究依地造屋的层次章法,营造得天地意韵的灵气之所。  <STRONG>-因水而起,辉映自然(水景)</STRONG>  以景观水系营造为核心轴线,保留并充分利用基地水景资源,吸纳并发扬传统中国的院落文化,规划出家家枕河,户户临水的独特水景围合。  <STRONG>-延禀江南,人文大宅(户型)</STRONG>  580余席水景美宅,250-300平米景观排屋、叠跃排屋、90平米平层电梯公寓、1400平方尊崇会馆,共同组成的原生态高尚别墅式住区。  -<STRONG>精雕细琢,尊崇品质(材质)</STRONG>  外立面大量采用高级天然石材干挂,保持建筑隽永品质。阳光地下室、门厅露台、大面积玻璃门窗等建筑细节均由内而外的流露出居住的舒适感。  <STRONG>-生态悠居,典藏一生(科技)</STRONG>  运用了智能化园区安防系统,地下车库智能指示系统,指纹锁等多个高科技系统,尽显尊崇生活;外墙外保温、彩色断桥铝合金门窗、中空玻璃等节能环保技术应用,有效降低建筑能耗。  VIP专线:0571—85287222、85287333  展示中心:杭州建国北路557号西园销售展示中心  开发商:浙江百家乐房地产开发有限公司  建筑&景观设计:中国美术学院风景设计研究院  全案策划:智威(中国)创造社0571-85803611<br />园林景观:西园以水为魂的景观设计充分考虑自然水景线与局部环境水体的关系,借自然优势及人工妙匠,曲布驳岸、密植植物,营造充满生机的水景,着力令家家枕河,户户邻水,形成纵向景观、横向景观和鸟瞰景观等全方位的观赏景观。<br />', '2010-05-01', '3.5元/月/平方米');
