INSERT INTO "public"."gaode_residential_region" VALUES ('B023B143GO', '330100', '120.251555,30.137435;120.253207,30.137449;120.25361,30.137453;120.253701,30.137472;120.253738,30.137521;120.253754,30.137662;120.253743,30.138007;120.253698,30.138638;120.253651,30.13996;120.253648,30.140063;120.253319,30.139983;120.252605,30.139847;120.251967,30.139722;120.251716,30.139669;120.251619,30.139615;120.251539,30.139541;120.251504,30.139448;120.251475,30.139311;120.251436,30.13873;120.25142,30.138079;120.251426,30.13762;120.251426,30.137532;120.251469,30.137472;120.251555,30.137435', '半岛花园(晨晖路)', '杭州市萧山区蜀山街道蜀山路', '杭州市', '', '49030.620111', '120.252608,30.138627', '商务住宅;住宅区;住宅小区', '', '1.6', '120000平方米', '19425', '得力.半岛花园由中国著名企业兴惠化纤集团投资,浙江得力房地产开发有限公司开发建设。楼盘位于萧山区蜀山路以东、南环二路以北,占地近90亩,总建筑面积约12万方。半岛花园三面临水,成“半岛”状独特地理环境,直接享有500米漫长滨河观景大道。同时小区内部引入近1万余方人工水域,形成4个“内半岛”式自然水景花园。半岛花园住宅由联体排屋、小高层、高层联袂组团而成,利用先进的网络通讯技术、自动控制技术、节能环保技术实现家居生活的智能化管理,从而给住户带来更舒适、更安全、更便捷的全新家居生活体验。    得力.半岛花园由中国著名企业兴惠化纤集团投资,浙江得力房地产开发有限公司开发建设。楼盘位于萧山区蜀山路以东、南环二路以北,占地近90亩,总建筑面积约12万方。半岛花园三面临水,成“半岛”状独特地理环境,直接享有500米漫长滨河观景大道。同时小区内部引入近1万余方人工水域,形成4个“内半岛”式自然水景花园。半岛花园住宅由联体排屋、小高层、高层联袂组团而成,利用先进的网络通讯技术、自动控制技术、节能环保技术实现家居生活的智能化管理,从而给住户带来更舒适、更安全、更便捷的全新家居生活体验。', '2008-11-30', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B143GT', '330100', '120.239714,30.351062;120.239606,30.351014;120.239487,30.350994;120.239357,30.351019;120.238629,30.352621;120.23863,30.352693;120.238706,30.352755;120.239677,30.35308;120.240214,30.353276;120.240739,30.353449;120.240877,30.353439;120.240961,30.353392;120.241215,30.352771;120.241215,30.352504;120.24118,30.352348;120.241102,30.35215;120.240947,30.351934;120.240249,30.35145;120.239714,30.351062', '联合新苑', '杭州市江干区丁桥勤丰路108号', '杭州市', '', '35878.083287', '120.239983,30.352308', '商务住宅;住宅区;住宅小区', '125个', '2.2', '85540平方米', '', '联合新苑小区位于杭州江干区丁桥勤丰路与丁群街交界处,是政府廉租房项目,目前已交付入住。现主要推广的是联合新苑的底层商铺,新苑商铺直接沿街,东南面为环丁路,西临勤丰路,北临丁群街。商铺主力面积50-90方,少量面积有30方及200方以上。商铺层高3.9米,户型方正,带独立卫生间。', '2011-07-31', '1.5元/月/平方米');
