INSERT INTO "public"."gaode_residential_region" VALUES ('B023B149YU', '330100', '120.152068,30.156311;120.151734,30.156147;120.15169,30.156124;120.151687,30.156103;120.151685,30.156084;120.151689,30.156056;120.152058,30.155549;120.152135,30.155534;120.152225,30.155529;120.152331,30.155539;120.152519,30.15555;120.152528,30.155685;120.152068,30.156311', '浦沿公寓', '杭州市滨江区新浦路100号', '杭州市', '', '3372.84439', '120.152109,30.155882', '商务住宅;住宅区;住宅小区', '1:1.69', 'None', '13020平方米', '28870', '共计59套住宅和3000多㎡商铺;30套90㎡以下的小户型,29套90-140㎡的三居房。两幢11层小高层住宅,其中1号楼为一个单元的塔式住宅,布置在地块南面,2号楼为两个单元组合的单元式住宅,布置在地块北侧,两幢高层住宅南北前后分开,遥相呼应。', '2008-06-15', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B149YX', '330100', '120.238352,30.350425;120.236039,30.349375;120.235802,30.34983;120.235597,30.350257;120.235141,30.351286;120.237414,30.352202;120.238352,30.350425', '中豪四季公馆', '杭州市江干区环丁路299号', '杭州市', '0103000020E61000000100000007000000EB3BBF28410F5E4068B3EA73B5593E40286552431B0F5E403D0AD7A370593E4036954561170F5E40E12879758E593E4049827005140F5E40F0315871AA593E40B83CD68C0C0F5E40EC8A19E1ED593E4034677DCA310F5E40F69507E9295A3E40EB3BBF28410F5E4068B3EA73B5593E40', '46970.731815', '120.236723,30.350808', '商务住宅;住宅区;住宅小区', '共1040个车位，其中地下970个、地上70个', '2.3', '166027.6平方米', '29621', '杭州,一座有情有味的城市,温暖、怡人、悠闲的江南水乡。需要用与之气质相对应的建筑来承载,中豪四季公馆,以杭州特有文化气质为底蕴,开启人文品质生活新篇章,成为丁桥品质住宅的领航者。    中豪四季公馆位于杭州城北丁桥CLD核心生活区,南临环丁路,北至丁群路,西接长虹路,拥有成熟的周边配套和优越交通。中豪四季公馆总建筑面积16万平方米,整个社区由13幢16层和2幢15层的高层品质公寓组成,以两梯两户和两梯四户为主,包括81㎡-158㎡多种舒适户型。奢适居住空间令完美生活境界得以再现,满足各阶段人群居住需求。    中豪四季公馆,以非豪宅的定位配备豪宅的品质。项目将原本只有市中心豪宅才能享受到的石材干挂立面引进丁桥,以区域内前所未有的高端配置,进一步提升丁桥的宜居标准;高层设计社区气质整齐有序、稳重大气;4.5米架空层的设计,兼顾了现代都市人群的生活方式,杭州市场上亦罕见设计;全南向阳光户型,100%南北通透的户型设计,不仅采光良好,更可拥揽清风美景;超尺寸的绿化空间,中轴对称的法式艺术园林,四季主题的组团庭院景观,让您处处享受到自然的生活。    稳重正气的社区规划,辅以素雅黄建筑外立面,加之精细的园林设计,成就丁桥中心区难得一见的经典社区。备注:中豪四季公馆项目注册名为中豪四季公寓。', '2013-09-24', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B149ZD', '330100', '120.090498,30.293627;120.09089,30.293641;120.091308,30.293567;120.091711,30.293335;120.092,30.293094;120.091995,30.292631;120.092161,30.29261;120.092403,30.292599;120.092478,30.29113;120.092381,30.29088;120.090488,30.291056;120.090442,30.291253;120.090396,30.291835;120.090337,30.293581;120.090498,30.293627', '紫荆雅苑', '杭州市西湖区紫荆花路399号', '杭州市', '', '43758.309021', '120.091338,30.292184', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B149ZI', '330100', '120.235975,30.356512;120.235422,30.356815;120.235125,30.357018;120.235403,30.357496;120.234646,30.357832;120.234978,30.358595;120.236294,30.358087;120.236524,30.358012;120.236699,30.357996;120.236792,30.357971;120.23703,30.357909;120.237102,30.357852;120.23747,30.35695;120.236823,30.356721;120.236152,30.356496;120.235975,30.356512', '联合格里', '杭州市江干区大农港路226号', '杭州市', '', '30465.90102', '120.23605,30.35748', '商务住宅;住宅区;住宅小区', '车位比1：0.57', '2', '100000平方米', '24038', '联合•格里,位于主城区CLD——丁桥核心区,南至大农港路,西至勤丰路,倚靠长睦幼儿园、长睦小学,交通便利,周边配套全面。  格里秉承了“光合规划、有机生活”的产品设计倡导来着力打造品牌居住区。项目主力户型以90㎡小三房为主,总建筑面积近10万平方米,是一个标准的中型体量社区。它由11幢高层、小高层组合而成,拥有动静平衡的地缘环境和精心规划的社区内景观。  建筑的采光与合理是居住品质的最基本内容。联合•格里,以居住舒适度为核心,采用与区域内大部分社区建筑格局不同的“短板+点式”排布手法,并以18.8%超低建筑密度建造,不仅减少了户型布局中的中间套,使室内空间的采光和通透性加强,住户有更多机会选择阳光空间,同时也降低了建筑压迫感,更容易使生活在这里的人们产生家园归属感。  与此同时,项目还以现代主义的手法表达出高尚而又前卫的建筑审美。其立面设计轻快活跃,以时尚浅灰色为主基调,在现代、挺括与精致、内敛间营造出完美的平衡,展现开放包容的时代内蕴,形成中央居住区的视觉归属。  为了突破城市约束,展现阳光气质。联合•格里,更是采用错落式半围合布局,建筑单体最大距离甚至达到80米,并以挺拔俊朗的建筑气质勾勒出优美的天际线,极具亲切与活跃,同时,洞察人居需求的发展趋势,提出活性园林概念,将约5300㎡园林打造成可赏、可游、可参与的自然天地,营造快乐、温馨、亲和的社区氛围。  联合•格里,作为联合房产为杭城首次置业者打造的充满阳光特质的社区气质及温情和煦的生活社区,将以更人性化、更善意性的姿态映献于市场。', '2010-03-29', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14A02', '330100', '120.362822,30.311395;120.36281,30.312687;120.362801,30.314009;120.362783,30.315773;120.364347,30.315774;120.365823,30.315754;120.365929,30.315709;120.36597,30.315665;120.365987,30.315605;120.365983,30.315515;120.364857,30.311623;120.364632,30.311667;120.36444,30.311473;120.362822,30.311395', '清雅苑(学林街)', '杭州市江干区学林街633号', '杭州市', '', '102829.874913', '120.364132,30.31379', '商务住宅;住宅区;住宅小区', '1:0.4', 'None', '200000平方米', '18729', '清雅苑位于下沙高教园区核心地带,是下沙大学城首个超20万平方米的大型住区,专为1390户高校教师定制,殷殷学子,鸿儒巨匠,为住区平添几许翰墨风情。开发区管委会斥巨资全力打造的滨河休闲风情公园,以浓厚的东南亚风格浸润其中,与清雅苑自成一体,全情演绎都市风华,优雅挥洒生活情韵。紧邻规划中的地铁一号线出入口,教园区文津公交总站,比邻快速公交终点站和高教园区文溯路公交总站,近在咫尺的绕城高速与沪杭甬高速更是须臾可至。景观:滨河休闲风情公园,以浓厚的东南亚风格浸润其中,与清雅苑自成一体,全情演绎都市风华,优雅挥洒生活情韵。', '2006-05-16', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14A05', '330100', '120.076633,30.329994;120.076114,30.330891;120.078481,30.33193;120.078998,30.330895;120.079392,30.329967;120.079274,30.329881;120.078094,30.329614;120.077741,30.330336;120.076724,30.329957;120.076633,30.329994', '慧仁家园南区', '杭州市西湖区嘉仁路与大公路交叉口', '杭州市', '', '38025.142493', '120.077883,30.330698', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14A0J', '330100', '120.238167,30.352723;120.236521,30.352014;120.235243,30.351525;120.235142,30.35152;120.235077,30.351548;120.235012,30.351636;120.234326,30.353152;120.23432,30.353237;120.234328,30.353291;120.234377,30.353344;120.234474,30.353368;120.237358,30.354359;120.23745,30.354352;120.237521,30.354299;120.238237,30.352897;120.238229,30.352804;120.238167,30.352723', '昆仑天籁', '杭州市江干区丁群路与长虹路交汇处东北角', '杭州市', '', '59776.359722', '120.236257,30.352963', '商务住宅;住宅区;住宅小区', '1287（1:1）', '2.2', '200000平方米', '21610', '昆仑天籁位于杭州丁桥,东至勤丰路,南至规划丁群路,西至长虹路,北至明珠路,宗地面积65824平方米(即98.8亩),呈不规则矩形,东西长南北短,整体南偏东约21度。使用权出让年限为住宅70年,配套商业40年。昆仑天籁项目占地面积65824平方米(即98.8亩),总建筑面积约20万方,容积率是2.2,绿化率30%,建筑密度28%,总户数1234户,抗震为6级。建筑形态是16层的高层为主,及少量低层建筑。层高约2.9米左右。昆仑天籁有2个机动车出入口,1个人行出入口,地下车库的出入口有3个,整个小区机动车位约为1200个左右。车位配比达1:1,可以电梯直达。', '2013-04-20', '2.35元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14A0V', '330100', '120.268606,30.324044;120.268038,30.324212;120.266945,30.325745;120.268397,30.326473;120.269087,30.326759;120.270326,30.324969;120.268606,30.324044', '九润公寓', '杭州市江干区九环路与九福路交叉口', '杭州市', '0103000020E610000001000000070000009A6038D730115E400C772E8CF4523E407505DB8827115E4083F8C08EFF523E402B357BA015115E40E5D5390664533E400C569C6A2D115E40EA060ABC93533E40D731AEB838115E4075AC527AA6533E408B506C054D115E40BD361B2B31533E409A6038D730115E400C772E8CF4523E40', '46993.107016', '120.26865,30.325361', '商务住宅;住宅区;住宅小区', '车位配比1：0.93', '2.2', '160000平方米', '23400', '郡原九润公寓位于杭州市九堡九华路与九福路交界处,西邻和睦港河,毗邻地铁一号线和客运中心有多路公交直达。项目建筑面积近15万平方米由12幢小高层共同组成四个独立的居住院落。郡原九润公寓在保证景观与建筑完整性的同时将建筑围合成为四个组团院落,形成了内外两个层次景观空间序列,有效地将社区内交通和景观元素结合在一起形成更为丰富的居住体验。 郡原九润公寓定位为高品位城市公寓, 将多种形态的城市公寓有机融合,以尊重及满足不同年龄段客户的多元化市场需求。郡原九润公寓户型以90-120平方米精致实用户型及130-160平方米舒适户型为主,同时引入复合式欧美城市公寓设计理念,规划了高附加值的舒适空间尺度。建筑风格以巴黎现代城市公寓为蓝本,赋予建筑立面丰富细腻的性格面设计,力求创造一个精致典雅、耐得住时间考验的住宅精品。', '2016-05-30', '2.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14A6K', '330100', '120.142371,30.297024;120.142378,30.296753;120.142385,30.296567;120.143173,30.296617;120.143242,30.295937;120.143421,30.295946;120.143435,30.295791;120.142941,30.295768;120.142516,30.295762;120.142386,30.295752;120.142202,30.295654;120.142033,30.29582;120.141805,30.296001;120.141772,30.296182;120.141762,30.296236;120.141731,30.296284;120.141683,30.296331;120.141631,30.296373;120.141589,30.296407;120.141551,30.296435;120.141492,30.296446;120.141333,30.29645;120.141181,30.296449;120.141139,30.296935;120.141108,30.297325;120.141134,30.297392;120.141163,30.297426;120.141209,30.297452;120.14128,30.297471;120.141354,30.297483;120.141677,30.297535;120.141851,30.297578;120.14211,30.297661;120.142165,30.297645;120.142202,30.297607;120.142276,30.297444;120.14235,30.297266;120.142368,30.297172;120.142371,30.297024', '贾家弄新村', '杭州市拱墅区和睦路56号', '杭州市', '', '22374.082417', '120.142126,30.296607', '商务住宅;住宅区;住宅小区', '', '2.6', '44000平方米', '29312', '贾家弄新村由杭州城建开发有限公司 开发,1993年6月竣工,位于杭州拱墅和睦路与贾家弄交叉口,小区环境优美,景色宜人,交通便利。贾家弄新村位于湖墅路与大关桥交。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14AO1', '330100', '120.09978,30.276912;120.099177,30.276886;120.099123,30.277325;120.100291,30.277385;120.100392,30.276934;120.09978,30.276912', '丹枫新村', '杭州市西湖区古墩路与金康路交叉口西100米', '杭州市', '0103000020E61000000100000006000000DF32A7CB62065E40B5DE6FB4E3463E40FCE07CEA58065E4063B83A00E2463E4003D2FE0758065E40FB5C6DC5FE463E405245F12A6B065E40A5660FB402473E40EC3191D26C065E4085268925E5463E40DF32A7CB62065E40B5DE6FB4E3463E40', '4851.641822', '120.099749,30.277132', '商务住宅;住宅区;住宅小区', '', 'None', '', '29185', '丹枫新村位于文三西路与古墩路交叉口金海公寓北面。交通便捷,购物方便,风景优美。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。环境优美,丽水成天的风景给予了回归家庭、回归私域的生活体验。', '', '0.35元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14ARK', '330100', '120.095069,30.288613;120.094982,30.287605;120.095438,30.287582;120.095445,30.287499;120.09545,30.287139;120.095453,30.286802;120.095434,30.286709;120.093846,30.286858;120.092572,30.286946;120.092601,30.287838;120.092689,30.288777;120.095069,30.288613', '金成·嘉南公寓', '杭州市西湖区西湖文一西路378号', '杭州市', '', '43806.344944', '120.093931,30.287723', '商务住宅;住宅区;住宅小区', '', 'None', '', '42049', '嘉南公寓位于杭州市紫荆花路与文一西路交叉口,毗邻高教新村、西溪文化旅游度假区。占地90亩,建筑面积90000多平方米,拥有15幢多层公寓,6个单元小高层、12幢别墅、1幢大型豪华中心会馆和商铺,以多层为主兼容别墅与临街商业用房。  平面布局分为吟泉居、青藤居、瀑水居、影池居、嘉南广场,规划中临街商铺的半环绕设计及建筑外形立体多端和不平衡式设计,打破了小区对称、千篇一律的死板,体现了开放与兼容并存的设计思想,满足了人们心理上、对建筑规划的综合要求。', '', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14AY8', '330100', '120.098306,30.286663;120.097133,30.286683;120.097061,30.287137;120.097024,30.287594;120.09701,30.287785;120.09697,30.288021;120.096872,30.28827;120.096891,30.288495;120.09804,30.288403;120.098121,30.288382;120.098155,30.288329;120.098463,30.286812;120.098454,30.286732;120.098427,30.286666;120.098306,30.286663', '华苑公寓', '杭州市西湖区古墩路453号', '杭州市', '', '20887.453437', '120.097659,30.287547', '商务住宅;住宅区;住宅小区', '', '2.8', '100000平方米', '47826', '华苑公寓配套成熟、交通便利。', '', '0.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14BJY', '330100', '120.205923,30.339288;120.206085,30.33772;120.205232,30.337729;120.20518,30.340002;120.205735,30.340002;120.205864,30.339561;120.205923,30.339288', '亿城雅苑', '杭州市下城区华丰路145号', '杭州市', '0103000020E61000000100000007000000A19FA9D72D0D5E40DDEC0F94DB563E408ECC237F300D5E40833463D174563E40EE056685220D5E4029E9616875563E40C5724BAB210D5E401893FE5E0A573E40202922C32A0D5E401893FE5E0A573E401FDB32E02C0D5E403FFF3D78ED563E40A19FA9D72D0D5E40DDEC0F94DB563E40', '15441.141821', '120.205584,30.338797', '商务住宅;住宅区;住宅小区', '', '2', '100000平方米', '24781', '“亿城雅苑”位于下城区华丰村,紧邻润和R26;亿城嘉园项目,东至朱家河,南至下城区公安分局石桥派出所,西至规划道路,北至华丰路。项目周边属于华丰区块的中心地带,项目得益于北景园大型居住社区以及多个目前正在开发的楼盘,各项生活配套设施基本齐全;随着农改居以及道路建设的完善,连接主城区的道路具有较好的通行能力,交通条件得到进一步改善。 楼盘总用地面积17316平方米,总建筑面积45802.69平方米,绿化率在30%以上。该楼盘属于一次性开发。', '', '1.4元/月/平方米');
