INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14BTW', '330100', '120.280141,30.306474;120.280409,30.308638;120.284386,30.308256;120.284195,30.306081;120.284139,30.30601;120.280321,30.306369;120.280191,30.306378;120.280141,30.306474', '金雅苑', '杭州市江干区九堡仁爱路219号、杭乔', '杭州市', '0103000020E61000000100000008000000335184D4ED115E4006137F14754E3E4043209738F2115E40874D64E6024F3E402D5C566133125E40B8CB7EDDE94E3E40F3AB394030125E404EED0C535B4E3E40292158552F125E40BC3FDEAB564E3E4073D87DC7F0115E401B82E3326E4E3E408C683BA6EE115E40C136E2C96E4E3E40335184D4ED115E4006137F14754E3E40', '83090.21882', '120.282277,30.307318', '商务住宅;住宅区;住宅小区', '', 'None', '', '26474', '金雅苑商铺位于九堡客运中心南侧胜稼路与金禾路交叉口,地铁铺:地铁一号线将于2012年国庆前开通,金雅苑05地块现铺距离地铁一号线客运中心站出口100米,距离客运中心400米,处于九堡核心商圈1000米中心的中心;商圈铺:坐享九堡商贸、交通、物流、居住、教育5大集群效应,600万平米专业市场,新四季青、华贸鞋城、红星美凯龙等大型市场汇聚;人气铺:360度交通轨道,30多个楼盘陆续开发及交付,40万社区人口,零距离分布7所学校,每日10万人日人流量……成就九堡第一地铁金铺。价值铺:商圈、地铁、人气、地段,四者任一价值点都足以引起投资风暴,2012年10月1日,地铁一号线开通,当四者齐汇金雅苑,演绎投资典范绝对理所当然。', '2011-11-12', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14BVN', '330100', '120.352147,30.302519;120.352202,30.301935;120.352099,30.301815;120.351868,30.301755;120.351637,30.301725;120.350662,30.301647;120.350628,30.302275;120.35085,30.302283;120.35082,30.302689;120.349753,30.30263;120.34974,30.30305;120.351959,30.303167;120.352012,30.303155;120.352051,30.303129;120.352089,30.3031;120.352147,30.302519', '精欧荣寓', '杭州市江干区下沙5号路与6号大街交汇处', '杭州市', '', '22119.887019', '120.351222,30.302484', '商务住宅;住宅区;住宅小区', '地面：63个;地下：586个', '3', '114782平方米', '25931', '精欧置业投资建设的精欧荣寓,是继尊宝大厦后又一房产力作。该项目位于目前下沙最繁华的商业中心区,西临5号路,距离地铁1号线文泽路站约600多米,更有公交站和快速公交,周边学校、超市、医院各类配套齐全。项目总用地面积25677㎡,总建筑面积114092㎡,包括三幢板式高层,两幢点式高层,一所国际化现代双语幼儿园及3000平方米净菜超市。社区规划设计合理,有效做到人车分流,景观设计重点突出水景与绿色两大元素,于社区中心形成大面积中央水景,建筑为典雅的ART DECO风格,每个细节做到精益求精,项目建成后将成为下沙城市中心尊贵与繁华兼具,万千宠爱于一身的高尚住宅。', '2013-10-25', '1.7元/月/平方米');
