INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14CAS', '330100', '120.053779,30.242278;120.054431,30.242373;120.054464,30.242331;120.054683,30.241354;120.05459,30.241282;120.054044,30.241227;120.054002,30.241236;120.053951,30.241281;120.053779,30.242278', '西溪·君逸汇', '杭州市西湖区留下街道125号(北依西溪路、南望午潮山国家森林公园)', '杭州市', '', '6988.216492', '120.054224,30.241788', '商务住宅;住宅区;住宅小区', '0.3', '3', '23288平方米', '13530', '西溪君逸汇立处杭州千年古街留下街道中心,北依西溪路,毗邻“杭州景观大道”天目山路,,南望午潮山国家森林公园,北眺西溪国家湿地公园。项目总建筑面积23288平方米,采用U型建筑设计半围合内院空间,主力户型40-100平方米。西溪君逸汇位于留下街道中心,项目周遍交通便利,十几条公交路线直达城市中心。轻松接轨黄龙商圈。同时,周遍大规模的高品质住宅将在后期陆续上市,高尚生活范围将逐渐生成,集群效应使板块生活价值进一步提升,发展潜力十分巨大。西溪君逸汇创新70M2私享空间,可演绎为一室一厅的阔绰空间,颠覆了传统小户型的概念;亦可升级为二室一厅宜家空间,关照成长型居家需求。', '2008-04-25', '2.00元/月/平方米');
