INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14CMB', '330100', '120.175539,30.261395;120.175479,30.261388;120.175483,30.261259;120.175261,30.261253;120.175273,30.261577;120.175288,30.262794;120.175258,30.264506;120.176044,30.264509;120.176096,30.263218;120.176197,30.261422;120.176049,30.261417;120.175539,30.261395', '柳营社区(新华路)', '杭州市下城区威乙巷93号', '杭州市', '', '23974.325728', '120.175692,30.262894', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '柳营花园约于2000年建造完工,西区由4幢多层住宅构成,东区由4幢多层住宅、1幢小高层和1幢高层住宅构成,小区楼下有地下室,可以停放自行车和汽车。在西区的中央有一面积约为4000平方米的绿化广场,这成为小区居民早上锻炼、晚上散步纳凉的好去处。柳营花园为“住在杭州”十大代表楼盘之一,2000年被杭州市评为“住宅小区”,2001年又被评为“杭州市物业管理示范住宅小区”。柳营花园地处市中心,周围的生活配套设施非常齐全。长庆街上,小区对面就是新华路农贸市场。长庆街、林司后商店众多,经营范围及品种多而广,能够很好地满足住户的需要。包括小吃店、杂货店、房产中介公司、服装店、冷饮店洗烫店。相比较而言,以特色餐饮店聚集而闻名的新华路,消费档次比较高,美容店、美发店、饰品店、服装专卖店等穿插在餐饮店间,很能留住消费者的脚步。另外,环北小商品市场、庆春家友超市、肯德基、浙医一院、银行、邮局等都分布在柳营花园的附近,购物办事非常方便。', '', '');
