INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14EZ9', '330100', '120.223161,30.198202;120.222761,30.198006;120.222259,30.197965;120.222295,30.197766;120.22138,30.197678;120.221334,30.197314;120.221111,30.197278;120.221092,30.197553;120.221068,30.197696;120.220958,30.199734;120.223443,30.200042;120.223592,30.198253;120.223161,30.198202', '迎春东苑', '杭州市滨江区桂子路43号附近', '杭州市', '', '46429.162738', '120.222207,30.198861', '商务住宅;住宅区;住宅小区', '', 'None', '', '30913', '迎春小区位于滨江区迎春路与江陵路交叉口,邻近地铁一号线,另有多条公交线路经过,交通比较便利。小区属于农民回迁房,建成于2005年,共33栋,1344户,容积率2.01,绿化率35%,建筑面积35000㎡。周边有西兴街道幼儿园、中兴花园幼儿园、钱塘春晓幼儿园、江南实验学校、闻涛小学、西兴实验小学、西兴中学、杭州师范大学滨江校区、浙江旅游职业技术学院、滨江高教园区、浙江工业大学国际学院、联华超市、鹏齐平价水果超市滨江店、江南豪园农贸市场、滨江医院、华生口腔、武警医院、浙江省人民医院滨江分院(固陵路)、杭州西兴中心卫生院、杭州联合银行星民村储蓄所、杭州市商业银行(江南大道)、杭州银行滨江支行、中国建设银行(中兴路)、杭州市商业银行(江南大道)、西兴农贸市场、江滨公园、射潮广场、苏宁电器、迪欧咖啡、滨江区政府、浙商大酒店、新街坊假日酒店等配套设施,宜于居住。', '', '1.6元/月/平方米');
