INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FUH', '330100', '120.067113,30.328856;120.068459,30.330023;120.069565,30.32887;120.069607,30.328731;120.069457,30.328564;120.068411,30.327745;120.068245,30.327731;120.067113,30.328856', '丰盛九玺', '杭州市西湖区榨河巷与池华街交汇处', '杭州市', '0103000020E61000000100000008000000BC0853944B045E40E71725E82F543E407B87DBA161045E4085ED27637C543E408FFCC1C073045E40B1A206D330543E40A724EB7074045E406F2EFEB627543E409CDEC5FB71045E4098A432C51C543E40F2EB87D860045E40726DA818E7533E4065C746205E045E40A8E2C62DE6533E40BC0853944B045E40E71725E82F543E40', '27517.675801', '120.068391,30.328832', '商务住宅;住宅区;住宅小区', '停车位:规划有停车位301个 停车位售价暂时没有', '3.5', '105852平方米', '17300', '丰盛九玺位于三墩新城大型高档生活区核心,由85万方高端大盘之金地自在城三面围合,南邻40万方协安紫郡,12万方中海紫藤苑等高端社区,以九玺为中心的15分钟步行圈内集中了十余个高端社区。项目总建筑面积约25万方,拥有22000方超大双公园景观,是一个集合了420方奢华大平层、精装酒店式物业、高星级酒店、5A级写字楼、多业态稀缺性商业空间的大型高端物业,周边配套完善,商业氛围浓郁,交通出行便捷:外享185万方五里塘商务中心、日本永旺“吉之岛”购物中心、三墩新天地、沃尔玛超市、城西银泰等大型商业配套以及重点名校文三街教育集团;内拥项目内部沿街名品商业、高星级酒店配套;距规划中的地铁2号线金渡北路站西侧站点仅约800米,距金渡北路快速公交总站仅约200米,零距离交通配套,双线速享都市繁华。', '2016-05-11', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FUL', '330100', '120.255107,30.238362;120.25714,30.23737;120.257252,30.237356;120.257328,30.237374;120.257365,30.237421;120.257725,30.238716;120.256732,30.239168;120.256477,30.239235;120.25626,30.239242;120.256126,30.239224;120.255927,30.239191;120.255764,30.239119;120.255614,30.239038;120.255396,30.238862;120.255107,30.238362', '英冠水天城', '杭州市萧山区钱江世纪城鸿宁路与皓月路交叉口', '杭州市', '', '27665.01448', '120.256535,30.238403', '商务住宅;住宅区;住宅小区', '1500个车位', '6', '30000平方米', '', '英冠.水天城地处钱江世纪城中心地段,东临广场路,西南临公园东路,北临盈丰中心小学,区域位置比邻奥体中心。建成后的英冠.水天城将集五星级酒店、甲级写字楼、精品商业、五星级豪华总裁公馆于一体。在如此众多的外部条件下,城市建筑综合体的概念便应运而生。这是功能的综合、形式的综合、环境的综合。', '2014-04-27', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FUP', '330100', '120.10057,30.330736;120.10366,30.332116;120.103671,30.33231;120.100919,30.335185;120.100726,30.335246;120.099519,30.334361;120.098676,30.333829;120.10057,30.330736', '阳光郡', '杭州市拱墅区莫干山路与广业街交汇处', '杭州市', '0103000020E610000001000000080000005C3D27BD6F065E40209C4F1DAB543E40D1798D5DA2065E40747ADE8D05553E40CBA2B08BA2065E403E22A64412553E40E222F77475065E40191C25AFCE553E40D7F6764B72065E40651D8EAED2553E402995F0845E065E40D00EB8AE98553E409B3924B550065E40D6743DD175553E405C3D27BD6F065E40209C4F1DAB543E40', '107538.241725', '120.101055,30.332948', '商务住宅;住宅区;住宅小区', '2184个', '2.6', '350741平方米', '28000', '阳光郡占地150亩,总建筑体量近36万方,体量恢弘巨大,规模居住效应明显。随着杭州主城区土地价值日益稀缺,大规模、成效应土地出让逐渐稀缺,杭州主城区一次性出让体量25万方以上的住宅项目凤毛麟角,更是体现出阳光郡作为主城区标杆性大盘的重要地位。    阳光郡,雄踞莫干山路杭州大动脉,扼守杭州主城区发展核心格局,东临城市主干道莫干山路直达西湖风景区,北接全线修通的长青路连通申花高档成熟生活区, 与地铁2号线站点仅1公里距离,出则繁华,入则静谧,交通条件十分优越。    阳光郡,多次深入深圳等南方一线优良户型重地,甄选海量户型,因地制宜,结合杭州市民的居住习惯,历经数次修改讨论,研磨出面积、功能、朝向等均好的户型,90方魔幻三房、110—140方舒适三房和华丽三房、160方以上豪华四房,为杭州主流家庭贴身打造。', '2017-09-21', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FUV', '330100', '120.105704,30.305223;120.105645,30.305241;120.105592,30.305288;120.105566,30.305347;120.105415,30.305857;120.105088,30.306602;120.104787,30.307186;120.104777,30.307224;120.104793,30.307255;120.105875,30.307642;120.105928,30.307651;120.10597,30.307621;120.106483,30.307024;120.106638,30.306837;120.107394,30.305959;120.107402,30.305918;120.107391,30.30588;120.107363,30.305853;120.106943,30.305691;120.106308,30.305476;120.105895,30.305301;120.105704,30.305223', '赛丽绿城·慧园', '杭州市拱墅区丰潭路与方家北路交汇处东北侧100米', '杭州市', '', '31223.272252', '120.106003,30.306435', '商务住宅;住宅区;住宅小区', '地下停车位', '2.4', '114309平方米', '54661', '赛丽绿城慧园,位于丰潭路与方家北路交叉口,正处申花板块核心。作为老城西的延伸板块,申花板块拥有成熟的生活配套,分明的生活圈层,占据独特的自然环境,并做到与市中心无缝对接。根据规划,申花板块被杭州市政府定位为“城西核心示范区”,将引入40万人口居住,成为“学在杭州、住在杭州、游在杭州、创业在杭州”和谐示范的典型区域。此外,慧园周边近享一所大学(浙江大学),两所甲级幼儿园(申花路幼儿园、闻裕顺幼儿园),四家重点小学(学军小学、保叔 ......', '2014-03-29', '4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVD', '330100', '120.312118,30.267867;120.310452,30.268031;120.306533,30.271207;120.306972,30.271781;120.307421,30.272344;120.309572,30.270974;120.313263,30.268787;120.312118,30.267867', '科尔世纪外滩', '杭州市萧山区水博大道1号', '杭州市', '0103000020E610000001000000080000008C9FC6BDF9135E4079AD84EE92443E4094BE1072DE135E406E50FBAD9D443E404489963C9E135E403F726BD26D453E406A32E36DA5135E4097AC8A7093453E40A24621C9AC135E4007431D56B8453E4078F01307D0135E40F910548D5E453E40000341800C145E4007978E39CF443E408C9FC6BDF9135E4079AD84EE92443E40', '104982.362961', '120.309791,30.26985', '商务住宅;住宅区;住宅小区', '1440', '1.3', '290000平方米', '35000', '科尔世纪外滩,位于钱塘江畔,属于中国国际水城规划配套房产项目,规划用地150667平米。项目规划为线性高层公寓,法式排屋。', '2016-03-12', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVH', '330100', '120.190742,30.256578;120.190916,30.25657;120.191254,30.256575;120.191344,30.256549;120.191365,30.256469;120.191406,30.256165;120.191436,30.256138;120.191488,30.25613;120.192617,30.256183;120.192664,30.256171;120.192707,30.256126;120.192767,30.255932;120.192781,30.255318;120.192127,30.255303;120.192117,30.255186;120.190314,30.255142;120.190318,30.255664;120.19028,30.255847;120.190191,30.256203;120.19018,30.256352;120.190152,30.256497;120.190123,30.25658;120.190242,30.256601;120.190742,30.256578', '滨江·凯旋门', '杭州市江干区凯旋路116号(近庆春东路)', '杭州市', '', '26138.363149', '120.191359,30.255802', '商务住宅;住宅区;住宅小区', '912个（地下）', '2.7', '158892平方米', '47217', '滨江凯旋门,北临庆春东路,西邻贴沙河,向东、西各三公里可直达钱塘江与西湖。总建筑面积约18万㎡,由3幢多层、1幢小高层、3幢高层公寓与1幢酒店式公寓围合而成。', '2012-09-26', '4.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVI', '330100', '120.230376,30.343981;120.230376,30.343896;120.230312,30.343847;120.229344,30.343412;120.229255,30.343392;120.229189,30.343405;120.229133,30.343436;120.227861,30.344709;120.227392,30.345124;120.226568,30.345733;120.226526,30.345813;120.226515,30.345885;120.226559,30.346027;120.22707,30.34694;120.227124,30.347011;120.227152,30.347042;120.227269,30.347027;120.227575,30.34701;120.227932,30.346983;120.228518,30.346928;120.228593,30.346889;120.228653,30.346822;120.229063,30.346177;120.229741,30.345546;120.229973,30.345136;120.230376,30.343981', '玺之湾', '杭州市江干区笕丁路与华丰路交汇处', '杭州市', '', '69093.849745', '120.228506,30.345335', '商务住宅;住宅区;住宅小区', '1439个车位（1:0.9配比；地上100个，地下1339个）', '2.3', '176000平方米', '24975', '玺之湾规划20幢房源,分别是10幢高层和10幢小高层,形成区域内产品独特优势。内围建筑偏东30度规划,采光景观面更佳。最大楼间距达到70余米,社区通透感更强。简约新古典建筑气质,超越现有区域楼盘。外水内坡自然形成台地筑品,增加亲和力。四大邻里空间,九大集中院落,围合静谧生活。高得房率,基本上维持在82%-88%。内围小高层层高3米左右,主力户型是89方-140方。', '2015-04-11', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVJ', '330100', '120.105484,30.264507;120.105775,30.264823;120.106027,30.265062;120.106164,30.265141;120.107026,30.265535;120.107344,30.265049;120.107503,30.264891;120.108386,30.26499;120.108381,30.264651;120.107428,30.264534;120.107304,30.264358;120.107562,30.263924;120.108063,30.263628;120.108796,30.263076;120.108697,30.262881;120.108554,30.262741;120.108296,30.262797;120.107753,30.262986;120.107063,30.263291;120.106588,30.263268;120.106504,30.263481;120.1066,30.263549;120.105962,30.264035;120.105484,30.264507', '钱江西溪和景', '杭州市西湖区西溪路537号', '杭州市', '', '37245.901174', '120.107075,30.264161', '商务住宅;住宅区;住宅小区', '457个（1:1）', '1.4', '93451平方米', '29000', '钱江西溪和景,南靠老和山,北接西溪路,东临浙大科技园,项目距离黄龙商圈、武林商圈都比较近。钱江西溪和景总用地面积约4万余平米,总建筑面积约9.3万平米。由15幢多层、低层新古典主义建筑的名仕馆、商务大公馆和企业独联体组成。', '2017-10-08', '4.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVO', '330100', '120.248999,30.202232;120.249127,30.20213;120.249118,30.200051;120.249021,30.199933;120.246405,30.199972;120.246348,30.20002;120.246342,30.202153;120.246489,30.202272;120.248999,30.202232', '保利·霞飞郡', '杭州市萧山区建设二路401号', '杭州市', '', '57936.673993', '120.247733,30.201102', '商务住宅;住宅区;住宅小区', '超1：1（共910个）', '2.2', '190000平方米', '29071', '保利集团集19年高端地产巅峰造诣,跨越钱塘江,于城市中轴之上,定鼎钱江世纪城核心,钜献保利&#8226;霞飞郡。        项目继承1915年霞飞路的优雅神韵,以60余户法兰西城市御墅,90—200方ART-DECO高层公馆,全面复兴19世纪霞飞路的名门生活情境,卓然演绎百代传承的家族荣耀,为城市的领导者,书写世人称颂的经典华章。', '2013-11-02', '2.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVQ', '330100', '120.105296,30.288333;120.105421,30.287918;120.105694,30.287949;120.105855,30.287341;120.105905,30.287;120.105671,30.286984;120.10539,30.286956;120.104992,30.288485;120.104564,30.290003;120.104581,30.290063;120.10462,30.290079;120.104688,30.290089;120.1061,30.29017;120.106363,30.289297;120.106471,30.288949;120.105475,30.28877;120.105532,30.288453;120.105285,30.288393;120.105296,30.288333', '文溪鼎园', '杭州市西湖区文一西路100号', '杭州市', '', '26597.320996', '120.105477,30.288992', '商务住宅;住宅区;住宅小区', '1：0.7', '2.35', '100000平方米', '49826', '位于文一西路与丰潭路交叉口西北侧,东靠莲花港河与丰潭路,南临文一西路,地处老城西核心区域,左拥华美西溪,右揽文教繁华。    项目总占地面积约45亩,总建筑面积约10万平方米。共由4幢高层公寓、2幢多层公寓、5幢小高层公寓、1幢6层写字楼以及沿街商业用房组成,共设12幢建筑。    项目周边生活配套设施完善,西城广场、古墩路沃尔玛印象城、文二路华商超市、文一路物美超市、绿城医院、省立同德医院、竞舟路农贸市场、骆家庄农贸市场等近在咫尺。项目附近名校林立,浙江大学紫金港校区、浙江财经学院、之江外国语学校、求是竞舟小学、文华小学、文华中学。项目距规划地铁二号线丰潭路站仅900余米,距离在建的40万方城西银泰都市综合体仅1000余米。    项目建筑规划源自绿城血统,全花岗岩石材立面,新古典主义建筑风格,强调沉稳,以高耸、挺拔的建筑姿态,表达不断超越的人文精神和力量,形成精致典雅、芳华百年的建筑气质。户型以市中心罕有精致三房85-89平方米、舒适精装三房130-138平方米、奢华精装四房175平方米为主。包括部分65平方米精装酒店式公寓、临街商铺等。', '2013-10-13', '3.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVS', '330100', '120.120995,30.32029;120.120869,30.320145;120.120078,30.319198;120.119471,30.319545;120.118874,30.31991;120.118404,30.320196;120.117949,30.320473;120.117888,30.320543;120.117912,30.320613;120.117965,30.320658;120.118758,30.320924;120.120114,30.321322;120.121333,30.321645;120.121453,30.321685;120.12156,30.321664;120.121946,30.321177;120.121955,30.32112;120.121921,30.321046;120.121102,30.320406;120.120995,30.32029', '富越·香郡', '杭州市拱墅区杭行路与湖州街交汇处', '杭州市', '', '44081.331943', '120.120031,30.320552', '商务住宅;住宅区;住宅小区', '住宅847个', '3', '170000平方米', '37438', '富越&#8226;香郡坐拥银泰商圈内,湖州街(申花路)与杭行路交叉口。不仅能享受到城西银泰第一级综合体,同时步行即达堪比4个武林银泰的北城天地综合体、城北最大的世纪联华超市,除此之外还拥有奥特莱斯和运河天地等多重商业配套,近在咫尺的杭州市第二医院,拱墅区中医院、桥西历史街区、台湾美食街等更是让生活锦上添花,对于第一次置业的年轻人而言,决不会有比身处繁华正中央更惬意的生活质感了 富越房产联手全国特级施工企业八达建设,获得过全国鲁班奖的原班人马在寸土寸金的杭州市区,打造出罕见百米楼间距,邀请滨江房产御用设计单位棕榈景观打造27000㎡小区园林,原装进口三菱电梯、2000㎡泛会所、12大智能等等为第一次购房群体提供最好的品质住区。 富越&#8226;香郡,西邻27万方西塘河景,外依大运河中央公园,目前在售房源更是拥有百米楼间距,可直接欣赏4个足球场大小的园区景观,整个项目距离千年运河美景仅800米,凭借景观上的绝对优势,成为城西银泰商圈内绝无仅有的宜居景观住品,让人生的第一个家,便在美景中享受温馨。', '2014-09-30', '2.25元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FW1', '330100', '120.234408,30.34519;120.234356,30.345114;120.232854,30.344698;120.231336,30.344296;120.230678,30.345313;120.231614,30.345681;120.232426,30.34596;120.233193,30.34628;120.233913,30.346512;120.234451,30.345282;120.234408,30.34519', '北城铭苑(华丰路)', '杭州市江干区华丰中路434号', '杭州市', '', '40896.180775', '120.232662,30.34535', '商务住宅;住宅区;住宅小区', '', 'None', '', '22090', '北城铭苑经济适用房项目总建筑面积约为11万余平方米,其中地上总建筑面积约8万余平方米,由13幢主体建筑组成,其中包括11幢小高层建筑(14-17层)、2幢多层建筑(7层)及配套公建。户型为约63㎡、83㎡的经济适用房和50㎡的廉租房,共有住宅1200多套。 产品设计现代、适用、经济,为居住者的切身需求考量,从居住环境的舒适性、美观性、人文性出发,打造一个幸福的成熟生活住区。    北城铭苑项目位于丁桥镇,东邻惠兰雅路、南接华丰路、西至丁群路、北临规划中小学,占据丁桥大型居住区的核心地段,交通便利,周边配套齐全。   醇熟生活区:新城广场已建成使用,广场内物美超市、苏宁电器均已开业运营,农贸市场、医院、文体中心等生活配套逐步完善中,完美品质生活从容拥有。    高质教育圈:规划中的中学、小学、幼儿园等大部均已建成,部分已投入使用。丰富的教育资源,一体化的教育配套,让您的孩子赢在起跑线上。    便捷交通线:居住区内公交中心站已建成并投入使用,多路公交均已开通;石大线、秋石高架等城市快速路与五条城市主干道路网纵横;更有地铁3号线让您的生活无比便捷。    人性化配置:小区内按规划设计要求设置了地上、地下车位,社区服务设施、商业设施等,一应俱全。', '', '0.8-1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FW2', '330100', '120.110659,30.309323;120.111545,30.308598;120.110278,30.307575;120.109735,30.308185;120.109234,30.30879;120.110659,30.309323', '保利·香槟国际', '杭州市拱墅区人文路与方家北路交叉口北150米', '杭州市', '0103000020E6100000010000000600000084807C0915075E408EE6C8CA2F4F3E4012C2A38D23075E406B9C4D47004F3E40F8DD74CB0E075E403411363CBD4E3E40800EF3E505075E40261E5036E54E3E401F679AB0FD065E40F35487DC0C4F3E4084807C0915075E408EE6C8CA2F4F3E40', '18819.765447', '120.110395,30.308532', '商务住宅;住宅区;住宅小区', '配比近1:1', '2.6', '53000平方米', '36108', '保利R26;香槟国际,位于城西繁华中心,杭州核心区域——申花板块。区域内高档社区集聚,大型商业中心银泰、印象城、美凯龙等相继入驻,同时拥有优越的教育资源,完善的生态、生活、娱乐、医疗等配套设施及交通体系。香槟国际临近地铁2、5号线站点,咫尺城市主题公园、教育配套、距浙大紫金港校区仅2公里。', '2012-03-01', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FW7', '330100', '120.347219,30.303818;120.347155,30.304512;120.347426,30.304771;120.347525,30.304904;120.348473,30.304953;120.348567,30.303896;120.347219,30.303818', '盛泰名都公寓', '杭州市江干区西部生活区南区1号路东侧', '杭州市', '0103000020E6100000010000000700000030630AD638165E40A6EF3504C74D3E4025E99AC937165E40533D997FF44D3E40EDF1423A3C165E40EBC4E578054E3E40B7627FD93D165E406A6B44300E4E3E407FA2B2614D165E402DD15966114E3E40C05DF6EB4E165E409E62D520CC4D3E4030630AD638165E40A6EF3504C74D3E40', '12369.240937', '120.347878,30.304365', '商务住宅;住宅区;住宅小区', '860个', '5.27', '180000平方米', '25204', '', '2009-12-26', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FWB', '330100', '120.076664,30.316478;120.074704,30.315891;120.074152,30.317539;120.074992,30.317699;120.076177,30.317829;120.076664,30.316478', '西城博司', '杭州市西湖区紫萱路158号', '杭州市', '0103000020E61000000100000006000000F4311F10E8045E404BE7C3B304513E40583849F3C7045E40CA198A3BDE503E40B6BB07E8BE045E405D34643C4A513E408BDD3EABCC045E40CFF8BEB854513E4046ED7E15E0045E406BB8C83D5D513E40F4311F10E8045E404BE7C3B304513E40', '29631.142625', '120.075389,30.316934', '商务住宅;住宅区;住宅小区', '800多个', '3.5', '145000平方米', '', '西城博司位于城西环浙大商务圈核心,东隔城市绿化带与规划紫金港路(吉鸿路)相接,南望女儿港河,西接东陈路,北靠西园七路,一路之隔紧邻规划中杭州最大城市综合体——五里塘生态休闲商务综合体,南面毗邻浙大紫金港校区,距规划地铁2号线振中路站仅1000米左右,10分钟生活圈内可享银泰都市综合体、西溪湿地、沃尔玛印象城等大型城市配套,地段优势十分突出。    项目由7幢520平方米的大平层城市商务公馆、1幢SOHO公馆、1幢高端商务酒店和地标商铺等几大类产品组成,其中520平方米的大平层城市名流公馆整层作为一个销售单位,产权40年,二梯一户,户型设计可自由分割,预留更多个性创造空间。SOHO公馆户型面积为40~85平方米,满足城市精英白领的不同需求。同时小区内设网球场、商业会馆、高端商务酒店、精致餐饮等高端物业配套,和五里塘生态商业休闲综合体形成一体,提升区域商业氛围。    西城博司定位为大城西城市名流公馆,以其国际化的视野、前瞻性的设计理念、专业水准的业态整合能力,将项目规划建设成为一个城西核心集商务、办公、生活、休闲等功能于一身的都市综合体。项目外型设计方正大气,建筑线条简洁流畅,墙体采用高档石材干挂,公共部位高档精装修,景观设计突破原商业用地的绿化设计,约10000平方米中心花园以苏州园林藕园为蓝本,并和南面的女儿港河绿化带、东面沿紫金港路城市路绿化带形成多重景观,多方位享受唯美风景。', '2012-10-27', '3.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FWL', '330100', '120.232246,30.350217;120.231465,30.351457;120.233843,30.352565;120.234591,30.351208;120.232246,30.350217', '冠宇隽园', '杭州市江干区蕙兰雅路358号', '杭州市', '0103000020E610000001000000050000001EA8531EDD0E5E40D48041D2A7593E40CB4A9352D00E5E4045F30016F9593E408159A148F70E5E40D8B628B3415A3E40E63BF889030F5E40F4177AC4E8593E401EA8531EDD0E5E40D48041D2A7593E40', '35210.117301', '120.233046,30.351371', '商务住宅;住宅区;住宅小区', '540个(1：0.6)', '2.3', '120000平方米', '26031', '冠宇隽园地处丁桥板块核心地段,由11栋高低错落的高层建筑群构筑仅10万平方米建筑面积的家园,主力户型86-115平方米三房两厅精细化全明设计,四大庭院落环抱约5000平方米中央水景花园,10万平方米建筑规模大小适度的社区,将由近千户志趣相投的人家共享,形成非常和谐宜居的氛围。11栋高层建筑群高低错落、疏密有致,构成优美的天际线,极具标识性。楼盘自身商业配套达5600方,轻松解决生活中的所有麻烦。园区散点设置幼儿娱乐天地、青年活动场地、老年活动场所等,“泛会所”服务渗透生活的每个神经末梢。借助周边健康运动配套(学校、新城广场、金融中心等)操场、篮球场、羽毛球、足球、跑道等开启健康韵动生活。', '2011-01-03', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FWM', '330100', '120.283759,30.110734;120.283791,30.110629;120.283774,30.109988;120.283735,30.109899;120.283621,30.109885;120.281333,30.109921;120.28126,30.10996;120.281252,30.110026;120.281258,30.110783;120.283662,30.110764;120.283759,30.110734', '科尔·南城嘉园', '杭州市萧山区所前中路331-335号', '杭州市', '', '19949.638057', '120.282521,30.110338', '商务住宅;住宅区;住宅小区', '510个', '3', '61647平方米', '14373', '科尔南城嘉园位于萧山区城南板块、育才南路,西靠所前大道,北临所前镇政府,南临商贸路,东依自然河道,占据区域中心位置,西侧约百米处即为科尔房产在城南的开篇力作南城景园。    科尔南城嘉园建筑面积约61647㎡,规划为5栋板式小高层围合的大庭院住区,总户数约477户。新古典主义建筑,法式中央园林,致力于打造南城高品质住宅的标杆力作。    科尔南城嘉园采用优雅法式园林风格,精心营造多处细节景观。中心水景花园,以中轴对称的布局,彰显园区的优雅尊贵。硬质铺地小广场,丰富了园区景观的观赏性,为居者提供富有亲和力的公共活动场所。局部架空层景观、屋顶花园景观将风景引入建筑,形成多层次景观空间,亲切宜人。户内推窗见景,园中步移景异,营造一个充满典雅韵味而又赏心悦目的风景大院。    科尔南城嘉园采用新古典主义建筑风格,将古典的浪漫情怀与现代人的生活需求相结合,兼容华贵典雅与时尚现代形式,构筑历久而弥新的建筑细部。同时甄选高品质用材,辅以宽景阳台,错层露台、情景飘窗等通透设计,整体上庄重典雅、而又不失简约实用,可谓内在舒适、外在典雅,处处彰显居者尊贵高雅的气质。    科尔南城嘉园将根据社区需要定制人性化的物管服务,为业主提供365天24小时的生活关怀。为营造高端舒适安全的园区环境,园区还将引入闭路监控、可视对讲、红外周界报警、门禁管理系统、停车管理一卡通系统等多重智能配备,助力生活品质的全面升级。', '2012-12-09', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FWW', '330100', '120.271184,30.295015;120.270777,30.294888;120.270766,30.294716;120.270803,30.294614;120.271651,30.293021;120.27179,30.292787;120.27197,30.292505;120.272059,30.292405;120.272102,30.2924;120.272209,30.29241;120.273075,30.292706;120.273378,30.292792;120.273609,30.29285;120.273633,30.292866;120.273652,30.292905;120.273571,30.294591;120.273542,30.295196;120.272724,30.295153;120.271334,30.295095;120.271184,30.295015', '圆梦园(之江东路)', '杭州市江干区之江东路1850号', '杭州市', '', '54013.309536', '120.272393,30.293958', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FX6', '330100', '120.232695,30.308057;120.232829,30.308138;120.234489,30.30856;120.234676,30.308688;120.235908,30.309282;120.236207,30.309401;120.236476,30.30941;120.236691,30.309363;120.236699,30.308317;120.235391,30.308313;120.235436,30.307853;120.234183,30.307564;120.232952,30.307258;120.232695,30.308057', '原筑壹号', '杭州市江干区德胜东路7666号', '杭州市', '', '34372.027881', '120.234811,30.308304', '商务住宅;住宅区;住宅小区', '300个（1：2）', '2.2', '200000平方米', '24785', '原筑壹号坐落于杭州主城区城东新城,处新火车东站区域核心,紧邻德胜快速路,右接同协路,地铁一号线七堡站步行十分钟可达。项目规划为一个都市居住、商务、休闲、娱乐、酒店等各类功能为一体建筑综合体,由融合风尚公寓、悦LOFT 、原筑悦庄和国际酒店等部分组成。    原筑壹号·悦LOFT采用精装标准,以75㎡和81㎡户型设计为特有的X户型跃层设计,是传统酒店式公寓的升级换代产品,实现南北通透、动静分区、高得房率的空间享受。悦LOFT高配国际品牌酒店,建筑面积3万余方,拥有各类标准套房、豪华套房共263间。设有全日制西餐厅、中餐厅、大堂酒吧、行政酒廊、大型多功能厅和中小型会议中心,以及配有恒温室内游泳池和健身房的健身俱乐部。', '2012-04-29', '2元/月/平方米');
