INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14IHD', '330100', '120.237357,30.362169;120.237279,30.362134;120.237152,30.362154;120.233487,30.363439;120.233241,30.363573;120.233026,30.363732;120.232775,30.363992;120.232616,30.364271;120.232548,30.364417;120.233583,30.36445;120.236227,30.364691;120.237398,30.36225;120.237357,30.362169', '中兴·久睦苑', '杭州市江干区临丁路', '杭州市', '', '58135.816475', '120.235204,30.363626', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '中兴·久睦苑经济适用房项目由中兴房地产开发有限公司下属中兴·景灿房地产开发有限公司开发建设。项目总建筑面积约为177217平方米,其中廉租房约13103平方米,经济适用房约119476平方米,配套用房月14667平方米。项目由十三幢板式高层组成,其中9和10号楼为廉租房,其余为经济适用房。本项目的住宅立面采用现代简洁风格,品质感与实用性俱佳。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14JB2', '330100', '120.17991,30.120887;120.179171,30.121554;120.178658,30.121944;120.178354,30.122171;120.178082,30.122333;120.176878,30.122795;120.176948,30.123021;120.179816,30.123234;120.180242,30.122375;120.180789,30.121645;120.17991,30.120887', '云涛名苑', '杭州市萧山区湘湖新城', '杭州市', '', '38500.96934', '120.179156,30.122306', '商务住宅;住宅区;住宅小区', '', 'None', '', '23854', '', '', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14JB6', '330100', '120.103149,30.325321;120.103069,30.325385;120.101859,30.325038;120.10139,30.324862;120.101309,30.3248;120.101342,30.324624;120.10146,30.324307;120.10157,30.324073;120.101728,30.323681;120.103434,30.32411;120.103552,30.32414;120.103149,30.325321', '丽晶湾', '杭州市拱墅区祥符南路和莫干山路交叉口往西200米', '杭州市', '', '22434.7553', '120.102425,30.324523', '商务住宅;住宅区;住宅小区', '600个地下车位', '2.5', '100000平方米', '32618', '丽晶湾毗邻五里塘河,风景优美,距武林广场直线距离约6.5㎞,交通便捷,是用地日益稀缺的主城区项目之一。凭借超过300亿元的投资及200余万平方米的综合体群落,申花CBD,正在日益成为影响杭州这座魅力之城的国际化时尚生活源泉。丽晶湾凭借地利之优势,与建设中的100万平米蓝孔雀综合体隔石祥路相伴,与20余万平米的央企大盘蓝翔综合体毗邻而居。于世界级综合体双子星的围合中,步行五分钟之内,畅享国际级大型城市综合体的超级配套。丽晶湾采用世界建筑的精华——法国新古典主义建筑形态,园区规划6幢21-23层的高层建筑,外立面大部分饰以高档石材,庄重俊朗,高贵典雅。以中央法式景观大道为东西轴线,建筑围绕近万平米的中央花园围合布局,形成超宽的楼间距,整体布局层次分明,大气庄重,户户见景。丽晶湾全面融入建工地产“以超五星级酒店的手笔营建公寓”的综合体人居设计思想,实现产品各个界面的全方位、系统化升级。丽晶湾主力户型配置有89-130平米多款经典户型,每款户型均配备典雅的入户花园及可增长的空间系统,为都市新贵带来奢适的居住新体验。丽晶湾,堪称续世贸丽晶城、欧美中心(EAC)之后,建工地产又一超越之作。', '2013-01-12', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14KJ7', '330100', '120.075076,30.33455;120.075377,30.333365;120.077161,30.334769;120.077174,30.33482;120.077049,30.334969;120.076977,30.335021;120.076906,30.335027;120.075076,30.33455', '金地自在城', '杭州市西湖区金渡北路通济路交汇处西北方向', '杭州市', '0103000020E61000000100000008000000BA2D910BCE045E4076E09C11A5553E40B8770DFAD2045E408CA19C6857553E40B5E1B034F0045E40F2B6D26BB3553E407F86376BF0045E40F60B76C3B6553E4021CCED5EEE045E40802C4487C0553E40D462F030ED045E402579AEEFC3553E406FB72407EC045E40E9465854C4553E40BA2D910BCE045E4076E09C11A5553E40', '14398.467425', '120.07598,30.334339', '商务住宅;住宅区;住宅小区', '纯地下车位配比1：0.7 只售不租', '住宅:1.8', '850000平方米', '36193', '金地地产坚守“科学筑家”的使命,在“做中国最有价值的国际化地产企业”的愿景指引下,不断开拓新里程。作为连续八年跻身中国地产上市公司十强的金地地产将杭州作为企业下一步发展的战略要地,并将推出继格林系、未来系、国际系作品之后的新一代创新作品——自在城。金地•自在城项目位于杭州市西湖区三墩镇,东至通济路,南至金渡北路,项目占地面积546亩,总建筑面积约85万㎡,地块内金家汇河、董家桥河、池华港河、三墩港河四条天然河道环绕。建筑类型包括杭城稀有的大规模城市别墅组团、花园洋房、精装修高层景观公寓、时尚SOHO等,是目前杭州三墩板块规模最大、起点最高的综合性住宅项目,也是金地地产进驻杭州的首个重量级大盘。在未来将成为区域高端住宅标杆。依托杭州城西成熟生活配套及自身的科学规划,金地.自在城必将成为功能齐备、生活便利、环境宜人、邻里和谐的新城市生活范本。', '2013-08-03', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14KJK', '330100', '120.243592,30.308529;120.243669,30.308544;120.245669,30.308567;120.245794,30.308288;120.245936,30.308042;120.246858,30.30703;120.24686,30.306878;120.245751,30.30663;120.245254,30.306571;120.244463,30.306491;120.243768,30.306431;120.243644,30.306465;120.243592,30.308529', '远洋心里', '杭州市江干区建福街86号', '杭州市', '', '48480.345774', '120.244943,30.30749', '商务住宅;住宅区;住宅小区', '1014个', '2.4', '123000平方米', '34001', '远洋心里,毗邻德胜快速路枢纽、沪杭高速、新东站核心枢纽,紧邻地铁1号线,集结多重交通枢纽。它距离地铁1号线七堡站仅500余米,距地铁1号线九和路站仅400余米,并有多路公交线路经过。远洋心里将分享未来的区域商业、生活配套。它不仅自身拥有美式风情的商业广场、商业街,并能方便地享受七堡站地铁上盖商业配套。远洋心里总占地面积约5.1万平方米,建筑面积约12.3万平方米,采取美式温暖褐石风格,规划有10栋小高层和4栋高层,主力户型面积89-140方,并配套有商业广场、商业街。将“花园洋房”与小高层融合,塑造出1楼、2楼私家庭院独立入户式居家空间;它将立体式多层次的堆坡景观和参与式宜居花园理念相贯通。', '2013-10-25', '2.25元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14KUR', '330100', '120.278847,30.299359;120.278653,30.297811;120.274583,30.29824;120.274735,30.299735;120.276113,30.299593;120.278847,30.299359', '杨公江岸邻里', '杭州市江干区九堡镇杨公路66号', '杭州市', '0103000020E610000001000000060000009D6516A1D8115E4065C39ACAA24C3E40AB7B6473D5115E40996379573D4C3E40684293C492115E40EA5BE674594C3E4043041C4295115E407077D66EBB4C3E400740DCD5AB115E404C1C7920B24C3E409D6516A1D8115E4065C39ACAA24C3E40', '56984.192093', '120.276718,30.298782', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '小区交通便利 配套完善', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14L7Y', '330100', '120.283675,30.301791;120.281757,30.302128;120.281938,30.303875;120.283933,30.303681;120.283675,30.301791', '德信·金泊林公寓', '杭州市江干区九堡镇仁爱路133-12号', '杭州市', '0103000020E6100000010000000500000057EC2FBB27125E40263ACB2C424D3E40D21A834E08125E40B534B742584D3E40FA5FAE450B125E406F1283C0CA4D3E40555051F52B125E40A56ABB09BE4D3E4057EC2FBB27125E40263ACB2C424D3E40', '32911.36451', '120.28284,30.302871', '商务住宅;住宅区;住宅小区', '759个', '2.3', '100000平方米', '28846', '德式规划布局,以中央水景营造“都市桃源”在建筑形态和空间布局上,泊林公寓将德国讲究的次序性、功能性和本土的生活习惯综合纳入设计考虑中。社区门前,是一个开畅的风情小广场,取德国柏林“菩提树下大街”的意象,绿荫葱葱的树阵,树立于水中,优美雅致,两边是休闲商业如酒吧、咖啡店等,既有异国情调又能展示现代生活的诗意;穿过树阵就是“星级大堂入口”,以尊贵舒适的入口设计,迎接回家的人,这在杭州也是比较少见的;通过大型中央水景花园,沿着蜿蜒的小景,经过风情优美的组团景观、带半围合性质的静谧院落,一路把绿色灵动的休闲感延伸至每一个的单元入口,进入家里时,一天疲劳已经获得了释放和消解。挑战空间设计的极限,“革新户型”感动杭州客观的说把90方的户型做到三房,对技术上要求极高,如果同时又具备双阳台甚至三阳台那就更是难得了,泊林公寓89方三房双阳台,几乎是挑战了户型设计的极限!其户型原型我们可以从德国街头的一些高层度假公寓中找到,圆弧阳台、落地窗户、一步阳台等;此外,节约的户型空间却也可以做的很豪华,泊林公寓结合了现代豪宅中的品位设计,如:准一梯一户,业主刷卡后,就可“直接入户”,如此一来电梯前厅显得非常私密,在实际中增加了一些使用面积,不仅如此,公寓内很多设备运用都达到了豪宅的标准,像智能的信箱家居、紧急呼叫、煤气报警、新风系统、景观水处理、电子公告系统、太阳能热水系统、公共空间的无线上网等等。', '2009-09-30', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14LQP', '330100', '120.32663,30.315288;120.326528,30.317677;120.32733,30.3179;120.327478,30.317938;120.327828,30.31537;120.32663,30.315288', '铭和苑探梅坊', '杭州市江干区学源街1401-1号', '杭州市', '0103000020E610000001000000060000001EF98381E7145E403DD2E0B6B6503E409C4EB2D5E5145E40FFB0A54753513E40FB3F87F9F2145E40FE65F7E461513E40350A4966F5145E40D927806264513E40A3AD4A22FB145E40B8239C16BC503E401EF98381E7145E403DD2E0B6B6503E40', '24590.715441', '120.327128,30.316526', '商务住宅;住宅区;住宅小区', '', 'None', '', '21167', '', '', '0.68-0.92元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14MJ5', '330100', '120.258466,30.166013;120.258217,30.165508;120.257362,30.165639;120.257104,30.16564;120.256993,30.165636;120.256958,30.165651;120.256941,30.165676;120.256961,30.165945;120.257028,30.166232;120.257073,30.166514;120.257138,30.166689;120.25724,30.166855;120.257274,30.166916;120.257221,30.167028;120.25731,30.167208;120.257586,30.167555;120.258217,30.167152;120.258854,30.166728;120.258702,30.166517;120.258466,30.166013', '井泉苑', '杭州市萧山区城厢街道湘湖路21号', '杭州市', '', '22457.235166', '120.257812,30.166433', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '普通居民住宅小区,环境整洁干净,周边交通方便快捷,各类生活配套服务设施(商业、金融、教育、医疗、便民等)齐全.', '', '4.16元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14NMS', '330100', '120.328408,30.313891;120.32838,30.313819;120.328293,30.31379;120.327611,30.313788;120.326795,30.313754;120.325529,30.313679;120.3254,30.313788;120.325295,30.314786;120.325296,30.314901;120.325305,30.315046;120.32664,30.315133;120.327997,30.315193;120.328166,30.31514;120.328281,30.315042;120.328408,30.313891', '湖左岸', '杭州市江干区海达南路与学林街交汇处', '杭州市', '', '37670.761525', '120.326842,30.314439', '商务住宅;住宅区;住宅小区', '车位比1：0.7', '2.75', '100000平方米', '32697', '名城湖左岸位于下沙新城金沙湖板块,学林街与新业北路交叉口,毗邻地铁一号线下沙中心站及600亩的金沙湖。项目总占地面积约3万平方米,总建筑面积10万余平方米,主力户型是89方到140方。产品定位为“墅式公馆”, 作为全新一代公寓的升级产品,所有房型都采用局部5.6米挑空的跃层设计,既具备别墅那种立体的室内空间形式以及丰富的景观资源,又蕴含公馆优雅人文底蕴,营造出创新、舒适、高尚的生活感受。名城湖左岸位于新兴的金沙湖板块,金沙湖板块是整个下沙副城的政治、经济、文化、科技中心,它的打造,意味着向西发展连同九堡与钱江新城二期联接,从而在战略意义上成为杭州东部的中心。湖左岸地处金沙湖板块的核心区位,项目交付时地铁一号线已开通,无缝连接杭州主城区,畅享大杭州繁华配套。', '2011-08-07', '1.75元/月/平方米');
