INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14NV4', '330100', '120.288398,30.307879;120.288136,30.305477;120.286659,30.305582;120.285204,30.30572;120.285331,30.306364;120.284455,30.306455;120.284504,30.307056;120.284558,30.308287;120.288398,30.307879', '德信·泊林印象', '杭州市江干区仁爱路218号', '杭州市', '', '80069.275332', '120.286466,30.30691', '商务住宅;住宅区;住宅小区', '1400多个', '2.36', '260000平方米', '31272', '德信泊林印象择址杭州九堡核心区,总建筑面积约26万方,规划住宅1581户。交通:地铁一号线将于2012年国庆前开通,泊林印象与地铁客运中心站直线距离仅700米,加之城际交通四通八达出行极为便捷。学校:规划7所学校现已建成5所学校,已开学的有1所浙大幼儿园九欣分园、2所东城小学和1所东城中学,还未开学的有1所九洲芳园幼儿园,您的子女在家门口就可享受优质的一站式教育资源。配套:目前住区周边已然呈现醇熟的人居氛围,生活配套非常完善。小区西面300米已建成农贸菜场、江干区人民医院九堡院区、文体中心、公交始末站等配套。小区西北面规划有16万方商业综合体、地铁上盖物业、地铁客运中心站等。小区北面汇聚红星美凯龙金茂Mall、中国五金机电城、东大门交易中心等商业场所。周边11大专业市场、各大银行大型超市等商业配套齐备,居住泊林印象,生活方便快捷。', '2010-12-18', '1.75元/月/平方米');
