INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VOA', '330100', '120.196691,30.176976;120.193615,30.177093;120.193521,30.177108;120.193466,30.177157;120.19346,30.177236;120.193463,30.177764;120.193398,30.178257;120.193435,30.178378;120.193495,30.178426;120.196575,30.178265;120.196669,30.178233;120.196716,30.178154;120.196761,30.177088;120.196744,30.177002;120.196691,30.176976', '铂金名筑', '杭州市滨江区长河街道平安路38号', '杭州市', '', '39044.458762', '120.195081,30.17769', '商务住宅;住宅区;住宅小区', '553个', '2.2', '111907.09平方米', '36361', '铂金名筑是由金迅达集团-杭州金潮房地产开发有限公司开发建设,项目位于杭州市滨江区,长河路以西,纵二路以东,平安路以南,南环路以北,总占地面积为39631平方米。有十幢高层小高层合围而成,总建筑面积111907.09平方米,总户数815户。于2011年3月开工,预计2014年12月交付使用。铂金名筑项目是金迅达集团在杭开发继铂金时代后又一标杆性工程。项目秉承集团公司的“用心开发、创建精品、关爱业主、回报社会”的企业理念和“追求卓越,造福万家”企业宗旨。  铂金名筑楼盘地处滨江核心区,市政生活设施配套完备,近邻长河街道幼儿园、博文小学、长河中学、长河高级中学、长河镇政府、邮局、银行和长河水产市场(农贸市场)等,距中河高架仅五分钟路程,距武林商业圈30分钟车程。地处星光大道商业圈辐射范围,彩虹快速路预计2012年底通车。  医院:杭州滨江医院三级甲等综合医院、滨江区妇幼保健医院,武警医院。  文化休闲:临近白马湖创意园,湘湖休闲度假区。  酒店:喜来登、华美达、歌山品悦等。  铂金名筑方案设计定位“简约、理性、经济、时尚、运动”', '2013-12-18', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VOC', '330100', '120.330391,30.307127;120.329191,30.3071;120.329094,30.307171;120.328973,30.308431;120.332212,30.308525;120.33219,30.307222;120.330391,30.307127', '和达·御观邸', '杭州市江干区上沙路246号', '杭州市', '0103000020E6100000010000000700000023F94A2025155E40F6B704E09F4E3E40CDC8207711155E40029A081B9E4E3E40D4D347E00F155E40954737C2A24E3E401711C5E40D155E4094128255F54E3E40AED51EF642155E4097FF907EFB4E3E40BA83D89942155E40999CDA19A64E3E4023F94A2025155E40F6B704E09F4E3E40', '38296.179589', '120.330612,30.307819', '商务住宅;住宅区;住宅小区', '925个（1:0.9）', '2.8', '152000平方米', '29246', '和达御观邸距离轨道交通1号线千米以内,项目基本为纯跃层户型,层高5.8米—6.2米,拥有89-139㎡ 高厅叠墅。和达御观邸基于对作息起居状态的深度理解将“交谈-闲娱-就餐”“休憩-静思”划分为上下不同的平面, 实现生活的纵向剖析。', '2016-10-20', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VPG', '330100', '120.328915,30.30844;120.328831,30.309229;120.3322,30.309265;120.332203,30.308544;120.328915,30.30844', '万亚·金沙湖1号', '杭州市江干区金沙大道与银沙路交汇处', '杭州市', '0103000020E610000001000000050000007C0A80F10C155E403BC780ECF54E3E404DBA2D910B155E408BF9B9A1294F3E40CCEEC9C342155E4025CCB4FD2B4F3E4085285FD042155E40856055BDFC4E3E407C0A80F10C155E403BC780ECF54E3E40', '22899.087382', '120.330512,30.30887', '商务住宅;住宅区;住宅小区', '527个', '3.2', '105595平方米', '19734', '项目规划为集酒店式公寓、特色时尚酒店、主题商场于一体的商业综合体,酒店式公寓产品类型以LOFT为主。万亚金沙湖1号坐拥地铁1号线的金沙湖站和高沙路站, 30分钟即可穿越武林商圈抵达金沙湖。金沙大道、沿江景观大道、迎宾大道,绕城高速,江东大桥、九堡大桥“四纵四横二桥”,便捷完善的区内交通网络。距新的开发区管委会仅百米。该项目总建设面积约为105595平方米由3幢高层组成地下1层和地上2层为商业地产,地面3层以上为LOFT酒店式公寓4.8米层高设计。金沙湖1号,以水元素设计曲线时尚造型可享最大65平米、270°开阔阳光回廊。', '2013-05-11', '3.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VQ5', '330100', '120.23119,30.358521;120.231128,30.358467;120.231033,30.35846;120.229093,30.359124;120.228186,30.359526;120.22729,30.360058;120.227187,30.3602;120.227223,30.360343;120.229001,30.361061;120.229878,30.361427;120.23119,30.358521', '广宇·东承府', '杭州市江干区惠兰雅路与勤丰路交汇处', '杭州市', '', '51721.632897', '120.22934,30.359955', '商务住宅;住宅区;住宅小区', '777个（1:0.93配比）', '2', '151654平方米', '25145', '广宇东承府规划有多层公寓、高层公寓、单身公寓等产品,传承城市高端大宅的“依水而居,方为大宅”、“有山有水,有私家花园”、“独门独户、有天有地”、“家庭成员生活空间相对独立”等传统,是杭州主城区为数不多的高品质城市山水大宅。  广宇东承府位于丁桥CBD中央区,北眺皋亭山风景区,近揽丁兰公园、勤丰港公园;坐拥52万方品牌大盘上东城成熟社区,上市房企广宇集团鼎立钜制。  多层:220-250平方米、高层:50-130平方米', '2013-09-14', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VQG', '330100', '120.328504,30.312386;120.325493,30.312239;120.325412,30.313511;120.328391,30.313669;120.328504,30.312386', '龙湖·滟澜山1期', '杭州市江干区下沙海达南路华景街交汇处东北面', '杭州市', '0103000020E61000000100000005000000BB26A43506155E406FBA6587F84F3E40EC8497E0D4145E40278925E5EE4F3E40766EDA8CD3145E40AEEFC34142503E403F53AF5B04155E40DFC4909C4C503E40BB26A43506155E406FBA6587F84F3E40', '34956.69095', '120.326953,30.31295', '商务住宅;住宅区;住宅小区', '', 'None', '', '30401', '', '', '2.9-3.9元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VVW', '330100', '120.172948,30.229264;120.172435,30.227636;120.170977,30.227976;120.171542,30.229589;120.172948,30.229264', '赛丽绿城丽园', '杭州市上城区江城路355号', '杭州市', '0103000020E6100000010000000500000027FA7C94110B5E407026A60BB13A3E40E36BCF2C090B5E406B64575A463A3E4090D78349F10A5E40DD4598A25C3A3E40FDF84B8BFA0A5E4077853E58C63A3E4027FA7C94110B5E407026A60BB13A3E40', '22750.838587', '120.171974,30.228611', '商务住宅;住宅区;住宅小区', '290个地下车位', '1.9', '48000平方米', '61105', '赛丽绿城丽园是赛丽控股集团与绿城集团联手合作,集杭州千年皇脉厚祉、深厚人文底蕴和国际一流品质于一身的罕见城市中心精品物业。项目位于杭州老城中心,总占地面积28052.2平方米,距西湖直线距离约1公里,距吴山广场直线距离约0.8公里,凝聚老城中心的通达与繁华。赛丽绿城丽园园区规划为7幢小高层、多层及1幢商用写字楼。全石材干挂外立面,色彩大气精致、端庄典雅,在窗、檐口、立面等部位采用古典的元素和符号,线条装饰简洁流畅,呈现细节上的体贴与完美。法式建筑的血统赋予丽园一种神圣的特质,营造庄严、尊贵的美感。', '2010-11-06', '4.48元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VVY', '330100', '120.024205,30.240934;120.0234,30.24071;120.023288,30.240854;120.023227,30.241887;120.022998,30.242798;120.022971,30.243031;120.024066,30.243088;120.024117,30.242897;120.02418,30.242316;120.024199,30.241459;120.024173,30.24119;120.024205,30.240934', '绿城·翡翠湾', '杭州市余杭区高教路与五常大道交汇处以东300米路南', '杭州市', '', '20517.38662', '120.023661,30.241987', '商务住宅;住宅区;住宅小区', '388个', '2.1', '69418平方米', '22561', '项目位于杭州城市的西溪闲林板块, 在五常大道高教路交汇处往东300米左右,紧临十平方公里的5A级国家西溪湿地公园,东至余杭区五常乡,西溪沃尔玛,宏丰家居城,与华立科技园相邻;南临02省道、经天目山路;西临高教路,北临五常大道。    建筑设计主要采用了地中海风格,翡翠湾延续了绿城集团的建筑特色,依然是走新古典建筑风格,典雅、精致的路线将东西方建筑艺术和审美观念有机地融汇在一起。    建筑表现:坡屋顶,水泥瓦,线条丰富、宽挑檐。建筑色彩追求与环境融合互补效应,以端庄典雅的暖色调为主,力求展现历久弥新,经典永恒的建筑之美。外墙涂料采用质感涂料,底层为花岗岩石材饰面,工艺做法通过相关评审确定。套内外墙门窗为彩色铝合金。外墙采用无机保温砂浆(阻燃)提高保温性能。    景观设计由绿城景观设计中心的首席设计师宋淑华先生亲力打造,原代表代:蓝色钱江、温州鹿城广场等。园区内部的景观设计上采用的是西班牙风格,以植物配置、生态水系、园林小品、铺装道路等元素有机配合。景观营造中运用丰富的配置与其他园林小品相互映衬相互和谐,通过合理的植物配置,充分展现了园区“自然、灵秀、精巧、雅致”的居住特色。    项目特色与亮点:景观由入口景观、中心广场景观、组团庭院景观等渐次展开,通过曲折有致的步道系统,将景观院落有机地串连起来。景观设计还非常注重吸纳杭州山水人文特征,强调生态、自然的景观意境。园区水系,环境优美,通过滨河绿化的渗透,体现出景观的自然性、亲水性。    周边的商业配套:项目紧邻5万平方米的“翡翠天地”生活圈,满足购物、餐饮、休闲的生活需求。周边有农业银行、超市、农贸市场、医院、教育配套从幼儿园到大学都一应俱全。步行十分钟可到达的配套有:翡翠天地、农业银行、世纪联华超市、农贸市场、翡翠城社区卫生服务站、健身中心等。10分钟车程可到达的配套有:西溪印象城、西溪湿地、淘宝城、杭州第十人民医院、西溪沃尔玛休闲购物公园、宏丰家居城。教育配套:社区内12班绿城育华幼儿园,求是小学,闲林二小,杭州英特外国语学校,五常中心小学,西湖高级中学、杭州师范大学、浙江省委党校、浙江理工大学等,教育配套从幼儿园到大学一应俱全。西溪印象城总占地21万平方米(相当于七个武林银泰那么大),距本项目仅5分钟车程,将于2013年初开业,车位总数达到2000个以上。开业后它将成为城西目前最大的商业购物中心。西溪印象城现已和沃尔玛山姆会员店、中影集团、金钱豹餐饮集团、外婆家餐饮集团、面包新语、迪卡侬、苏宁精品店、银乐迪等200多家国内外知名连锁公司形成了战略合作伙伴关系。印象城的投资商--深国投商用置业有限公司,它是中国最大的商业地产投资开发及经营管理公司之一.国家5A级湿地公司--西溪湿地距本项目也仅5分钟的车程,它是全国排名第二的负氧离子最高的地方(排名第一的是海南),达7000-8000立方。在西溪,你可以在初春时踏青漫步,泛舟湖漾港汊,也可以在夏日下采菱赏荷,可以垂钓河塘柳荫,秋风中可以观柿听芦,冬日里可以探访梅花。在您的家门口,四季如画。在西溪湿地周边是100平方公里的西溪科技岛,它具有“中国硅谷”之称,是杭州政府目前制定了大量的优惠政策全力支持的一个生态科技岛。现已进驻如阿里巴巴、强联国际、恒生电子、新能基、加利利科技、以及杭州师范大学为核心的杭州大学城高教综合体等20多企事业单位。', '2014-07-26', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14YZL', '330100', '120.148349,30.267861;120.14736,30.267512;120.147116,30.268171;120.14807,30.268435;120.148726,30.268648;120.148974,30.268085;120.148966,30.268046;120.148349,30.267861', '松木场社区南区', '杭州市西湖区保俶路164号大院内的', '杭州市', '0103000020E610000001000000080000003CD9CD8C7E095E40B5DFDA8992443E40452FA3586E095E409D499BAA7B443E40F92D3A596A095E4051BCCADAA6443E4033E197FA79095E400D1AFA27B8443E4027840EBA84095E40C422861DC6443E40137D3ECA88095E40548CF337A1443E40D28DB0A888095E40D8D2A3A99E443E403CD9CD8C7E095E40B5DFDA8992443E40', '10121.127', '120.148035,30.268091', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14Z1T', '330100', '120.056305,30.289193;120.056141,30.289092;120.055118,30.289054;120.056551,30.291222;120.058289,30.290633;120.058611,30.290417;120.058131,30.290272;120.057645,30.290121;120.05718,30.289943;120.056895,30.289773;120.056644,30.289585;120.056426,30.289317;120.056305,30.289193', '富越·香溪', '杭州市西湖区崇义路与文一西路交汇处西北', '杭州市', '', '28421.82144', '120.056693,30.290156', '商务住宅;住宅区;住宅小区', '停车位描述：1170个停车位，停车位价格未定。', '2', '50000平方米', '37687', '富越香溪位于杭州城西西溪板块核心住区,文一西路与崇义路交叉口,东南至五常港河,紧挨着西溪国家湿地公园。约2.5万方的土地上,精巧布局着浪漫奢华的法式园林,糅合着西溪山水的闲情野趣。4幢河景法式公寓及4幢滨水法式公馆围合而成,隐于静处却不去都市繁华的独特气质,处处流露着香溪生活的自然雅致。 项目距西湖约20分钟车程。', '2014-02-28', '2.25元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14ZGE', '330100', '120.209789,30.30129;120.208539,30.30036;120.207859,30.299958;120.207189,30.300541;120.206775,30.301067;120.207389,30.301532;120.207955,30.30195;120.208229,30.302152;120.208464,30.302205;120.208988,30.30186;120.209789,30.30129', '东港嘉苑1区', '杭州市江干区机场路与下宁路交叉口', '杭州市', '', '32258.465494', '120.208219,30.301116', '商务住宅;住宅区;住宅小区', '', 'None', '', '27419', '小区周边配套齐全    小区周边配套齐全', '', '0.8-3.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1509W', '330100', '120.045719,30.277988;120.043203,30.2772;120.043097,30.277253;120.04271,30.279083;120.042777,30.279123;120.045682,30.279456;120.045719,30.277988', '昆仑府', '杭州市余杭区余杭文二西路和荆长大道(文二西路以北,荆长路以东)', '杭州市', '0103000020E610000001000000070000009373620FED025E4032AEB8382A473E40B40584D6C3025E4082734694F6463E409163EB19C2025E40C8B7770DFA463E40944DB9C2BB025E409CDEC5FB71473E405801BEDBBC025E40B88FDC9A74473E4004013274EC025E40C5ABAC6D8A473E409373620FED025E4032AEB8382A473E40', '44459.926547', '120.044231,30.278434', '商务住宅;住宅区;住宅小区', '独栋别墅车位比1:2', '1.08', '85940平方米', '28905', '昆仑府坐落于杭州城西西溪板块核心,西溪国家湿地公园的西北面,周围西溪楼盘集结。项目紧临文二西路和荆长路(文二西路以北,荆长路以东),武林广场约9公里,距西湖风景区约7公里,距离西城广场约4.5公里左右距离,为纯正的城市第一居所。昆仑府,择址西溪国家湿地公园核心景观区,占位“杭州高端居住史脉”——文二西路黄金末端。由94栋意式独栋与194席花园洋房相合而成;循景而瞻,风光悠然;回首而望,繁华尽现。    昆仑府项目采用杭州首创的规划形式,以东方传统的院落形态定制“独栋别墅”的组团空间,形成“国家级景观资源+传统豪宅区+顶级建筑产品”的豪宅金三角;在杭州西湖渐渐淡褪居住价值的今天,昆仑府,这席占位正西溪的独栋园区,将成为“一栋西溪,别无杭州”的杭州高端物业价值的最后承载者。', '2013-04-20', '6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B151PT', '330100', '120.233283,30.37114;120.230149,30.370089;120.229898,30.370152;120.229782,30.370376;120.22881,30.372672;120.23198,30.373972;120.233283,30.37114', '城发·云锦城', '杭州市江干区丁桥长睦路北段', '杭州市', '0103000020E610000001000000070000009EEDD11BEE0E5E40C93CF207035F3E40410DDFC2BA0E5E40FE9B1727BE5E3E409DDA19A6B60E5E408B8C0E48C25E3E4068CD8FBFB40E5E402A3927F6D05E3E40DBBFB2D2A40E5E408A22A46E675F3E40DE54A4C2D80E5E40A59E05A1BC5F3E409EEDD11BEE0E5E40C93CF207035F3E40', '94589.880324', '120.231027,30.371955', '商务住宅;住宅区;住宅小区', '约1:1', '2.4', '250000平方米', '', '城发云锦城,位于杭州市江干区丁桥街道长皋生态居住区,距武林门广场约12公里,东临东风港,南至天丰路,北邻皋亭山生态休闲风景度假区和上塘河,西至长睦路;山水资源丰富,城市生活便捷。
