INSERT INTO "public"."gaode_residential_region" VALUES ('B023B155XE', '330100', '120.137305,30.291122;120.137323,30.290558;120.137389,30.289092;120.136046,30.289062;120.136009,30.28959;120.135952,30.290046;120.135885,30.290777;120.135873,30.29096;120.135762,30.290961;120.135716,30.290961;120.135663,30.290989;120.135618,30.291044;120.135592,30.291098;120.135538,30.291663;120.135479,30.292188;120.135461,30.292557;120.136114,30.292679;120.136164,30.292552;120.1362,30.292446;120.136274,30.292351;120.136445,30.292161;120.136597,30.292056;120.136823,30.291922;120.136993,30.291828;120.137119,30.291718;120.137193,30.291602;120.13723,30.291538;120.137243,30.29145;120.137293,30.291189;120.137305,30.291122', '金都·城市芯宇', '杭州市西湖区文一路122号', '杭州市', '', '43862.512753', '120.136474,30.290775', '商务住宅;住宅区;住宅小区', '1000余个', '2.5', '23平方米', '50382', '金都城市芯宇位于杭州市中心文一路与教工路交汇处,距西湖3公里;距商业中心武林广场3公里;距黄龙体育中心1.8公里;距市政府2公里。交通十分便利,各种配套设施完善。金都城市芯宇整个建筑雕塑感强烈,具有精准明确的美学,独具匠心。轮廓天际巧用传统马头墙似的斜切退台,摒弃高层建筑常见的冰冷与生硬,柔化板楼的四方形为五边形,意寓了大度宽厚、礼让在先的为人处世的高超境界。大块面分割与作为“破格”要素的形体穿插,玻璃与铝板的材质对比,隐喻了信息时代的复杂性与多元性。色彩对比和线条处理营造出的无形的屋檐,写意、深邃。黑、白、灰三色的大胆启用,既有现代感,又有中国建筑味,暗合了“学院与科技”的地缘文化,含意隽永。景观设计充分融入城市肌理,借鉴城市公共广场的设计手法,强调大开大合的规划布局,主题各异的院落层层推进尽显大户贵族遗风,简练之风与现代俊朗的建筑造型相得益彰。建筑中部架空设置的巴比伦皇室余韵的空中庭院,屋顶花园,提供俯瞰园区景观的视点,成为高层住宅“绿肺”。建筑底层5.6米架空,整体环境融为一体;蜿蜒溪流贯穿南北,构成整个景观主线;下沉广场、休闲平台、雕塑小品、风雨廊与行人步道点缀其中,步移景异;多空间、多层次、多组团立体景观,美不胜收。小区东北侧大面积亲水景观带,设置具有学院特色的校园文化广场、树林锻炼场地、羽毛球场、篮球场、休闲场地等,使区域功能更合理的发挥,将整个小区与河道无缝链接。三重景观系统动静相宜,内外兼修。', '2008-11-28', '3.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B15FDY', '330100', '120.263178,30.132541;120.264342,30.132555;120.264492,30.133793;120.264616,30.135199;120.26461,30.135259;120.264578,30.135301;120.264551,30.13532;120.264508,30.135334;120.262891,30.135241;120.263178,30.132541', '开元广场·悦墅', '杭州市萧山区西河路', '杭州市', '', '36463.551809', '120.263767,30.134008', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '开元广场地处杭州市萧山区蜀山街道,东至市心南路,西至曹家桥社区现有农居,南至规划南三路,北至蜀山街道拆迁安置小区及曹家桥村级留用地(柳桥南和城);项目东侧连接杭州地铁一号线(南部卧城站)和南门江,地理条件和环境资源均为优越。 建设总用地面积248亩;项目总建筑面积68.06平方米,其中商贸用地总建筑面积211135平方米,住宅用地总建筑面积23.67万平方米(共1880户)。 开元广场由低层住宅区、高层住宅区和商贸区三部分组成,地块中间规划道路将项目一分为二,道路以东为高层住宅区(带幼儿园)和商贸区,道路以西为低层住宅(排屋)区。低层住宅区属于高端物业,独立于其景观大道、生活配套和高层与商业区,紧密相联系;高层住宅区与商业区毗邻而居,做到既不受商业人流和地铁等噪音干扰,又能充分的享受到生活的便利。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B15FN6', '330100', '120.102925,30.163964;120.101854,30.163336;120.101456,30.163871;120.101102,30.16398;120.100689,30.164392;120.100406,30.164684;120.100254,30.164835;120.100321,30.165021;120.101809,30.165964;120.103529,30.166992;120.103684,30.16686;120.104264,30.166013;120.104535,30.165609;120.104592,30.165384;120.104733,30.164602;120.104721,30.164262;120.103608,30.164178;120.102925,30.163964', '珊瑚沙家园', '杭州市西湖区转塘枫桦路', '杭州市', '', '82310.413229', '120.102692,30.165088', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '普通居民住宅小区,环境整洁干净,周边交通方便快捷,各类生活配套服务设施(商业、金融、教育、医疗、便民等)齐全.', '', '0.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B15FOM', '330100', '120.010913,30.219876;120.011138,30.220043;120.011433,30.220497;120.011975,30.221118;120.01307,30.220914;120.013257,30.220831;120.01432,30.220655;120.014046,30.219394;120.014039,30.219349;120.014053,30.219337;120.014082,30.21933;120.014128,30.219334;120.014387,30.21937;120.014447,30.219377;120.014613,30.21938;120.014734,30.21938;120.01502,30.219282;120.015209,30.219212;120.015753,30.218961;120.016539,30.218597;120.016588,30.218582;120.016652,30.218587;120.01683,30.218688;120.016894,30.218725;120.017029,30.218769;120.01709,30.218786;120.017116,30.218772;120.017219,30.218675;120.017317,30.218538;120.017399,30.218402;120.017513,30.218288;120.017644,30.218162;120.017704,30.218104;120.017487,30.217905;120.017207,30.217651;120.016908,30.2174;120.01686,30.217396;120.016181,30.217696;120.015485,30.218007;120.015095,30.217575;120.013756,30.216115;120.013595,30.216157;120.013029,30.216419;120.012777,30.216507;120.012603,30.216618;120.012708,30.216866;120.012918,30.217162;120.0131,30.217503;120.01306,30.217897;120.013063,30.218244;120.013224,30.218395;120.013259,30.218715;120.011829,30.218678;120.0117,30.218747;120.011684,30.218868;120.011572,30.218984;120.011336,30.219331;120.010913,30.219876', '众安·白马山庄', '杭州市余杭区留和路水木清华旁', '杭州市', '', '126302.535601', '120.013869,30.218769', '商务住宅;住宅区;别墅', '总1152个，地上337个，地下815个。', '1.29', '243497平方米', '20267', '众安&#8226;白马山庄位于杭州大城西闲林镇民丰村,毗邻杭州唯一国际长寿村。总建筑面积约23万方,容积率在1.3左右,规划户数992户,涵盖豪华双拼、联排、叠拼、高层公寓四大产品。    项目三面环山,北依小和山,南望午潮山,绕项目而过的项灵溪,为西溪源头。此外,还有相当于2个西湖容量的“闲林水库”在兴建中。    东邻留和路,直接天目山路到达主城。周边有地铁3号线(规划)、绕城高速、02省道、杭徽高速以及多路公交。     区域内的杭州小和山高教园区,人文氛围浓郁。浙江工业大学、浙江科技学院、浙江外国语学院、杭州外国语学校、浙江长征职业技术学院等高等院校皆布局于此。    众安房产坚持建筑是建立在对自然的理解、对城市的理解、对人性的理解上的,它存在于自然的环境中,提升自然的价值,升华生命的价值。作为众安房产15年大成之作,众安&#8226;白马山庄,师法自然,秉承有机建筑,开始一次有机生活的完美实践。', '2013-08-25', '2.49元/月/平方米');
