INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16BGA', '330100', '120.169762,30.268199;120.16931,30.268174;120.169273,30.268403;120.169221,30.268892;120.169682,30.268918;120.169689,30.268834;120.1704,30.268831;120.170426,30.268432;120.169736,30.2684;120.169743,30.268328;120.169762,30.268199', '玄坛公寓', '杭州市下城区体育场路229号', '杭州市', '', '5674.896351', '120.169756,30.268583', '商务住宅;住宅区;住宅小区', '', '2.6', '', '47368', '玄坛公寓建筑年代大约2000年,是城中比较新的楼盘,在体育场路与中河北路交叉中间口,离西湖10多的路程,小区里就有农贸市场,旁边就是浙江国际大酒店,联通大厦,生活很方便。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.6元/月/平方米');
