INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16BQS', '330100', '120.213793,30.272577;120.212909,30.272268;120.211933,30.274136;120.213816,30.274899;120.214822,30.27307;120.213793,30.272577', '水湘社区农转居公寓2期', '杭州市江干区三新路345-4号', '杭州市', '0103000020E6100000010000000600000047C7D5C8AE0D5E404CA4349BC7453E408A01124DA00D5E4051BF0B5BB3453E405DFC6D4F900D5E4000A8E2C62D463E4023D74D29AF0D5E40FFB3E6C75F463E40861DC6A4BF0D5E40CB845FEAE7453E4047C7D5C8AE0D5E404CA4349BC7453E40', '39524.8453', '120.213376,30.273576', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16C3P', '330100', '120.150313,30.295507;120.150257,30.295558;120.150238,30.295558;120.150127,30.295547;120.149944,30.295838;120.151028,30.29624;120.151075,30.2962;120.151163,30.296008;120.151199,30.295923;120.151213,30.295897;120.151236,30.295869;120.150313,30.295507', '上岛公馆', '杭州市拱墅区霞湾路', '杭州市', '', '4414.736086', '120.150605,30.295859', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '项目介绍:作为首届“杭州市最佳人居奖”、“亲水人居奖”楼盘,清水公寓与运河、公园相互交融,并挖掘了富义仓遗址和古树木的保护;小区内注重院落空间、邻里交往空间和绿色坡地的设计,体现了江南的韵味。目前清水公寓已入住1100余户,拥有醇熟、悠然的居住氛围。  上岛公馆,位于清水公寓北区块,以江南韵味十足的石拱桥——华光桥、霞湾公园与清水公寓其他各组团相衔接。上岛公馆由两幢高层、小高层围合而成,东依红建河,南临胜利河,西邻京杭大运河,“三河”环拥,半岛形制,其独特的地块条件在杭州市中心显得弥足珍贵。而紧邻的霞湾公园、富义仓主题公园、御码头、南薰轩、湖墅环楼、古水街以及大兜路历史保护街区等自然人文景观,更是凸显出“繁华于都市,共生于自然”的隐贵气质。  漫步于此,既可体会深厚、优雅的人文脉络,又不失亲切、民俗的烟火气息。站在乾隆御码头旧址,看万里河塘,十里湖墅,旌旗如云,华盖蔽天的圣驾亲临之所,与面前平静、安恬、悠缓的水面,让人体味到时空交织的神奇。无论是与上岛公馆一墙之隔的“天下粮仓”——富义仓,飞檐钩角、雕梁画栋、掩隐于竹影树幔间的南熏轩,还是粉墙黛瓦、镂花窗格、倒映于古河波光中的的湖墅环楼,无不令对本土文化怀有深厚感情的人为之眷顾。  不仅是历史,不仅是文化,不仅是风光,这是一段大隐隐于市的人生理想。也许,这是“隐贵华宅”的题中应有之义。<!--显示正文 END--><br />景观:依托于运河、沿河绿化带和霞湾公园,为1200余户清水公寓家庭营造了一方悠然、怡然、自然的生活天地。有一座带有室内篮球场、网球场和各种健康休闲娱乐设施的高级业主会所,和一个带有游泳池、篮球场和众多运动设施的大型户外运动广场。<br />园林景观:依托于运河、沿河绿化带和霞湾公园,为1200余户清水公寓家庭营造了一方悠然、怡然、自然的生活天地。有一座带有室内篮球场、网球场和各种健康休闲娱乐设施的高级业主会所,和一个带有游泳池、篮球场和众多运动设施的大型户外运动广场。<br />', '', '');
