INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16DW7', '330100', '120.1603,30.278252;120.160434,30.277604;120.160506,30.277355;120.1605,30.277323;120.16047,30.277314;120.159591,30.277077;120.159562,30.277057;120.159565,30.277022;120.159598,30.276935;120.159606,30.276894;120.159587,30.276872;120.158352,30.276559;120.158276,30.276528;120.158143,30.276864;120.157375,30.276702;120.157078,30.276646;120.15683,30.277359;120.156412,30.277282;120.156326,30.277288;120.156229,30.27735;120.156121,30.277675;120.156137,30.277762;120.156576,30.277919;120.156414,30.278435;120.156272,30.278926;120.157603,30.279226;120.158353,30.279406;120.159224,30.279599;120.159872,30.27976;120.159942,30.279747;120.159972,30.279726;120.159999,30.279662;120.160069,30.279358;120.160195,30.278844;120.1603,30.278252', '武林壹号', '杭州市拱墅区湖墅南路66号', '杭州市', '', '88616.911882', '120.158419,30.278107', '商务住宅;住宅区;住宅小区', '1691个；车位比1:2.3', '2.97', '469196平方米', '82171', '武林壹号,坐落武林广场北侧,坐拥武林商务圈、西湖文化广场,以及京杭大运河水景资源。INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JF0', '330100', '120.13303,30.321497;120.134018,30.321443;120.134311,30.321429;120.134377,30.321398;120.134411,30.321327;120.134388,30.321037;120.134333,30.320504;120.134256,30.319932;120.133133,30.319969;120.133053,30.320001;120.133006,30.320035;120.132978,30.320091;120.132977,30.320323;120.133004,30.320702;120.13303,30.321497', '城市风景', '杭州市拱墅区风景街333号', '杭州市', '', '18409.557964', '120.133673,30.320717', '商务住宅;住宅区;住宅小区', '431个（1:1）', '2.7', '76000平方米', '40022', '金瑞城市风景位于杭州拱墅区拱宸桥西,通益路与风景街交界处,总建筑面积约7.6万平方米,由3幢现代风格的板式高层住宅、多主题立体景观庭院及商业街构成。   金瑞城市风景坐享优势品牌教育圈,与卖鱼桥小学及大关中学为邻,孩子迈出小区,家对面就是学校。卖鱼桥小学教育集团文澜校区是目前杭州市教育规模最大,设施、设备最完善的国际化一流名校之一,是杭州市教育局、拱墅区政府重点打造的百年名校。不仅如此,与项目隔街对望的文澜中学,还有杭州求事高级中学、源清中学、红缨幼儿园等众多教育质量居全市前列的名校都在家门口,孩子成长无忧,家长更放心。   金瑞城市风景周边交通便利,城市公交、城市主干道、运河巴士共同构筑立体交通体系,上塘高架、登云路、莫干山景观大道等城市大动脉顺畅地联动了项目和周边区域,人们可随心所欲地驾车穿梭于运河文化广场、武林广场、黄龙体育中心、西湖大道等地。   金瑞城市风景周边环绕着缤纷如云的配套设施,各大银行、邮政中心、医院、商务大楼、世纪联华、农贸市场等生活风景,loft文化公园、运河天地公园、运河八景等自然风景,运河博物馆、3个国字号博物馆、运河图书馆等人文风景,项目便处于所有资源环绕的中心,尽享桥西核心生活区带来的无限便利和惬意。   金瑞城市风景主力户型面积为86-200平方米,包括平层、创意跃层等多类别户型,拥有超值可延展空间,让购房者能以更少付出收获价值。', '2012-11-25', '2.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JF8', '330100', '120.092759,30.328573;120.093377,30.328769;120.093565,30.328245;120.092991,30.328068;120.092759,30.328573', '红杉雅园', '杭州市拱墅区拱墅长阳路339号(环镇北路长阳路口)', '杭州市', '0103000020E6100000010000000500000038DA71C3EF055E403E59315C1D543E40B64C86E3F9055E404AF086342A543E4037C30DF8FC055E40551344DD07543E40A1F48590F3055E4037DDB243FC533E4038DA71C3EF055E403E59315C1D543E40', '3147.244836', '120.093172,30.328417', '商务住宅;住宅区;住宅小区', '57个停车位', '2.7', '12310平方米', '19178', '项目介绍:  红杉雅园由杭州安达置业有限公司开发,项目位于拱墅区祥符板块,北接余杭区勾庄,西临西湖区的三墩镇,南临环镇北路,东临长阳路,西侧为都市水乡,北侧为大型社区都市水乡配套公建。  地块属性:地块用地性质为商业金融兼办公用地,总用地面积为3707平方米,总建筑面积为12310平方米。容积率2.7,建筑密度为30%,停车位57辆。  建筑结构:主体建筑为一幢9层高45米的单元式办公建筑,裙楼为5层,主楼及裙楼的一层为5.8米层高的商业用房,二层以上除裙楼第五层为3.6米层高的平层结构,其他均为层高4.78米的loft结构。  大堂介绍:项目大堂5.8米挑高,并且内中庭直通顶层,玻璃覆盖,拥有足够的采光。大堂内两侧设置绿化景观。  产品结构及卖点:项目在产品设计中采用纯loft结构,这在目前杭州市面比较稀缺,该设计满足现代年轻购房人群对于空间的要求,一层购买,两层享受;同时,loft也是目前时尚的代名词,是一种年轻、时尚的象征。目前市面上的小户型单身公寓一部分是点楼设计,无法做到各单元两面通透,有些板楼设计上为中间公共走道,两边分布小户型单元,也无法实现双面通透,双面采光。而本案主体建筑内通过设置底层直通顶层的中空庭,保证实现每户拥有双面的的采光通风,虽然增加了建设成本,但却大大的优化了各单元的户型品质,裙房部分的单元更是直接设计成南北通透。  主力户型40-50㎡,精致实用,总价低,大量的赠送面积不但能使购房者得到实惠,而且可以增加房间的舒适度和利用性。两房两厅两卫,两房三厅两卫,多种户型设计满足了购房者的多样性选择,上下双卫生间设计改变了目前市面上部分loft小户型产品一个卫生间非人性化设计状况,精装修交付不但可以满足投资客户交付即可出租的想法,又可以满足现代年轻购房者不喜欢装修房子的心理&#160;<br />', '2010-12-05', '4.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JFH', '330100', '120.159375,30.166533;120.159936,30.165486;120.158814,30.164794;120.158739,30.16485;120.15821,30.165998;120.158213,30.166092;120.159375,30.166533', '东和云第', '杭州市滨江区东冠路与明德路交汇处东北角', '杭州市', '0103000020E6100000010000000700000033333333330A5E406CB41CE8A12A3E40FF5C34643C0A5E4024F25D4A5D2A3E40680932022A0A5E40B89388F02F2A3E4062669FC7280A5E40E0BE0E9C332A3E409CF9D51C200A5E408F334DD87E2A3E4055336B29200A5E4092205C01852A3E4033333333330A5E406CB41CE8A12A3E40', '15713.730664', '120.15905,30.165702', '商务住宅;住宅区;住宅小区', '432个', '2.5', '64791平方米', '29808', '东和云第,位居一桥(钱江大桥)南——浦沿街道,东至规划支路,南至东冠路,西至明德路,北至冠新路。滨江高新区、高教园区两大优势资源叠加,未来超越无限想象:地铁4号线(规划中)、地铁6号线(规划中)、彩虹快速高架、钱江一桥、江南大道等,立体交通网通达全城;杭州第二中学、中国美院、浙江中医学院、等学府林立;华润万家超市、福朋喜来登大酒店;浙医二院滨江医院、省儿保滨江分院等医疗、金融、休闲配套尽为所享。    项目规划总建筑面积约6.5万㎡,由4幢高层建筑组成,66.92米超宽楼间距,拥有无限风景、阳光心情,全面拉阔生活尺度。杭城首例架空层wifi覆盖,多种情景设置,聚合同一个圈层,开启云生活。约10000m2中央大庭院,注入优雅、浪漫东南亚园林风情。平板电脑智能家居系统,通过家庭内部的无线局域网登陆系统,无限扩充了信息交互。未来电子商务升级,实现更多增值服务。85-115㎡卓越“4-Good”户型,GOOD1:大面宽短进深 ,三房朝南,全明通透。GOOD2:小户型实现主卧套房设计。GOOD3:独特连廊创意,舒适又私密。GOOD4:丰富可变空间,无限附加价值。    东和云第,置业滨江,刚需首选', '2012-09-22', '2.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JFI', '330100', '120.265743,30.228209;120.266347,30.228723;120.266728,30.228352;120.267023,30.228005;120.267162,30.227826;120.267229,30.227727;120.267235,30.22768;120.267224,30.227634;120.267176,30.227588;120.265118,30.226102;120.265035,30.22607;120.264973,30.22607;120.264912,30.226116;120.264273,30.226976;120.265743,30.228209', '顺发·江南丽锦', '杭州市萧山区市心北路与扬帆路交叉口', '杭州市', '', '33080.668839', '120.265765,30.227371', '商务住宅;住宅区;住宅小区', '820个:{地下1层：19万/个，地下2层：17万/个）', '3', '131968平方米', '33127', '顺发江南丽锦,位于钱江世纪城中轴线市心北路上,通过庆春路过江隧道和钱江新城无缝对接,紧邻地铁2号线外环路站。项目由8幢风格现代的高层公寓组成,主力户型110-140方,以改善型的三房至五房为主,得房率超高,主次功能收放自如。项目立志打造CBD高地作品,外立面铝板干挂,三大抬地庭院,和而不同,品质精雕细琢,创造同城、不同美的完美栖居。', '2015-04-25', '2.25元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JFK', '330100', '120.228738,30.20622;120.226183,30.205964;120.225852,30.207208;120.225588,30.207944;120.227759,30.208594;120.228345,30.207488;120.228738,30.20622', '绿城·明月江南东区', '杭州市滨江区共联路与月明路交叉口东北200米', '杭州市', '0103000020E610000001000000070000008F56B5A4A30E5E40F7C77BD5CA343E4051FA42C8790E5E404227840EBA343E401E6FF25B740E5E4036785F950B353E40AF97A608700E5E40416667D13B353E40A9177C9A930E5E404F24986A66353E4021CD58349D0E5E40FD4FFEEE1D353E408F56B5A4A30E5E40F7C77BD5CA343E40', '51080.779266', '120.227154,30.207179', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JFO', '330100', '120.135028,30.324439;120.135049,30.325899;120.135079,30.325952;120.135131,30.325968;120.136268,30.32597;120.136356,30.325872;120.136503,30.324615;120.136343,30.324512;120.136135,30.324449;120.135028,30.324439', '德信·臻园', '杭州市拱墅区小河路669号', '杭州市', '', '19050.707382', '120.135728,30.325196', '商务住宅;住宅区;住宅小区', '411个（1:1.4）', '2.5', '80000平方米', '45757', '德信臻园,位于拱墅区拱宸桥历史文化景区北侧,小河路文岚街交叉口,东临京杭大运河,南至后横港河,为市中心稀缺的双水岸景观大宅。项目周边交通便捷,配套齐全,三横四纵的道路网络出入便捷,5分钟尊尚生活圈内,不但享有红缨幼儿园、卖鱼桥小学、文澜中学等顶级名校教育资源,还将动人的运河优质历史文化资源交织于一身:与项目仅一街之隔的运河天地内汇聚了比高电影城、新发现餐厅、蓝莲花园餐厅、古水人家餐厅、唛蝶时尚KTV、雅布度酒吧、明星潮牌服饰顶秀1000等众多娱乐、美食、休闲配套。此外,项目周边还聚集了欧尚超市、百安居、运河广场等丰富的商业配套,以及集美食、商业、休闲于一体的桥西历史街区,环境优美的LOFT文化公园,刀剪剑、扇、伞等各式博物馆等均近在咫尺。    传承千年皇风福泽,德信地产18年集大成之作,德信&#8226;臻园淡然筑就中国之河畔的又一传奇府邸。项目规划之初即邀请国际最佳优秀设计组合承担,汲取东方礼制与西方古典规格,建筑规划设计由GOA建筑设计研究院担纲,园林景观设计由贝尔高林(香港)有限公司担纲,在物业服务方面,更是导入纯正的英式管家服务理念,经过英国管家行业协会认证,为业主提供全方位、个性化的服务方案,满足都市精英阶层高品质生活定位。项目全力集现出对土地、历史、文脉的尊重,呈现出德信地产又一进阶产品。    臻园项目总建筑面积约8万方,整个园区由7幢高层建筑构成,采用ARTDECO建筑风格,全石材干挂,鉴取欧洲经典建筑形式,与东方传统建筑精神相融合,中轴对称式的建筑布局,围合中央景观隐逸院落。整个项目规划仅300余席,为目前杭州市中心,运河边稀有的精装人文府邸。    德信臻园主力户型为160-200平米,精装修户型以平层官邸造型,诠释了别墅级别的尊贵生活,在建筑中借鉴并采用别墅级装饰设计的同时,集中应用全方位的现代科技,悉心设置了独立中央空调系统、户内全屋地暖系统、恒温热水循环系统、绿色户内新风系统等16大系统,全面打造了64项精装细节,考究的细节和人性化的居家体验,营造备受期待的理想人居。在物业服务方面,更是导入纯正的英式管家服务理念,经过英国管家行业协会认证,为业主提供全方位、个性化的服务方案,满足都市精英阶层高品质生活定位。    同时,臻园在园区北主入口两侧规划了9席珍稀商铺。商铺布局科学,功能前瞻,主力户型100平米,拥有6-8米的超宽门面开间,12米较短进深,整体大气方正,空间利用率高;商铺紧临文岚街,与东侧运河国际旅游综合体、“运河天地”紧密共融,同享未来无限商机。', '2011-06-06', '4.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JFT', '330100', '120.245001,30.381913;120.24495,30.38214;120.245849,30.382341;120.245916,30.382315;120.246038,30.38205;120.246119,30.381917;120.246287,30.381718;120.246565,30.381462;120.246566,30.381402;120.246552,30.381347;120.246071,30.380766;120.246034,30.380769;120.24565,30.380993;120.245451,30.381194;120.245263,30.381424;120.245109,30.381669;120.245001,30.381913', '爱尚公寓', '杭州市余杭区天都大道(天都大道和欢乐大道交汇处)', '杭州市', '', '13225.314249', '120.245763,30.381602', '商务住宅;住宅区;住宅小区', '70个', '2.76', '52365平方米', '12513', '本项目位于杭州市余杭区广厦天都城,处于天都城最中心位置,北临一站式生活体验中心。蓝调公寓总占地4.2万㎡,总建筑面积16.8万方,由8幢小高层、高层围合而成,外立面以现代主义风格为主。小区整体规划布局成弧状,建筑布局分成南北两排,其中南北楼间距最大高达80米左右,营造出东西宽310米,南北深80米的内庭院,从而形成了一个约2万方的景观庭院。整个2万方的内庭景观从西到东共营造出三大景观主题花园,分别为蓝调新天地、中心主题花园、奢华的水景主题园。    本项目位于杭州市余杭区广厦天都城,处于天都城最中心位置,北临一站式生活体验中心。蓝调公寓总占地4.2万㎡,总建筑面积16.8万方,由8幢小高层、高层围合而成,外立面以现代主义风格为主。小区整体规划布局成弧状,建筑布局分成南北两排,其中南北楼间距最大高达80米左右,营造出东西宽310米,南北深80米的内庭院,从而形成了一个约2万方的景观庭院。整个2万方的内庭景观从西到东共营造出三大景观主题花园,分别为蓝调新天地、中心主题花园、奢华的水景主题园。', '2011-06-13', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JFU', '330100', '120.292024,30.333832;120.291838,30.333806;120.2917,30.333836;120.29158,30.334904;120.291436,30.335999;120.291279,30.336456;120.291038,30.336973;120.290887,30.337241;120.290878,30.337291;120.290913,30.337331;120.291134,30.337505;120.291366,30.337641;120.291577,30.337668;120.291745,30.337659;120.291913,30.337645;120.293274,30.336838;120.293137,30.336165;120.293085,30.335824;120.292989,30.335483;120.29266,30.334929;120.292024,30.333832', '复地·又一城', '杭州市余杭区杭海路1636号', '杭州市', '', '47057.961883', '120.292107,30.336047', '商务住宅;住宅区;住宅小区', '1078个', '2.59', '173031.88平方米', '', '复地又一城位于杭州主城区东部,临近地铁一号线乔司南站,距离市中心武林广场约15公里的车程。复地又一城作为复地连城国际的收官之作,位于“杭州国际商贸城”核心区域,共享约3万平米的大型集中商业、吉的堡国际双语幼儿园、近8千平米健身娱乐中心等配套资源。项目总建筑面积约18万平方米,规划为公寓社区。复地又一城主力户型为120平米三房和82平米两房。1)在户型设计方面,复地又一城始终注重创造怡人的居住空间,经济小房结构紧凑,布局合理。中、大房型方正大气,流线清晰,动静分明。2)项目北侧为两梯四户高层,户型为约120平米三房和82平米两房。3)一梯两户的“晶品893”经典户型为主力户型。4)85平米双阳台两房、138平米及129平米三房位于中央景观区。5)80平米左右两梯八户的紧凑两房位于项目最南端。从大方面看,沪杭高速公路、杭州绕城公路、杭海公路、德胜快速等都可到达项目。公交车可乘坐k309、k339到三角村站下车。而推开杭州楼市地图来看,九堡板块和乔司板块紧紧相连,但九堡归主城区江干区,乔司则分属余杭区。九堡板块也在市中心和乔司连线之间,毫无疑问,九堡比乔司更靠近市区,购房者的可接受程度更高。由市区前往复地又一城,可取道德胜快速路转至德胜东路,项目分侧在德胜东路南北面。由德胜东路沿着航海路往北开,又一城与九堡相距约10分钟车程。另外,地铁一号线乔司站直线最短距离约700米,以后乔司到达市中心只需半小时。1.整体规划1)项目总建筑面积约17万㎡,规划由10栋高层及小高层组成,楼间距在34-45米之间。2)东西对称布局,车行与步行主入口分开设置,实现人车分流;步行出入口设有主出入口及辅助出入口,公共绿地和步行道路彼此贯通,为住户营造安全舒适的社区环境。2.建筑风格1)作为连城国际5期典藏之作,复地又一城延续了前四期的建筑风格,并进行了相应的改进,使其更加轻巧、开放。2)整体布局错落有致,建筑上部采用仿面砖涂料,基座饰以石材;色彩以暖调的浅褐色为基调,突出端庄、高雅和洗炼的风范。3.景观特色1)在景观设计方面,复地又一城十分注重均好性,力求每户的景观及视野最大化,营造出现代公园式的社区景观。2)采用南北向景观轴线通廊设计,四大邻里交往空间遥相呼应。3)步行轴线上的两个景观绿化节点,增强了小区景观丰富性。4)西侧设置2.52万方绿化带,北侧设置1.7万方绿化带,隔绝外部道路噪音影响。4.周边配套1)复地又一城,独享地铁一号线乔司南站,约15km车程直达武林广场。更有公交线路K339、K309直通艮山东路、建国北路,K314、K33、K523、K825直达杭城各地;沪杭高铁0换乘,上海片刻即达。2)复地又一城充分享受约30000㎡的大型集中商业,包含超市、BLOCK街区、COCO街区等在内的各种商业形态,全方位、多层次满足了又一城乃至周边居民的各类消费需求。3)吉的堡国际双语幼儿园落户家门口,带来世界先进教育理念,20余年丰富教育经验,为又一城家庭提供双语教学等全方位服务。4)近8000㎡大型健身娱乐休闲中心设施丰富,健身中心、沙壶球游戏室、羽毛球馆、乒乓球室、棋牌室、瑜伽室、室内游泳池等休闲去处应有尽有。5、复地又一城位于“杭州国际商贸城”大商圈核心区域,地理位置优越。杭州国际商贸城位于杭州“一主三副六组团”总体布局结构的空间几何中心,区域面积约7.6平方公里,比整个钱江新城还要大。政府规划的目标是将其“打造成长三角一带人们最喜欢的购物天堂”,并围绕地铁一号线乔司南站形成一个规模适中、较为完整的城市配套区域。随着杭州“城市东扩”的演进,杭州城东已成为杭州城市未来发展的重要区域。九堡客运中心快速连接长三角各大城市,新火车东站将成为华东最大的集磁悬浮、高速铁路、地铁于一体的现代化交通枢纽,复地又一城业主将轻松享受双铁生活。目前,在连城国际的东面,复地集团附规划了3万方的大型商业中心。另外,乔司板块内杭州九乔国际商贸城在建,建成后将这里将是杭派女装、家纺、化妆品、文体、户外休闲等产业为的高端市场,还将引入数码科技城、汽车4S店等,发展前景值得期待。', '2013-09-15', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JFV', '330100', '120.282866,30.195874;120.281734,30.195755;120.281525,30.195937;120.279051,30.196201;120.279433,30.198384;120.283186,30.198022;120.282866,30.195874', '华瑞·晴庐', '杭州市萧山区建设二路1504号', '杭州市', '0103000020E610000001000000070000009FC9FE791A125E40FF2268CC24323E40F60A0BEE07125E404A07EBFF1C323E4069006F8104125E408C135FED28323E40A1BAB9F8DB115E4047718E3A3A323E40151BF33AE2115E40B70C384BC9323E40D82B2CB81F125E4076E3DD91B1323E409FC9FE791A125E40FF2268CC24323E40', '77630.164452', '120.28114,30.197088', '商务住宅;住宅区;住宅小区', '2451个（车位比1:1.07）', '2.8', '342856平方米', '22000', '华瑞晴庐位于萧山新区、钱江新城以及钱江世纪城交汇之地,建设二路与宁税路的交叉口,项目距离萧山城市中轴市心北路步行几百米。INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JN7', '330100', '120.194991,30.258282;120.195011,30.257705;120.194042,30.257719;120.194015,30.257918;120.193988,30.258175;120.194991,30.258282', '庆春东路62号', '杭州市江干区凯旋街道庆春东路62号', '杭州市', '0103000020E61000000100000006000000EB0088BB7A0C5E403E25E7C41E423E400ED76A0F7B0C5E40040473F4F8413E403A03232F6B0C5E40CE8E54DFF9413E40BDFBE3BD6A0C5E40BB0CFFE906423E4041F4A44C6A0C5E4012A5BDC117423E40EB0088BB7A0C5E403E25E7C41E423E40', '4657.723406', '120.194526,30.257973', '商务住宅;住宅区;住宅小区', '', 'None', '', '34096', '小区配套成熟、交通便利', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16JNN', '330100', '120.137765,30.313812;120.137937,30.313791;120.137676,30.311948;120.137569,30.311884;120.135815,30.312095;120.135753,30.312181;120.136068,30.313871;120.136161,30.313933;120.136282,30.313934;120.137765,30.313812', '凯德龙湾', '杭州市拱墅区小河路188号(登云路和小河路交汇处)', '杭州市', '', '32886.641209', '120.136862,30.312924', '商务住宅;住宅区;住宅小区', '500余个', '2.3', '120000平方米', '45109', '凯德龙湾坐落于拥有丰富历史遗迹与人文风情的运河西岸。许多昔日的老建筑,在经过现代改造之后,已然是创意文化的产地与各色各香的商业街区,成为高端住宅无可取代的人文居住配套。小河直街历史文化街区“修旧如旧”;大兜路历史街区私家菜馆林立,三个“国字号”博物馆环绕四周;桥西历史保护街区、高家花园、桑庐等众多文化遗存和历史建筑经过保护修缮,已成为极富看头的文化创意园区。当灯光阑珊,从繁忙的工作中抽身,从城市嘈杂中驱车返家,运河两岸树影婆娑,水波荡漾,跨过登云桥,凯德龙湾的园内水景,悄然水韵,荡涤着心也随之安静下来。推门而入,遇见转角的花簇小庭,仿佛儿时的时光院落重上心头,静逸的屋内畅阔了然,8-16层的最佳运河观赏视觉,轻眺对岸繁华,运河水岸的惬意生活亦随之满溢开来。纯粹的私享圈层,保障生活私密之感,轻松享受一颗闲适之心枕水而眠的满足。凯德龙湾,用一种巧妙的平衡介入城市家庭生活,既有便利的交通,又能将噪音与匆忙隔绝在一河之岸,这种平衡之源,皆因凯德深信,“静处繁华”才是城市卓然生活的品质核心。', '2013-06-22', '4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16YWC', '330100', '120.252951,30.150737;120.252893,30.150784;120.253031,30.15102;120.253125,30.151185;120.253207,30.151335;120.253242,30.151406;120.253253,30.151509;120.253223,30.151634;120.253165,30.151824;120.254477,30.152196;120.255845,30.152585;120.256142,30.151773;120.252999,30.150776;120.252951,30.150737', '财和湘域湾', '杭州市萧山区潘水路与蜀山路交界处', '杭州市', '', '24721.631077', '120.254537,30.151721', '商务住宅;住宅区;住宅小区', '490个（1:1.28）', '2', '83730平方米', '23670', '财和湘域湾位于湘湖板块,东邻老城区,南依西山。项目离地铁一号线湘湖站不远。INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16YWE', '330100', '120.283635,30.24608;120.283559,30.246034;120.283447,30.245945;120.283404,30.245893;120.283311,30.24575;120.283207,30.245231;120.280935,30.24568;120.281301,30.247399;120.281427,30.247429;120.281553,30.247324;120.281788,30.247259;120.282385,30.247181;120.28374,30.246884;120.283776,30.246734;120.283635,30.24608', '顺发·康庄', '杭州市萧山区萧钱线南', '杭州市', '', '38759.078238', '120.282321,30.246314', '商务住宅;住宅区;住宅小区', '', '2.49', '150000平方米', '24921', '顺发康庄位于利群河以东萧钱线以南,经鸿达路、盈丰二路(规划)捷达庆春路过江隧道口。项目总建筑面积约15万平方米,规划有地中海风情排屋和阳光高层公寓两大系列产品。顺发康庄新生代阳光高层注重紧凑合理户型结构的同时,亦强调南北通风、景观通透,71-159平方米多层次公寓户型系统,可满足品质生活的多样需求。74席地中海风情排屋则援引经典带来诗意的生活体验,阳光地下室、私家庭院、豪华双主卧以及全套房设置,更是预见高品质的人性化设计。顺发康庄接驳世纪城,坐享高规格完善配套。更可经庆春路过江隧道,近享钱江新城的核心便利。随着奥体博览城、庆春路过江隧道以及地铁2号线等市政工程的深入开展,其双城价值将日益显现。', '', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B16YWH', '330100', '120.158171,30.142794;120.158398,30.142821;120.158417,30.142816;120.158425,30.142804;120.158445,30.142518;120.158294,30.142502;120.158226,30.142486;120.158211,30.142488;120.158193,30.142509;120.158159,30.142781;120.158171,30.142794', '通和府尚公馆', '杭州市萧山区钱江南万达路戈雅公寓西侧', '杭州市', '', '720.757265', '120.158305,30.142657', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '府尚公馆地处杭州钱江南岸,依托钱塘江畔原生山地,与府尚别墅为邻;距离钱塘江仅30余米,处于钱塘江拐弯处,江面宽广,形成了滨江大区域拥有可与北岸江景楼盘媲美的南向正江景和双面瞰江的地标性公馆建筑。钱塘江时代,这条旖旎繁华的江岸线连同两岸的地标建筑共同成为这个都会城市新的象征。  府尚公馆是通和置业在依托戈雅公寓40万方纯粹地中海风情住区基础上,继府尚别墅之后精心打造的府尚系列高端住品之一。作为“府尚full-sun” 品牌系的江景空中院宅,府尚公馆依托的江景资源,建筑排布限度保证一线纯正江景户户共享,基地抬高与江堤齐平,设计5.2米架空层,全楼层均能清晰观江;50-100米超大楼间距,绝大部分中间套也可以轻松实现南北赏江;西边套更以270度超大视角阳台,宽广的江景视野就此展开; 约87、138、261㎡高端化、多景观平台的户型创新,增加了室内与室外的交流空间,营造出揽江、赏江、聆江、院江的独有奢适生活体验。  府尚公馆立面采用高档石材饰面干挂,一片新古典主义建筑矗立于钱塘江畔,掩映于地中海风情的景观中间,与壮美的钱塘江景相融。', '', '');
