INSERT INTO "public"."gaode_residential_region" VALUES ('B023B175VC', '330100', '120.212997,30.25498;120.212936,30.254769;120.211912,30.253421;120.211455,30.252897;120.211068,30.253061;120.210696,30.253226;120.210169,30.253396;120.210203,30.2535;120.210347,30.253727;120.210676,30.254266;120.210939,30.254743;120.211057,30.255023;120.211184,30.255318;120.211267,30.255589;120.211349,30.255859;120.211452,30.256129;120.211912,30.255918;120.212747,30.255475;120.212866,30.255358;120.212972,30.255121;120.212997,30.25498', '和谐嘉园东苑', '杭州市江干区顺福路18号', '杭州市', '', '43335.237048', '120.211644,30.254469', '商务住宅;住宅区;住宅小区', '', 'None', '', '43469', '和谐嘉园小区位于江干区钱江路与江锦路交叉口,近地铁2号线、4号线,另有多条公交通达,交通便利。小区建成于2009年,建筑面积200000平方米,占地面积80000平方米,总户数4838户,绿化率30%,容积率2.40,停车位3500个。小区及周边教育、医疗、商业等设施配套成熟完善,可满足多样化需求。', '', '1.35元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1767Y', '330100', '120.049908,30.365693;120.049677,30.365964;120.049482,30.366234;120.049171,30.366643;120.049058,30.366796;120.048962,30.366913;120.049019,30.36697;120.049127,30.366971;120.050869,30.366979;120.050977,30.366966;120.051076,30.366949;120.051249,30.366841;120.051685,30.366831;120.051684,30.366069;120.051708,30.365756;120.051689,30.365717;120.05082,30.365709;120.049908,30.365693', '石榴派', '杭州市余杭区东西大道与新104国道交汇处', '杭州市', '', '25676.49293', '120.050504,30.36637', '商务住宅;住宅区;住宅小区', '519个', '2', '80000平方米', '24693', '石榴派是由7栋10至12层的小高层建筑组成。项目建筑单体采用点状分布,采光朝阳。户户坐南朝北的户型设计,适合北半球气候特点,冬暖夏凉;中央景观园林,30%以的绿化率,视野宽阔,绿意盎然,修身养性,自在其中。', '2013-02-28', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B17682', '330100', '120.103109,30.377723;120.103567,30.376895;120.103944,30.375862;120.104159,30.375506;120.104361,30.375265;120.102555,30.375163;120.100685,30.375274;120.099907,30.375533;120.100374,30.377042;120.100466,30.377314;120.100593,30.377529;120.100855,30.377422;120.10112,30.377332;120.101503,30.377315;120.101966,30.377365;120.103109,30.377723', '名城博园', '杭州市余杭区博园西路8号', '杭州市', '', '72462.644119', '120.102037,30.376269', '商务住宅;住宅区;住宅小区', '', '2.8', '321724平方米', '14361', '嘉凯城名城博园,位于杭州北部新城,上塘高架北口,农副物流园区,总建筑面积32万平方米,12幢ART-DECO风格高层,21%的建筑密度,4.4米层高的架空层设计。59-161方的多元化户型,合理的空间配置、通透格局、多面积赠送。
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176GY', '330100', '120.253812,30.110974;120.253787,30.110913;120.253746,30.110881;120.252759,30.110787;120.252528,30.11073;120.252132,30.110502;120.251641,30.110249;120.250795,30.109946;120.250885,30.110183;120.251248,30.111209;120.251312,30.111296;120.251429,30.111377;120.251543,30.111417;120.251657,30.111442;120.251921,30.111452;120.252808,30.111459;120.253671,30.111466;120.253786,30.111466;120.253812,30.110974', '香山四季公馆', '杭州市萧山区蜀山街道蜀山路与亚太路交界口', '杭州市', '', '21689.529567', '120.252205,30.110928', '商务住宅;住宅区;住宅小区', '非机动车760个，机动车980个', '5', '75281平方米', '', '香山四季公馆,总建筑面积10万㎡,为城市中近乎绝版的LOFT全产权公馆,项目位于处萧山南部卧城重心之地,蜀山路与亚太路两条黄金干线交汇处,占据萧山交通大动脉,为真正的经济黄金路口,不久还将有2号线通过。周边公园较多,居住环境极佳,距离湘湖近3分钟车程,是真正的距湘湖很近,离繁华不远。更有,项目还可近享南环路繁华商圈及大型的世纪联华超市、汇德隆购物中心及建造中的开元广场建有11万平方米的高档商业配套。香山四季公馆,为城南乃至萧山全城绝版的LOFT产权公馆,主打户型为79-91㎡,不限购、不限贷、低总价。更有,项目层高高达4.99米,空间更显阔绰大气,可以自由分割、灵活组合,买一层得两层。即可作为居住的第一场所,亦可设计成个性办公空间。', '2013-06-21', '2.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176IJ', '330100', '120.063776,30.361679;120.063738,30.359302;120.062588,30.359406;120.062491,30.359417;120.06241,30.359502;120.062397,30.362377;120.063739,30.362335;120.063776,30.361679', '亿丰·蔚蓝郡', '杭州市余杭区良渚街道勾庄路218号', '杭州市', '0103000020E610000001000000080000004391EEE714045E4065A6B4FE965C3E40CC608C4814045E402C634337FB5B3E40D047197101045E4076FC1708025C3E40D65240DAFF035E405EA0A4C0025C3E40603C8386FE035E40BAD8B452085C3E409697FC4FFE035E4095D233BDC45C3E40B41EBE4C14045E4038328FFCC15C3E404391EEE714045E4065A6B4FE965C3E40', '36849.900601', '120.063084,30.360866', '商务住宅;住宅区;住宅小区', '人车分流设计，地下停车库，约800个左右', '2.8', '96000平方米', '22562', '亿丰蔚蓝郡公寓由上海亿丰集团投资,浙江亿丰置业开发的高层住宅。项目位于古墩路延伸段,104国道与绕城高速交汇处,紧邻规划地铁二号线,出入便捷,与杭州主城生活无缝融合。项目占地面积约3.4万方,总建筑面积约为9.6万方,是由10幢点式与板式组成的新古典主义高层建筑社区,以典雅细腻的设计笔触融合现代建筑简洁大方的气质,体现时代的城市精神。住宅楼间距在50米左右,营造出自在通透的生活空间,没有视野的磕磕碰碰,只有闲坐阳台看风景的自在与惬意。在园林设计上,亿丰蔚蓝郡运用东南亚的园林风格,景观布局采用十字纵横连轴的方式,精心打造四大围合式中央景观组团,细腻精致,风韵俊雅。在栋宇连绵的园境里,熏染出一抹繁华中的明媚诗意。85-130方主力户型,设计方正通透,合理空间动线,多重附送面积,量身打造多重空间需求,能够满足客户更多的居住选择。', '2012-04-24', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176LY', '330100', '120.055635,30.246528;120.055183,30.246462;120.05542,30.245317;120.055735,30.245362;120.055806,30.245522;120.055635,30.246528', '西溪壹树', '杭州市西湖区天目山路五常大道口南侧', '杭州市', '0103000020E61000000100000006000000D4601A868F035E405D8C81751C3F3E40E412471E88035E40EEB43522183F3E40D6E253008C035E4020274C18CD3E3E40868F882991035E4060AE450BD03E3E40EB3A545392035E40D272A087DA3E3E40D4601A868F035E405D8C81751C3F3E40', '4567.68108', '120.055512,30.245937', '商务住宅;住宅区;住宅小区', '29个', '1.4', '11211平方米', '', '本项目位于西溪湿地南侧,离西溪湿地龙舌嘴入口仅200米。项目是由8栋独栋组成,每个独栋建筑面积400方,赠送精装庭院及300方左右的地下室,实用面积超800方,是西溪湿地边非常稀缺的独栋产品,本项目适合作为第一居所、高端会所、名家收藏等。', '2013-11-30', '4.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176M2', '330100', '120.360856,30.267203;120.360845,30.264386;120.358617,30.264339;120.358434,30.264599;120.357866,30.26711;120.35793,30.267231;120.360856,30.267203', '保利·玫瑰湾', '杭州市江干区24号大街附近', '杭州市', '0103000020E610000001000000070000002FA4C34318175E40A164726A67443E40357BA01518175E402F8507CDAE433E4089B2B794F3165E40AE0E80B8AB433E4091F12895F0165E40E78D93C2BC433E406C96CB46E7165E403F6F2A5261443E4077103B53E8165E40357A354069443E402FA4C34318175E40A164726A67443E40', '69617.334817', '120.359499,30.26585', '商务住宅;住宅区;住宅小区', '1117个（配比1:0.87）', '2.5', '173000平方米', '22399', '保利玫瑰湾,位于杭州东部湾的最南端,拥享270°一线钱塘江景,2200亩天然湿地在玫瑰湾前形成300米宽的生态公园。作为离钱江新城最近的一线江景小户型楼盘,玫瑰湾约15分钟即可通过沿江大道到达钱江新城,同时位于地铁1号线首站旁,打造“工作在CBD,住在玫瑰湾”浪漫宜居理念。玫瑰湾总建面约17万㎡,绿地率达到罕见的45%,由12栋欧洲新古典风格高层建筑围合而成,以“玫瑰”为主题元素打造近5万方惊艳园林(含架空层),尤以“情人岛”浪漫中心泳池为最大亮点。80-140㎡经典MAX户型,玫瑰湾倾情呈现。', '2014-09-29', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176M3', '330100', '120.265024,30.137536;120.267761,30.137658;120.267779,30.136414;120.264955,30.136348;120.265024,30.137536', '柳桥·南和城', '杭州市萧山区市心南路晨晖路交汇处西南侧(新消防大队对面)', '杭州市', '0103000020E61000000100000005000000ED293927F6105E40CD052E8F35233E403B8908FF22115E406308008E3D233E408FE3874A23115E406FB72407EC223E4059FAD005F5105E4001E0D8B3E7223E40ED293927F6105E40CD052E8F35233E40', '30750.007382', '120.266391,30.136986', '商务住宅;住宅区;住宅小区', '1100个', '4.5', '150000平方米', '', '柳桥南和城项目位于市心南路晨晖路交汇处西南侧,项目由杭州柳桥宜家房地产开发有限公司开发,项目总建筑面积约16万方,由5幢27层高层组成,预计于2015年交付。柳桥南和城是汇集商业、办公、餐饮、公馆、娱乐于一体的复合型综合体项目,地铁2号线站口可直接入户。', '2012-12-08', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176M4', '330100', '120.098281,30.16057;120.098321,30.160476;120.098323,30.16035;120.097977,30.15983;120.097684,30.159249;120.097631,30.1592;120.097532,30.159194;120.097334,30.159241;120.095803,30.159733;120.095637,30.159834;120.095301,30.160064;120.09525,30.160155;120.095276,30.16026;120.096109,30.161245;120.09634,30.161575;120.096416,30.161643;120.096518,30.161621;120.098281,30.16057', '大家·之江悦', '杭州市西湖区之江度假区枫桦西路与碧波路交叉口西南角', '杭州市', '', '40154.422583', '120.096829,30.160342', '商务住宅;住宅区;住宅小区', '600个', '1.8', '110000平方米', '', '1.项目区位    大家之江悦项目位于杭州市之江国家旅游度假区核心区,杭州市之江国家旅游度假区是1992年至今国务院批准建立的12个国家级旅游度假区之一,与西湖风景名胜区毗邻,东临钱塘江,西靠龙坞、灵山风景区,气候宜人,环境优美,项目距离西湖核心景区约9公里,周边3-5公里范围内分布着云栖竹径、五云山、九溪烟树、六和塔、梅家坞等众多西湖南线名胜。项目距杭州市中心武林广场约15公里,距钱江新城CBD核心区约12公里,出则繁华,入则景。    2.区域发展    之江国家旅游度假区区域为杭州的传统高端住宅区,大家之江悦项目周边聚集有绿城九溪玫瑰园、阳明谷、公元沐桥、九树公寓、云栖蝶谷等众多以别墅为主的经典高端项目,为项目塑造了良好的居住氛围。    大家之江悦项目同时也属于杭州市重点发展的十大新城之一——之江新城的核心区,未来项目周边2公里内将建成总建筑面积约80万方的大型会展、商业综合体——杭州之江国际金融会展中心、三级甲等医院——之江医院等众多生活配套资源,同时,项目所在位置也将是规划地铁6号线经过之处,将一同为项目创造一个便捷、舒适的居住环境。    3.项目产品定位    大家之江悦项目总建筑面积约11万平方米,容积率1.8,由10幢古典法式小高层建筑组成,总户数500余户,户型面积由89-180平方米不等,主力户型面积为165方,项目采用整体地下室设计,车位数量600余个。    项目由国内顶尖的建筑设计公司天华建筑设计有限公司担纲建筑设计,以经典法式建筑为蓝本,以经典的三段式为建筑形制,配以精致的门窗及细节处理,采用全石材干挂立面,打造出沉稳大气、雍容华贵的古典宅邸。    项目结合区位大环境的景观优势,因地制宜采取了围合式布局,不设置沿街商铺,既围合出了数个景观组团,又增加了作为高品质住宅的私密性和安全感。    在户型设计上,注重改善型客户需求,以空间舒适度为首要目标,项目所有户型均为南北通透的全明户型,主力户型以165方三房(双套房)为主,致力于将项目打造成高品质、高舒适性的精品公寓。    项目荣获中国房地产管理协会评选的“2012浙江十大宜居楼盘”称号。', '2015-07-11', '2.95元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176M5', '330100', '120.197844,30.171344;120.197827,30.170797;120.197329,30.170795;120.197481,30.17052;120.197646,30.170228;120.198055,30.169121;120.198597,30.169251;120.198549,30.171347;120.197844,30.171344', '湖漫雅筑', '杭州市滨江区天官路以南、光裕路以西、长河绿化带以东、乳泉路以北', '杭州市', '', '16292.928486', '120.198138,30.170307', '商务住宅;住宅区;住宅小区', '257个（1:0.81）', '1.8', '44788.7平方米', '28259', '湖漫雅筑,由5幢纯板式小高层构成。项目地处滨江长河核心区位,毗邻10000亩白马湖创意园,与3万方城市公园相邻,尽享天赋稀贵的原生态景观资源。  项目交通四通八达,无缝对接滨江时代大道、钱江三桥、四桥以及中河高架,约20分钟车程即达西湖,约10分钟车程即达钱江新城,经江南大道直通萧山国际机场、杭金衢高速及沪杭甬高速,经彩虹大道直通杭千高速,与规划中的地铁5号线相依,便捷出行,居于此,购物、娱乐、医疗、休闲配套一应俱全,繁华触手可及。  30%绿化率,约10000平米景观面积,45-60米超阔楼间距,打造最自然、舒适的园区空间尺度;大型中央景观,多重景观组团,构筑层次丰富的园林空间;儿童游戏区、健身活动区,为健康人居提供完美生活场地。  其建筑引入18世纪中叶传承至今的新古典主义风格,极富韵律感的立面线条,极富个性化的建筑语言,使其高端品质和建筑内涵不言而喻,一个精致、奢华的品质社区优雅呈现。  项目主力户型为90平方米左右的小户型,边套为130平方米左右的大户型,为住户提供充分的选择余地。户型全明通透,户内功能分区明确、独立,超值赠送面积,百变灵动空间,礼献城市菁英。', '2013-10-16', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176MB', '330100', '120.149063,30.202118;120.149196,30.202285;120.149517,30.202516;120.150438,30.203022;120.150879,30.202339;120.1497,30.20172;120.149337,30.201596;120.149179,30.201563;120.149104,30.201801;120.148974,30.201969;120.149063,30.202118', '华成·钱塘艺墅', '杭州市上城区南星街道复兴路与之江路交叉口东侧象牙海岸项目部', '杭州市', '', '12397.468185', '120.149906,30.202266', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '钱塘艺墅项目是由浙江亚飞置业有限公司开发建造的。基地位于杭州市钱江一桥北岸附近,南临中河,西和北部接复兴路,有着得天独厚的地理位置,南环钱塘江,北靠余杭山,并且靠近西湖和六和塔。  建筑用地面积为13375平方米,区块现状为高起伏的丘陵地带,适合开发住宅。容积率在1.3至1.5之间,绿地率不小于30%,建筑密度不大30%,正南向建筑间距不小于1:1.2H,建筑限高18米。交通出入口面朝北侧复兴路。  规划原则  1、自然保护和可持续发展  ·波尔多庄园维护环境品质,  ·增加景观的自然美丽。  ·通过高效和细心的整体设计,尽可能减小对周边的破坏,使得工程的地方量最小化。  ·营造一个以自然环境为依托,以人造景观为充实的温馨家园。  2、建立一个亲水的社区  ·充分利用场地现有条件,引中河之水和地面雨水,营造出宜人的亲水空间。  ·使水景不但具有美化和湿润环境的作用,还具有泄洪、绿化灌溉、消防等用途。  3、因地制宜创造本土化建筑  ·结合当地的气候条件和居住习惯,使建筑具有良好的采光、通风,达到冬暖夏凉的效果。  ·建筑用材本土化,就地取材,达到与自然环境相融合的目标。  总体布局  1、功能区块  区块地势较为平坦规整,对建筑排布较为有利。主要功能规划为18幢方盒子住宅公寓,七种公寓及住宅形式的灵活组合,包括单身公寓,水平组合公寓,南北两种复式公寓,南北两种屋顶公寓及花园洋房。半地下休闲会所为小区提供健身运动和休闲的场所,地下室为配套车库及辅助用房。  2、绿化景观设计  钱塘艺墅南侧为中河,以水为依托的景观设计是建筑的第二个层面,景观设计利用空间,水体空间,植物空间和石头空间的不同仿射每个空间的层次感。五条绿化轴线穿插在建筑单元之中,将周边的绿景引深入建筑区域。基地北侧是由竹子和石头组成的两种空间,木材铺地连接会所的不同部分和大堂入口通往公寓。树木和水池用于特定用途和休闲场所。植物使中央空间和私家花园的感觉更为强烈。  园区的绿化空间按空间序列可分为多种空间形式,有公共活动空间如入口广场、中心绿地等,有安静活动空间如竹林,石景,有联络空间,如五条绿带。这些多层次的空间形态为居民提供了丰富多彩的休闲和交往的场所,拉近了人与人间的距离。  绿化景观设计突出几何和穿插的主题,通过层高的错落转换,叠水,重点部分的植被设置,创造出呼应建筑的和谐环境。  3、道路交通组织  将园区的主入口设于地块的西北侧,正对已建规划路复兴路,此处地势落差平坦,机动车辆由主入口直接进入北侧地下车库,实现人车分流。地面仅保留消防车辆的通道。人行入口广场位于基地西侧,整个行人活动区域随大台阶拾级而下,进入一个相对城市私密而不受车辆干扰的下沉空间。同时两侧配以绿化和水景等小品烘托主入口的氛围。下沉广场的道路主骨架即是一个休闲的人流走廊,尽端是会所,保证和谐轻松的步行空间。  建筑单位设计  1、设计特点  ·豪华性:平面的布局以住宅功能为依托而进行创造,每套户型各有其长,满足人们多方位的需求。  ·人性化:尽量考虑现代人的求变求异心态,打破传统平面布局营造趣味化的多功能的空间形态,美式住宅平面是其中的尝试之一。  ·灵活型:为使用户能根据个体需要进行局部房间调整,结构方面均按大开间(框架结构)设计,为后续发展留有一定的弹性空间。  ·合理性:居室内部的布局依据人的生活模式,以起居室为中心,做到公私、洁净、闹静、干湿的相对分区。合理的布局使到每个公寓都拥有最佳的南朝向,开放式的阳台保证了良好的自然采光和宽阔的景观视野。  ·地城性:考虑现代人的生活方式,在户型的设计中采用私空间和公共空间的有机结合,大面积的家庭空间设计,活跃现代人的沟通和生活情趣。  2、单体类型  公寓的设计使用同一模块,不同的组合方式形成不同空间类型通过这样的组合方式。立面的重复构成和基本模数的应用,使得内部空间富于变化。  3、立面造型  建筑造型从方盒子的追求与自然相合谐,与环境相协调的理念,同时运用建筑的空间组合,营造出宜人的空间氛围。每一种单元都各具特色、各有变化,但又相互统一。  建筑立面材料,考虑以大理石金属为主,变化其组合形态,增加线脚来区分各个单元,使得建筑更显自然、简约和纯净。  节能、环保与卫生防疫设计  1、住宅节能设计  ·本小区按现行国家规范《夏热冬冷地区居住建筑节能设计标准》GJ/34-2001要求设计,并结合浙江省建设厅颁布的《居住建筑节能设计标准》。  ·建筑体形系数:多层点式建筑物的体形系数不超过0.4。  ·建筑门窗中的玻璃采用具有保温节能作用的双层中空玻璃,窗墙比大于0.5时按节能5%要求设置保温隔热构造措施。  ·围护结构各部分的传热系数和热惰性指标按JGJ134-2001规范的40.8要求设置构造措施。  2、环保设计  ·住宅厨房的烟气均设竖井从各自屋顶排放。  ·设备用房考虑置于地下室,各类机械设备选用低嗓声型号产品。  ·排水实行雨污分流制。  ·设置集中的垃圾收集点,并定时收集、出运。  3、卫生防疫  ·日照设计满足大寒日连续窗日照两个小时要求;并符合正南向1:1.2H的日照间距的要求。  ·小区的配套用房单独设置,减少对住户的干扰。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B176MC', '330100', '120.093922,30.164374;120.093292,30.163803;120.092489,30.164387;120.091966,30.164931;120.092472,30.165184;120.092763,30.165347;120.092925,30.165456;120.092966,30.165588;120.092629,30.166041;120.093308,30.166505;120.09404,30.166895;120.095021,30.167408;120.095397,30.167662;120.095894,30.167863;120.096822,30.16593;120.09681,30.165857;120.096762,30.165791;120.094963,30.165118;120.094528,30.164862;120.094221,30.164617;120.093922,30.164374', '华润新鸿基·之江九里', '杭州市西湖区之江国家旅游度假区之江路与碧波路交叉口', '杭州市', '', '82550.520032', '120.094472,30.16586', '商务住宅;住宅区;住宅小区', '停车位:批准车位总数量300个、其中地下车位273个、地上27个，业主购买优惠5万元。', '2', '181280平方米', '31897', '华润新鸿基之江九里,是继成功开发杭州万象城之后,世界500强华润集团和港资巨擘新鸿基携手打造的又一巅峰力作。其传承华润置地最高端住宅作品“九里系”的豪宅基因,构筑一个藏品级都市山水人文住区。    项目位于西湖景区南线、之江国家旅游度假区核心,宋城以西,之江路以南,拥揽九溪烟树、云栖竹径、梅家坞、钱塘江、九溪等隐贵山水。之江国家旅游度假区生态环境优越,区域内分布近10平方公里的山林绿地,绿化率高达60%,空气中PM2.5浓度相比杭州市区低约50%,其中有益于人体健康的负氧离子含量高出约25倍,是杭城少有空气质量极高的理想居住地。    项目周边云集了梦湖山庄、九溪玫瑰园、九树公寓、公元沐桥等高端物业,是杭州传统的豪宅区,兼有浙江大学之江校区、中国美院象山校区等高等学府气质浸染,具有深厚的人文底蕴。项目拥有足够的城市便利,通过之江路快速到达主城区,即将通车的之江大桥直达滨江,2012年底动工的紫之隧道将城西与之江连接的更为紧密。    之江九里地上总建筑面积约18万㎡,是一个以城市排屋为主的低密度高端住区,其中排屋户型为245-420㎡,高层公寓户型为84-252㎡。整体设计采用现代古典主义建筑风格,以花岗石、仿铜铝板和深灰色陶瓦打造高贵典雅的立面造型,呈现睥睨一方的恢弘气势。内部空间则汲取经典帕拉迪奥十字圆厅的设计精髓,组合不同功能的室内空间,营造低调沉稳、山水宜居的时代人物官邸。项目拥有内外10万㎡的奢侈园林景观,约3000㎡豪华“九里会” 包罗室内恒温泳池、健身房、桌球房、咖啡吧等多功能设置,更有24小时贴心物业服务。', '2016-10-15', '3.8元/月/平方米');
