INSERT INTO "public"."gaode_residential_region" VALUES ('B023B17AJG', '330100', '120.186418,30.305872;120.185599,30.305853;120.1856,30.30592;120.1856,30.306094;120.185622,30.306434;120.185642,30.306724;120.185674,30.307148;120.1857,30.307524;120.18571,30.307658;120.185732,30.307858;120.185968,30.307854;120.185997,30.307873;120.186215,30.307858;120.186625,30.307824;120.186884,30.307784;120.187198,30.307796;120.187439,30.3078;120.187441,30.307166;120.187325,30.307162;120.187249,30.307142;120.187212,30.307122;120.187197,30.307086;120.187227,30.305967;120.187212,30.305905;120.187175,30.305876;120.187084,30.305851;120.187049,30.305829;120.187044,30.305794;120.18724,30.305175;120.187179,30.305148;120.187077,30.305116;120.186554,30.30501;120.18653,30.305093;120.186488,30.305299;120.186502,30.305799;120.186461,30.305864;120.186418,30.305872', '锡铂园', '杭州市下城区东新路沈家村一组', '杭州市', '', '33843.009304', '120.186514,30.306669', '商务住宅;住宅区;住宅区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B17AM0', '330100', '120.254995,30.225381;120.254353,30.226988;120.257415,30.227449;120.257606,30.227289;120.25799,30.226566;120.257972,30.226441;120.257926,30.226386;120.254995,30.225381', '金昌·春和钱塘', '杭州市萧山区飞虹路与民和路交汇处', '杭州市', '0103000020E610000001000000080000002F698CD651105E40C823B891B2393E40ED28CE5147105E409E95B4E21B3A3E40FD9FC37C79105E40068200193A3A3E403750E09D7C105E4094BDA59C2F3A3E407C2C7DE882105E40B262B83A003A3E4028D2FD9C82105E403A799109F8393E4070B20DDC81105E40B345D26EF4393E402F698CD651105E40C823B891B2393E40', '41352.162543', '120.256121,30.226533', '商务住宅;住宅区;住宅小区', '1128个（均是地下车库）', '2.8', '170000平方米', '36579', '金昌春和钱塘,泽祉钱塘江畔,鼎踞钱江世纪城核心区位,范成17万平米国际都会资源中心豪宅;距地铁2号线外环路站仅600米,奥体博览城近在咫尺;25000㎡中央奢景庭院,以非凡手笔谱就CBD贵族生活秘境。金昌春和钱塘,为世纪城而生,在世纪城这块被寄予厚望的土地上,潜心筑城,缔造城市理想人居,筑就世界级CBD公园豪宅典范。新古典建筑群、法式风情园林、90-180平米臻适户型,处处用心考量,彰显气势非凡的居住格局。', '2015-11-21', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B17UVU', '330100', '120.054627,30.284475;120.055012,30.284893;120.055255,30.285119;120.055331,30.285149;120.055407,30.285156;120.057888,30.285158;120.057904,30.283727;120.057879,30.283659;120.057822,30.283633;120.057724,30.283612;120.054012,30.283662;120.054002,30.28381;120.054627,30.284475', '西溪花园蒹葭苑', '杭州市西湖区凌波路', '杭州市', '', '46080.770334', '120.056218,30.284344', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '西溪花园小区位于西湖区文二西路与紫金港路交叉口,有86/K86路公交通达。小区建成于1995年,建筑面积4433平方米,占地面积4433平方米,共598户,绿化 率30%,容积率1.50。小区及周边教育、医疗、商业等设施配套成熟完善,可满足多样化需求。', '', '');
