INSERT INTO "public"."gaode_residential_region" VALUES ('B023B17WPA', '330100', '120.07061,30.322623;120.072367,30.322929;120.072843,30.321264;120.072701,30.321233;120.072392,30.321175;120.072113,30.321179;120.071234,30.321376;120.071047,30.32146;120.070882,30.321624;120.07061,30.322623', '汇禾领府', '杭州市西湖区紫萱路279号', '杭州市', '', '25278.922408', '120.07176,30.322024', '商务住宅;住宅区;住宅小区', '666个', '3.5', '138000平方米', '13000', '汇禾领府,位居杭州西城CED(Central Education District)环浙大经济圈核心区块,总建筑面积35万平方米左右,项目北邻苏嘉路及大港桥国际饭店,东为吉鸿路,西沿西陈路,南向为富于景观特色的天然河道。一期总建筑面积13万㎡,采用经典中空围合布局,由七幢20-22F高层组成,集合了五幢点式360°450㎡全景大平层及270°276㎡宽景平层、两幢45㎡、75㎡板式小户型和U形风情商业街等。杭州城西的发展与扩张,从未离开过浙江大学紫金港校区这一重要的文化地标。环浙大经济圈将以浙大紫金港校区为中心,依托浙大的科技成果和创新创业人才,努力打造知识产业和总部经济圈。正如CBD、CLD概念的产生,我们将其定义为西城CED——Central Education District。随着众多创新创意园区、商业综合体入驻CED板块,三墩将以业态更复合、功能更多元的都市化形象融入杭州主城区。同时联动黄龙、武林商务区,西城CED将作为区域核心商务力量,扛鼎后城西时代的产业自信。汇禾·领府采用法式“新古典主义”建筑风格,建筑立面继承了新古典主义建筑风格精髓,构建丰润、凝练的大家风范。建筑整体超越了“欧陆风”的生硬与“现代简约”的粗糙,表达上更趋精细典雅。景观设计上借鉴了法国当代城市公园的造园理念,注重景观整体的仪式感。主入口景观、中心景观区、领秀商街景观区、滨水景观区,四大景观空间营造进退有序的观景气场。社区中央设计了约8000㎡围合中心景观庭院,领秀商街屋顶花园设置约4000㎡,从各个角度保证了建筑单体的观景效果。汇禾领府经古墩路、莫干山路、留石路转上塘高架,均可由三墩快速抵达杭州市中心;通过绕城高速,可快速到达上海、温州、宁波等周边城市;项目步行范围内有三墩公交站、金渡北路公交站、大港桥站等站点,有公交303、403、B2、B支1等共计18条公交路线,便捷到达市民中心、武林广场、黄龙体育中心、城站火车站、古荡、西溪、良渚等;规划地铁2号线董家路、镇中路站点均在项目步行范围内。汇禾领府360°全视界平层公馆,户型面积约410-460㎡,主力户型约450㎡,限量80席,创新户型设置:户户均设置约42㎡,高度约6.6米的空中花园,极大满足了高层用户对地面以及绿色的向往。两梯一户私家门厅、挑高阳台、门厅空间拓展更多的私属空间,全面提升层空间的利用率,所有的尺度与功能设想,全凭意愿剪裁!', '2014-03-11', '3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B17XE7', '330100', '120.122844,30.341943;120.121001,30.341997;120.120954,30.343838;120.120999,30.343991;120.121129,30.344057;120.124037,30.344228;120.126401,30.344363;120.126417,30.343796;120.12673,30.343806;120.126783,30.342445;120.125772,30.342433;120.125485,30.342412;120.124272,30.342167;120.124132,30.342268;120.123977,30.342311;120.123832,30.342162;120.123247,30.341985;120.122844,30.341943', '万科北宸之光', '杭州市余杭区通运街与东吴路交汇处', '杭州市', '', '105761.613382', '120.123751,30.343172', '商务住宅;住宅区;住宅小区', '1033个', '2.54', '300000平方米', '24069', '', '2015-09-30', '2.58元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18929', '330100', '120.177362,30.191189;120.177085,30.191676;120.176884,30.192003;120.177059,30.192126;120.177083,30.192177;120.17708,30.192241;120.176846,30.192655;120.176307,30.193616;120.177333,30.19404;120.178401,30.194482;120.178633,30.194326;120.179744,30.192199;120.179323,30.192011;120.178673,30.191735;120.177362,30.191189', '仁苑', '杭州市滨江区滨盛路3191号', '杭州市', '', '58986.369933', '120.178009,30.192859', '商务住宅;住宅区;住宅小区', '', '3', '60000平方米', '36049', '仁苑属于普通居民住宅小区,环境整洁干净,周边交通方便快捷,各类生活配套服务设施(商业、金融、教育、医疗)齐全。', '', '1.65元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1895S', '330100', '120.22914,30.291033;120.22923,30.290628;120.228538,30.289324;120.226698,30.289704;120.225827,30.290173;120.224903,30.291199;120.224957,30.291415;120.226133,30.291477;120.227515,30.291277;120.22914,30.291033', '德信·东望府', '杭州市江干区新塘路与明月桥路交汇口东南面', '杭州市', '', '54208.86161', '120.227228,30.290531', '商务住宅;住宅区;住宅小区', '约1200个，车位比1:0.9', '≤2.60', '180000平方米', '33932', '德信东望尊踞城市核心,择址武林广场东6公里处,新塘路与明月桥路交叉口,尽揽城市腹地的尊贵与荣耀,坐拥武林广场东部都市繁华圈,尽显城市新贵气质。德信东望,集德信二十年之大成,以“东之名望”的气势,昭示着城东人居新时代的到来。    德信东望,占地面积约5万平方米,总建筑面积约18万平方米,承袭德信20年品牌开发精髓,联袂知名建筑设计大师、景观设计团队,以创新理念打造经典户型,建树都市新贵住区。    德信东望,居城市枢纽之上,紧邻华东地区现代化交通领地——新火车东站,无缝对接地铁1号线/4号线彭埠站地铁口,5站直达武林门,快速融入核心繁华。距离德信东望仅100余米的港龙地块,将打造成一个25万㎡的综合体,引入欧尚超市、中影国际影城等主力品牌,还有诸多高端商业配套,这个综合体距离德信东望仅100余米,通过地下通道可直达。另外,城东新城还有华润欢乐颂和银泰等综合体,加上德信东望旁边的麦德龙购物中心,城东新城的商业已初具规模。教育配套方面,德信东望百米内夏衍幼儿园、夏衍小学与住区隔路相望,浓郁的文化氛围营造一站式学区中心。    主城核心、双地铁口、德信力作,三大稀缺价值聚合德信东望的人居品质,再树城东新贵住宅典范。', '2015-04-12', '2.25元/月/平方米');
