INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18D1G', '330100', '120.082324,30.323861;120.081587,30.323749;120.081449,30.325008;120.082419,30.325121;120.082492,30.324694;120.082324,30.323861', '厚诚公寓', '杭州市西湖区三墩镇厚诚路160号', '杭州市', '0103000020E6100000010000000600000042EBE1CB44055E402A73F38DE8523E40D731AEB838055E40DA1CE736E1523E40AFD2DD7536055E4039F06AB933533E406B64575A46055E40293E3E213B533E40A08B868C47055E401A355F251F533E4042EBE1CB44055E402A73F38DE8523E40', '10408.764612', '120.08197,30.324469', '商务住宅;住宅区;住宅小区', '', 'None', '', '18667', '小区位于三墩镇中心位置,由兰里房产开发,距离三墩公交总站仅几步之遥,小区配套齐全,居住环境完善,周边配套齐全,是三墩镇的黄金地段。小区由4幢多层住宅组成,非常安静舒适!', '', '0.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18D1L', '330100', '120.039221,30.270683;120.038926,30.270283;120.038765,30.270371;120.038505,30.270267;120.038622,30.270084;120.038854,30.269934;120.038672,30.269644;120.036917,30.269704;120.03671,30.2699;120.036535,30.270151;120.036498,30.270851;120.036581,30.270993;120.038151,30.270982;120.039057,30.270897;120.03916,30.270848;120.039215,30.270766;120.039221,30.270683', '香洲里', '杭州市余杭区荆长大道与阮家路交叉口', '杭州市', '', '27210.243166', '120.037746,30.270366', '商务住宅;住宅区;住宅小区', '地下274个，地面18个', 'None', '51800.8平方米', '29287', '香洲里位于杭州市文二路西端、余杭区五常管委会辖区内西溪湿地公园西侧,西溪湿地区域范围内。东临荆常大道、北面为一条规划主干道,项目周边不乏高端豪宅项目,道路、市政设施完善,环境良好。通过对院落和景观的创新性处理,香洲里营造出一种既相互关联又彼此独立的独联体形态。整个园区由独联体别墅、独立别墅、联排别墅、叠合别墅四类产品组成,主力户型为220-280㎡,建成后将成为城西板块低密度住区的代表作。', '2011-09-28', '3.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18D1V', '330100', '120.168853,30.295223;120.168775,30.295272;120.168694,30.295326;120.168473,30.295551;120.167982,30.29608;120.167534,30.296565;120.167212,30.296912;120.167193,30.296979;120.167212,30.297033;120.167288,30.297072;120.167579,30.29718;120.16787,30.29729;120.168375,30.297508;120.170024,30.29574;120.169489,30.295502;120.168906,30.295238;120.168853,30.295223', '现代景苑', '杭州市下城区下城绍兴路与德胜路交汇处', '杭州市', '', '27871.210361', '120.168584,30.296359', '商务住宅;住宅区;住宅小区', '0.8', 'None', '200000平方米', '39400', '现代景苑,野风·现代城三期20万平米压轴钜作,位于绍兴路与德胜路交汇处,由8幢尊贵住宅群与1幢商务楼(暂名:现代商务大厦)组合而成,800多套高档住宅,精致户型80-180平米。现代景苑将着力打造为艺术感、品质感和时代感的尊贵住品。外形大气庄重,气质高贵典雅,色彩柔和内敛,细部精致和谐。运用东西、南北通透的建筑布局,形成错落有致、层次分明的立体形态。现代景苑景观设计追求现代式中国风格的园林景观,错落有致的景色、丰富的节点塑造,形成南向城市公园、小区中央花园、架空层休闲花园及屋顶花园为系列的丰富景观空间,亲近自然、贴近自然……现代城地处市中心和平会展板块,距武林广场(西湖文化广场)仅约3.5公里、西湖约6公里,享受城市品质生活,区域价值凸显。现代城沿绍兴路等城市主干道,毗邻上塘高架、德胜快速路,与建设中的地铁1号线艮山门站相距数百米,构建地面、高架、地铁立体交通网络,出入便利。', '2008-08-01', '1.44元/月/平方米');
