'2017-04-18', '3.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18HWO', '330100', '120.053201,30.291775;120.053864,30.29163;120.056029,30.291144;120.056189,30.290906;120.055017,30.289094;120.054311,30.28943;120.054078,30.289497;120.053799,30.289552;120.053598,30.289576;120.053252,30.28959;120.052916,30.289606;120.052508,30.289609;120.052283,30.28959;120.051948,30.289502;120.051994,30.289641;120.052411,30.290387;120.053201,30.291775', '中海西溪华府', '杭州市西湖区五常港路', '杭州市', '', '60829.96006', '120.054128,30.290465', '商务住宅;住宅区;住宅小区', '', '2', '140000平方米', '39073', '中海西溪华府,位于老城西繁华CBD,南临西溪湿地,北邻浙大紫金港校区,周边商业综合体林立,教育、医疗资源丰富,悠享最宜居生活配套。    西湖区稀缺小高层, 90方到138方主力户型,一梯两户阳光花园住区,中央景观南北双向大花园。承袭经典新古典建筑风格,立面典雅大气,细部设计极致精工,是中海地产精心打造的第五代产品升级力作。', '2013-11-24', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18HY2', '330100', '120.171903,30.312737;120.171838,30.310966;120.170469,30.311014;120.170454,30.310615;120.16955,30.310687;120.169491,30.310746;120.169475,30.310851;120.16947,30.311312;120.169594,30.311754;120.169799,30.31219;120.170031,30.312626;120.170142,30.312734;120.17025,30.312796;120.171797,30.312824;120.171903,30.312737', '万和玺园', '杭州市下城区颜三路与再行路交汇处', '杭州市', '', '38717.017227', '120.170723,30.311772', '商务住宅;住宅区;住宅小区', '车位占比93.8%', '2.5', '155000平方米', '60000', '万和玺园是杭州下城中心全能型的品质住宅项目,交通便捷直线距离武林门仅3.8公里, 300米内优质学区覆盖,配套成熟,户型设计独特创新,主力户型89方,可实现全明三房两卫,户户全明通透,功能布局合理,在有限的空间满足各类使用需求。    项目规划:    (1)万和玺园项目由11幢18层的高层建筑组成,采用板式和围合式相结合排列的空间布局,既保持了安全性和私密性,又大大增加了中心绿化和活动空间,将近1万方的中心绿化使得户户有景,南北最大楼间距70米左右,6大景观体系,在视野角度开阔的同时更体现了优美的皇家园林氛围;    (2)万和玺园采用新古典主义设计理念,全石材干挂外立面、智能化入户门禁系统、三合一指纹锁、宽敞担架电梯等等更显楼盘品质;    (3)园区内设置人性化交通体系,采用人车分流的道路设计理念,很好的保证了园区和谐、安全、绿色的生活品质。    户型点评:    万和玺园户型面积主要是以89方可变三房为主,配有少量的120方、138方和70方等多种户型。    所有的户型都有具有三大独特优势:    第一:全明通透,中间户型也能实现大面积采光和通透;    第二:高赠送空间,每套房基本都能享受10几方的赠送面面积(70方除外),89方的边套就有12方赠送,加上赠送面积得房率可高达100%;    第三:得房率高、空间灵动可变,整个项目得房率在80%-82%左右,房子外立面好不好别人知道,但是住的舒不舒适只有自己能体会,万和玺园每个房间的空间尺度舒适,两房可变三房、三房可变四房,让房子更实用性价比更高。', '2014-08-16', '2.25元/月/平方米');
