INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18JME', '330100', '120.137928,30.284274;120.13791,30.284483;120.137911,30.284502;120.137917,30.284512;120.137936,30.284519;120.1383,30.284547;120.138947,30.284597;120.139546,30.284643;120.13957,30.284638;120.139582,30.284621;120.13961,30.284287;120.139611,30.284091;120.13961,30.28402;120.139636,30.283861;120.139674,30.283817;120.139762,30.28379;120.140221,30.283803;120.140261,30.283789;120.140291,30.283764;120.140303,30.283727;120.140313,30.283466;120.140304,30.283456;120.140272,30.283453;120.139286,30.283408;120.138993,30.283389;120.138414,30.283353;120.138039,30.283328;120.138031,30.283343;120.138023,30.283365;120.137983,30.283773;120.137939,30.284174;120.137928,30.284274', '兰庭国际', '杭州市西湖区文二路128号', '杭州市', '', '20345.179021', '120.13892,30.283945', '商务住宅;住宅区;住宅小区', '', '2.9', '10平方米', '46982', '华都.兰庭国际依托保俶路、文二路交叉区域的地段优势,将优越的地缘特征融入到项目之中,并充分引入周边绿树成荫、内蕴淳厚的环境气氛,将绿荫满堂、高差错落、曲水流淌的内部景观与其融为一体,形成内外兼得的双重宜人居住环境。  同时,在内部空间设计、产品用材、配置、智能化、物业服务等多个层面均作细致入微的考量,力求营造出精细品质由表及里的标准。', '2006-11-05', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18JNJ', '330100', '120.107381,30.271486;120.107576,30.270743;120.10711,30.270626;120.107026,30.270837;120.106974,30.270988;120.106944,30.271082;120.106849,30.271392;120.107351,30.271501;120.107381,30.271486', '炮台公寓', '杭州市西湖区莲花街97号', '杭州市', '', '3748.198981', '120.107221,30.271072', '商务住宅;住宅区;住宅小区', '', '2.1', '', '', '小区交通便利 配套完善', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18JO4', '330100', '120.256426,30.232184;120.256284,30.232016;120.256078,30.231767;120.255977,30.231704;120.255764,30.231554;120.255471,30.232679;120.256372,30.233533;120.256642,30.233914;120.256777,30.234104;120.256851,30.23418;120.256894,30.234199;120.256937,30.234212;120.25699,30.234215;120.257045,30.234213;120.257164,30.23416;120.257386,30.234025;120.257828,30.233781;120.257204,30.232787;120.256991,30.232543;120.256821,30.232365;120.256555,30.232305;120.256426,30.232184', '万和国际', '杭州市萧山区皓月路188号', '杭州市', '', '25706.786141', '120.256577,30.232993', '商务住宅;住宅区;住宅小区', '700多个车位，价格未定', '4', '170000平方米', '37591', '万和国际坐拥钱江世纪城CBD核心地段——市心北路与广场路交汇处,紧依庆春过江隧道出口,与钱江新城核心区仅需5分钟车程,天赋一江双城的地段优势,是CBD罕有的贵胄之地。    总建筑面积17万余平米,由住宅、写字楼、商业三种物业形态组成。其中住宅主力户型面积为120㎡--140㎡,典雅的建筑与富有贵韵的新古典风格园林相互辉映,彰显出雍容且高雅的气度,为匹配钱江世纪城CBD璀璨耀人地标华宅形象,万和国际外立面大面积采用石材干挂,商业裙房楼顶创新设置典雅的屋顶花园、社区入口处设有灵动水景、两条景观轴线相交点精心擘划开放性的中心庭院,并在万和国际园区中设置了嬉水泳池,在不动声色地为您演绎居住艺术的繁华和高贵。    户型设计上,万和国际充分考量建筑与自然的和谐,住宅总计约600户的贵雅宅邸,户型区间从70㎡--175㎡,主力户型为120㎡--140㎡,更有少量面积在200㎡以上的跃层。充分满足从两口之家到四代同堂的居住需求。    万和国际力邀绿城景观公司全程擘画社区景观设计,不凡的大师手笔,钜献超群的景致观感;再配以浙江开元物业有限公司担纲物业管家,引入开元酒店式管家服务,为阁下的生活起居、烦心琐事等皆可交其打理,在点滴中领略贵族管家细致入微的周到服务,奢享名门世家的专属礼遇。    媲美世界级醇熟配套,绽放国际时尚生活盛宴    作为钱江世纪城核心区块庆春过江隧道的尊贵华宅,万和国际占尽一江双城的天赋优势,集商业配套、商务配套、体育文化配套、教育配套、医疗配套为一体,媲美世界大都会醇美配套,尽享世界级双核CBD精粹生活,绽放国际时尚生活盛宴。', '2013-04-13', '2.45元/月/平方米');
