INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18JOJ', '330100', '120.169061,30.314682;120.166589,30.314645;120.16657,30.315393;120.167024,30.315405;120.167244,30.315413;120.167343,30.315423;120.167444,30.315454;120.167438,30.315892;120.169065,30.315907;120.170423,30.315894;120.170431,30.315421;120.17042,30.315394;120.170404,30.315367;120.169964,30.315308;120.170017,30.314789;120.169303,30.314703;120.169187,30.314693;120.169061,30.314682', '中粮·方圆府', '杭州市下城区善贤路', '杭州市', '', '36178.148532', '120.168513,30.315272', '商务住宅;住宅区;住宅小区', '约500个', '2.69', '143000平方米', '17542', '中粮晓悦公馆以42-68方为主力户型,创意设计入户精装大堂门厅,功能齐全的精致空间,分区独立舒适,梯形凸飘窗更多迎景入室;精选ToTo、摩恩、奥普、德意等国际国内一线品牌精装卫浴、厨房配套等,特聘国际一线室内设计团队,打造全方位精奢生活!项目身处城北新天地、中大银泰城等繁华交汇处,毗邻沃尔玛、国美、乐购、物美等大型超市;地铁、秋石、留石快速路及中河—上塘、德胜快速路,构成发达的井字交通网。10分钟武林广场,5分钟运河天地。中央商务区、大运河商务区,两大繁华中心国家一级资质,高尚服务典范中粮地产物业成立于1993年6月,国家一级物业管理资质,隶属于中粮集团-中粮地产(集团)股份有限公司。公司自成立以来,管理水平与服务质量一直保持一流,公司所管理的小区先后荣获“深圳市物业管理优秀住宅小区”、“广东省物业管理优秀住宅小区”及“全国城市物业管理优秀住宅示范小区”等殊荣。中粮物业将在酒店式公寓的每个大堂通过管家中心,设立专职的楼宇管家,为业户提供上下班迎宾式接送服务、信息咨询、代办代订等专享型服务,满足高级白领阶层需求。', '2013-12-08', '2.2元/月/平方米');
