INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18TAS', '330100', '120.165254,30.18509;120.164228,30.184594;120.162928,30.18413;120.162766,30.184608;120.162697,30.184841;120.162456,30.185845;120.164884,30.18635;120.165254,30.18509', '通策广场', '杭州市滨江区江南大道3672号', '杭州市', '0103000020E6100000010000000800000020628385930A5E400FD1E80E622F3E40994528B6820A5E40AF09698D412F3E4092E68F696D0A5E406536C824232F3E40A6B915C26A0A5E4079944A78422F3E40118AADA0690A5E40BEF561BD512F3E407FC2D9AD650A5E400820B589932F3E408EE89E758D0A5E400F9C33A2B42F3E4020628385930A5E400FD1E80E622F3E40', '36051.574149', '120.163819,30.185315', '商务住宅;住宅区;住宅小区', '1:0.5', '2.4', '140000平方米', '14781', '通策广场位于钱塘江南岸杭州高新区之江科技园内,紧邻钱塘江,西望钱江一桥,南临江南大道,占地面积90余亩,总建筑面积近14万平方米,由写字楼、SOHO、酒店式公寓、商场以及7幢小高层、高层住宅组成。通策广场以采用现代高技术元素的技术优势,拥有得天独厚自然资源的环境优势以及地处快速成长中的高新技术产业开发区的区位优势作为其主要特征,以做减法的建筑为理念,尝试在建筑形象及组团空间上突破传统,充分体现出现代、新颖、通透、空间景观的展现以及绿色环保意识的落实,是集住宅、办公功能于一体的当代智能型住宅。', '2003-10-14', '1.25-2.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18WPN', '330100', '120.229711,30.273411;120.228119,30.272257;120.22802,30.272219;120.227934,30.272224;120.227875,30.272257;120.226838,30.273318;120.226894,30.273368;120.227276,30.273694;120.227614,30.274004;120.228191,30.274535;120.228327,30.2745;120.229676,30.273637;120.229761,30.273587;120.229786,30.273541;120.229783,30.273495;120.229711,30.273411', '东方御府', '杭州市江干区江干凤起东路与御道路交叉口东南', '杭州市', '', '32701.232378', '120.228266,30.273384', '商务住宅;住宅区;住宅小区', '867个（地下827个，地上40个，1:2配比）', '3.2', '148827平方米', '35146', '东方御府,位于钱江新城,附近有钱江新城金融城、渔人码头以及万象城、市民中心、洲际酒店等一系列商业金融、休闲娱乐配套。
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1943C', '330100', '120.148643,30.167742;120.147575,30.167267;120.14698,30.168493;120.148304,30.168848;120.148358,30.168699;120.148514,30.168329;120.14861,30.168029;120.148696,30.167802;120.148643,30.167742', '绿城巧园', '杭州市滨江区浦沿路与坚塔路交叉口', '杭州市', '', '14855.732456', '120.147872,30.168098', '商务住宅;住宅区;住宅小区', '车位价格待定', '2.7', '60641平方米', '36586', '继明月江南之后,绿城在钱江南岸再续精品地铁江景公寓,甄选江与城之精华领地,与蓝色钱江、明月江南共享钱江两岸。绿城·巧园,居钱江南岸一桥南高新区核心区域,依新浦河,近看钱塘江,汇聚地铁4号线与6号线,占据约1.5万㎡稀缺土地,聘请精英团队联袂设计,融合约2.5万㎡精致住品、约1.6万㎡商业物业,营造约6万㎡城市精品地铁综合体。    一桥南,钱江湾,繁华胜景    钱江南岸现代繁荣胜景,自钱江一桥开始,地铁1号线、钱江七桥、奥体中心……陆续呈现。高新区现代恢弘的都市规划,雄厚的产业基础在此相逢,便捷的交通网络和优美的人居环境在此重叠,成熟的商务环境和完善的配套服务完美融合。接驳钱江一桥,通达全城,便捷直达武林广场、西湖,紧邻在建的之江大桥,直达之江度假区,一桥南,繁华自由切换。    地铁零距离,轻松自在,便捷畅达    绿城·巧园,紧邻规划地铁4号线坚塔路规划地铁站,与规划地铁4号线和规划地铁6号线换乘枢纽站约1公里,出入自在,轻松享受地铁时代的便捷与自由。    配套醇熟,品质至上,繁华精彩    钱江一桥南,高新区核心区域,大型商业汇聚,医疗市政体系完善,名校云集,荟萃书香人文之风华,成熟品质配套,进退繁华。绿城·巧园,绿城高品质物业,畅享高新区成熟配套与精致生活品位,与繁华都市相得益彰。    一站式生活方程式,居住、创业、休闲全体验    绿城·巧园,聚合住宅、写字楼、商业,创业、居家、生活步行可至,坐享城市综合体的便捷、舒适。    精致、巧思、舒适,绿城划时代90㎡户型美学    绿城90㎡户型优化设计,两梯两户,主次卧尺度舒适,超高挑空阳台,空间疏阔,更多利用,更多舒适,更多布局考量。90㎡-135㎡户型区间,同样给你超出想象的空间感受。', '2013-08-18', '2.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B194E0', '330100', '120.245117,30.379026;120.245259,30.379114;120.246445,30.378605;120.246525,30.378526;120.24653,30.37841;120.246005,30.376596;120.245211,30.376818;120.243736,30.377508;120.244988,30.37904;120.245117,30.379026', '爵士花园', '杭州市余杭区星桥镇', '杭州市', '', '38382.631507', '120.245307,30.377866', '商务住宅;住宅区;住宅小区', '车位数量791个车位比1:1', '2.4', '140000平方米', '14037', '爵士花园紧邻杭州市时代小学,天都大道东面属于天都城继温莎花园后又一改善型优质楼盘。距离临平与丁桥主干道临丁路仅有200米。项目交通便利。多条公交线路:762、767、535、371、386、330路等。紧邻一站式生活体验中心,届时生活、休闲、购物非常方便。小区由9栋17层小高层住宅组成。小区享方有 93米超宽楼间距和3万方的中心庭院(相当于4个足球场的大小)。    小区的建筑户户面景,立面采用新古典主义风格材质为面砖和干挂石材;户型设计上注重舒适感,以及带给居住者更多的拓展空间,满足丰富多彩的家居功能。小区按照1:1的车位配比,地下车位709个,地上车位82个。结合沥青环道合理设置,实现完善的人车分流。建筑底层局部架空使住户有更多的休息、交谈、嬉戏公共活动场所,从而延伸了户外活动的范围。电梯厅和公共大堂双精装提升了小区的档次。     爵士花园建筑布局以“点板结合”为主,沿天都大道布置三幢点式住宅,沿天龙路和新开河布置6幢板式住宅,最大间距达到93米,体现大尺度的建筑空间,沿天都大道侧设立主路口,结合主入口设置景观主轴线,地块内通过建筑布局,自然地将地块围合成两个英伦风情景观庭院爵士花园的园林景观:3万方的景观绿化,造英伦浪漫四季美宅,一条轴线、双英伦风情景观主题园。', '2013-09-07', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B19954', '330100', '120.16539,30.261364;120.165294,30.261022;120.165163,30.260641;120.16504,30.260236;120.164984,30.25994;120.164474,30.259917;120.164455,30.260156;120.164326,30.260156;120.164321,30.260319;120.164751,30.260334;120.164751,30.261023;120.164615,30.261023;120.164611,30.261361;120.164224,30.261366;120.164219,30.2615;120.165414,30.261495;120.16539,30.261364', '广福路小区', '杭州市下城区延安路与孩儿巷交叉口', '杭州市', '', '8637.055447', '120.164877,30.26081', '商务住宅;住宅区;住宅小区', '', '1.6', '', '33722', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1996O', '330100', '120.192715,30.257439;120.192782,30.257433;120.19282,30.257418;120.192827,30.257359;120.192749,30.2567;120.192536,30.256692;120.1925,30.25673;120.191966,30.256696;120.191913,30.257428;120.192715,30.257439', '庆春御府', '杭州市江干区庆春东路93号', '杭州市', '', '5629.92752', '120.192367,30.25708', '商务住宅;住宅区;住宅小区', '170个（1:2配比）', '3.5', '30000平方米', '47778', '元丰&#8226;庆春御府,位于庆春东路与庆菱路交叉口,北临杭州庆春东路,西面距古城河(贴沙河)约300m,市中心罕有的奢适华宅。    庆春路被誉为“杭州第一金融街”,左右分别连接西湖CBD和钱江新城CBD,处西湖时代与钱江时代双城核心。周边交通路网成熟而发达,是整个杭州的交通枢纽之一。对内,钱江新城区块内“两横九纵”已经启动,其中新安江路、灵江路、衢江路已经完成;对外,庆春御府附近交通路网成熟,客运中心、高速公路彭埠入口、萧山国际机场等交通要道与项目对接相邻。同时紧邻地铁二号线双菱路站站点也近在咫尺,共同构成了项目周边的立体交通路网。    元丰&#8226;庆春御府占地面积约6304㎡,建筑面积约22064㎡,共包括两幢高层大宅公寓,其中1、2层建筑规划为高档商业裙房,规划总户数86席,主力面积为180-250㎡。小区主入口朝东布置,远离庆春东路的干扰。小区内完全人车分流。    建筑采用简素主义,用现代的语言去诠释古典秩序的精神。三段式建筑立面,从上至下浓缩历史。底层通过檐口、柱头、柱身、柱础、台阶的组合再现庄重秩序,入口处利用古典柱式强调了空间仪式感,裙房处以匀质的柱列适当增加建筑的时代气息;屋身石材立面,局部装饰铝板,窗户位置采用盒式窗立面,通过均匀的比例控制了建筑的整体效果,窗顶及窗台通过阴刻及凸起构造方式丰富了细部,又更好的保护了建筑外墙,是现代建筑功能美学的经典再现;屋顶用玻璃和铝板取代石材墙身,做多层次退台处理,以此形成空灵、纯净的顶部形象,使建筑在天际线处达成了高潮中的完美谢幕。     户型上,庆春御府采用两梯两户结构,每一户都是边套,拥有270°观景空间,户型全部南北通透开敞,主要空间向阳,明厨明卫,使空间居住品质彰显无余。5米、7米客厅开间,4.2米、4.5米主卧开间,3.2米建筑层高,阔绰尺度均超出普通建筑规格,使得室内外接触面尽可能扩大, 切实尊重居住者的高端生活要求,最大限度的呼应园景、河景、城景,将户外的斑斓风景引入室内。    生活配套方面,庆春东路贯通了武林广场和钱江新城,坐享庆春商圈与武林商圈两大繁华中心,市中心配套优势不言而喻。依照政府规划,江干区将把庆春商圈打造成杭州“第二武林商圈”。依此,庆春商圈领域内将新建、续建13个大型经济项目,包括大型百货、精品百货、商务办公、建材超市等。随着银泰百货、欧亚达家居、天星龙等大型商业中心的相继落成,“第二武林商圈”的宏伟规划日渐形成。    教育资源上,项目所在区域有采荷一小和采荷重点中学。采荷一小,学校被评为杭州市首批文明学校。杭州采荷中学教育集团是杭州唯一的省级示范性初中。每年,都有数百名学生赢得国家级、省级、市级或区级竞赛的各种奖项。这些成绩在省内其他同类学校中处于领先地位。    项目的开发团队包括:发展商,浙江元丰房地产开发有限公司;建筑设计,中国美术学院风景建筑设计研究院卢翔建筑设计事务所;室内精装设计,台湾含奕设计工程有限公司。', '2013-06-29', '5.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B199AH', '330100', '120.166425,30.379823;120.167149,30.379749;120.168056,30.379661;120.168415,30.379605;120.169236,30.379427;120.16978,30.379247;120.168484,30.377784;120.167771,30.377824;120.16775,30.378027;120.167761,30.378532;120.166846,30.378553;120.166873,30.379027;120.166398,30.379018;120.166425,30.379823', '中和北宸府', '杭州市余杭区崇贤镇尚德路与崇文街交汇处', '杭州市', '', '35964.303126', '120.168009,30.378946', '商务住宅;住宅区;住宅小区', '700个', '2.5', '136218.76平方米', '11766', '中和北宸府坐落杭州崇贤新城,北面紧邻崇文街,西临尚德路,东沿京杭大运河支流,南望森林公园半山公园。项目占地超4万平方米,总建面积约14万方,规划总住户数990余户,由8栋法式精工小高层及沿街主题商业街组成,项目以76—140方的高层公寓为主,利用入户花园、露台、空中平台、飘窗等各种可延展空间90方可变式空间。', '2016-03-25', '1.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B19BON', '330100', '120.134714,30.176242;120.133865,30.176239;120.133431,30.176193;120.133017,30.176235;120.131321,30.176228;120.131309,30.176425;120.131399,30.177364;120.131504,30.178046;120.131686,30.179864;120.132918,30.179946;120.134639,30.180028;120.134714,30.176242', '钱江湾花园', '杭州市滨江区东信大道99号', '杭州市', '', '107821.310553', '120.133094,30.178044', '商务住宅;住宅区;住宅小区', '1100', '1.53', '220000平方米', '34486', '钱江湾花园在杭城率先提出“从绿色到蓝色—环境主义的蓝色运动”理念,聘请国际知名BELTCOLLINS景观设计公司大手笔营建具有秩序感、历史感、意义感的生活园境,强调居住环境中人与人之间安全、祥和、安宁的秩序空间,从环境的各个细节营造城市人居的人性化氛围和人性化功能链。  钱江湾花园以蓝色的生活方式为主题,2002年荣获“首届中国环境设计”综合金奖,2003年入围“全国人居经典”,并被评定为“2003年度中国名盘50强。', '2005-06-30', '1.8-3.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B19GB5', '330100', '120.173515,30.226845;120.173389,30.226799;120.173293,30.226699;120.173253,30.226521;120.173263,30.226293;120.173404,30.225508;120.173864,30.225557;120.17377,30.226048;120.173348,30.226005;120.173292,30.226315;120.173636,30.226363;120.173867,30.226308;120.173963,30.226634;120.173969,30.226692;120.173963,30.226732;120.173883,30.226771;120.173515,30.226845', '候潮公寓北区', '杭州市上城区江城路256号', '杭州市', '', '4959.121971', '120.173611,30.225781', '商务住宅;住宅区;住宅区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B19GMB', '330100', '120.183721,30.337424;120.183855,30.337031;120.183905,30.336815;120.183954,30.336191;120.183909,30.336103;120.183832,30.336052;120.181817,30.336227;120.181924,30.336749;120.182245,30.337914;120.182402,30.338443;120.182467,30.338496;120.182586,30.338525;120.183372,30.338542;120.183427,30.338496;120.183471,30.338431;120.183523,30.33805;120.183721,30.337424', '祥和人家(永潮街)', '杭州市下城区永清路43-62号', '杭州市', '', '35687.723424', '120.182929,30.337182', '商务住宅;住宅区;住宅小区', '0.43', '2.3', '100000平方米', '23281', '华府.祥和人家位于东新路延伸段,石祥路北,沈半路以东,毗邻大型经济适用住宅区“北景园”。西南方即是开发成熟的上塘-拱北生活区,生活配套设施齐全,是一个成熟的住宅区域。祥和人家由10幢现代型优美建筑围合而成,风格简洁,小区内风景怡人,注重建筑细节与实用功能,真正体现了住宅以人为本的朴素理念,而祥和人家的主体——户型与功能则是其值得关注的亮点。  祥和人家的小区户型以空间合理、布局紧凑,短进深、大开间、明厨明卫为主要特点,从细节处着手,居住的舒适性与经济性达到了的统一。以祥和人家一套109平方米左右的标准户型为例:户型为舒适实用的三室二厅二卫。两卧朝南、双阳台设计、主卧独立卫生间,并且保证了一个卫生间较为宽敞、功能舒适,具备了一套中等面积三室户的优点。值得一提的是,该户型两个朝南卧室面宽均达到3.6米,采光良好,在视觉上也起到了拉伸的作用,空间上显得十分开阔舒适;经过合理的安排,从入门处即是餐厅与客厅,整体感觉居家气息十分浓厚,方正大气的客厅不仅功能实用,而且东面有大幅面的采光取景,使整个室内空间增色不少。', '2004-09-29', '1.4元/月/平方米');
