INSERT INTO "public"."gaode_residential_region" VALUES ('B023B19JDD', '330100', '120.085691,30.337574;120.085569,30.337545;120.085188,30.337471;120.085044,30.337449;120.084943,30.337456;120.084874,30.337537;120.08457,30.338188;120.084183,30.339017;120.084195,30.339107;120.084327,30.33918;120.086262,30.339858;120.087017,30.340121;120.088105,30.340528;120.088652,30.340738;120.089202,30.340893;120.089395,30.340677;120.089649,30.340325;120.089755,30.340181;120.090108,30.339658;120.090193,30.339546;120.09023,30.339472;120.090226,30.339433;120.09022,30.339359;120.090139,30.339282;120.089801,30.339132;120.08873,30.338681;120.087524,30.338247;120.086179,30.337759;120.085691,30.337574', '铭雅苑东区', '杭州市余杭区古墩路北端', '杭州市', '', '97571.702476', '120.087166,30.339152', '商务住宅;住宅区;住宅小区', '', 'None', '', '22187', '铭雅苑在社区设置的每一处细节上无一不体现轻松舒适的宗旨。总体上采用自由式与组团式相结合的复合式建筑布局,合理运用了街、巷、院、园等功能要素,使城市道路得以自然地向小区内部延伸。社区内步行空间以复合内街形式引入,结合街巷的设置,形成了铭雅苑丰富多变的社区空间和景观。南北走向的古墩路将整个社区分成东西两个区域为东区从古墩路通过一个标志性很强的门廊进入,主入口处为一个开放性的广场。走进小区,展现在面前的则是一条约400米长通透、流畅的休闲步行道。社区步行系统以这条中轴线为主干道,与东、南两条绿化步行系统联通,为整个小区的居民提供茶余饭后散步的休闲环路。在这休闲步行系统里,不仅布置了数量充足的四季花草树木、石砌小道、石凳、桌椅等,并有幽雅的小溪置于其间。人们沿着水流的方向漫步在这有水有景的空间,轻松、惬意。西区空间在风格上于东区相统一,半圆形的广场空间设计,中央设喷泉,并有标志性的主题。', '', '0.9元/月/平方米');
