INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1ABDY', '330100', '120.042848,30.271266;120.042918,30.27117;120.042961,30.271073;120.043075,30.27075;120.043163,30.270423;120.043241,30.269936;120.043258,30.269698;120.043241,30.269583;120.043163,30.269495;120.04283,30.26938;120.042411,30.269242;120.041967,30.269089;120.041404,30.268933;120.041091,30.269647;120.040718,30.270231;120.040167,30.270894;120.040769,30.271603;120.041513,30.272302;120.041679,30.272194;120.042848,30.271266', '绿城·西溪融庄(荆长公路)', '杭州市余杭区荆长大道与文二西路口前行600米', '杭州市', '', '57156.522558', '120.041817,30.270556', '商务住宅;住宅区;住宅小区', '', 'None', '', '31207', '绿城西溪融庄,是由融创、绿城两大地产巨鳄在杭州联手打造的第一个高端精品项目,也是绿城在留庄、翡翠城、溪上玫瑰园、西溪诚园后入驻西溪的第5个项目。    项目位于西溪板块核心,距离西溪湿地国家公园仅300米,三面环水,拥享西溪绝版景观资源。周边海港城、西溪印象城、西溪慢生活街区、淘宝城等众多商业配套环饲,浙大紫荆港、绿城育华等名校云集。    绿城西溪融庄,提粹绿城两大经典产品——玫瑰系经典法式排屋、法式花园洋房 。法式排屋,秉承绿城10余年别墅营造经验,以法国经典官邸及宫廷建筑为原型,是绿城城市别墅的经典代表作品之一。法式花园洋房,以绿城平层官邸经典之作——留庄为建筑形态摹本,是西溪乃至整个杭城都极为稀缺的低层低密度高端住品。    项目沿袭绿城整体营造理念,采用高档石材干挂立面、经典法式宫廷园林、中轴对称的景观布局,人性化的人车分流,全方位园区服务体系将绿城品质一以贯之,成为城市第一居所首选。', '', '1.6-1.68元/月/平方米');
