INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1AENI', '330100', '120.302116,30.275677;120.30367,30.274895;120.30439,30.274476;120.30533,30.273919;120.307076,30.272804;120.307445,30.272621;120.307487,30.272582;120.307486,30.272522;120.306587,30.271291;120.306525,30.271235;120.306452,30.271244;120.304934,30.272476;120.304862,30.272531;120.304779,30.272503;120.304608,30.272387;120.303997,30.271928;120.303928,30.271866;120.303924,30.271798;120.305241,30.270216;120.305235,30.270134;120.305157,30.270059;120.304262,30.26965;120.304177,30.269808;120.303872,30.2702;120.303519,30.270622;120.303361,30.270765;120.302779,30.271343;120.302619,30.271458;120.301557,30.272577;120.300771,30.273326;120.300676,30.273475;120.300643,30.274479;120.300654,30.275338;120.30065,30.275518;120.300651,30.275621;120.300703,30.275746;120.300815,30.275938;120.300967,30.276068;120.301202,30.276107;120.301337,30.27606;120.302116,30.275677', '众安·景海湾', '杭州市萧山区中国水文化博览园区内', '杭州市', '', '179518.96577', '120.303503,30.27314', '商务住宅;住宅区;住宅小区', '1658个', '1.2', '260000平方米', '23694', '众安景海湾位于钱江南岸,与下沙、九堡隔江相望,北临钱塘江,西接钱江世纪城,南通中国水博园,是钱江湾畔大型水生活住区。项目北接700米钱塘江一线江景,东南享近3000亩中国水博园湿地,呼吸之间尽是自然光华。广袤的湿地,飞翔的白鹭,赋予这片土地天然的生态资源。景海湾首创岛居理念,岛屿式排屋借鉴了西班牙建筑的精髓,色彩明快,唯美舒适,充分体现休闲人居理念。高层公寓一层架空,真正户户面江。每个户型设计均考虑江景效果,南北均设置阳台或露台,开阔视野,增加生活的舒适度。是城市雅贵阶层向往的休闲宜居之地。', '2011-05-17', '2元/月/平方米');
