INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1BKH5', '330100', '120.198686,30.171216;120.198706,30.171296;120.19874,30.171345;120.198823,30.171367;120.199797,30.171357;120.200765,30.16959;120.200737,30.169515;120.200666,30.169477;120.198898,30.169368;120.198776,30.169422;120.198747,30.169503;120.19873,30.169615;120.198686,30.171216', '保亿·风景蝶院留园', '杭州市滨江区光裕路临38', '杭州市', '', '28354.186169', '120.199531,30.170294', '商务住宅;住宅区;住宅小区', '', 'None', '', '31176', '风景蝶院位于滨江腹地正中心偏南的长河板块、江虹路与乳泉路交汇处、滨江三大商圈之一的白马湖休闲文化圈西北,拥有充满田园风光的生态环境资源。项目距市中心武林广场约25分钟车程,距钱江新城约10分钟车程,距萧山新区约10分钟车程,距城站约15分钟车程,距机场约30分钟车程,距建设中地铁1号滨康站约1500米,距钱塘江约2000米,交通十分便捷。华荣风景蝶院总占地面积6.9万平方米,总建筑面积约18万平方米,总户数1580户,容积率2.2,绿化率30%以上,建筑密度22%以下,由11幢14-25F层高层景观公寓组成,70%以上为90M2以下两房及三房户型,全部为板式及局部点式高层产品', '', '1.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1BKUQ', '330100', '120.279225,30.306399;120.278624,30.306492;120.27809,30.306534;120.277274,30.306569;120.277305,30.306765;120.277392,30.306756;120.277587,30.307772;120.277256,30.308289;120.278007,30.308639;120.27836,30.308798;120.278743,30.308818;120.279564,30.308734;120.279225,30.306399', '蓝桥景苑', '杭州市江干区金禾街190', '杭州市', '', '39163.424574', '120.278461,30.307633', '商务住宅;住宅区;住宅小区', '', '1.99', '56814平方米', '23274', '“蓝桥景苑” 属于经济适用房项目,位于杭州市江干区九堡镇八堡村,项目周围的配套设施和交通条件基本良好,并在进一步的改善之中。', '', '0.9元/月/平方米');
