INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CBO7', '330100', '120.245606,30.311463;120.245444,30.310912;120.244779,30.310934;120.244028,30.311063;120.243325,30.31126;120.244266,30.312553;120.245606,30.311463', '中国铁建·国际花园', '杭州市江干区普德路', '杭州市', '0103000020E61000000100000007000000E36C3A02B80F5E40FFE9060ABC4F3E40F73FC05AB50F5E4017EFC7ED974F3E40D8EF8975AA0F5E40E736E15E994F3E40BBD39D279E0F5E40E3FE23D3A14F3E40265305A3920F5E408F8D40BCAE4F3E409561DC0DA20F5E404644317903503E40E36C3A02B80F5E40FFE9060ABC4F3E40', '19223.092454', '120.244513,30.311559', '商务住宅;住宅区;住宅小区', '地上：54个 地下：396个', '2.4', '70697.8平方米', '32642', '中国铁建国际花园项目位于杭州城东新城北区域的核心,在其南面即为德胜快速路综合交通枢纽出口处,德胜高架通往下沙和杭州市区,转上塘高架通往城北和滨江完成全程高架交通圈,其西面即为沪杭高速入口距离项目仅5分钟。到即将通车的火车东站直线距离3.2公里,距离杭州市中心武林门9公里,到达萧山机场也仅需20分钟的车程。该区域位于地铁七堡站和九和路站之间,其中项目到九和路地铁站步行仅10分钟左右。目前公交35、842路至普福村站,69、111、212、842路到红五月村站。板块内在建的公交换乘中心也将有多条公交线路可以达到。项目周边的普福公园、世纪联华、好又多便宜超市、阳光超市、品汉酒店、禧福汇、交通银行、建设银行、杭州银行、招商银行、时尚KTV等,项目的南侧和北侧分别紧邻规划中的两个幼儿园项目北侧就是即将开工的36班普福小学。整个项目周边已形成了由幼教、小学、初中、高中等数十所院校构成的立体教育网络。小区占地21257平方米,总建筑面积70697.8平方米,其中地上51016.8平方米,地下19681平方米,整个小区有两个出入口,主入口在项目南侧的支十二路,次入口在项目西侧的冯普路。是由8幢16层住宅、2423平米的沿街商铺和超大中庭景观区组成的,项目容积率为2.4,建筑密度25%,绿化率30%。整个小区是以新古典建筑风格为主,外立面主要以干挂花岗岩和真石漆为主。整个小区的景观是依托后面自然河流结合项目打造成围合式的景观设置,以林木、大草坪、花园、喷泉、跌水等元素形成层次丰富、移步换景的华美景致,通过连廊、栈道、凉亭、座椅等休闲观景场所组成的,且小区的水系全部都是引入的自然水系的活水,除小区中央的中庭景观以外,围绕小区还设置专门的主题景观组团,如沿河设置的休闲小憩区,主题景观区的儿童游乐园等。整个小区由8幢住宅,主要面积以89平米的2+1户型和115平米宽绰3室2厅2卫,其中1、2、3、4幢为89平米户型,7幢为115平米户型,5、6、8幢89平米和115平米各占50%。', '2015-04-01', '2.25元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CBOC', '330100', '120.199233,30.300987;120.199219,30.301113;120.199249,30.301244;120.199488,30.301507;120.1999,30.301753;120.20174,30.300183;120.201085,30.29958;120.20079,30.299919;120.200602,30.300011;120.200066,30.29996;120.199233,30.300987', '锦润公寓', '杭州市江干区机场路和全福桥路交汇处西北200米', '杭州市', '', '23422.026384', '120.200372,30.300654', '商务住宅;住宅区;住宅小区', '约600个（配比约1:1）', '2.4', '99000平方米', '37000', '信宇锦润公寓,项目靠近机场路与新风路交叉处,东面临近机场路,南面临近新风路,距武林商圈约5公里。锦润公寓总建筑面积约9.9万平方米,由10幢16层电梯公寓与沿街商业组成,主力户型90-126方。', '2015-04-30', '2.5元/月/平方米');
