INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CBOM', '330100', '120.317141,30.30456;120.318214,30.304583;120.31831,30.304536;120.318353,30.302508;120.318299,30.302438;120.317066,30.30235;120.316969,30.302397;120.316937,30.302434;120.316921,30.303376;120.316947,30.304314;120.316964,30.304476;120.317033,30.304546;120.317141,30.30456', '郡原蓝湖国际', '杭州市江干区下沙天城东路与幸福南路交叉口', '杭州市', '', '27601.051527', '120.31763,30.303472', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '郡原蓝湖国际,金沙湖一线摩登中心体,由精装小寓、整层办公写字楼、商业休闲中心组成。项目位居金沙湖南岸,近邻地铁1号线金沙湖站,占据CBD繁华之心,融合时尚生活元素,尽享现代都市生活。    近期将推出的精装修酒店式公寓“湖印”,以30、45平方米的主力户型以及充满文艺气息的无印良品风精装倾献市场。户型空间灵动,可创意性强,功能齐全,收纳空间足,是自住、投资、办公的绝佳选择。', '', '');
