INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CCE9', '330100', '120.150949,30.291497;120.150099,30.291136;120.149004,30.290679;120.148803,30.291033;120.148314,30.291883;120.147902,30.292612;120.147194,30.293934;120.147046,30.294243;120.14734,30.294346;120.147644,30.294447;120.147738,30.294535;120.147822,30.294706;120.147912,30.294743;120.148093,30.294703;120.148216,30.294693;120.148278,30.294652;120.14834,30.294547;120.148458,30.294454;120.148562,30.294397;120.148755,30.294363;120.148889,30.294309;120.148965,30.294289;120.149029,30.294265;120.149224,30.29397;120.149555,30.293645;120.149694,30.293503;120.149989,30.293132;120.15029,30.292723;120.150501,30.29242;120.150754,30.292055;120.150881,30.291935;120.15095,30.291888;120.150971,30.291802;120.150972,30.291597;120.150949,30.291497', '仓基新村社区', '杭州市拱墅区湖墅南路460号', '杭州市', '', '72197.841318', '120.149002,30.292705', '商务住宅;住宅区;住宅小区', '', '1.8', '207900平方米', '31920', '仓基新村社区于2001年4月正式成立,东沿京杭运河,西靠湖墅南路,南德胜桥,北至江涨桥,占地面积11.5万平方米,绿地面积约2.2万平方米;社区有2169户居民,5870余人口。辖区单位有小学和幼儿园各一所,建行和农行各一家,以及拱墅区老干部局、拱墅区教师进修学校、景福百货、杭州工业建筑设计院、兴业物业公司、肯德基店、新丰小吃、联华超市等三十余家。    仓基新村社区于2001年4月正式成立,东沿京杭运河,西靠湖墅南路,南德胜桥,北至江涨桥,占地面积11.5万平方米,绿地面积约2.2万平方米;社区有2169户居民,5870余人口。辖区单位有小学和幼儿园各一所,建行和农行各一家,以及拱墅区老干部局、拱墅区教师进修学校、景福百货、杭州工业建筑设计院、兴业物业公司、肯德基店、新丰小吃、联华超市等三十余家。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CFGU', '330100', '120.12968,30.351551;120.129982,30.350527;120.130147,30.34963;120.129919,30.349614;120.128991,30.349539;120.128967,30.349913;120.128861,30.350425;120.128685,30.350947;120.128594,30.351451;120.12968,30.351551', '凯喜雅·锦河湾', '杭州市余杭区好运路和储运路交叉口', '杭州市', '', '19975.458048', '120.129378,30.350543', '商务住宅;住宅区;住宅小区', '500个', '2.5', '76000平方米', '21523', '凯喜雅锦河湾是由凯喜雅房产打造的首个“锦制”生活精品住宅,城北双水景运河文化住区,也是运河新城核心区首发住宅楼盘。    项目位于运河新城核心区,好运路和储运路路口,西临清澈天然河道,东依京杭大运河。总建筑面积7.6万㎡,7幢建筑南低北高组合,主力户型87~128㎡,宽景奢适,紧凑而不局促。遵循国际生态理念,超面宽景观园林设计,精工屋顶花园,配以浪漫的法式园林。在项目东侧,规划有运河生态岛,两河一园,珍藏360度天赋美景,稀缺的“绿肺”功能更丰富了锦河湾的风景线,描绘了一副“左右皆美景”的锦绣书卷。    咫尺运河印象5万方立体商业,周边25万方商业旗舰万达广场、西田城、欧尚超市等大型主题商业相继进驻,加上运河新城自身规划的银河埠商贸区,生活倍添魅力。    上塘高架勾运路出口、规划中地铁4号线站点和水上巴士站点均在凯喜雅锦河湾300米半径圈内,距离城市核心9公里,立体化交通交织繁华,接轨城市通行速度。    运河新城是国内第一个以运河为中心景观建设的市级新城大项目。以高起点规划,打造兼具运河特色、杭州特点、时代特征,集生活居住、商务办公、商贸物流、旅游休闲、文化创意、总部经济为一体的城北新中心。', '2015-01-31', '1.68元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CG08', '330100', '120.156151,30.271971;120.15647,30.271966;120.156648,30.271663;120.156684,30.271468;120.156664,30.271282;120.156061,30.271321;120.156151,30.271971', '混堂桥小区', '杭州市下城区混堂桥26号', '杭州市', '0103000020E61000000100000007000000368FC360FE095E40DE7536E49F453E408733BF9A030A5E40BA9F53909F453E40F73E5585060A5E408388D4B48B453E409DF3531C070A5E4018E945ED7E453E407A1D71C8060A5E4054FEB5BC72453E4096CB46E7FC095E40D0B7054B75453E40368FC360FE095E40DE7536E49F453E40', '3122.844626', '120.156369,30.271602', '商务住宅;住宅区;住宅小区', '', 'None', '', '41695', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CG2V', '330100', '120.042657,30.286834;120.042744,30.286785;120.042836,30.286776;120.044977,30.287459;120.044676,30.288209;120.044623,30.288284;120.04456,30.288309;120.044483,30.288316;120.044415,30.288308;120.044284,30.288281;120.043432,30.288037;120.042669,30.287808;120.042367,30.287704;120.042657,30.286834', '西溪MOHO', '杭州市余杭区荆长大道与红旗道交汇处', '杭州市', '', '21710.575999', '120.043649,30.287565', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '西溪MOHO为湿地生态商务综合体。西溪MOHO,源于Multiple Office、 Hotel and Home work(多样性的办公、酒店与SOHO综合体)。项目位于文一西路辅道与荆常大道交汇处,西溪科技岛核心区域,与西溪湿地、浙大紫金港高教园区、浙江理工大学、杭师院高教园区紧邻,恒生科技园、海创园等众多科技产业园区紧密依托。项目总建筑面积174631m2,规划建设5幢7—9层总部研发办公楼群与4幢SOHO基地、1幢主题酒店建筑群沿天然水系景观南北排布。项目立足建设一个融合中小企业总部、研发中心、总裁行宫、办公SOHO、酒店以及多重配套商业为一体的湿地生态商务综合体。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1CR5B', '330100', '120.058117,30.241545;120.058945,30.241623;120.058898,30.242304;120.058551,30.242289;120.058207,30.242265;120.058186,30.242054;120.058117,30.241545', '安乐新村', '杭州市西湖区留下大街55号', '杭州市', '0103000020E61000000100000007000000DD955D30B8035E402783A3E4D53D3E40D0D03FC1C5035E401FF64201DB3D3E4030F31DFCC4035E40A3B08BA2073E3E407A89B14CBF035E40382EE3A6063E3E407D59DAA9B9035E4027F73B14053E3E4072C5C551B9035E40B1DD3D40F73D3E40DD955D30B8035E402783A3E4D53D3E40', '4827.446388', '120.05854,30.241925', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '安乐新村小区很安静,是学区房。交通非常方便。因为物业管理好,所以小区安全性高。西溪湿地尽在咫尺;空气清新。', '', '');
