INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D0FQ', '330100', '120.149631,30.260367;120.150003,30.260401;120.150229,30.260426;120.150278,30.259988;120.149696,30.259941;120.149631,30.260367', '坚匏别墅', '杭州市西湖区北山路附近', '杭州市', '0103000020E61000000100000006000000F0DDE68D93095E4027F56569A7423E4052D32EA699095E4080D8D2A3A9423E404A7A185A9D095E4031074147AB423E40BBD39D279E095E403A5AD5928E423E40E415889E94095E40B9E34D7E8B423E40F0DDE68D93095E4027F56569A7423E40', '2431.588734', '120.14996,30.260181', '商务住宅;住宅区;别墅', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D113', '330100', '120.254198,30.199945;120.254137,30.199891;120.254066,30.199864;120.252465,30.199924;120.252373,30.199949;120.252331,30.200001;120.252362,30.202178;120.254283,30.202127;120.254268,30.201037;120.254233,30.200003;120.254198,30.199945', '顺发·恒园', '杭州市萧山区建设二路与金鸡路交汇处', '杭州市', '', '39298.849835', '120.253304,30.201028', '商务住宅;住宅区;住宅小区', '1145个', '2.0-2.5', '160000平方米', '38851', '顺发恒园傲踞新区核心地段,项目南临建设二路,东临金鸡路,近邻区政府、人民广场、萧山剧院等大型市政配套,更可享受LSE城市生活广场、恒隆广场等高档购物中心。项目周边教育资源尤为丰厚,周边不仅汇集湖滨小学、金山初中等现成优质教育配套,更有多所教育机构就近规划。项目总建筑面积约16万方,规划为68席法式城墅与4幢新古典主义高层。', '2014-07-14', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D1DW', '330100', '120.246559,30.302339;120.248356,30.303263;120.249414,30.301607;120.248433,30.300884;120.248311,30.300858;120.248189,30.300906;120.246559,30.302339', '世茂茂悦府', '杭州市江干区建华路与红普路交汇处西', '杭州市', '0103000020E610000001000000070000003562669FC70F5E402B4EB516664D3E40FC709010E50F5E403C16DBA4A24D3E40884A2366F60F5E40A33EC91D364D3E40D28F8653E60F5E40C1E3DBBB064D3E402C0FD253E40F5E406FBDA607054D3E40868E1D54E20F5E40912BF52C084D3E403562669FC70F5E402B4EB516664D3E40', '32120.273481', '120.248103,30.302043', '商务住宅;住宅区;住宅小区', '746个（配比1:0.87）', '2.4', '120260平方米', '', '世茂东壹号,位于城东新城辐射板块,处于3.9平方公里艮北国际居住区黄金大道核心位置,紧邻沪杭高速、德胜东路、地铁1号线,可畅达杭州中心城区、上海、宁波等地。承袭豪宅思维建造公寓,以高品质、优服务建造12万方尊崇生活领地,把城市的丰富延伸到寓所近地,却与喧嚣保持应有的距离。300米直达130万方七堡段综合体,390万方国际社区保驾护航,商业、教育、医疗、 娱乐、休闲一应俱全。    世茂东壹号,占地面积约3万平方米,总建筑面积约12万平方米,采用法式园林景观规划,与新古典主义建筑风格相依托,打造以人为本、自然生态的人居环境。', '2013-12-29', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D1H9', '330100', '120.018995,30.253135;120.01903,30.253092;120.019035,30.253018;120.019009,30.252904;120.018676,30.250812;120.018393,30.249015;120.018383,30.248916;120.018333,30.248845;120.018239,30.248826;120.017358,30.248935;120.013105,30.249333;120.012947,30.249348;120.012861,30.249382;120.012824,30.24945;120.013241,30.25309;120.013277,30.253192;120.013362,30.253262;120.013525,30.253274;120.016628,30.253193;120.018727,30.253155;120.01893,30.253151;120.018995,30.253135', '西溪华东园', '杭州市余杭区五常大道高教路', '杭州市', '', '213589.499523', '120.015921,30.251161', '商务住宅;住宅区;住宅小区', '', 'None', '', '24835', '华东园位于潮王路30号。建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。小区及周边教育、医疗、商业等设施配套成熟完善,可满足多样化需求。', '', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D1I0', '330100', '120.020849,30.271662;120.02083,30.27159;120.020836,30.271516;120.021055,30.270054;120.020541,30.270026;120.019625,30.269902;120.019549,30.269959;120.019567,30.270161;120.019823,30.271008;120.020015,30.271713;120.020073,30.271891;120.020085,30.272735;120.02006,30.272873;120.019979,30.273254;120.01997,30.273387;120.020011,30.273458;120.021235,30.273756;120.022194,30.273965;120.022298,30.273965;120.022398,30.273905;120.022442,30.273835;120.022778,30.272552;120.022786,30.272251;120.022854,30.271845;120.020849,30.271662', '何母桥农民多高层公寓', '杭州市余杭区高教路何母桥农民高层公寓(草荡)', '杭州市', '', '66561.183491', '120.021111,30.272187', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D3O3', '330100', '120.042417,30.278244;120.042149,30.279986;120.04217,30.280718;120.041559,30.280736;120.041022,30.281376;120.039263,30.283182;120.039112,30.283229;120.038791,30.28321;120.037664,30.282626;120.038544,30.281274;120.039525,30.280278;120.039778,30.279842;120.040024,30.278763;120.04011,30.278448;120.040207,30.278295;120.040829,30.277637;120.040942,30.277598;120.041081,30.277633;120.042433,30.27792;120.042417,30.278244', '大华·西溪风情6期', '杭州市余杭区纬八路与荆长大道交叉口西南50米', '杭州市', '', '112671.218604', '120.040358,30.280402', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '大华西溪风情位于文一、文二西路与绕城公路交界处,距市区仅有10公里,距国家西溪湿地仅有400米,中心水系湖贯穿整个小区,环境很优美,风景也很美,交通便捷,购物方便。  通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。环境优美,丽水成天的风景给予了回归家庭、回归私域的生活体验。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D4C9', '330100', '120.04223,30.252187;120.042218,30.251707;120.042333,30.250388;120.042564,30.248411;120.042092,30.248372;120.041106,30.248204;120.040872,30.24825;120.040634,30.24823;120.040064,30.248156;120.039947,30.248708;120.039827,30.249261;120.039657,30.250375;120.039576,30.250876;120.039503,30.251356;120.039446,30.251972;120.041115,30.25204;120.04223,30.252187', '西溪玫瑰', '杭州市余杭区荆长路100号', '杭州市', '', '91768.998535', '120.041032,30.250188', '商务住宅;住宅区;别墅', '均设有半地下车库', '1.05', '110000平方米', '29614', '西溪玫瑰位于荆长路,紧邻五常大道。绕城高速连接天目山路,灵溪隧道直通西湖景区,与西溪国家湿地咫尺相距。距黄龙体育中心20分钟车程,周边高教路和建设规划中的良睦路、荆长路一起成为联系南北的主干道。    项目总用地面积99523平方米,规划289户。项目导入BLOCK建筑围合庭院思想,超宽楼间距,不凡气度间纯正新都铎(New Tudor)风格大宅与英伦风情景观完美相融,并植入英国皇家气质的管家式物业服务体系,智能化高端园区科技配套一应俱全,是杭州主城以内稀缺罕有的英伦城市排屋,堪称不可再版的上佳地段,稀缺的品质属性无论作为第一居所的自住还是良好预期下的投资均显现出不同于其他的显著优势。    为余杭区距杭州市区最近的地块之一,在道路、公交、旅游、医疗方面已形成了无缝对接。', '2014-08-23', '3.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D4E5', '330100', '120.135777,30.1716;120.136396,30.171675;120.137731,30.171958;120.13894,30.169332;120.136879,30.168586;120.136143,30.169999;120.135912,30.170748;120.135777,30.1716', '璞悦湾', '杭州市滨江区滨文路670号', '杭州市', '0103000020E6100000010000000800000023A30392B0085E405DFE43FAED2B3E4089D349B6BA085E40728A8EE4F22B3E404E29AF95D0085E401B498270052C3E40CD069964E4085E40912A8A57592B3E40962023A0C2085E403F90BC73282B3E4014252191B6085E404B5AF10D852B3E4093C83EC8B2085E407FDB1324B62B3E4023A30392B0085E405DFE43FAED2B3E40', '60430.769531', '120.137265,30.170317', '商务住宅;住宅区;住宅小区', '地面车位：145个，地下车位：1276个', '2.5', '228000平方米', '35556', '万科璞悦湾,位于杭州滨江一桥南,滨文路与西浦路交叉口,东临浦西路、南至滨文路、西至规划西浦路、北至规划七甲路,总占地面积6.6万方,项目总建筑面积约23万方,容积率为2.5,规划6幢高层与12幢洋房,共1771户。万科璞悦湾周边配套齐全,之江大桥、江南大道等道畅达区域各个角落,地铁4号线(规划)、6号线(规划)近在咫尺,未来出行非常方便。同时,这里还汇聚了逸天广场、钱江湾花园等成熟小区;杭二中、杭州国际学校等学校;更紧邻滨江高教园区,浙江中药大学、公安高等专科学校等高校;万科璞悦湾周边更有华润万家、物美(在建)等生活配套又为该项目添色不少。', '2015-03-21', '2.25元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D4QP', '330100', '120.013211,30.245761;120.013383,30.24519;120.014005,30.245219;120.014176,30.244888;120.015624,30.245087;120.015665,30.244457;120.015613,30.244336;120.015746,30.243956;120.015784,30.243821;120.015956,30.243255;120.013533,30.243053;120.013585,30.242532;120.008803,30.242103;120.008709,30.243635;120.008696,30.244386;120.008826,30.244518;120.008818,30.244891;120.009167,30.244948;120.00941,30.245024;120.009459,30.245155;120.009564,30.245315;120.009598,30.245369;120.009746,30.245499;120.009982,30.24552;120.013211,30.245761', '华丰社区(华丰路)', '杭州市余杭区二号路与和睦路交叉口东北50米华丰社区居委会(五常大道)附近', '杭州市', '', '176623.568233', '120.011907,30.243946', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D5QN', '330100', '120.026022,30.285844;120.026796,30.286053;120.026747,30.286204;120.028141,30.286592;120.028205,30.286597;120.028275,30.28656;120.028347,30.2865;120.028653,30.285752;120.029101,30.284677;120.029267,30.284112;120.02925,30.284015;120.028408,30.283778;120.026921,30.283352;120.02688,30.283452;120.026376,30.284714;120.026011,30.285763;120.026022,30.285844', '富力·西溪悦居北区', '杭州市余杭区文一西路与常二路交汇处(乐淘城对面)', '杭州市', '', '62059.727002', '120.027638,30.284974', '商务住宅;住宅区;住宅小区', '总数为2071，车位比：1：2', '2', '281435平方米', '30498', '溪区地处富力R26;西溪悦居的核心地段,未来繁华与西溪湿地的交汇之地。地块东侧即为阿里巴巴淘宝城,西侧迎面未来科技城辽阔版图,南向紧邻广袤的湿地景观和未来科技城规划中大型城市公共中心,尽享稀世天然景观,繁华静谧一步即达。', '2015-06-23', '1.68元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1D5UF', '330100', '120.04431,30.283465;120.044162,30.283438;120.043521,30.283282;120.043485,30.283201;120.043437,30.282512;120.043367,30.282447;120.042862,30.282472;120.042813,30.282535;120.042984,30.284916;120.043056,30.284964;120.044336,30.284974;120.04441,30.284924;120.044428,30.284541;120.044447,30.284353;120.044487,30.284215;120.044398,30.28353;120.04431,30.283465', '西溪公馆', '杭州市余杭区文一西路822号(余杭五常文一西路与荆常大道交界处)', '杭州市', '', '26859.525415', '120.043575,30.283924', '商务住宅;住宅区;住宅小区', '规划中', '1.8', '300000平方米', '', '浙江国恒西溪置业有限公司,项目国恒西溪公馆地块位于余杭五常,文一西路与荆常大道交界处,占地面积245亩,总建筑面积30万平方米,总投资近50亿。    国恒地产以26余亿元飙得了余杭区13和14号“姊妹花”地块,两块地平均溢价超165%,两地平均楼面价达8888元/平米。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DAP0', '330100', '120.104252,30.121943;120.104273,30.122141;120.102697,30.122267;120.102801,30.12355;120.103469,30.123514;120.103505,30.124206;120.103503,30.124771;120.103526,30.124846;120.103584,30.124927;120.103678,30.124948;120.103769,30.124958;120.104855,30.124875;120.105825,30.124745;120.105749,30.123315;120.105633,30.121835;120.104252,30.121943', '回龙雅苑', '杭州市西湖区转塘街道回龙村', '杭州市', '', '67907.499887', '120.104438,30.123372', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DAY0', '330100', '120.237225,30.371211;120.236921,30.371319;120.236063,30.371538;120.235462,30.372902;120.235313,30.373402;120.235308,30.373538;120.235174,30.37368;120.236764,30.3747;120.237861,30.373747;120.238874,30.372343;120.237888,30.371171;120.237589,30.371204;120.237225,30.371211', '保利·罗兰香谷(天都路)', '杭州市江干区天都路与华鹤街交汇处', '杭州市', '', '72243.488186', '120.236976,30.372807', '商务住宅;住宅区;住宅小区', '车位配比：1:0.82（共1722个）
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DAYC', '330100', '120.053835,30.29178;120.05373,30.291837;120.053667,30.291922;120.05361,30.292045;120.053639,30.292159;120.054064,30.292822;120.055438,30.294869;120.055863,30.295448;120.059017,30.295296;120.058184,30.29392;120.057189,30.292466;120.056466,30.291195;120.053835,30.29178', '万科西庐', '杭州市西湖区五常港路与紫霞街交叉口', '杭州市', '', '117085.190193', '120.056215,30.293443', '商务住宅;住宅区;住宅小区', '约1:1；售价24万/个', '2', '217821平方米', '42924', '万科西庐位于杭州西湖区,毗邻西溪国家湿地公园,是万科继西溪蝶园之后又一深耕西溪之作。项目规划排屋、多层花园洋房、小高层和高层公寓。一期总建筑面积约为22万方,规划打造与西溪湿地自然融合的高端人文住区,主力户型为89方三房、138方三房、175方四房。基于万科对于西溪地理文脉的尊重和深度理解,项目独创建筑新风格,在当前杭州房地产市场可谓独树一帜。项目继续万科精装修工程,升级原有精工性能,在居住功能上更具人性化。', '2014-10-18', '3.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DGHO', '330100', '120.103585,30.323037;120.104069,30.323188;120.104591,30.323383;120.10544,30.323674;120.106248,30.323962;120.106337,30.323746;120.106222,30.323685;120.106268,30.323548;120.106306,30.323316;120.106233,30.323131;120.105961,30.322824;120.105003,30.322507;120.104132,30.32223;120.103695,30.322118;120.103508,30.32214;120.103401,30.322182;120.103138,30.322913;120.103585,30.323037', '金地·繁华里', '杭州市拱墅区祥符街道13号', '杭州市', '', '26696.946843', '120.104798,30.322969', '商务住宅;住宅区;住宅小区', '617个；配比1:1', '2.3', '89125平方米', '33226', '', '2015-06-13', '2.9元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DGHV', '330100', '120.137367,30.38238;120.134483,30.382337;120.134413,30.384611;120.137642,30.384648;120.137683,30.382727;120.137364,30.382718;120.137367,30.38238', '恒基旭辉府', '杭州市余杭区康兴路与崇杭街交叉口', '杭州市', '0103000020E610000001000000070000002D23F59ECA085E40FDA4DAA7E3613E408DB7955E9B085E40FE0C6FD6E0613E4010CAFB389A085E408EAED2DD75623E4096236420CF085E40C878944A78623E40C58D5BCCCF085E40D34B8C65FA613E4075E95F92CA085E402D978DCEF9613E402D23F59ECA085E40FDA4DAA7E3613E40', '65473.003295', '120.136033,30.383511', '商务住宅;住宅区;住宅小区', '1997个', '2.5', '278023平方米', '18078', '恒基旭辉府位于杭州大城北,丽水北路与崇杭路交汇处,西侧为京杭大运河,地理位置相对良好。该地块总用地面积约86670平方米,地上总建筑面积约27万平方米,容积率2.5,业态包括沿街商铺、高层住宅及花园洋房。建筑造型设计注重塑造群体形态的可识别性,通过群体空间组合体现整体造型艺术美,使本项目成为大城北板块上一个新的建筑景观、优雅、高贵、别致的新古典主义风格是造型的主题。在建筑造型气质上力求打造一种全新升级版的艺术建筑风格,将在大城市被豪宅客户普遍接受的新古典主义风格做了优化和改善,加大了采光的面积,增加了更为灵动的元素,不变的是其奢华而低调,历久而弥新的建筑品味,重在塑造挺拔、大气、典雅建筑形象,同时给建筑品质生活抹上淡淡的现代气息', '2016-09-30', '1.68元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DGHY', '330100', '120.099025,30.304444;120.10044,30.30459;120.100768,30.302978;120.099328,30.30297;120.098232,30.302979;120.097922,30.304294;120.099025,30.304444', '滨江紫金府', '杭州市西湖区申花路(西至古墩路,北至方家北路)', '杭州市', '0103000020E61000000100000007000000211FF46C56065E40A376BF0AF04D3E4075CDE49B6D065E404BB0389CF94D3E40EF1EA0FB72065E40516859F78F4D3E40EFE4D3635B065E404BAB21718F4D3E40ECDADE6E49065E40F25F2008904D3E40C5E3A25A44065E40785E2A36E64D3E40211FF46C56065E40A376BF0AF04D3E40', '34418.648573', '120.099381,30.303718', '商务住宅;住宅区;住宅小区', '地下约625个，地面约29个', '2.1', '117000平方米', '31592', '滨江紫金府是滨江集团继万家花城之后,再树申花标杆的倾力之作。集萃滨江集团20余载精工,于难以复制的申花中央,悉心营造双地铁名校华宅。项目隶属于西湖区,由8幢臻稀排屋、7幢华贵高层两大物业类型组成,纯法式精工筑品,诠释滨江品质的高度与力度,彰显贵族独有的华贵,致敬杭城精英。滨江紫金府居于古墩路与方家北路交汇处,紧临城西商业航母——银泰城,周边汇集印象城、沃尔玛、世纪联华购物中心、物美文一店、物美莫干山路店等商业综合体,市中心价值不彰自显。项目位于西湖区,浙大紫金港校区、保俶塔实验学校分校、文一街小学政苑校区、学军小学紫金港分校等知名学校周边环绕,令项目的人文氛围更加浓郁。并规划有地铁2号线和5号线经过并设站点,双地铁站的便捷出行,瞬时纵横全城。', '2014-07-05', '3.6元/月/平方米');
