INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DRZL', '330100', '120.203367,30.273409;120.204401,30.273579;120.205414,30.273796;120.206066,30.273826;120.20613,30.272371;120.207273,30.272403;120.207316,30.271903;120.206141,30.271908;120.20621,30.270504;120.203641,30.270472;120.203367,30.273409', '景芳四区', '杭州市江干区昙花庵路238号', '杭州市', '', '81101.45609', '120.204965,30.272088', '商务住宅;住宅区;住宅小区', '', '1.7', '', '35866', '景芳四区作为杭州成熟的一批小区,多年来通过不断的完善和建设,生活配套公共设施齐全,房子以以33至68方之间为主,户型合理,小区整体比较安静。  景芳四区交通状况:公交:20/K20 87/K87 848 864 Y7 20/K20(区间) 18/K18 K215 842/K842;地铁:新塘路站(4号线)。商场: 华日商场、世纪联华、乐购、国美、苏宁、五星电器,景芳三区公园-583米菜场:严家弄农贸市场-326米、五福农贸市场-514米、景芳农贸市场-681米小区:水湘农贸市场。', '', '0.3-0.5元/月/平方米');
