INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DS6Y', '330100', '120.194582,30.233985;120.194459,30.233979;120.193502,30.234811;120.192837,30.235395;120.194192,30.236502;120.194384,30.236455;120.19514,30.235757;120.194459,30.235189;120.195203,30.234457;120.194582,30.233985', '婺江家园(一园)', '杭州市上城区婺江路38号', '杭州市', '', '27948.638479', '120.194137,30.235272', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '小区地址为上城近江路与秋涛路交叉口,开发商为杭州市居住区发展中心有限公司,建筑类别为塔楼、多层,属于发展比较成熟的小区,周边配套齐全,生活便利  。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DS7L', '330100', '120.187908,30.229012;120.18922,30.229899;120.189341,30.22992;120.189421,30.229895;120.190322,30.229443;120.190357,30.229387;120.190357,30.229327;120.190309,30.229276;120.189206,30.228173;120.188978,30.228031;120.188895,30.228024;120.188807,30.228036;120.188608,30.228138;120.187908,30.228933;120.187908,30.229012', '融创大家望江府', '杭州市上城区钱江路393号附近', '杭州市', '', '23341.039712', '120.189108,30.22901', '商务住宅;住宅区;住宅小区', '510个（地面20个，地下490个）；非机动车车位1130个（地上42个，地下1004个）', '2.9', '89132平方米', '71630', '望江府位居杭州钱江新城核心区,望江路与钱江路交汇处,西倚凤凰山南宋皇城遗址,南望钱塘江,紧邻市民中心、万象城和杭州大剧院,坐享CBD核心资源。项目周边云集了众多品牌开发商营造的高端住宅,如蓝色钱江、阳光海岸等,被誉为“杭州顶级豪宅区”。望江府由融创中国与大家房产联合力邀世界知名设计团队打造。传承亚洲顶级豪宅——新加坡爱马仕公寓the MARQ的建筑风范,结合杭州本土气候特点,以高贵的“金茂蓝“干挂石材、玻璃及铝板,营造出现代简约、大气典雅的气质。望江府占地2万平米,建筑面积6万多平米,一共有7幢18-19层的住宅,480户和28间商铺。小区采取全人车分流设计,地下地上双大堂,建筑由绿城设计参照亚洲唯一的爱马仕公寓“MarQ”外立面设计,简约大方,玻璃幕墙与干挂石材结合凸显出项目现代感和高贵典雅的气质。', '2014-04-19', '4.8元/月/平方米');
