INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DV0N', '330100', '120.207419,30.26865;120.207439,30.267383;120.20378,30.26737;120.203785,30.267923;120.20455,30.267934;120.204566,30.268456;120.204597,30.268636;120.205288,30.268644;120.205333,30.269093;120.203696,30.269127;120.20366,30.270391;120.20628,30.270428;120.206245,30.268641;120.207419,30.26865', '景芳3区', '杭州市江干区景芳路162-22号', '杭州市', '', '71564.473392', '120.205449,30.268788', '商务住宅;住宅区;住宅小区', '', '1.8', '134640平方米', '34768', '景芳三区新规划的学区房。东南西北四个门口均有公交车经过。交通非常方便。附近有乐购和银泰百货等的大型超市。幼儿园:景华幼儿园、大地幼教集团中小学:景芳中学、春芽实验学校大学:杭州市江干区社区学院综合商场:华日商场、杭州光明综合商场医院:昭义夫医院、景芳社区卫生服务站邮局:新塘路邮政所银行:中行城东支行、中行新塘支行其他:五福农贸市场、严家弄农贸市场、汽车东站小区内部配套:棋牌室、羽毛球场、停车场', '', '0.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DV91', '330100', '120.180719,30.315145;120.180701,30.314591;120.180668,30.31366;120.18147,30.313438;120.181483,30.314125;120.181468,30.315133;120.180719,30.315145', '星火公寓', '杭州市下城区沈家路108号', '杭州市', '0103000020E6100000010000000700000003B16CE6900B5E40787FBC57AD503E40B056ED9A900B5E40AE9D280989503E40C2DB8310900B5E40381092054C503E4021CD58349D0B5E40DB5207793D503E40EB71DF6A9D0B5E4023DBF97E6A503E405051F52B9D0B5E40EFE3688EAC503E4003B16CE6900B5E40787FBC57AD503E40', '11347.817751', '120.181093,30.314332', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '星火公寓位于下城区沈家路100号,泽和大酒店旁,有500余套多户型精装公寓组成,设单人房、双人房和集体房,户型面积均为40m2,家具、电器厨房、独立卫生间等配套设施齐全,可拎包入住。公交41、46、72、78、219路及快速公交B3皆在本公寓附近有站点,附近公园、沃尔玛超市、医院、酒店等商业俱全,全日制物业保障。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1DVDP', '330100', '120.112805,30.293441;120.112996,30.293441;120.113205,30.293442;120.113243,30.293434;120.113278,30.293417;120.113302,30.293368;120.113269,30.292753;120.11324,30.292677;120.113201,30.292644;120.113109,30.292633;120.112843,30.292634;120.112604,30.292633;120.112342,30.292625;120.112218,30.292614;120.111831,30.292584;120.111568,30.292557;120.111301,30.292531;120.111011,30.292523;120.110437,30.292484;120.109588,30.292411;120.109546,30.292425;120.109533,30.292453;120.109514,30.293193;120.109513,30.293282;120.109535,30.293329;120.109609,30.293343;120.109776,30.293353;120.110232,30.293385;120.110528,30.293435;120.111124,30.293475;120.111403,30.293475;120.11198,30.293462;120.112306,30.293446;120.112805,30.293441', '中天·西城纪', '杭州市拱墅区余杭塘路417号', '杭州市', '', '30382.884789', '120.111344,30.292988', '商务住宅;住宅区;住宅小区', '约696个', '2.8', '180000平方米', '26881', '中天&#8226;西城纪总建筑面积约11万方,分布为5幢建筑,按照“E”字形沿余杭塘河排布,北沿余杭塘路。北临余杭塘路,西靠丰潭路,南临余杭塘河,距城西银泰城约1000米,位于申花板块的核心腹地。即将开通的余杭塘路(双向六车道),打通了城市东西动脉,交通便利,各项配套完善成熟,延续传统文教区繁华生活的同时,又优享银泰城为核心的新兴城核心CBD的板块活力及发展前景,成为城西置业的首选,交通通达便利、车位充裕。西城纪1号楼处于小区主入口最中心位置,建筑面积约为10000 ㎡,东西朝向,总层高14层。1、2层呈“T”型结构,1层设独立大堂、会客休息区、电梯厅、沿河架空层休憩区。2层整层商业办公、层高4.5米,面积约1250 ㎡。3层-14层标准层,面积约780 ㎡左右,层高4.2米,每层由12个65 ㎡模块组成。', '2013-05-26', '3.78元/月/平方米');
