INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1ELUF', '330100', '120.078493,30.315773;120.078509,30.315893;120.078568,30.315949;120.078707,30.316018;120.079335,30.316226;120.079681,30.315279;120.080027,30.314352;120.080013,30.314304;120.079972,30.314284;120.079862,30.314258;120.079475,30.314163;120.079051,30.31405;120.078493,30.315773', '爱尚里', '杭州市西湖区振华路三墩小学西侧', '杭州市', '', '17818.478577', '120.079228,30.315112', '商务住宅;住宅区;住宅小区', '机动车位401个，非机动车位3013个', '3', '80000平方米', '18000', '爱尚里北临振华路,可快速到达西湖、武林等商业圈,交通便捷,还有西溪湿地、银泰都市综合体、五里塘生态休闲商务综合体、沃尔玛印象城等大型城市配套,尽享时尚都市潮流生活 INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1ELXI', '330100', '120.175708,30.289532;120.175802,30.289518;120.176524,30.288702;120.176345,30.288465;120.176078,30.288454;120.175926,30.288458;120.175855,30.288495;120.175707,30.288488;120.175559,30.288482;120.175407,30.288499;120.175575,30.289064;120.175708,30.289532', '朝晖现代城', '杭州市下城区潮王路2号', '杭州市', '', '6364.818886', '120.175922,30.288864', '商务住宅;住宅区;住宅区', '', 'None', '', '', '现代现代城是野风房地产打造品牌的经典楼盘,位于潮王路和绍兴路交界处。该物业由23幢高层和小高层建筑及一幢现代之窗大厦(会所)组成,总建筑面积187240平方米,整个园区采用现代阶梯式组团布局规则,具现代时尚风格.朝晖现代城占地366亩,总建筑面积约50万平方米。小区以上塘河支流,潮王路延伸段为分界,自然形成北、中、南三个区域,以高层和小高层构成,并由“翠湖”“景湖”两个景观湖,“沁春园”“满庭芳”“蕙兰居”三个主题中庭花园,及“都市之星”“会所广场”“缤纷广场”三大广庭围绕。另外还配备大型中心会所,现有游泳池、健身房、美容中心、咖啡吧等生活、娱乐设施。完全人车分流体系营造园区恬然有序居住氛围,让您感受到现代与古朴,喧嚣与宁静的天然融合。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1ELXS', '330100', '120.248177,30.311301;120.24836,30.312857;120.248357,30.312919;120.248349,30.31297;120.248323,30.31301;120.248268,30.313046;120.247304,30.313406;120.247257,30.31343;120.247205,30.313436;120.247138,30.313424;120.247045,30.313388;120.245985,30.311878;120.245952,30.311809;120.245938,30.311685;120.246002,30.311593;120.24671,30.310994;120.248181,30.311296;120.248177,30.311301', '保利·梧桐语', '杭州市江干区红普路与九州路交汇处西侧', '杭州市', '', '37024.570064', '120.247263,30.312147', '商务住宅;住宅区;住宅小区', '约900个（配比1:0.9）', '2.4', '150000平方米', '27306', '保利梧桐语位于城东新城,距离地铁一号线九和路站点仅800米左右。随着火车新东站的投入运营、八大综合体的规划营建、德胜快速高架的全线开通,昭示着城东新城不仅是杭州的枢纽中心,更是城市未来价值版图的引领者。同时区域内品牌房企云集,众星拱月的力量合集,将使保利梧桐语所在的区域,成为杭城最瞩目的人居板块,成倍升级人居价值。    作为目前城东新城核心罕有的远离主干道的住区,保利·梧桐语最大化地隔绝了交通噪音、扬尘,使梧桐语在享受迅捷交通的同时,避免了车水马龙的轰鸣和人流通行的喧闹,堪称都会繁华中的静好住区。    保利梧桐语是保利地产的城市高端产品系列,在上海、南京、成都都有开发,而且保利表示,项目产品的研发将追求“舒适性”的极致,为“挑剔型”的首置、首改客户带来全新的居住体验。', '2016-06-26', '2.25元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1ELYO', '330100', '120.175069,30.239625;120.175498,30.239489;120.176046,30.239263;120.176049,30.239237;120.176044,30.239212;120.175566,30.238583;120.175215,30.238124;120.17488,30.238215;120.175085,30.238803;120.174801,30.238886;120.174902,30.239268;120.175014,30.239611;120.175038,30.239625;120.175069,30.239625', '断河头小区', '杭州市上城区建国南路67号附近', '杭州市', '', '9405.844084', '120.175334,30.238953', '商务住宅;住宅区;住宅小区', '', '1.2', '7800平方米', '28553', '本小区毗邻西湖风景区河坊街、南宋江御街、鼓楼、中东河、胡雪岩故居着明旅游景点。 2、周边配套:餐饮、银行、家电卖场、大型超市齐全. 中小学:杭州建兰中学、杭州饮马井巷小学、杭州市抚宁巷小学幼儿园:天艺幼儿园、江城路幼儿园商场:悦盈综合商店(杭州) 邮局:杭州市河坊街邮政支局银行:中国农业银行杭州市中山支行滨江分理处、中国工商银行杭州市江城支行望江储蓄所医院:铁路中心医院、杭州中兴医院其他:于谦故居(祠堂巷)', '', '3.6-4.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1EM0I', '330100', '120.043907,30.293713;120.043939,30.293044;120.045433,30.293042;120.04546,30.293787;120.044079,30.293783;120.043985,30.293762;120.043907,30.293713', '豪波西溪润景', '杭州市余杭区创意二路', '杭州市', '0103000020E6100000010000000700000031444E5FCF025E40F96871C6304B3E40360186E5CF025E40FD497CEE044B3E40304AD05FE8025E40BC5AEECC044B3E40AD510FD1E8025E406DFDF49F354B3E402FDCB930D2025E40EB1ED95C354B3E40EF2076A6D0025E40BCCE86FC334B3E4031444E5FCF025E40F96871C6304B3E40', '10254.090398', '120.044688,30.293415', '商务住宅;住宅区;住宅小区', '570个', '2.97', '60493.51平方米', '16072', '豪波西溪润景,总建筑面积约60493.51平方米,用地面积13333.50平方米,其中商业约4000平方米,共有停车位570个,建筑密度29.98%,容积率2.97,绿化率25%。本项目由两幢10层建筑半围合而成,规划1-2层为部分商业、3-4层为平层、5-10层为LOFT,合计共560套房源,主力户型面积在43-83平方米, LOFT每层层高约4.79米,超高空间利用率,更有超级中央水景、全屋顶花园、生态阳光中庭打造360°全景LOFT花园式办公', '2014-05-08', '3.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1EM1Z', '330100', '120.199849,30.352997;120.199539,30.352901;120.199294,30.352856;120.198917,30.352849;120.198656,30.352869;120.197876,30.353204;120.197795,30.353265;120.197751,30.353349;120.197968,30.353661;120.198767,30.354329;120.199278,30.35459;120.200683,30.355103;120.200795,30.355104;120.200856,30.355052;120.201361,30.353705;120.201324,30.353582;120.200436,30.353239;120.199849,30.352997', '绿城西子·田园牧歌风禾苑', '杭州市拱墅区建工路26号', '杭州市', '', '44801.675105', '120.199688,30.35385', '商务住宅;住宅区;住宅小区', '', '1.6', '550000平方米', '27411', '', '', '2.80元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1EMMX', '330100', '120.01778,30.241321;120.017587,30.242312;120.01785,30.242576;120.018027,30.242641;120.01918,30.242711;120.019304,30.242646;120.019357,30.242512;120.01957,30.24133;120.019073,30.24126;120.01896,30.241251;120.018842,30.241244;120.018805,30.241293;120.01851,30.241311;120.01786,30.241274;120.01778,30.241321', '翡翠城灵峰苑', '杭州市余杭区高教路与和睦路交汇处', '杭州市', '', '21930.819521', '120.018584,30.241963', '商务住宅;住宅区;住宅小区', '12.8万元/个', '1.3', '1500000平方米', '', '翡翠城绿城集团联手铁路投资集团在杭州城西西溪板块合力开发的大型社区,紧邻约10平方公里的西溪国家湿地公园。翡翠城占地约1400亩,总建筑面积约150万平方米,规划有多层、高层、排屋等住宅,还有社区商业中心、运动中心、幼儿园、超市、酒店、医疗服务中心等,建成后将形成一个8000多户人家、约3万人口的大型城市社区,是杭州罕有的集生活、休闲、商业、娱乐、运动、教育等功能于一体的现代社区。   翡翠城拥有天目山路延伸段、西溪路、文一西路、五常大道、高教路等通达的交通网络,开车至西湖景区仅需约十分钟,距黄龙商务区仅约10公里,周边的各项城市配套资源丰富,西溪印象城、西溪天堂、省委党校、规划杭师大、小和山高教园区、杭州第十医院、宏丰家居城等城市资源日渐完善。', '2012-10-02', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1ENV3', '330100', '120.133788,30.31632;120.132116,30.31638;120.13203,30.316508;120.132078,30.319138;120.132087,30.319204;120.132131,30.319249;120.134143,30.319097;120.134181,30.319004;120.133886,30.31642;120.133788,30.31632', '九龙仓·碧玺', '杭州市拱墅区桥弄街63号', '杭州市', '', '50905.700251', '120.133041,30.317795', '商务住宅;住宅区;住宅小区', '1737个', '2.1', '225000平方米', '45398', '九龙仓碧玺位于拱墅小河路、桥弄街交汇处西南角,身处最具人居价值与投资价值的杭州拱墅区拱宸桥西板块,距离武林广场驱车仅10分钟。交通由上塘高架、石祥快速路、登云路多条城市主干道汇合,邻近以运河为中心的三条水上黄金旅游路线。规划中的地铁5号线,2015年建成后,即刻贯通海陆铁三维交通网。  璞俪洋房以豪华的平层官邸组成的多层花园洋房作为整个小区的标杆,面积段涵盖了155—320方,包含底越、标准层、顶层平层大套等户型。全部采用带电梯精装修设计,装修标准5000—5500元/平方米,囊括了唯宝、高仪、弗兰卡、西门子、施耐德等一众国际品牌。小区由一条南北景观主轴贯穿假日广场、众乐园、四季花园3大主题景观区。身价不菲的大香樟、沙朴、大银杏、榉树,与不同季节的植被搭配,魔纹花坛、玫瑰庭院、风信子庭院、丁香庭院……一年四季都弥漫美景的心情与艺术品味。  玺悦公馆以高品质的舒适高层做为主打住宅类型,户型面积以90方的小户型为主,同时也涵盖了120—180方的改善类户型。楼层由14层到32层,为桥西第一高度。小区在6#楼设置会所,地上800方地下2500方,带有恒温泳池,方便业主的休闲健身。', '2013-03-04', '2.25元/月/平方米');
