INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EA71', '330100', '120.050652,30.367414;120.050648,30.367174;120.050616,30.367105;120.050557,30.367058;120.050476,30.36702;120.048866,30.367004;120.048741,30.367157;120.048626,30.368881;120.050475,30.368941;120.050631,30.368847;120.050662,30.367999;120.050652,30.367414', '九衡公寓', '杭州市余杭区余杭良渚镇良周路(良渚镇商贸区块核心)', '杭州市', '', '33726.8603', '120.049671,30.367974', '商务住宅;住宅区;住宅小区', '1:1；700余个', '2', '110000平方米', '20069', '郡原九衡公寓位于杭州余杭区良渚镇商贸区块核心,东西大道与良周路交汇处,紧邻规划地铁二号线,通过莫干山路和古墩路延伸段与主城区紧密相连。良渚镇商贸区北侧为中国文化——良渚遗址,西北侧有建筑大师David Chipperfield担纲设计的良渚博物院,人文气息浓郁。在良渚镇商贸区规划中,该区块将建设成布局合理、交通便捷、环境优美、功能完善的现代化新镇区。随着古墩路延伸段的顺利通车,该商贸区与大城西融为一体,共享三墩成熟配套。郡原九衡公寓是郡原地产继成功开发公元大厦、九树公寓两个高端房产品之后,将高端房产品的基因植入城市主流公寓的精心尝试之一,同时也是小户型公寓从现代主义建筑风格向新古典主义建筑风格延伸的一次尝试。郡原地产将以精巧户型、精彩立面、精美园林为九衡公寓内涵,将其打造成杭州城北新一代精致公寓的标杆。', '2012-02-13', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EAO2', '330100', '120.110667,30.400786;120.111784,30.400905;120.112946,30.401006;120.113061,30.399621;120.110935,30.399452;120.110622,30.400681;120.110667,30.400786', '花和雅居', '杭州市余杭区陈章线', '杭州市', '0103000020E61000000100000007000000C66F0A2B15075E40D5B14AE999663E40D40D147827075E408ACDC7B5A1663E40B20DDC813A075E40F17F4754A8663E40FF5C34643C075E4079CBD58F4D663E40D53E1D8F19075E4061527C7C42663E40F60D4C6E14075E40EA20AF0793663E40C66F0A2B15075E40D5B14AE999663E40', '28107.667599', '120.111889,30.400229', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EJIO', '330100', '120.198834,30.297424;120.200816,30.296748;120.200255,30.295879;120.200105,30.295639;120.199971,30.295452;120.199877,30.29552;120.199335,30.295909;120.198474,30.296292;120.198834,30.297424', '紫玉福邸', '杭州市江干区新风路888', '杭州市', '', '22744.144684', '120.199581,30.296499', '商务住宅;住宅区;住宅小区', '1296个', '2.5', '92900平方米', '36069', '项目位居秋涛北路与机场路交叉口附近,项目距武林广场仅4公里,坐享“武林黄金四公里圈”,藏尽主城繁华万象。同时,一条杭州最美的香樟大道——机场路,一湾自然生态水岸——麦庙港河,令本案贵雅之气与生俱来。    项目总建筑面积约9.29万平米,共有522户,由12幢16层高层住宅和2层商铺组成,并以点式结合板式布局,户型面积区间在89-180平米。户户南北通透,全明布局,主力户型139平米采用阔绰三房可变四房设计,并布置三卫双套间,私享独立电梯厅,营造空间递进礼制,成就一方静谧领地;120平米同样以三房可变四房为亮点,引入双卫双阳台,彰显主次有序的从容气度;少量89平米户型,更创造性做到可变四房双卫,三室朝南设计;跃层特赠送大面积功能空间。    从整体规划、园林设计,到户型打造,本案始终贯穿“中正平和”的规划理念。于此同时,项目在每一个环节,更是极尽考究,无论是石材干挂立面的新古典主义建筑,还是围合包容的园林景观,抑或主次有序的户型空间等,都将紫玉福邸诗礼门庭的温润、优雅气质,彰显得淋漓尽致。    作为杭钢集团旗下浙江汇元公司2013年的扛鼎力作,紫玉福邸势必将成为主城核心,独树一帜的高端公寓。', '2015-02-28', '2.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EUTC', '330100', '120.210997,30.36056;120.21089,30.360559;120.210783,30.360639;120.210728,30.360721;120.210153,30.36206;120.211041,30.362392;120.212481,30.362488;120.213201,30.362593;120.213488,30.362692;120.213733,30.362776;120.213821,30.362824;120.213872,30.362847;120.213894,30.362813;120.213888,30.362766;120.213849,30.362658;120.213722,30.362367;120.213558,30.36213;120.213359,30.361913;120.21292,30.361548;120.210997,30.36056', '田园秋韵苑', '杭州市拱墅区笕丁路附近', '杭州市', '', '38597.041185', '120.211829,30.361775', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '田园项目于2010年正式开工建设,是杭州市乃至浙江省开工最早、建设规模最大的公共租赁房项目。项目位于半山田园区块,沿笕丁路、天鹤路和广济路分为田园春晓苑、田园夏意苑、田园秋韵苑3个区块,总用地面积约13.58万平方米,总建筑面积约33.58万平方米,共设置31幢高层、小高层住宅,3幢单身公寓及1幢服务中心楼。项目总户数4693户,可容纳万余人入住。设计有35平方米左右单身公寓、50平方米左右一居室户型和60平方米左右两居室户型。', '', '');
