INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EUV7', '330100', '120.272,30.192082;120.271975,30.19181;120.270673,30.191834;120.270584,30.191899;120.27056,30.19203;120.270672,30.193926;120.272178,30.193846;120.272,30.192082', '东方一号', '杭州市萧山区建设一路与宁东路交叉口往南180米', '杭州市', '0103000020E61000000100000008000000C520B07268115E40782634492C313E401895D40968115E40B70BCD751A313E4041BAD8B452115E40C84274081C313E4089B48D3F51115E409622F94A20313E40C5E6E3DA50115E40D3D9C9E028313E4059FCA6B052115E4017D86322A5313E40342C465D6B115E40DE7536E49F313E40C520B07268115E40782634492C313E40', '27522.813405', '120.271342,30.192867', '商务住宅;住宅区;住宅小区', '约500个', '2.5', '67511平方米', '27116', '东方一号,位于萧山经济技术开发区,项目东临宁东路、南邻萧山“塞纳河”北塘河,北临建设一路,往西约300米即可达到贯穿萧山的市心北路,市心北路也是连通杭州和萧山的主轴线。项目距离地铁2号线建设一路站300余米,步行可达,交通便捷。', '2016-07-10', '3.3元/月/平方米');
