INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EW20', '330100', '120.226078,30.185812;120.226047,30.185809;120.225673,30.185871;120.225162,30.185953;120.22513,30.185975;120.225108,30.186013;120.2251,30.186082;120.225096,30.186271;120.225115,30.186344;120.225184,30.186594;120.225232,30.186673;120.225263,30.186685;120.225303,30.18669;120.225338,30.186687;120.225384,30.186684;120.225424,30.18668;120.22546,30.18667;120.2255,30.186658;120.225619,30.186647;120.226296,30.186448;120.226325,30.186433;120.226078,30.185812', '水晶湾城市雅苑', '杭州市滨江区人民路与滨安路交叉口西北100米', '杭州市', '', '7213.884305', '120.225663,30.186249', '商务住宅;住宅区;住宅小区', '', 'None', '', '31198', '小区位于滨安路与西兴固陵路交叉口,只有一栋,分两个单元,以灰白外墙外观,小区周边配套完善,在西兴百年老镇街上。装修情况:毛坯;安保系统:电子监控智能化设施:宽带入户电梯品牌:品牌电梯外墙:面砖;进户门:高级防盗门配套:医院、超市、银行、综合商场等完善生活配套设施。休闲商业广场', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EW23', '330100', '120.227314,30.291996;120.227237,30.291791;120.226745,30.2918;120.225699,30.291843;120.224631,30.291803;120.224349,30.292546;120.22444,30.292637;120.225728,30.292844;120.226564,30.292841;120.22722,30.292773;120.227314,30.291996', '新中宇·维萨', '杭州市江干区明月桥路与新塘路交汇处(地铁1号线彭埠站D出口南200米)', '杭州市', '', '24689.699657', '120.225911,30.292308', '商务住宅;住宅区;住宅小区', '714个', '2.9', '120000平方米', '37762', '新中宇维萨,汲取世界著名建筑的创意精神,于城东新城正中央,塑造独具摩登气质的曲线建筑。项目总建筑面积约12万方,规划为3幢高层住宅和1幢小高层住宅,以连动的海浪型流线面层、建筑体块的逐层跌落、以及错位双层挑空露台等,赋予原本静止的建筑以动态韵律美。维萨,新中宇进驻杭城之开篇巨著,以曲线摩登建筑的名义耀目杭州。  项目地处新塘路与环站东路交汇口,零距离地铁1、4号线彭埠双站点,1000米即至新火车东站枢纽,畅享枢纽立体交通体系下的磁悬浮、高铁、地铁、城际大巴、快速公交、运河水上巴士等交通工具,快速通达全城,畅享长三角一小时生活圈。  新中宇?维萨,精研城市高端精英族群生活习性,为少数懂得的人定制非同寻常的空间格局和生活动线。以摩登89为主,89—165方特色户型以独特设计赋予空间摩登型、焕新型、魔力型、尊奢型等精神魅力,浪漫优雅的弧形挑高阳台、生动别致的情调飘窗、珍藏时装的奢侈衣库、以及敞阔到可以举办PARTY的大开间餐客厅、功能齐全的超豪华套房设计等等,放纵居者每一种巅峰享受。', '2013-06-10', '2.85元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EW25', '330100', '120.214728,30.309233;120.214873,30.308962;120.216015,30.308512;120.216238,30.308498;120.216793,30.308487;120.217509,30.308654;120.219143,30.309219;120.219191,30.30939;120.218625,30.310152;120.218313,30.310109;120.217516,30.310027;120.217232,30.310002;120.215875,30.310312;120.214728,30.309233', '万科草庄西岸', '杭州市江干区机场路355号', '杭州市', '', '49687.268805', '120.216906,30.309376', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '万科草庄西岸,位于城东新城核心区旁,靠近地铁1号线,距火车东站约2公里,距武林广场约7公里。项目北揽2.5万㎡草庄公园,东依逾60米笕桥港奢阔景观带,西拥30米市政绿化,坐拥城东新城自然景观资源。', '', '');
