INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF2H80O', '330100', '120.254292,30.121966;120.25333,30.121828;120.252004,30.121792;120.251894,30.121757;120.251827,30.121648;120.251698,30.119834;120.251686,30.119719;120.251701,30.11959;120.251795,30.119314;120.251961,30.119249;120.254831,30.119231;120.254976,30.119319;120.25504,30.121945;120.254292,30.121966', '盛和居·紫荆园', '杭州市萧山区蜀山路东100米', '杭州市', '', '77466.343572', '120.253408,30.120552', '商务住宅;住宅区;住宅小区', '1397个 车位比1：0.92', '1.49', '263280平方米', '14000', '盛和居紫荆园是一个27万方的大型精装修高品质老年养生社区。它除一般居住设施外,还专门设计有医疗护理、文化娱乐、生活服务等适宜老年人需要的特殊室内配套设施和室外环境空间。    一期工程已开工建设,均为多层电梯公寓及相关老年养生设施,如:医院、托老公寓等。一期项目主力户型70---90平方,为一室二厅、二室二厅。    盛和居紫荆园老年养生公寓采取会员制入住模式,具备相关会员条件的老年人即可申请入住。', '2012-09-03', '6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF2HJJ6', '330100', '120.187596,30.120965;120.186791,30.12085;120.186634,30.121719;120.18991,30.121955;120.189957,30.121857;120.188448,30.119936;120.18825,30.120173;120.187822,30.120063;120.187596,30.120965', '御湘湖', '杭州市萧山区湘湖路3333号,湘湖旅游度假区内', '杭州市', '', '33174.752081', '120.188248,30.121173', '商务住宅;住宅区;住宅小区', '270个', '1.76', '52922平方米', '', '三江国际御湘湖项目是由国内房地产百强企业三江集团打造的,也是三江集团回归杭州后首个高端项目。项目位于国家4A级旅游风景区湘湖内,北临风情大道,东沿东风河,南临规划湘湖三期湖面,西靠时代大道。项目总占地面积35782平米,规划建筑面积52922平方米,项目由8栋7层高的法式多层电梯寓所、两栋2-3层的名流会所、2幢6层高的企业办公楼组成,项目东侧规划建设两栋双主题高端会所。', '2013-12-21', '6.6元/月/平方米');
