INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF33XAP', '330100', '120.236747,30.205577;120.23785,30.205496;120.237844,30.204146;120.236835,30.204115;120.236773,30.204162;120.236755,30.204971;120.236747,30.205577', '风情雅苑', '杭州市萧山区风情大道239号', '杭州市', '0103000020E61000000100000007000000459BE3DC260F5E404FCFBBB1A0343E40A1D634EF380F5E407575C7629B343E4030630AD6380F5E40F69B89E942343E4015E3FC4D280F5E40809F71E140343E40DAE4F049270F5E400116F9F543343E40878A71FE260F5E40E0A0BDFA78343E40459BE3DC260F5E404FCFBBB1A0343E40', '13917.339152', '120.237296,30.204837', '商务住宅;住宅区;住宅小区', '', '2', '120000平方米', '', '小区位于萧山萧山区风情大道武警边防总队旁边,由杭州城建开发有限公司进行开发,建筑面积为120000平方米,总户数为1300户,交通十分便利,周边学校、医院、银行等配套设施十分完善', '', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF34044', '330100', '120.226757,30.227408;120.228358,30.226498;120.228367,30.226451;120.227205,30.225156;120.226425,30.225668;120.225969,30.2252;120.22521,30.225798;120.225207,30.225909;120.226671,30.227406;120.226757,30.227408', '莱蒙水榭春天', '杭州市滨江区飞虹路208号', '杭州市', '', '35852.863973', '120.226778,30.226226', '商务住宅;住宅区;住宅小区', '', 'None', '', '42039', '本项目位于滨江博览城核心区内,紧邻主体育场及地铁上盖物业。东至奥运路,南至滨盛路,西至七甲路,北至规划支路。项目由莱蒙国际开发打造。    整个项目占地28704平方米,总建筑面积约150000平方米,其中住宅面积约85000平方米,写字楼17000平方米,商业约11500平方米。项目预计交付时间为2015年。    莱蒙国际集团有限公司及同集团附属公司于1993年成立于香港,2001年开始全面进入国内房地产市场。莱蒙国际打造了“莱蒙系”和“水榭系”两条优质的产品线,如“水榭系”中的“莱蒙&#8226;水榭花都”、“莱蒙&#8226;水榭山”、“莱蒙水榭春天”为代表的城市中高端住宅品牌。    目前在香港、深圳、东莞、惠州、广州、杭州、常州、天津、南京、成都等地成立分公司或运作项目,形成立足香港、深圳,辐射珠江三角洲、长江三角洲、京津及成渝地区的格局。    2011年3月23日,莱蒙国际集团成功登陆香港联交所主板(HK3688),成为2011年首个港交所成功上市的内地房地产企业。', '', '3-4.5元/月/平方米');
