INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF38QWO', '330100', '120.249634,30.301749;120.249538,30.301762;120.249447,30.301811;120.248427,30.303254;120.248422,30.303316;120.248441,30.303335;120.249948,30.303955;120.250031,30.303965;120.250128,30.303911;120.250167,30.303825;120.250184,30.303724;120.25031,30.30302;120.25045,30.30227;120.250388,30.302198;120.249634,30.301749', '招商雍华府', '杭州市江干区建华路与红普路交汇处', '杭州市', '', '24753.830981', '120.249578,30.30289', '商务住宅;住宅区;住宅小区', '703个（配比1:0.96）', '2.4', '72504平方米', '30990', '半壁武林,不过雍华一府。招商&#8226;雍华府,占据城东新城门户地带,无缝连接武林商圈、钱江新城、城东新城三大中心区。300米咫尺地铁1号线九和路站,约15分直达武林,形成20分钟黄金三角生活圈,接轨国际繁盛生活。    招商雍华府是招商地产进入杭州的两大“雍”字系作品之一,也是招商在全国的第九座雍华府。项目承袭招商地产30年的“造家”精萃,将“爱在”理念深入到每一个细节,赋予生活最高的舒适度。示范全城的90方三室两厅两卫,大面宽采光纳景,让更多自然景观融入生活。主卧套房式设计,配独立卫生间,尽享私密尊崇生活。70-125方舒适人居,灵动空间随心布局,全方位满足各个家庭置业的不同需求,开启杭城高端人居新范本。', '2016-02-20', '2.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF38R3H', '330100', '120.243065,30.167316;120.244039,30.167309;120.24406,30.167016;120.244114,30.16684;120.244156,30.166732;120.244156,30.166608;120.244042,30.166611;120.244039,30.166551;120.243819,30.166547;120.243556,30.166715;120.243234,30.166905;120.243084,30.167021;120.243004,30.167183;120.243065,30.167316', '湘湖居', '杭州市萧山区乐园路', '杭州市', '', '5558.460661', '120.243645,30.166991', '商务住宅;住宅区;住宅小区', '', '2', '44577平方米', '', '湘湖居位于杭州市萧山湘湖旅游度假区,杭州休博园区,项目毗邻越王城山,项目距离地铁一号线湘湖站300余米。湘湖居总建筑面积约40000平方米,由一幢12层板楼和三幢11层点式小高层组成。其中A/B/C三幢位于休博园东侧,独立围合;E幢位于休博园中心区,部分户型更可直面湘湖。', '', '2.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF38VHK', '330100', '120.065348,30.243419;120.065645,30.243523;120.066541,30.241694;120.063833,30.241083;120.063536,30.242065;120.063185,30.242719;120.065348,30.243419', '复地·黄龙和山', '杭州市西湖区西溪路957号(西溪路杨梅山路交叉口)', '杭州市', '0103000020E61000000100000007000000FAB660A92E045E409B3924B5503E3E405709168733045E40E5D2F885573E3E40F6B52E3542045E40B1A371A8DF3D3E40F5D901D715045E401F9F909DB73D3E4098874CF910045E409981CAF8F73D3E40422619390B045E402A1E17D5223E3E40FAB660A92E045E409B3924B5503E3E40', '44952.649697', '120.064854,30.242257', '商务住宅;住宅区;住宅小区', '596个', '1.6', '150000平方米', '25000', '复地黄龙和山,是复地集团入驻杭州多年来山水系“御”字系列高端法式筑品。项目位于西湖区西溪路957号,老和山北面,西溪湿地南面。项目周边尽享双重商业配套,西溪印象城、西溪天堂及各大银行、世纪联华超市等。整个项目占地面积6.38万方,规划建筑总面积约15万方,规划为三个部分,住宅部分占地4.81万方,由9幢多层电梯洋房和14幢联体排屋组成,总户数631户;商业部分一二层为小区的商业配套,每户面积约200-300㎡,商业楼上设计为45-69㎡酒店式公寓,及小区自建配套的西湖区甲级名苑幼儿园。', '2015-09-19', '2.85元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF38WNT', '330100', '120.133762,30.316171;120.134964,30.316095;120.136206,30.315993;120.135871,30.314575;120.13536,30.314484;120.133716,30.314643;120.132009,30.314791;120.132022,30.316091;120.132038,30.316169;120.132092,30.316225;120.132188,30.316267;120.133762,30.316171', '绿城·运河宸园', '杭州市拱墅区杭印路200号', '杭州市', '', '55801.573711', '120.134038,30.315394', '商务住宅;住宅区;住宅小区', '共909个，地下车位700个左右，配比1:1', '2.1', '103055平方米', '53345', '绿城运河宸园地处登云路和小河路交叉口,东邻千年京杭大运河约200米,享桥西历史文化街区百年繁华,北距拱宸桥500米左右,直面运河天地、桥西历史街区、运河文化广场及杭州青少年创意活动中心,五大博物馆群密布环绕,位置优越。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF38WQY', '330100', '120.215321,30.252976;120.215263,30.252872;120.215156,30.25291;120.214992,30.252873;120.214782,30.252759;120.214418,30.252402;120.213881,30.251703;120.212246,30.252543;120.212214,30.252751;120.212732,30.253382;120.213537,30.254372;120.213668,30.254515;120.214258,30.255253;120.214384,30.255177;120.215975,30.25433;120.215585,30.253817;120.215272,30.253343;120.215321,30.252976', '悦玺', '杭州市江干区钱江路与庆春东路交叉口以南', '杭州市', '', '60948.748401', '120.214082,30.253463', '商务住宅;楼宇;商住两用楼宇', '', 'None', '', '38000.0', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF392IA', '330100', '120.102857,30.379075;120.104778,30.379692;120.104877,30.379661;120.104902,30.379598;120.104971,30.378516;120.104971,30.377414;120.104977,30.376498;120.104974,30.375827;120.104919,30.375612;120.104853,30.375536;120.104452,30.375585;120.104291,30.375707;120.103893,30.376685;120.10326,30.377927;120.10316,30.378083;120.103004,30.378303;120.102896,30.378444;120.102828,30.378613;120.102795,30.378773;120.102799,30.378868;120.102857,30.379075', '赞成赞城', '杭州市余杭区棕榈路801号', '杭州市', '', '51572.11449', '120.104175,30.377867', '商务住宅;住宅区;住宅小区', '1177,车位比1:0.88', '2.6', '182308.74平方米', '', '赞成赞城是由浙江赞成集团旗下杭州金樽房地产开发有限公司开发的重点项目。赞成房产,作为杭州本土主流开发商之一,已有20余年的房地产开发经验,开发的足迹遍及杭州、上海、嘉兴、绍兴、湖州、天台、安吉等地。赞成房产已成功开发赞成林风、赞成良著、赞成美树、赞成中心、赞成太和广场等高品质、高性价比的楼盘。    赞成赞城,项目总占地面积51900平米,总建筑面积约18万平米,由13幢高层和9000多平米沿街商铺组成,户型面积88-120平米;楼幢全是南北朝向,西面和南面均直面天然水岸,具有较好的景观资源。而且,在项目内还有一座建于清朝的古桥,名为永丰桥,已有300年左右的历史。这座桥不仅是一座古桥,更是一个活的文化瑰宝,也是赞成赞城最具有历史韵味的景观。', '2015-08-31', '2.4元/月/平方米');
