INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF3A65B', '330100', '120.107194,30.271593;120.106835,30.271542;120.105613,30.271548;120.105499,30.271927;120.105389,30.272299;120.105325,30.27265;120.105799,30.272757;120.106259,30.272854;120.106777,30.272969;120.106829,30.272955;120.106863,30.27288;120.107264,30.271697;120.107194,30.271593', '莲花新村', '杭州市西湖区古荡街道莲花街110号', '杭州市', '', '19078.834517', '120.106294,30.272183', '商务住宅;住宅区;住宅区', '', 'None', '', '', '莲花新村位于莲花街110号。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。小区竣工于1998年,环境幽雅,绿化面积广。房屋建筑颜色采用蓝白色调,与周边环境融合。小区配套齐全,周边店铺多,靠近联丰广场(世纪华联大超市)。小区配套成熟、交通便利', '', '');
