INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF3C887', '330100', '120.092836,30.135037;120.092456,30.135002;120.092098,30.135033;120.090952,30.135319;120.090893,30.135445;120.091293,30.136657;120.091363,30.13684;120.091863,30.136738;120.092395,30.136645;120.092754,30.13662;120.093017,30.136605;120.093339,30.13567;120.093351,30.135285;120.093296,30.135167;120.092836,30.135037', '梧桐燕庐', '杭州市西湖区科海路与狐山路交叉口东北方向', '杭州市', '', '31144.843006', '120.092157,30.135855', '商务住宅;住宅区;住宅小区', '365个', '1.86', '88297平方米', '27418', '钱塘梧桐燕庐位于杭州之江旅游度假区内,背靠杭州人文坐标——狮子山,南面比邻杭州市委党校,西面一路之隔为转塘科技园区,周边群山相连,自然环境得天独厚。项目距武林广场约18公里,距九溪、六和塔景区仅约4-5公里。项目整个园区由7幢法式官邸Townhouse、7幢10-18层迈阿密ARTDECO山景公寓和部分商铺组成。', '2013-05-18', '2.7元/月/平方米');
