INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF3F1PE', '330100', '120.15815,30.17024;120.158225,30.170217;120.159552,30.170658;120.159652,30.170495;120.15964,30.170433;120.159592,30.170367;120.158472,30.169935;120.159336,30.168108;120.15906,30.168009;120.158714,30.167869;120.15868,30.167788;120.158534,30.167739;120.158386,30.167698;120.158284,30.167712;120.15822,30.167772;120.157757,30.16897;120.157251,30.170163;120.156909,30.170818;120.156646,30.171401;120.155388,30.171012;120.155162,30.171524;120.155366,30.171593;120.156847,30.172159;120.157123,30.172264;120.157273,30.172389;120.158196,30.172391;120.158111,30.170337;120.15815,30.17024', '立业园', '杭州市滨江区高教园区', '杭州市', '', '62326.800542', '120.157707,30.17038', '商务住宅;住宅区;宿舍', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF3K7IF', '330100', '120.084571,30.317218;120.084509,30.317317;120.084003,30.318572;120.084138,30.318688;120.084317,30.318799;120.086299,30.319549;120.086654,30.318977;120.08696,30.317921;120.087069,30.317359;120.084654,30.317179;120.084571,30.317218', '中旅·紫金名门', '杭州市西湖区振华路10号', '杭州市', '', '45477.686517', '120.085598,30.318221', '商务住宅;住宅区;住宅小区', '1193个', '3', '210000平方米', '32227', '中旅·紫金名门在西湖区,锻造约21万方的大盘,致敬人文杭州。项目涵盖5幢观景高层、4幢花园洋房及一条沿河风情商业街。百年名校的历史文化底蕴,更赋予本案天赋浓郁的人文内涵。项目北侧的风情商街依傍一条千年古河道,浓郁的江南色彩结合现代休闲味道,凝练出独具特色的新江南韵味。同时依附申花板块鼎盛的商圈,城西银泰城等多重城市综合体和地铁2号线等交通线路陆续呈现,共同交织出本项目的繁华生活主场。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF3LRQN', '330100', '120.170877,30.378948;120.171992,30.380199;120.174562,30.378414;120.172452,30.377481;120.170877,30.378948', '赞成杭家', '杭州市余杭区崇贤街道崇文街与洋湾路交叉口东北侧', '杭州市', '0103000020E61000000100000005000000DFA815A6EF0A5E4076E272BC02613E401DCBBBEA010B5E40CFF8BEB854613E40F54718062C0B5E403A596ABDDF603E404F081D74090B5E4083DC4598A2603E40DFA815A6EF0A5E4076E272BC02613E40', '44460.03121', '120.172549,30.378764', '商务住宅;住宅区;住宅小区', '1179个', '2.5', '174065平方米', '13830', '赞成杭家,处于城北板块,西湖直线距离13.6公里、离武林门直线距离11.8公里,是余杭区与杭州主城区接壤最近、处于绕城内最后的价值洼地。项目总体占地面积约78亩,总建筑面积近18万㎡的大盘,经上塘高架20分钟直达武林门、经秋石高架15分钟直达城东新城、高架在建工程完工后20分钟直达钱江新城,1.5公里范围内,幼儿园、小学、中学等校园林立,更有闻名杭城的十四中咫尺相伺,教育优势明显,超市、医院等配套也一应俱全。不出绕城、离市中心很近,随着城市化进程的发展,大器晚成的城北日益受到市民的关注。翻开大杭州的版图,在主城北面绕城公路以内,你会发现一个房产开发的空白点,那就是运河新城的政府刚确立打造的城北新城的交汇处。近年来,杭州房产开发浪潮向外围突进直到绕城以外,杭州东西南北都满是开发项目,特别是西部,开发商的足迹已远达五常、闲林甚至老余杭,然而运河新城和城北新城双城交汇处却似一个被人遗忘的角落,它的位置比下沙闲林都近,却罕有开发商进驻。眼下,在政府、开发商及相关方面的努力下,正兴起一场开发热潮。作为本土20年的知名开发公司之一的赞成房产,就是在这种情况下,历经30余轮激烈的竞拍,收入赞成杭家地块。', '2016-09-12', '2元/月/平方米');
