INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF4KQL1', '330100', '120.083254,30.34029;120.083294,30.340348;120.085822,30.341198;120.088317,30.34204;120.088456,30.342044;120.088984,30.341095;120.086578,30.34018;120.085364,30.339737;120.084069,30.339335;120.083283,30.340223;120.083254,30.34029', '协安蓝郡', '杭州市余杭区古墩路', '杭州市', '', '58270.600104', '120.086136,30.340681', '商务住宅;住宅区;住宅小区', '约1200个', '2.5', '200000平方米', '25000', '协安蓝郡地处古墩路与金渡北路(金昌路)交界处,占地面积88亩,总建筑面积约20万平方米,由13幢新法式公馆组成,南低北高,礼仪布局,主力户型为约90方、125方、136方和173方;小区规划拥有大尺度的中央庭院和宽楼间距,外立面主要采用石材干挂与晶莹的玻璃构件,晶石建筑风格;而由英国维度景观规划与设计事务所领衔操作的蓝郡园区景观,秉承欧洲经典园林的园艺技法,有序布置多个景观节点,以对称仪式的美来呼应建筑。', '2012-07-14', '0.96元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF4N4FT', '330100', '120.186428,30.349056;120.187029,30.349074;120.187069,30.348406;120.18704,30.348264;120.186621,30.348152;120.18552,30.348128;120.185489,30.348984;120.186428,30.349056', '半山家苑', '杭州市拱墅区明园路1-1', '杭州市', '0103000020E61000000100000008000000C2C3B46FEE0B5E40FB78E8BB5B593E40D4997B48F80B5E4048E2E5E95C593E401B4641F0F80B5E40EDBAB72231593E40CEC29E76F80B5E40C85F5AD427593E40CCEF3499F10B5E4078094E7D20593E404030478FDF0B5E4067D2A6EA1E593E402331410DDF0B5E40C8D3F20357593E40C2C3B46FEE0B5E40FB78E8BB5B593E40', '12370.314874', '120.186275,30.348599', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF541EF', '330100', '120.205376,30.21058;120.206135,30.210967;120.205212,30.212319;120.204708,30.212106;120.204601,30.211825;120.205376,30.21058', '杭州印', '杭州市滨江区闻涛路与江晖路交叉口向东300米处', '杭州市', '0103000020E6100000010000000600000088D860E1240D5E4012312592E8353E40E7E3DA50310D5E400589EDEE01363E40CB2F8331220D5E40C651B9895A363E40B14E95EF190D5E400E492D944C363E40A6EECA2E180D5E40A779C7293A363E4088D860E1240D5E4012312592E8353E40', '12039.683383', '120.20532,30.211448', '商务住宅;住宅区;住宅小区', '911个', '10.5', '10418平方米', '23398', '杭州印,尊踞滨江CBD绝版地段,地处钱江南岸三桥、四桥之间的黄金分割点上,直面钱塘江一线江景核心区,坐拥射潮广场、杭州低碳科技馆、喜来登酒店、星光大道等城市配套,一桥、四桥、三桥、凤凰山及主城区优美城市轮廓线尽收眼底,更可高空远眺西湖,是杭州唯一拥有180°江景及可观赏西湖的高尚物业。双地铁零换乘,距地铁1号线、规划6号线江陵路站800米,距萧山国际机场、武林广场约25分钟车程,现距西湖长桥公园、火车城站约10分钟车程,滨江区政府、文化中心更咫尺可达。而连接吴山广场的望江路隧道不日开工,作为南岸桥头堡的本项目更是万众瞩目。    杭州印总建筑面积约16万平方米,以高端物业集群升级城市价值,缔造滨江CBD划时代的标杆力作,涵盖国际品牌公馆、国际名品广场、国际化甲级写字楼、鼎级私人会所等高端物业,筑造比肩纽约洛克菲勒中心、香港IFC、上海WFC的国际一流城市综合体。    据了解,杭州印由世界500强企业集团倾力打造,并邀请国际顶尖设计机构加拿大B+H建筑师事务所担纲设计,项目以国际顶级城市综合体为规划标准,将杭州城市生态、肌理与成熟配套完美地结合,并汲取西湖与钱塘文化灵感,塑造140米高堪称“雕塑美学”的独特形态。建筑体态形似月影、肌似波光,代表杭州向世界发声,诠释世界地标建筑新方向。', '2014-09-20', '5.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF541NG', '330100', '120.279149,30.34688;120.279653,30.346163;120.280007,30.345533;120.280238,30.345246;120.280576,30.345006;120.281016,30.344839;120.282062,30.3447;120.282716,30.34464;120.282877,30.344765;120.282603,30.34733;120.282421,30.34732;120.282394,30.347438;120.279363,30.347149;120.279385,30.346945;120.279149,30.34688', '朗诗花漫里', '杭州市余杭区博卡路', '杭州市', '', '68000.613855', '120.281283,30.346116', '商务住宅;住宅区;住宅小区', '1:1.1', '1.5', '122858平方米', '22524', '2014年,朗诗绿色地产在大城东地铁口的升级大成之作。    项目位于杭州大城东主轴线上,紧挨杭州唯一的5万方宜家国际家居城,距离地铁一号线乔司站仅300米,是地铁1号线旁唯一的低密度多层花园洋房社区,25分钟畅达武林商圈。    同时项目处于规划中的800万方九乔国际商贸城核心位置,35万方地铁上盖大型综合体近在咫尺,自身带有7000方的一站式服务商业街,让生活享受触手可及的国际都会繁华    项目总建筑面积18万方(其中商业配套面积7千方),容积率1.5,产品面积段包括80㎡--110㎡的三房、四房,其中一楼底跃设计,带私家花园,且赠送阳光地下室,即买一层送一层;顶楼为奢华跃层设计,赠送超大观景露台。    更近城市中心,更丰富城市配套,2014年,期遇80-110㎡大美纯洋房社区', '2016-05-16', '1.80元/月/平方米');
