INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFHNDIS', '330100', '120.065885,30.330107;120.065889,30.330199;120.066007,30.330306;120.06621,30.330471;120.066978,30.33114;120.067093,30.331171;120.067215,30.331122;120.067747,30.330668;120.068286,30.330195;120.068317,30.330123;120.068278,30.33005;120.06725,30.329127;120.067066,30.328994;120.066975,30.328982;120.066886,30.329028;120.065885,30.330107', '金地·栖霞居', '杭州市西湖区金蓬街与榨河巷交汇处', '杭州市', '', '26578.986709', '120.067082,30.330094', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '金地自在城位于西湖区三墩镇,东至通济路,南至金渡北路,项目占地面积546亩,总建筑面积约85万平方米,建筑类型包括城市别墅组团、花园洋房、精装修高层景观公寓、时尚SOHO等。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFLIMBQ', '330100', '120.08434,30.329353;120.084291,30.329301;120.083034,30.329023;120.082925,30.329066;120.082755,30.329825;120.082787,30.329904;120.082859,30.329946;120.084047,30.330218;120.084113,30.330194;120.08434,30.329353', '紫金港湾', '杭州市西湖区董家路和通济路交叉口', '杭州市', '', '12146.571957', '120.083536,30.329615', '商务住宅;住宅区;住宅小区', '197', '2.4', '', '29863', '紫金港湾,新城西繁华核心三墩镇中心,通济路和董家路交叉口,近邻浙江大学紫金港校区、西溪风景旅游园区,为“大城西示范核心区”中心位置。 紫金港湾项目总建筑面积约4.2万平方米,依托浙大紫金港深厚历史人文底蕴,导入艺术生活理念,以艺术的思想和笔触在园区布置4幢18层短板建筑及少量住宅底商,95-125平方米精致户型,打造新城西具艺术文化气息的精致生活家园。', '2008-04-24', '1.4元/月/平方米');
