INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFPA4HA', '330100', '120.101955,30.323008;120.101721,30.323652;120.102766,30.323917;120.103576,30.324116;120.103725,30.323768;120.10378,30.323335;120.103785,30.323231;120.10376,30.3232;120.102089,30.322727;120.101988,30.323015;120.101955,30.323008', '祥符佳苑', '杭州市拱墅区丽晶湾路99号', '杭州市', '', '16439.484465', '120.102796,30.323435', '商务住宅;住宅区;住宅小区', '', 'None', '', '23696', '丽晶湾总建筑面积近7万㎡,位于杭州未来商业中心申花CBD。项目毗邻五里塘河,风景优美,距武林广场直线距离约6.5㎞,交通便捷,是用地日益稀缺的主城区项目之一。 目前板块内商业配套逐渐成熟,包括在建的40万㎡银泰购物中心、已开业的沃尔玛,同时项目周边拱墅区政府将联袂启动六大综合体项目,形成杭州主城的区域商业中心。此外,丽晶湾项目更将零距离享受建设中的百万平米蓝孔雀综合体、央企拟入驻开发的蓝翔综合体等大型城市综合体的超级配套。 发展商建工地产集团作为杭州国际化生活的缔造者,已成功开发世贸丽晶城、欧美中心(EAC)等杭州市中心国际化标杆力作,秉承国际精品人居理念,将丽晶湾项目打造为杭州首家“法国艺术精工住区”', '', '1.05元/月/平方米');
