INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFQYX7M', '330100', '120.069076,30.350378;120.069451,30.350376;120.07024,30.35013;120.071144,30.350089;120.071667,30.350135;120.071957,30.350213;120.072112,30.35032;120.072743,30.350836;120.071007,30.352703;120.070761,30.352718;120.069089,30.35128;120.069076,30.350378', '杭州奥克斯缔逸城', '杭州市余杭区古墩路', '杭州市', '', '55851.07492', '120.070794,30.35117', '商务住宅;住宅区;住宅小区', '1662个', '2.6', '210761平方米', '16000', '奥克斯缔逸城位于城西主轴古墩路上,北至城市规划支路,南至庄墩路,项目总建筑面积21万方,共由8幢高层住宅、1幢酒店式公寓、1幢办公楼组成,主力户型75 方、89方、115方。 园区内部还设置了芳香漫跑道、智趣游乐天地、户外社交区、果园、宠物乐园等功能区。项目屹立于城西繁华,筑就一个生态、智慧、积极向上的年轻社区。缔逸城自配5万方商业包含2万方商业街,定位为美食、教育主题商业街,形成品质生活、美食、休闲娱乐、教育乐园主题业态分区。周边近100万方规划商业环伺,项目以南1.5公里亲亲家园商业街、三墩美食街、知味观、新华书店、建设银行等生活配套一应俱全。', '2017-08-06', '1.68元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFRL1EY', '330100', '120.179864,30.313961;120.179841,30.31376;120.179454,30.313773;120.17922,30.313787;120.179017,30.313799;120.178991,30.313802;120.178982,30.313813;120.178979,30.313827;120.17898,30.313849;120.178988,30.31392;120.178992,30.314025;120.179008,30.315236;120.179054,30.315259;120.180538,30.31521;120.180662,30.315092;120.180619,30.313956;120.179864,30.313961', '东新府', '杭州市下城区沈家路52号', '杭州市', '', '20426.033726', '120.179786,30.314545', '商务住宅;住宅区;住宅小区', '地上和地下总724个，车位配比1:1.28', '2.3', '57861平方米', '36224', '龙元东新府位于下城区东新园板块东北角,北靠沈家路紧邻东新园小区。项目毗邻武林门商圈,与城北体育公园、和平会展中心在同一板块,是下城区南精北快发展战略下迅速崛起的中心板块。区域内生活配套成熟,项目紧邻新天地商业中心,银泰城、东新公园等购物休闲场所都在附近,提供了丰富的生活娱乐。    项目总占地面积2.5万方,共6栋16层新古典主义建筑与8000方法式园林景观,在总体格局的营造上实现了景观面积的最大化。新古典主义的外立面上,全部使用石材干挂,在立面设计上充分重视了入口门厅,阳台及空调板等细部设计,使建筑具有错落的轮廓,所有的细节都散发出奢华的感觉,与时下高端人去的追求相一致。    项目内8000方法式景观,占据了小区中心,沿中轴对称,带来强烈的仪式感,同时令每一户都可以享受尽量多的景观资源。在主入口处,设置了喷泉景观广场,并以架空层作为入口,将地面空间留给景观,广场两侧是围绕小区的底层商业,满足日常需要。    项目主力户型为70方至90方的刚需户型与120方的改善户型,充分满足青年家庭的居住需求。在户型的设计上,从客户的实际需求出发,将各功能区间科学规划,尽量减少了无用空间,因此我们的户型都有非常高的得房率,同时我们也关注于家庭未来前景,预留了可生长户型空间,使每个户型的空间效果发挥到了最大。', '2016-05-13', '2.85元/月/平方米');
