INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFVSL9L', '330100', '120.12091,30.341461;120.123646,30.341368;120.123394,30.340678;120.123442,30.340132;120.123882,30.338886;120.121077,30.338743;120.120883,30.33984;120.12091,30.341461', '越秀·星汇尚城', '杭州市余杭区东吴路与通运口交叉口', '杭州市', '0103000020E6100000010000000800000099F04BFDBC075E4005DCF3FC69573E40FF91E9D0E9075E40A3E6ABE463573E4073A1F2AFE5075E40797764AC36573E40FB3C4679E6075E40B55208E412573E4009A4C4AEED075E407F129F3BC1563E400FD3BEB9BF075E40BABF7ADCB7563E401DE90C8CBC075E4065DF15C1FF563E4099F04BFDBC075E4005DCF3FC69573E40', '62761.744979', '120.122234,30.340096', '商务住宅;住宅区;住宅小区', '1513个，车位比0.91　', '2.5', '167000平方米', '26119', '越秀星汇尚城位于通运路与东吴路的交叉口,由广州开发商越秀地产开发。越秀地产成立于1983年,至今已有32年的历史,开发经验丰富。项目东临冯家浜路,南临祥园北路,西临锦江路,北临上园路,总占地6.7万方左右,总建筑面积约17.6万方,容积率仅2.5,绿地率30%以上,规划14幢18-25层现代古典风格的高层建筑。建筑群利用点式和板式的合理搭配,让每户都能拥有良好的采光和通风,并在东西北面共设约10000㎡的底商风情商业街。', '2017-03-24', '2.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFWMJ1F', '330100', '120.202825,30.169691;120.202802,30.169636;120.202758,30.169595;120.20266,30.169569;120.201518,30.169503;120.20141,30.169556;120.201333,30.169669;120.200999,30.170299;120.200918,30.170576;120.200896,30.171144;120.200901,30.171257;120.200922,30.171314;120.20097,30.171348;120.202554,30.171354;120.202643,30.171312;120.202697,30.171228;120.202825,30.169691', '保亿风景蝶院·观园', '杭州市滨江区江虹路附近', '杭州市', '', '28305.067209', '120.201887,30.170476', '商务住宅;住宅区;住宅小区', '', 'None', '', '30547', '保亿·风景蝶院位于滨江腹地正中心偏南的长河板块、江虹路与乳泉路交汇处、滨江三大商圈之一的白马湖休闲文化圈西北,拥有充满田园风光的生态环境资源。项目距市中心武林广场约25分钟车程,距钱江新城约10分钟车程,距萧山新区约10分钟车程,距城站约15分钟车程,距机场约30分钟车程,距建设中地铁1号滨康站约1500米,距钱塘江约2000米,交通十分便捷。项目总占地面积6.9万平方米,总建筑面积约18万平方米,总户数1580户,容积率2.2,绿化率30%以上,建筑密度22%以下,由11幢14-25F层高层景观公寓组成,70%以上为90M²以下两房及三房户型,全部为板式及局部点式高层产品。', '', '1.7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFXYWP9', '330100', '120.089922,30.137171;120.091247,30.13686;120.090705,30.135306;120.089407,30.135622;120.089922,30.137171', '东日晴好', '杭州市西湖区科海路与狐山路交汇处', '杭州市', '0103000020E61000000100000005000000384C3448C1055E40A9F57EA31D233E40EB36A8FDD6055E406C21C84109233E405B25581CCE055E40DCF3FC69A3223E40244223D8B8055E403D9E961FB8223E40384C3448C1055E40A9F57EA31D233E40', '20026.893253', '120.090322,30.136242', '商务住宅;住宅区;住宅区', '256个', '1.5', '44628.18平方米', '25000', '东日晴好位于杭州西湖区之江国家旅游度假区板块,有着优美自然环境。之江度假区主要建成有宋城、杭州西湖国际高尔夫俱乐部、云栖玫瑰园和九溪玫瑰园等。
