INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFH6SF5B', '330100', '120.048772,30.364306;120.048664,30.362339;120.048755,30.362279;120.05103,30.362251;120.051019,30.363024;120.052105,30.363033;120.052132,30.364265;120.052038,30.364348;120.048772,30.364306', '融信澜天', '杭州市余杭区104国道', '杭州市', '', '56192.086284', '120.05027,30.363378', '商务住宅;住宅区;住宅小区', '机动车位总共1761个，非机动车位总计3111个', '2.5', '248791平方米', '', '融信澜天,是融信集团在杭州的城市排屋项目。项目位于城市主脉古墩路北翼,周边配套有永旺梦乐城等大型综合体。并自带约5000㎡社区幼儿园。融信澜天布局25万方建筑,规划城市排屋、景观洋房、墅质高层等三大物业类型,满足城市精英不同的居住需求。融信澜天于外荟萃万象精彩,于内打造静谧社区,让城市精英们居悠然而享繁华。', '2017-09-05', '2.75元/月/平方米');
