INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFH87MLQ', '330100', '120.123597,30.340937;120.12371,30.341245;120.123769,30.341312;120.123876,30.341342;120.126995,30.341264;120.127057,30.341212;120.127053,30.341132;120.127012,30.341067;120.126539,30.34067;120.125965,30.34038;120.125254,30.340004;120.125004,30.33989;120.124815,30.339858;120.124642,30.339849;120.12441,30.33978;120.123828,30.339588;120.123707,30.339956;120.123635,30.34022;120.123576,30.340618;120.123597,30.340937', '万科北宸之光拱宸', '杭州市余杭区上园路南', '杭州市', '', '35360.7506', '120.12536,30.340706', '商务住宅;住宅区;住宅小区', '机动车位754个；非机动车位2109个', '2.3', '114526平方米', '', '万科·北宸之光,万科主城北首发大作,是万科2013年上市新品及整个版块中体量最大的住区。紧邻城市繁华中轴中河—上塘高架,及城北新核心——运河新城。住区内建有约8000㎡宸天地商业街区,将以餐饮、零售、休闲、亲子教育、公望会以及万科第五食堂等业态,打造出一个大体量的新商业中心,它也将与万达广场(建设中)、运河天地等商圈一同构筑“北宸版块”的新核心。北宸之光以90-130㎡装修成品面世,并以万科“三好住区领航版”之势,成就万科“三好”的首个典范。    产品优势:    紧邻繁华中轴的区域首席大盘    万科·北宸之光,万科主城北首发大作,30万方的恢弘体量,不仅是万科2013年上市新品中体量最大的一个,同时,也是引领当下整个版块的体量之首。北宸之光地处主城北通运路和通益路交叉口,距武林广场约10公里,紧邻被誉为杭城天脊的繁华中轴中河—上塘高架。项目依托繁华中轴,畅达杭州主城绝大部分东西向主干道,并串联起一城繁华:运河商务区、武林商圈、吴山商圈、钱江新城等城市顶级资源。    价值洼地——新生的北宸版块    万科·北宸之光与进驻此区域的大盘共同孕育出了北宸版块。北宸版块直接辐射主城北新核心——运河新城。运河新城是杭州市委市政府的重大战略部署,规划将此区域打造成具有运河特色、杭州特点、时代特征,集生活居住、商务办公、商贸物流、旅游休闲、文化创意、总部经济为一体的主城北部新的城市中心。再加上万达广场(建设中)的强势入驻,促成了北宸版块的巨大前景。    约8000㎡宸天地商街,城北新中心    万科·北宸之光园区中央建有一条约8000方的商业街——宸天地。这条相当于良渚食街5倍大小的综合性商业街区,把北宸之光分为东、西两个片区。与其他社区商业不同的是,万科坚持让商业回归生活的理念,除了满足居民基本商业购物需求外,更重要的是满足与居民生活相关的各项服务。所以宸天地商业街区前期由万科负责招商并且统一运营,业态涵盖了餐饮、零售、休闲、亲子教育、公望会等,并引入了著名的万科第五食堂。同时,万科·北宸之光将与万达广场(建设中)、运河天地等商圈一同打造出整个“北宸版块”的新核心,引导整个片区的商业氛围。    2013万科 “三好”住区领航版,首入城北    万科·北宸之光将以90-130㎡装修成品面世,秉承并延续万科从“住宅性能”全面升级为“三好住区”的品牌核心价值。“好房子、好服务、好邻居”的三好理念,涵括了万科多年来研究践行的住宅性能体系、享誉业界的万科物业、全新的社区商业解决方案——“九三学社”,以及导入基于良渚文化村《村民公约》演化的城市公寓版《邻里公约》。北宸之光是万科“三好”理念的首次全面践行,也将成为万科三好住区的首个典范。', '2016-09-27', '3.7元/月/平方米');
