项目立足于未来科技城板块,近享海港城、淘宝城、西溪印象城、西溪天堂、城西银泰城等综合体配套。项目具体位于荆长大道与海曙路交叉口,东临2万方市政公园,西接荆长大道,北临90米宽市政河道滨水公园,南接杨家墩路。外部双公园景观环绕,再加上项目内部5大新中式景观组团,让您出入皆风景。在坐享优质景观环境的同时,交通也是极为便利,南面紧邻文一西路,北面海曙路与余杭塘路对接,大大缩短了到达主城区的距离。
项目致力于打造集住宅、商业、公寓为一体的大型新文化公园住区。项目总用地面积6万余方,总建筑面积约19万方,其中社区商业规模1.5万方,极大限度地满足业主平日所需,足不出户享受便利品质生活。项目规划20幢11-12层低密度新中式风格小高层,以及2幢精品公寓。未名府以大于1:1的车位配比保证了977户业主的需求。同时,此次为杭州带来的89—130㎡的户型产品,全部是南北通透户型,满足各类购房客户的需求。
北大资源集团依托北京大学资源深厚人文底蕴以及集团资源优势,项目将引进“二中心一平台”——新文化中心、北大资源健康社区管理中心和“资源家”社区服务平台。在新文化中心,居民将有机会聆听北大教授的讲座;能够借阅来自北大图书馆的馆藏书籍;四点半课堂则能让孩子增长知识、开拓眼界。依托于北大医学部雄厚的专家、医疗资源,社区健康管理中心能够为业主提供全方位的健康管理和医疗服务。通过“资源家”社区服务APP,业主能够以更加智能化的方式,享受教育、健康、金融等领域的更智能化、更优质、更便捷的服务。除此之外,还有更多的资源诸如“北大资源大讲堂”、“北大文化之夜”、“北大艺术展”以及“北大考古训练营”等丰富多彩的文化活动将很有可能与大家见面,一起期待北大资源带给杭州的未名府项目', '2017-09-29', '3元/月/平方米');

金地大运河府由4幢高层公寓和6幢多层洋房组成,地暖、新风系统、中央空调为标准配置;首期推出"荣宸别墅"组团,面积142—151平方。
项目紧邻武林板块,周围交通便利,自驾、地铁、水上巴士等出行便利,快速联通整个杭州市。
