', '3.4', '178608平方米', '', '滨江保利翡翠海岸项目位于秋涛路近江路口,占地面积约3.6万㎡,总建筑面积约17.8万㎡,主力户型面积129-212㎡。项目整体由9幢轻古典风格建筑组成,邀请全球前五贝尔高林操刀设计,打造异域风情的东南亚皇家园林,并配置内外双泳池、高端会所等。     
