项目四面环水,环境优美,不但近邻西溪湿地、五常湿地等,往东又紧连大城西紫金港区域。项目北侧辅以2000方自持的社区生活配套及花园式生命健康中心。为业主的居家生活提供更多人性化的贴心关怀配套。', '2017-02-28', '2.9元/月/平方米');
