禹洲首次入杭,慧眼定鼎之江。
2013年钱塘江上驾起一座之江大桥,2016年紫之隧道开通,不仅在之江与滨江繁华间驾起通道,更拉近了之江与城西的距离。之江板块彻底打通任督二脉,板块全面激活。而中国美院与浙江音乐学院的逐一落地,“文化四馆”的规划落成,让之江成为杭州有韵味的文化地标。
禹洲集团于之江之滨打造入杭首作——禹洲滨之江,以高层与洋房作为主推产品,铸就约30万方精筑住区,并于(建筑面积)约89~140㎡的舒适户型中演绎精致生活,继承人文风骨,彰显现代居住精髓。
禹洲滨之江作为禹洲集团在杭州的作品,将全面引进并融合海峡两岸非毛坯住宅产品的成熟设计理念与服务标准,延续“精筑3.5价值体系”,将人文生活建造于艺术、体验、开放与服务之上,成就一个由内而外充满人文气质与艺术氛围的之江精品社区。', '2017-10-21', '');

